(1, 16, 46, 'attention à bien remplir le type d''incident à sa création (reseau/absence/matériel ...)\r\nLa carte mère de ce PC a eu un choc. Je l''ai provisoirement remplacé par le PC de Voix', '2015-10-30 22:51:00', '2015-11-03 19:44:04'),
(2, 57, 12, 'absente  aussi ce dimanche 20-12-2015', '2015-12-21 08:11:00', '2015-12-21 08:11:00'),
(3, 139, 48, 'Effectivement il y avait eu des problèmes de connexion chez Togo télécom et Café pendant la période indiquée.Les connexions étaient revenues. Mais à partir de 10h on a encore eu le problème de connexion avec Café informatique et qui a été rétablit à 15h30', '2016-03-15 11:52:00', '2016-03-15 11:52:00'),
