(7, 421, 48, 'Bonjour,\r\nA mon arrivé à 03h45, dans le petit coffret d’électricité qui se trouve dans notre bâtiment, j’ai disjoncté 2 interrupteurs avant que le courant ne revienne dans le bâtiment.  \r\nLe service dépannage de la CEET est venu faire les contrôles sur le compteur (ouverture, déprogrammé, reprogrammé …) mais toujours aucun soucis décelé sur le compteur. \r\nIls préconisent que l’électricien fasse les contrôle général de l’installation.\r\nJL', '2017-07-13 07:56:15', '2017-07-13 07:56:15'),
(8, 422, 48, 'La mise à jour de Windows a été désactivé sur le poste.\r\nJL', '2017-07-16 14:32:59', '2017-07-16 14:32:59'),
(9, 437, 48, 'Bonjour,\r\nLa connexion a été rétablie à 08h00', '2017-08-23 12:55:58', '2017-08-23 12:55:58'),
