INSERT INTO `pages` (`id`, `contenu`, `menu`) VALUES
(1, '<p>De la simple saisie kilom&eacute;trique de documents &agrave; des traitements plus complexes de t&eacute;l&eacute;secr&eacute;tariat, Proweb r&eacute;pond &agrave; des besoins tr&egrave;s vari&eacute;s d&rsquo;acquisition, d&rsquo;enrichissement et de diffusion d&rsquo;informations.&nbsp; &nbsp;</p>\r\n\r\n<p><img alt="" src="http://www.prowebgroupe.com/prowe_site/images/proweb.jpg" style="margin-left:225px; margin-right:225px" /></p>\r\n\r\n<p><span style="color:rgb(0, 0, 205)"><strong>Nature des prestations</strong></span></p>\r\n\r\n<p><strong>Type de support</strong>&nbsp;: documents texte manuscrits ou dactylographi&eacute;s (document, formulaire, enqu&ecirc;te, factures, coupons, rapport, questionnaire, bon de commande, adresses, compte-rendu), images, documents comptables.</p>\r\n\r\n<p><strong style="line-height:1.6">Type de traitement&nbsp;</strong><span style="line-height:1.6">: num&eacute;risation, saisie simple, saisie kilom&eacute;trique, double saisie, correction, relecture, mise en page, balisage et enrichissement, normalisation, conversion de fichier</span><span style="line-height:1.6">&nbsp;&nbsp;</span></p>\r\n\r\n<p><strong style="line-height:1.6"><span style="color:rgb(238, 130, 238)">Les avantages de notre entreprise de saisie</span></strong><span style="line-height:1.6">&nbsp; &nbsp;</span></p>\r\n\r\n<p>Notre centre de traitement &agrave; Lom&eacute;, avec nos op&eacute;ratrices de saisie francophones travaillant en flux tendus poss&egrave;de un temps de r&eacute;activit&eacute; tr&egrave;s comp&eacute;titif pour satisfaire vos exigences de d&eacute;lais.<br />\r\n<span style="line-height:1.6">Aussi, nous vous faisons profiter de nos&nbsp;tarifs de saisie&nbsp;les plus comp&eacute;titifs sur le march&eacute;.</span></p>\r\n\r\n<p><span style="line-height:1.6">De plus, notre proc&eacute;dure de traitement &eacute;prouv&eacute;e dans la&nbsp;</span><strong style="line-height:1.6">saisie informatique</strong><span style="line-height:1.6">&nbsp;:</span></p>\r\n\r\n<p><span style="line-height:1.6">tra&ccedil;abilit&eacute; par lot,</span><br />\r\n<span style="line-height:1.6">saisie simple ou double,</span><br />\r\n<span style="line-height:1.6">contr&ocirc;le,</span><br />\r\n<span style="line-height:1.6">contr&ocirc;le qualit&eacute;,</span><br />\r\n<span style="line-height:1.6">formatage final,</span></p>\r\n\r\n<p>nous permet d&#39;assurer une qualit&eacute; de travail &eacute;lev&eacute; &agrave; la livraison et nous garantit des partenariats &agrave; long terme.</p>\r\n\r\n<p><em style="line-height:1.6">Les transmissions des donn&eacute;es &agrave; saisir se font en g&eacute;n&eacute;ral par internet (r&eacute;seau priv&eacute; virtuel FTP, connexion s&eacute;curis&eacute;e, mail) apr&egrave;s num&eacute;risation en France (par nos clients).Les donn&eacute;es saisies sont livr&eacute;es soit directement sur l&rsquo;interface client, soit par mail pour int&eacute;gration directe dans une base de donn&eacute;es, soit sous forme de fichiers au format souhait&eacute;.</em></p>\r\n\r\n<p><strong style="color:rgb(238, 130, 238); line-height:1.6">Quelques gammes de nos services&nbsp; &nbsp;</strong></p>\r\n\r\n<ul>\r\n	<li>Traitement de contrats</li>\r\n	<li>Traitement de documents</li>\r\n	<li><span style="line-height:1.6">Traitement de bases de donn&eacute;es</span></li>\r\n	<li><span style="line-height:1.6">Traitement d&rsquo;adresse</span></li>\r\n	<li><span style="line-height:1.6">Traitement de courrier</span></li>\r\n	<li><span style="line-height:1.6">Traitement comptable</span></li>\r\n	<li><span style="line-height:1.6">Gestion &eacute;lectronique de donn&eacute;es</span></li>\r\n	<li><span style="line-height:1.6">Gestion des bases de donn&eacute;es</span></li>\r\n	<li><span style="line-height:1.6">Enrichissement de la base de donn&eacute;es</span></li>\r\n	<li><span style="line-height:1.6">Collecte d&rsquo;informations</span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 5),
(2, '<p>Les comp&eacute;tences d&eacute;velopp&eacute;es dans ce domaine sont :</p>\r\n\r\n<p>Traitement de donn&eacute;es (texte, photos) se font de fa&ccedil;on homog&egrave;ne dans une base de donn&eacute;es, gestion de bases de donn&eacute;es (mise &agrave; jour, mise en ligne, correction, normalisation, enrichissement...) d&#39;une information de qualit&eacute; fournie par vos soins.&nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p><img alt="Nos Representations" src="http://www.prowebgroupe.com/prowe_site/images/img2.jpg" style="margin-left:150px; margin-right:150px" /></p>\r\n\r\n<p>Ces comp&eacute;tences sont utilis&eacute;es dans de nombreuses probl&eacute;matiques :</p>\r\n\r\n<ul>\r\n	<li>Archivage &eacute;lectronique</li>\r\n	<li>D&eacute;mat&eacute;rialisation&nbsp;</li>\r\n	<li>Gestion &eacute;lectronique de document&nbsp;</li>\r\n	<li>Animation de contenus&nbsp; &nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', 6),
(3, '<p style="text-align:justify">Afin de satisfaire les besoins d&rsquo;une client&egrave;le particuli&egrave;rement exigeante en mati&egrave;re de qualit&eacute; de saisie de donn&eacute;es informatiques, PROWEB a ouvert en 2011 un centre de saisie et de traitement informatique &eacute;quip&eacute; de plus de 30 d&rsquo;ordinateurs en constante augmentation r&eacute;partis sur plus de 60 collaborateurs francophones hautement sp&eacute;cialis&eacute;s qui travaillent sur 4 plages horaires.</p>\r\n\r\n<p style="text-align:justify">Compos&eacute;e d&rsquo;ing&eacute;nieurs, de techniciens et d&rsquo;op&eacute;rateurs de saisie, notre &eacute;quipe constitue une force capable de r&eacute;pondre au mieux aux exigences et aux rigueurs indispensables &agrave; la satisfaction de nos clients.</p>\r\n\r\n<p style="text-align:justify">Notre exp&eacute;rience dans la saisie de donn&eacute;es nous a permis de fid&eacute;liser un grand nombre de clients (Fran&ccedil;ais et &eacute;trangers), d&eacute;sireux de rationaliser leurs budgets tout en conservant une qualit&eacute; de prestation optimale.</p>\r\n\r\n<p style="text-align:justify"><br />\r\nNotre plateau de production dispose d&rsquo;un groupe &eacute;lectrog&egrave;ne et&nbsp;plusieurs liaisons internet lui permettant de travailler de fa&ccedil;on autonome et en relation permanente avec le client.</p>\r\n\r\n<p style="text-align:center"><span style="font-size:18px"><strong><u>Notre centre de traitement &agrave; Lom&eacute;</u></strong></span>&nbsp; &nbsp;</p>\r\n\r\n<p style="text-align:justify"><img alt="Nos Representations" src="http://www.prowebgroupe.com/images/valComp.gif" style="height:158px; margin-left:105px; margin-right:105px; width:570px" /></p>\r\n', 1),
(4, '<p style="text-align:center"><strong>Retrouvez nous sur place</strong><br />\r\n<img alt="" src="http://localhost:443/prowe_site/images/t%c3%a9l%c3%a9chargement%20(1).jpg" style="height:200px; line-height:1.6; margin-left:225px; margin-right:225px; width:200px" /><br />\r\n<br />\r\n<span style="font-size:14px"><span style="font-family:lucida sans unicode,lucida grande,sans-serif"><strong><span style="color:rgb(51, 204, 255)"><u>DEMANDE DE DEVIS</u></span></strong></span></span></p>\r\n\r\n<p style="text-align:center">&nbsp; &nbsp;<span style="font-family:helvetica neue,helvetica,arial,sans-serif; font-size:12px">PROWEB SARL</span><br />\r\n<span style="font-family:helvetica neue,helvetica,arial,sans-serif; font-size:12px">Tel : (00228) 22208459 / 90048199</span><br />\r\n<span style="font-family:helvetica neue,helvetica,arial,sans-serif; font-size:12px">Si&egrave;ge social : Boulevard 13 Janvier - TOGO</span><br />\r\n<span style="font-family:helvetica neue,helvetica,arial,sans-serif; font-size:12px">B.P. 14547 Lom&eacute; -TOGO&nbsp;</span></p>\r\n', 3),
(5, 'sais', 2),
(6, '<p><span style="color:rgb(0, 0, 0); font-family:verdana; font-size:12px">Ouvert en 2011 PROWEB est un centre de saisie et de traitement informatique &agrave; l&#39;echelle internationale. Compos&eacute;e d&rsquo;ing&eacute;nieurs, de techniciens et d&rsquo;op&eacute;rateurs de saisie, notre &eacute;quipe constitue une force capable de r&eacute;pondre au mieux aux exigences et aux rigueurs indispensables &agrave; la satisfaction de nos clients. Notre centre est r&eacute;partis sur plus de 60 collaborateurs francophones hautement sp&eacute;cialis&eacute;s qui travaillent sur 4 plages horaires.</span>&nbsp;</p>\r\n\r\n<p style="text-align:justify">Implantations et partenariats strat&eacute;giques :&nbsp;</p>\r\n\r\n<p style="margin-left:200px"><img alt="" src="http://www.prowebgroupe.com/images/map.gif" style="height:200px; margin-left:0px; margin-right:0px; width:400px" />&nbsp;</p>\r\n\r\n<p>Notre exp&eacute;rience dans la saisie de donn&eacute;es nous a permis de fid&eacute;liser un grand nombre de clients (Fran&ccedil;ais et &eacute;trangers), d&eacute;sireux de rationaliser leurs budgets tout en conservant une qualit&eacute; de prestation optimale.</p>\r\n\r\n<p>&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 4);
