(4, 5, 1, 'Nouvelle Méthode d’auto coaching', 'Au lieu d’aller lire les messages  de meilleures animatrices (qualité de messages et cohérence) toute animatrice en auto coaching devra :\r\n\r\n1-	lire  les  rapports de coaching qui ont été envoyés dans leur  boite mail (professionnelles ou personnelles) et noter les  erreurs  qui lui on été   remontées !\r\n\r\n2-	lire  ses messages  propres afin de voir  si depuis les  coachings  elle a pu corriger les fautes remontées  ou  pas.\r\n\r\n3-	enfin  avoir le  courage de dire ce qu’elle  a   remarqué afin de permettre aux responsables de savoir comment  l’orienter dans le but de s’améliorer.\r\n\r\nMise en page de l’autocoahing', '2015-08-17 16:42:01', 0, 0, NULL),
(4, 7, 2, 'Panne electricite', 'Lors d''une panne  electricite dans le batiment , vous devez  vous  assurer  au 1er abord  qu''il ne s''agit pas d''un probleme interne  en  verifiant le  disjoncteur installé a l''interieur du local occupé. Au cas contraire , contactez l''electricien, mettre le groupe en marche.\r\nAu cas ou le groupe ne repondrait pas informer la France et laisser le minimun de personnes animer pour assurer la permanence', '2015-09-02 18:01:00', 1, 0, NULL),
