(4, 10, 5, 'Démarrage du Groupe Electrogène', 'Avant de démarrer le G.E après une coupure de courant, il faut:\r\n1. Arrêter les climatiseurs\r\n2. Vérifiez  le niveau du carburant dans le G.E\r\n2. Démarrer le G.E\r\n3. Basculer sur la position G.E\r\nLorsque le courant revient, il faut:\r\n4. Arrêter le G.E\r\n5. Enlever la clé du G.E et la déposer dans la boite dans la salle\r\n6. Balancer sur la position CEET\r\nSi le G.E ne démarre pas, merci de contacter le mécanicien (Hilaire) au 99 60 92 89', '2016-03-31 15:19:43', 0, 0, NULL),
