(48, 13, 7, 'Problème de connexion', '<p>PROBLEME DE CONNEXION WEB</p>\r\n\r\n<p>Nous disposons de 3 liaisons Internet, 2 liaisons Togo t&eacute;l&eacute;com et 1 liaison Caf&eacute; Informatique.<br />\r\nLa liaison principale est celle de Togo T&eacute;l&eacute;com disposant d&rsquo;un d&eacute;bit de 4 Mo avec 4 adresses IP reli&eacute;e &agrave; un Switch CISCO 2600 Series. La liaison Caf&eacute; informatique dispose d&rsquo;un d&eacute;bit de 4 Mo est &eacute;galement reli&eacute;e &agrave; ce m&ecirc;me Switch.<br />\r\nLa seconde liaison de Togo T&eacute;l&eacute;com dispose d&rsquo;un d&eacute;bit de 2 Mo et reli&eacute;e au Switch Netgear de l&rsquo;Archivage<br />\r\nQ1 : Pourquoi les 2 liaisons sur ce m&ecirc;me Switch ?<br />\r\nR : C&rsquo;est parce que quand une connexion tombe, l&rsquo;autre prend la rel&egrave;ve automatiquement.<br />\r\nExemple : Quand la connexion Togo T&eacute;l&eacute;com qui est la liaison principale tombe, Caf&eacute; Informatique prend aussit&ocirc;t la rel&egrave;ve et vice versa.&nbsp;<br />\r\nQ2 : Que fait-on quand les 2 liaisons sur le Switch Cisco tombent ?<br />\r\nR2 : il faut tout d&rsquo;abord red&eacute;marrer les 2 modems &agrave; savoir Togo T&eacute;l&eacute;com et Caf&eacute; Informatique. Il suffit d&rsquo;&eacute;teindre et de rallumer la rallonge qui se trouve dans le coffret.<br />\r\nQ3 : Au cas o&ugrave; les 2 connexions ne r&eacute;pondent toujours pas ?<br />\r\nR3 : Il faut retirer le c&acirc;ble de la seconde liaison Togo T&eacute;l&eacute;com du Switch Netgear &nbsp;et de le brancher sur le port N&deg; 20 du Switch Cisco 2600 Series et de tout red&eacute;marrer. Tout le Web sera connect&eacute; sur cette liaison.</p>', '2016-06-17 17:56:47', 0, 0, NULL),
(48, 14, 8, 'Problème de connexion', 'A : Modem/Routeur M’Fri de TOGO TELECOM\r\nB : Switch D-Link\r\nC : Panneau de brassage (à ne jamais toucher)\r\nD: Switch CISCO\r\nE: Câble bleu (relie Modem/Routeur M’Fri au swith CISCO)\r\n\r\n\r\n\r\nLe Web dispose de 3 connexions Internet à savoir :\r\nA.	M’Fri, câble bleu\r\nB.	Helim IP, câble gris et nommé Helim IP\r\nC.	CAFE Informatique, câble rouge\r\n\r\nNombre Total de PC au Web = 16, numérotés de pcw01  à pcw16 \r\n-	Nombre de PC sur M’Fri = 12	 : PCW1 à PCW12\r\n-	Nombre de PC sur CAFE = 02 : PCW15 et PCW16\r\n-	Nombre de PC sur HELIM IP = 02 : PCW13 et PCW14\r\n\r\n\r\nI.	PROBLEME DE CONNEXION\r\n\r\nCas N°1 : La connexion M’Fri ne marche pas  \r\nQ1 : comment je fais cette déduction ?\r\nR2 : les 12 PC n’ont pas la connexion, regardez sur le modem si le voyant Internet est éteint. S’il est allumé, il faut le redémarrer parce que dès fois c’est un problème de temporaire de connexion mais par contre si le voyant Internet est éteint alors\r\nRedémarrer le modem/Routeur et attendre 2 minutes.  Si la connexion n’est toujours pas revenue, il faut :\r\n-	Remplacer le câble bleu par le câble nommé Helim Backup IP à sa place.\r\n\r\n\r\n1.1	Cas N°2 : la connexion Helim IP ne marche pas\r\nLes 2 postes PCW13 et PCW14 n’ont pas la connexion. Enlevez leur câble du Switch D-Link et les connecter au Switch CISCO pour avoir  la connexion M’Fri.\r\n\r\n\r\n1.2	Cas N°3 : La connexion CAFE  ne marche pas\r\nLes 2 postes connectés à CAFE n’ont pas la connexion. Il faut juste retirer leur câble et brancher les câbles libres sous la table sur lesquels sont inscrits Helim IP sur le routeur CISCO \r\n\r\n1.3	Cas N°3 : Les connexions M’Fri et Helim IP ne marche pas\r\n\r\nRemplacer le câble bleu de M’Fri/HELIM IP par la câble de Cafe qui est de couleur Rouge', '2015-11-28 14:37:00', 0, 0, NULL),
(48, 18, 9, 'Validation Photos Landing', '<p>Photos Landing</p>\r\n\r\n<p>La rubrique Photo Landing ne se trouve que sur la mod&eacute;ration des sites Grand Public.</p>\r\n\r\n<p>Pour les photos landing, le but est de ne s&eacute;lectionner que les meilleures photos, les plus attractives.</p>\r\n\r\n<p>NB:</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Il faut valider majoritairement les photos de femmes car la cible de nos sites est constitu&eacute;es d&#39;hommes qui recherchent des femmes.</p>\r\n\r\n<p>Voici quelques r&egrave;gles plus pr&eacute;cises:</p>\r\n\r\n<p><u>Accepter:</u></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - Les personnes doivent &ecirc;tres attractives (des hommes et des femmes jeunes, beaux)</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - Les personnes doivent &ecirc;tre sympathiques</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - Le visage doit &ecirc;tre bien visible</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - Pas de nudit&eacute; et les photos doivent &ecirc;tre de bonne qualit&eacute;.</p>\r\n\r\n<p>Voici un exemple de photos &agrave; valider (les photos &agrave; accepter sont encadr&eacute;es en bleu)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><u>Refuser:&nbsp;</u></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - Personne non sympathique</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - Personnes qui ont l&#39;air m&eacute;content ou leur apparence est trop sp&eacute;cifique</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - Personne avec les lunettes de soleil car on ne voit pas leur visage alors peu d&#39;int&eacute;r&ecirc;t</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - Photos mal tourn&eacute;es</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - Photo o&ugrave; la personne est mal visible (loin sur le fond)</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - Photo de qualit&eacute; douteuse</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - Photo est plus petite que le cadre&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Voici un exemple de photo &agrave; refuser ( les photos &agrave; supprimer sont encadr&eacute;es en rouges)</p>\r\n\r\n<p>&nbsp;</p>', '2016-05-10 18:14:13', 0, 0, 'uploads/wiki/17657.jpeg'),
(48, 20, 10, 'Procédure validation', '<p>La validation des &nbsp;photos &nbsp;et &nbsp;Surveillance des Mots Suspects &nbsp;se fait tous &nbsp;les jours &nbsp;par une &eacute;quipe mise en place pour une dur&eacute;e de &nbsp;trois (3) heures &nbsp;repartie &nbsp;comme &nbsp;suite : 1h30 la &nbsp;matin&eacute;e ( 8h30-10h) et 1h30 l&rsquo;apr&egrave;s-midi (15h30-17h).</p>\r\n\r\n<p><strong>I-&nbsp;&nbsp; &nbsp;Proc&eacute;dure Validation des photos</strong> &nbsp;</p>\r\n\r\n<p>En quoi consiste la &nbsp;validation des &nbsp;photos ? Valider les &nbsp;photos &nbsp;revient &nbsp;soit &nbsp;&agrave; les accepter (subdivis&eacute;es en trois cat&eacute;gories) soit les refuser tout simplement tout en suivant une r&egrave;gle &nbsp;bien &eacute;tablie. La validation des photos se fait sur la mod&eacute;ration &nbsp;sous la rubrique &laquo; Valider les photos &raquo;et repartie sur deux bases: la base Coquine et &nbsp;la &nbsp;base Grand Public. &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; <strong>&nbsp;A-&nbsp;&nbsp; &nbsp;Validation des Photos sur la base Coquine </strong></p>\r\n\r\n<p>Les photos &agrave; valider &nbsp;sur la base coquine se pr&eacute;sentent comme &nbsp;suit :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Voici quelques r&egrave;gles &agrave; suivre pour soit Accepter, mettre en Hot ou en X les &nbsp;photos sur la &nbsp;base coquine :</p>\r\n\r\n<p><u><strong>Accepter: </strong></u></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Photo soft sans nudit&eacute;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Une photo montrant une personne</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;La photo doit &ecirc;tre de bonne qualit&eacute; &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Les photos de femmes, m&ecirc;me tr&egrave;s sexy (on peut accepter les seins, les strings, &nbsp; &nbsp;la lingerie) &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Les photos des hommes tors nus &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Une photo montrant deux personnes (femme+homme, deux femmes ou deux hommes) sans nudit&eacute; &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Une photo montrant des tatouages &nbsp;sur une partie du corps (bras, dos, jambe) sans partie g&eacute;nitale apparente. &nbsp;</p>\r\n\r\n<p><span style="color:#FF0000">Voici quelques exemples de photos &agrave; classer dans la cat&eacute;gorie </span></p>\r\n\r\n<p><u><strong>Accepter</strong></u></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><u><span style="color:#000000">Accepter mais classer comme HOT:</span><span style="color:#FF0000"> </span></u></strong></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;La nudit&eacute; int&eacute;grale sans gros plan, hommes et femmes &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Les photos de bonne qualit&eacute; t&eacute;l&eacute;charg&eacute;es de c&ocirc;t&eacute; &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Les tenues sadomaso &nbsp;</p>\r\n\r\n<p><span style="color:#FF0000">Voici quelques exemples de &nbsp;photos &agrave; classer dans la cat&eacute;gorie HOT :</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#FF0000">Accepter mais classer comme X:</span></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Les photos de nudit&eacute; int&eacute;grale avec sexe tr&egrave;s visible, &nbsp;hommes et femmes &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Les sexes en gros plan, hommes et femmes &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Les fesses ouvertes en gros plan &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Les sc&egrave;nes sadomaso (bondage, uro) &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Les photos de sexe en train d&rsquo;uriner ou &nbsp;avec sperme &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Les rapports sexuels &nbsp; de tout type (seul ou &agrave; plusieurs) &nbsp;</p>\r\n\r\n<p><span style="color:#FF0000">Voici quelques exemples de &nbsp;photos &agrave; classer dans la categorie X:</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><u><strong>Refuser :</strong></u></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Photos de groupe &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Toutes les photos avec coordonn&eacute;es (mails et tel) &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Les photos de personnalit&eacute;s (acteurs ou actrices connus, chanteurs...) &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Photos trop HARD, copi&eacute;es chez les sites pornos &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Photos en double &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Les photos de tr&egrave;s mauvaise qualit&eacute; : trop floues, trop petites, trop grandes... &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Les photos &agrave; caract&egrave;re p&eacute;dophile (si les inscrits hommes ou femmes semblent mineurs avertir un responsable imm&eacute;diatement avant suppression) &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Les photos d&#39;ado et d&#39;enfants (m&ecirc;me avec parents)</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Les photos d&#39;actrices X &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Les photos avec logo, plus photos douteuses &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Les photos de sex-toys ou objet sans personne &nbsp;</p>\r\n\r\n<p><span style="color:#FF0000">Voici quelques exemples de &nbsp;photos &agrave; refuser&nbsp;</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:11px"><strong>NB.</strong> </span></p>\r\n\r\n<p>&nbsp;Si &nbsp; une des mod&eacute;ratrices &nbsp;h&eacute;site entre deux cat&eacute;gories, toujours &nbsp;choisir la plus &laquo; s&eacute;v&egrave;re &raquo;, c&rsquo;est &nbsp;plus s&ucirc;r.</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;B-&nbsp;&nbsp; &nbsp;Validation des photos sur la base Grand Public : </strong></p>\r\n\r\n<p>Sur cette base, les photos sont soit &nbsp;&agrave; accepter &nbsp;soit refuser. Crit&egrave;res pour qu&rsquo;une photo soit :</p>\r\n\r\n<p><u><strong>Accepter :</strong></u></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Une personne est sur la photo</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Pas de sexe &nbsp;ou de nudit&eacute;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Homme torse nu</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Une personne avec des personnes en &nbsp;fond &nbsp;si le groupe n&rsquo;a pas pos&eacute; devant la camera</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Il n&rsquo;y a aucune adresse web/ email sur la &nbsp;photo</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Il n&rsquo;y a pas d&rsquo;enfants sur la photo &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;La photo est de bonne qualit&eacute;</p>\r\n\r\n<p>Voici un exemple de photo &agrave;</p>\r\n\r\n<p><u><strong>Accepter :</strong></u></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><u><strong>Refuser : </strong></u></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Photos &nbsp;coquines (sexe, nudit&eacute;)</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Photos de plus d&rsquo;une personne</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Photos &nbsp;d&rsquo;ados ou copi&eacute;es sur &nbsp;les sites pornos</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Photo d&rsquo;une personne avec enfant</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Photos avec logo ou photos douteuses &nbsp;</p>\r\n\r\n<p><span style="color:#FF0000">Voici un exemple de photos &agrave; refuser</span>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp;II-&nbsp;&nbsp; &nbsp;Proc&eacute;dure de la Surveillance des Mots suspects</strong></p>\r\n\r\n<p>En quoi consiste la &nbsp;Surveillance des Mots Suspects ?</p>\r\n\r\n<p>La surveillance des Mots Suspects est une rubrique de la Mod&eacute;ration qui consiste &agrave; &nbsp; &eacute;diter &nbsp;la description &nbsp;de chaque identifiant (pseudo) en corrigeant les messages suivant une r&egrave;gle &eacute;tablie. Cette r&egrave;gle s&rsquo;applique &nbsp;sur les deux bases &nbsp;(base &nbsp;Coquine et base Grand Public). Voici sa pr&eacute;sentation dans la mod&eacute;ration :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>D&eacute;marche &agrave; suivre pour &nbsp;la surveillance des mots suspects :</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Toujours commencer &nbsp;de &laquo; 0 &agrave; Z &raquo; en cliquant sur chaque chiffre et lettre &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Cliquer sur la case &laquo; tout cocher &raquo; et ensuite sur la case &laquo; EDITER &raquo; &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Lire le message et Supprimer les mots suspects : &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;Adresse mail, num&eacute;ro de tel. , skype, facebook, adresse postale, &nbsp;snap</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;Les messages comportant des menaces ou &nbsp;insultes comme arnaque, pute, allumeuse etc&hellip; &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Faire attention en lisant les messages car certains num&eacute;ros ou adresses mail &nbsp;ne sont pas donn&eacute;s &nbsp;directement mais &nbsp;se font glisser dans les &nbsp;phrases ou &nbsp;en &nbsp;devinette. &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;En lisant les messages et si vous vous &nbsp;rendez &nbsp;compte que &nbsp;le pseudo est soit mineur ou que le pseudo en soi &nbsp;est une adresse mail, &nbsp;soit un num&eacute;ro de tel, d&eacute;cocher la case &nbsp;du dit pseudo &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Apres v&eacute;rification et correction &nbsp;des colonnes de chaque ligne, cliquer sur la &nbsp;case &laquo; ENREGISTRER &raquo; puis passer &nbsp;au chiffre suivant ou &nbsp;lettre suivante. &nbsp;Voici un exemple : &nbsp;</p>\r\n\r\n<p><u><strong>Etape 1</strong></u></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><u><strong>Etape 2</strong></u></p>\r\n\r\n<p>&nbsp;</p>', '2016-05-11 19:17:12', 0, 0, NULL),
(48, 20, 11, 'PROCEDURE MODERATION ACCES GRATUIT', '<p>jhhhh</p>', '2016-05-12 10:11:00', 1, 0, NULL),
(48, 21, 12, 'MODERATION', '<p><em><strong><u>PROCEDURE MODERATION ACCES GRATUIT</u> &nbsp;(Profils de femmes)</strong> &nbsp;</em></p>\r\n\r\n<p>La &nbsp;Mod&eacute;ration des profils de femmes &nbsp;se fait sur &nbsp;la &nbsp;mod&eacute;ration sous la rubrique &laquo; Valider Acc&egrave;s gratuits &raquo; et &nbsp;consiste &nbsp;&agrave; &nbsp; analyser chaque profil &nbsp;en respectant certaines r&egrave;gles pr&eacute;&eacute;tablies. &nbsp;Elle s&rsquo;applique &nbsp;sur les deux &nbsp;bases : base Coquine et la &nbsp;base Grand Public. &nbsp;</p>\r\n\r\n<p><strong>I-&nbsp;&nbsp; &nbsp;ACCES GRATUIT BASE COQUINE &nbsp; REGLES GENERALES: &nbsp;</strong></p>\r\n\r\n<p>1-&nbsp;&nbsp; &nbsp;Supprimer tous les profils dont IP n&rsquo;est pas la France. Normalement ces profils se trouvent au d&eacute;but et &agrave; la fin de la liste des inscrits. Valider avec pr&eacute;caution les profils Belgique (s&rsquo;il n&rsquo;est pas suspect et si le lieu de r&eacute;sidence indiqu&eacute; dans le profil est en Belgique). &nbsp;</p>\r\n\r\n<p>2-&nbsp;&nbsp; &nbsp;Valider avec pr&eacute;caution les profils de femmes noires. Ne pas donner l&rsquo;acc&egrave;s si les photos ne repr&eacute;sentent que des parties du corps ou si elles proposent dans la description une rencontre chaude. &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;3-&nbsp;&nbsp; &nbsp;Supprimer les profils avec les photos de tr&egrave;s jolies femmes et les profils dont la description est du type &laquo;cherche mon &acirc;me s&oelig;ur&raquo; (r&egrave;gle pour la base adulte). &nbsp;</p>\r\n\r\n<p>4-&nbsp;&nbsp; &nbsp;Mot de passe suspect: si le profil a un mot de passe suspect qui est marqu&eacute; par rouge et qui est assez compliqu&eacute; (du type <span style="color:#FF0000">&laquo;ninho326987&raquo;</span>) il faut supprimer ce profil. Si le mot de passe est simple (du type &laquo;azerty&raquo; ou &laquo;123456&raquo;) il faut analyser ce profil en entier &ndash;pseudo, photos, adresse mail &ndash;et le supprimer s&rsquo;il est suspect. &nbsp;</p>\r\n\r\n<p>5-&nbsp;&nbsp; &nbsp;Supprimer des profils dont le pseudo est du type: coeuratristee--tendresse14180--femmelibre1980 &nbsp;</p>\r\n\r\n<p>6-&nbsp;&nbsp; &nbsp;Supprimer les profils o&ugrave; le pseudo = adresse mail (surtout si c&rsquo;est un nom/pr&eacute;nom, une femme r&eacute;elle ne donne jamais son nom et pr&eacute;nom) &nbsp; &nbsp;</p>\r\n\r\n<p>7-&nbsp;&nbsp; &nbsp; Supprimer les profils des hommes (m&ecirc;me si le pseudo est f&eacute;minin et l&lsquo;adresse mail appartient &agrave; un homme) &nbsp;</p>\r\n\r\n<p>8-&nbsp;&nbsp; &nbsp;Supprimer les profils contenant des coordonn&eacute;es (skype, tel, adresse mail, facebook, etc.) ainsi que les profils contant des mots &laquo;escorte&raquo;, &laquo;v&eacute;nale&raquo; etc. &nbsp;</p>\r\n\r\n<p>9-&nbsp;&nbsp; &nbsp;Quelques soient le pseudo, la description, l&rsquo;adresse mail et les photos NE DONNER JAMAIS l&rsquo;acc&egrave;s aux profils dont le mot de passe se termine par les chiffres 10, 12,123 et 225 &nbsp;</p>\r\n\r\n<p>10-&nbsp;&nbsp; &nbsp;Supprimer les profils des mineurs. Assez souvent leur mot de passe les d&eacute;masque &ndash;p.ex. le mot de passe 03052002 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp;Exemples de profils &agrave; supprimer : &nbsp;</p>\r\n\r\n<p>Supprimer &nbsp;tous les profils avec &nbsp;la geoIP autre que la &nbsp;France, ne valider que la France et la Belgique (seulement si la ville indiqu&eacute; est vraiment en Belgique, ne pas donc valider p.ex. Paris/Belgique) &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>Supprimer les profils suivants : &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Le pseudo contient plusieurs lettres x, le mot &laquo; love &raquo; (surtout s&rsquo;il y a une photo d&rsquo;une jolie femme) &nbsp;Exemple : xxxbellaxxx, lolahot, love4real &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Les profils dont le mot de passe ne contient &nbsp;que des &nbsp;consonnes qui se &nbsp;r&eacute;p&egrave;tent &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Les profils avec le mot de passe suspect (marqu&eacute; &nbsp;par la couleur rouge) &nbsp; &nbsp; &nbsp;&bull;</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;Si &nbsp;le pseudo et l&rsquo;adresse mail sont les m&ecirc;mes &nbsp;(lettre &agrave; &nbsp;lettre) &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Si la description contient &nbsp;l&rsquo;adresse mail, le num&eacute;ro de t&eacute;l&eacute;phone, les &nbsp;mots &laquo; &nbsp;escorte &raquo;, &laquo; &nbsp;venale &raquo;, etc. &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Si le mot de passe se termine &nbsp; sur les chiffres &laquo; 10 &raquo;, &laquo; 12 &raquo;, &laquo; 123 &raquo;, &nbsp;&laquo; 225 &raquo; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Profils &nbsp;des mineurs (le mot de passe contient &nbsp;la date de naissance, ou &nbsp;le pseudo du type &laquo; anna14ans &raquo;, etc.) &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Les profils qui contiennent les mots &laquo; fleur &raquo;, &laquo; nuit &raquo;, &laquo; toujours &raquo;, &laquo; douce &raquo;, &laquo; ravissante &raquo; (pseudo/MDP/mail) &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;S&rsquo;il y a plusieurs profils identiques de suite laisser un seul profil, supprimer tous les autres SEULEMENT si la ville et la date de naissance sont les m&ecirc;mes ! &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;&bull;&nbsp;&nbsp; &nbsp;Les profils avec l&rsquo;adresse mail qui contient le nom de famille &laquo; Dupont &raquo;, &laquo; rousseau &raquo;, &laquo; Dubois &raquo; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Les profils dont l&rsquo;adresse mail ou le pseudo/photo sont masculins. &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;&bull;&nbsp;&nbsp; &nbsp;Les profils qui &nbsp;cherchent du s&eacute;rieux, un homme de sa vie, etc &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Avec des photos vol&eacute;es / photos de racoleuses connues / photos choquantes Utiliser Google Image pour la recherche par photo &nbsp; &nbsp; &nbsp;Ou faire une recherche sur des sites sp&eacute;cialis&eacute;s d&eacute;masquant les fakes p.ex. :</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; &nbsp;http://arnaquesbrouteursafrique.eklablog.com/photos-femmes-de-couleurs-et-metisses-c17379191</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;http://www.arnacoeurs.com/pages/Les_albums_des_appats_feminins_22-8471421.html</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;http://www.arnacoeurs.com/pages/Les_albums_des_appats_feminins-8959819.html</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;http://arnaqueusebernadette.centerblog.net/</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;http://arnaqueusesdunet.centerblog.net/</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;http://arnaqueuses-du-net.skyrock.com/ &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Analyser tout le profil en int&eacute;gralit&eacute; (pseudo, mdp, photo, l&rsquo;adresse mail) et supprimer tous les &nbsp;profils suspects.</p>\r\n\r\n<p>Voici plusieurs exemples de profils &agrave; supprimer (la cause est marqu&eacute;e par la couleur rouge). &nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p><strong>&nbsp; &nbsp;II-&nbsp;&nbsp; &nbsp;ACCES &nbsp;GRATUIT BASE GRAND PUBLIC &nbsp;</strong></p>\r\n\r\n<p>La r&egrave;gle &nbsp;est un peu &nbsp; diff&eacute;rente de celle &nbsp;de la &nbsp;base coquine. Elle s&rsquo;applique comme suit :</p>\r\n\r\n<p>&nbsp;SUPPRIMER :</p>\r\n\r\n<p>&nbsp;1-&nbsp;&nbsp; &nbsp;Tous les profils dont IP n&rsquo;est pas la France. Normalement ces profils se trouvent au d&eacute;but et &agrave; la fin de la liste des inscrits. Valider avec pr&eacute;caution les profils Belgique (s&rsquo;il n&rsquo;est pas suspect et si le lieu de r&eacute;sidence indiqu&eacute; dans le profil est en Belgique). &nbsp;</p>\r\n\r\n<p>2-&nbsp;&nbsp; &nbsp;Les profils avec mot de passe en rouge. Surtout : sansan, bonjour2014 (2015,2016), maman123 &nbsp;</p>\r\n\r\n<p>3-&nbsp;&nbsp; &nbsp;Les profils avec informations personnelles indiqu&eacute;es &nbsp;dans la description (skype, mail, tel, adresse web, etc.) &nbsp;</p>\r\n\r\n<p>4-&nbsp;&nbsp; &nbsp;Les profils dont les informations personnelles (skype, facebook, etc,) sont envoy&eacute;es des le premier message (visible dans la colonne &laquo; Messages &raquo;) &nbsp;</p>\r\n\r\n<p>5-&nbsp;&nbsp; &nbsp;Les profils avec des &nbsp;photos vol&eacute;es / photos de racoleuses connues &nbsp;</p>\r\n\r\n<p>6-&nbsp;&nbsp; &nbsp;Adresse mail bidon ou jetable &ndash; les adresses utilis&eacute;es les plus souvent sont :</p>\r\n\r\n<p>&nbsp;@live.fr &nbsp;@uu1.pl ou @uu1.fr &nbsp;</p>\r\n\r\n<p>@dayrep.com &nbsp;</p>\r\n\r\n<p>@jourrapide.com &nbsp;</p>\r\n\r\n<p>@netcourrier.com &nbsp;</p>\r\n\r\n<p>@einrot.com &nbsp;</p>\r\n\r\n<p>@fleckens.hu &nbsp;</p>\r\n\r\n<p>@cuvox.de &nbsp;</p>\r\n\r\n<p>@teleworm.us &nbsp;</p>\r\n\r\n<p>@armyspy.com &nbsp;</p>\r\n\r\n<p>@rhyta.com &nbsp;</p>\r\n\r\n<p>@gustr.com &nbsp;</p>\r\n\r\n<p>@clipmail.eu &nbsp;</p>\r\n\r\n<p>7-&nbsp;&nbsp; &nbsp;Le pseudo est du type : &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;femmeseule</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;coeurapprendre &nbsp;</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;coeurlibre</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;coeurtendre &nbsp;</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;nellasympa &nbsp;</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;antonella</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;nellacelib</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;bellacelib</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;coeurdouce</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;soleilrose</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;rachlova</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;sandrine</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;coeurdamour</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;labelle</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;cupidon</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;tristeseul</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;cupid &nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp;Tous ce qui contient : c&oelig;ur, triste, douce, seule&hellip; &nbsp;</p>\r\n\r\n<p>8-&nbsp;&nbsp; &nbsp;Tout ce qui parait suspect ; surtout &nbsp;sur Miaoo &nbsp;Concernant les &nbsp;photos, malheureusement 90% &nbsp;des &nbsp;photos ne sont pas index&eacute;es Google Image. On peut utiliser les forums et les blongs &nbsp;pour une recherche des &nbsp; photos. &nbsp; Attention aux photos suivantes : &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Voici un exemple de profils &nbsp;&agrave; supprimer (la cause est marqu&eacute;e par la couleur rouge) &nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>', '2016-06-14 09:32:35', 0, 0, NULL),
(48, 22, 13, 'Table_Adresse', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>PROCEDURES TABLE ADRESSE </strong></p>\r\n\r\n<p><u><strong>Pr&eacute;ambule</strong></u></p>\r\n\r\n<p>Le client nous envoie des dossiers dans lesquels se trouve la Table_Adresse qui se pr&eacute;sente plus souvent sous format CSV dans la plus part des cas.</p>\r\n\r\n<p>&nbsp; S&rsquo;il n&rsquo;y en a pas, il faut v&eacute;rifier qu&rsquo;il ne s&rsquo;agit pas d&rsquo;un oubli. Pour cela balayer les Photos du chantier et v&eacute;rifier par exemple qu&rsquo;il s&rsquo;agit effectivement du Service GERANCE sinon informez le client pour avoir la confirmation ou non de la disponibilit&eacute; de la table adresse.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>1.&nbsp;&nbsp; &nbsp;Importation Table_Adresse</strong></p>\r\n\r\n<p>Aller dans DropBox &hellip; Service Client&hellip;Proarchives&hellip;ouvrir le fichier &laquo;0 Proarchives_R&eacute;ception_Table_Adresse_Historique&raquo;.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;-&nbsp;&nbsp; &nbsp;Onglet <strong>Donn&eacute;es</strong>&hellip;groupe <strong>Donn&eacute;es externes</strong> choisir &laquo; &agrave; partir du texte &raquo;&hellip;choisir le fichier nomm&eacute; &laquo; Table_Adresse_nom du chantier.csv &raquo; puis importer.</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;V&eacute;rifier dans la 1&egrave;re fen&ecirc;tre Windows &nbsp;Choisir D&eacute;limit&eacute; puis dans la liste d&eacute;roulante &nbsp;de Origine du fichier choisir Windows (ANSI) faire suivant. &nbsp; &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Une nouvelle fen&ecirc;tre s&rsquo;ouvre, choisir comme s&eacute;parateur Point virgule et Tabulation&hellip;suivant&hellip; -&nbsp;&nbsp; &nbsp;S&eacute;lectionner toutes les colonnes et mettre au format Texte puis cliquer sur Terminer&hellip;OK. -&nbsp;&nbsp; &nbsp;Vous avez ce tableau &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p><strong>2.&nbsp;&nbsp; &nbsp;<u>Retraitement / V&eacute;rification des cellules vides</u></strong></p>\r\n\r\n<p>Il ne doit pas y avoir de cellules vides dans la colonne Num COPRO. Pour cela il faut :</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;-&nbsp;&nbsp; &nbsp;Chercher ces cellules vides dans la colonne Num COPRO et les remplacer CO_N_01, CO_N_02, CO_N_03&hellip; Attention &agrave; &eacute;crire ce code en respectant bien l&rsquo;orthographe. Au moment de la restitution l&rsquo;interface transforme les CO_N_ &nbsp;par &laquo; des vides &raquo; pour recoller &agrave; la table adresse initiale du client. Mais il ne reconnaitra que ces caract&egrave;res !!</p>\r\n\r\n<p>Il ne doit pas y avoir de cellules vides dans les colonnes CP et Villes. Pour cela, il faut :</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;&nbsp; &nbsp;Chercher les cellules vides dans les colonnes CP et Villes et les remplacer par XXX. &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;&nbsp; &nbsp;S&rsquo;il y a des valeurs 0 dans le CP et villes, les remplacer par XXX.</p>\r\n\r\n<p>Il ne doit pas avoir des cellules vides dans la colonne Adresse, s&rsquo;il est vide il faut remettre le contenu de la cellule Nom de la copro</p>\r\n\r\n<p>Par exemple :</p>\r\n\r\n<p>PAD001&nbsp;&nbsp; &nbsp;8104&nbsp;&nbsp; &nbsp;RESIDENCE &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 6400CANNES</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;ARMENONVILLE</p>\r\n\r\n<p>&nbsp;PAD001&nbsp;&nbsp; &nbsp;8104&nbsp;&nbsp; &nbsp;RESIDENCE &nbsp;ARMENONVILLE&nbsp;&nbsp; &nbsp;RESIDENCE ARMENONVILLE&nbsp;&nbsp; &nbsp;6400CANNES</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;ARMENONVILLE</p>\r\n\r\n<p>&nbsp; <strong>3.&nbsp;&nbsp; &nbsp;</strong><u><strong>Lancement des macros</strong></u></p>\r\n\r\n<p>Dans le menu Affichage choisir Macro&hellip;afficher les macros et nous avons la fen&ecirc;tre suivante &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Choisir &laquo; Pr&eacute;paration_table_adresse &raquo; puis</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &hellip; Ex&eacute;cuter &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Et nous avons ce tableau ci-dessous &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;La ligne en vert indique que la macro a bien &eacute;t&eacute; lanc&eacute;e.</p>\r\n\r\n<p>4.&nbsp;&nbsp; &nbsp;V&eacute;rification des doublons NUMERO COPROPRIETAIRE</p>\r\n\r\n<p>Menu Compl&eacute;ment puis cliquez sur mDF XLdoublons, nous avons cette fen&ecirc;tre</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Ensuite s&eacute;lectionnez la colonne Num_Copro puis cliquez sur Ex&eacute;cuter&hellip;puis cochez la case &laquo; toutes les occurrences doublons &raquo;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Nous avons deux (2) cas :</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;<em><strong> Cas 1 :</strong></em></p>\r\n\r\n<p>&nbsp;S&rsquo;il n&rsquo;a pas de doublons une fen&ecirc;tre s&rsquo;ouvre pour confirmer &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; <strong><em>Cas 2 :</em> </strong></p>\r\n\r\n<p>&nbsp;S&rsquo;il y a des doublons, ils sont archiv&eacute;s dans une nouvelle feuille nomm&eacute;e ₺mDF &raquo; doublons archiv&eacute;s₺. Que faut-il faire ?</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Cr&eacute;er une 3i&egrave;me ligne : La ligne en doublon sera mise en triplet de mani&egrave;re &agrave; proposer aux op&eacute;ratrices la 3i&egrave;me solution ind&eacute;cidable o&ugrave; seul le num&eacute;ro Copro sur la boite sans autres informations. Dans ce cas l&rsquo;adresse propos&eacute;e n&rsquo;en sera pas en XXX mais les deux (2) adresses fusionn&eacute;es.</p>\r\n\r\n<p><strong>Exemple :</strong> &nbsp;</p>\r\n\r\n<p>TABLE_ADRESSE_PCU001_PIERRE_SCHEUER&nbsp;&nbsp; &nbsp;PCU001&nbsp;&nbsp; &nbsp;190 &nbsp;&nbsp; &nbsp;RESIDENCE LA COUR DES &nbsp;VIGNERONS &nbsp;&nbsp; &nbsp;RESIDENCE LA COUR DES VIGNERONS &nbsp;- 2B ET 2C RUE DE L&#39;HOPITAL&nbsp;&nbsp; &nbsp;67520&nbsp;&nbsp; &nbsp;MARLENHEIM</p>\r\n\r\n<p>TABLE_ADRESSE_PCU001_PIERRE_SCHEUER&nbsp;&nbsp; &nbsp;PCU001&nbsp;&nbsp; &nbsp;190 <span style="color:#FF0000">BIS</span>&nbsp;&nbsp; &nbsp;<span style="color:#FF0000">RESIDENCE LE CHANT D&#39;OISEAUX&nbsp;&nbsp; &nbsp;RESIDENCE LE CHANT D&#39;OISEAUX- 4 IMPASSE ST JUDE&nbsp;&nbsp; &nbsp;67530&nbsp;&nbsp; &nbsp;OTTROTT </span></p>\r\n\r\n<p><span style="color:#FF0000">TABLE_ADRESSE_PCU001_PIERRE_SCHEUER&nbsp;&nbsp; &nbsp;PCU001&nbsp;&nbsp; &nbsp;190 XXX&nbsp;&nbsp; &nbsp;RESIDENCE LA COUR DES VIGNERONS- RESIDENCE LE CHANT D&#39;OISEAUX&nbsp;</span>&nbsp; &nbsp;RESIDENCE LA COUR DES VIGNERONS &nbsp;- 2B ET 2C RUE DE L&#39;HOPITAL-67520 &ndash; MARLENHEIM - RESIDENCE LE CHANT D&#39;OISEAUX - 4 IMPASSE ST JUDE&nbsp;&nbsp; &nbsp;67530&nbsp;&nbsp; &nbsp;OTTROTT &nbsp;</p>\r\n\r\n<p><strong><u>Remarque</u> </strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;1.&nbsp;&nbsp; &nbsp;Indiquer dans le tableau de suivi des chantiers que le chantier comporte des doublons table adresse</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;2.&nbsp;&nbsp; &nbsp;Lorsque le client envoie les corrections, reporter dans le tableau de suivi des chantiers la date &agrave; laquelle il nous a transmis tous les &eacute;l&eacute;ments pour commencer la saisie d&rsquo;un chantier. Attention il faut ajouter peut &ecirc;tre une colonne par exemple &laquo; Date Tvaux &raquo; pour y mettre cette date en &nbsp;&eacute;vidence sans effacer Date Transfert !</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 3.&nbsp;&nbsp; &nbsp;Si le chantier a &eacute;t&eacute; import&eacute; dans l&rsquo;interface, il doit &ecirc;tre mis en statut &laquo; attendre &raquo; via l&rsquo;interface web tant que le client n&rsquo;a pas retourn&eacute; ses corrections. Il faut emp&ecirc;cher toute VALIDATION de photos. &nbsp;</p>\r\n\r\n<p><strong>5.&nbsp;&nbsp; &nbsp;</strong><u><strong>Mise en forme du fichier dans le bloc note</strong></u></p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Ouvrir bloc note, copier puis coller la colonne de B &agrave; la derni&egrave;re colonne. &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Remplacer dans Table_Adresse tabulation par virgule.</p>\r\n\r\n<p><strong>&nbsp;6.&nbsp;&nbsp; &nbsp;</strong><u><strong>Contr&ocirc;le</strong></u> &nbsp;</p>\r\n\r\n<p>V&eacute;rifier que la Table-Adresse s&rsquo;affiche correctement.</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Ouvrir le logiciel V&eacute;rifier_table_adresse.exe dans Y:\\Source\\</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Remplacer dans l&rsquo;&eacute;cran d&rsquo;accueil &laquo; Proarchives &raquo; par &laquo; Table &raquo;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Choisir le chantier &agrave; v&eacute;rifier (il faut avoir un r&ocirc;le de contr&ocirc;leur) et ouvrir en saisie</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;V&eacute;rifier le colonage des 5 champs. Ils doivent &ecirc;tre parfaitement align&eacute;s &nbsp; &nbsp;</p>\r\n\r\n<p><u><strong>Remarque</strong></u></p>\r\n\r\n<p>&nbsp;Il se peut que la Table_Adresse existe d&eacute;j&agrave; ou le client nous a envoy&eacute; un chantier peu de jours avant (chantier encore visible dans l&rsquo;interface web). &nbsp;Si c&rsquo;est le cas, il faut supprimer l&rsquo;ancienne table avant de copier la nouvelle. L&rsquo;&eacute;tape de comparaison &eacute;tant trop d&eacute;licate. &nbsp;</p>\r\n\r\n<p><strong>7.&nbsp;&nbsp; &nbsp;<u>Intervention manuelle fr&eacute;quente</u></strong></p>\r\n\r\n<p>Au moment du contr&ocirc;le, il arrive qu&rsquo;une anomalie revienne tr&egrave;s souvent. Les colonnes se d&eacute;calent lorsque le m&ecirc;me Libell&eacute; revient pour NOM Copro, Adresse et Ville</p>\r\n\r\n<p>&nbsp;<u><strong>Exemple : </strong></u></p>\r\n\r\n<p>PAF009,0731,VERSAILLES EXELMANS IMM,VERSAILLES &nbsp;EXELMANS IMM - 15/17/19 &nbsp;Bld Exelmans,78000,VERSAILLES &nbsp;La modification doit &ecirc;tre faite dans le fichier Table_Adresse.txt en l&rsquo;ouvrant directement avec Bloc Note. Les modifications ne seront visibles dans l&rsquo;&eacute;cran de l&rsquo;interface que lorsque la Table_Adresse est enregistr&eacute;e. Il suffit d&rsquo;ajouter des guillemets sur le premier et un espace pour le second. Et de contr&ocirc;ler &agrave; nouveau !</p>\r\n\r\n<p>PAF009,0731, &raquo;VERSAILLES EXELMANS IMM &raquo;, VERSAILLES &nbsp;EXELMANS IMM - 15/17/19 &nbsp;Bld Exelmans,78000,VERSAILLES &nbsp;</p>\r\n\r\n<p><strong>8.&nbsp;&nbsp; &nbsp;<u>Table adresse contr&ocirc;l&eacute;e</u></strong></p>\r\n\r\n<p>Une fois contr&ocirc;l&eacute;e la table adresse peut &ecirc;tre recopi&eacute;e dans la vraie table adresse utilis&eacute;e par la saisie dont l&rsquo;emplacement est :<strong> Y:/Source/ fichier_table_adresse.txt</strong></p>\r\n\r\n<p><strong>NB :</strong> Seules les tables contr&ocirc;l&eacute;es peuvent y &ecirc;tre recopi&eacute;es.</p>\r\n\r\n<p><strong><u>Questions : 1</u></strong>.&nbsp;&nbsp; &nbsp;Est-ce qu&rsquo;il peut arriver qu&rsquo;on fusionne deux/trois tables d&rsquo;adresse ?</p>\r\n\r\n<p>Oui si le client nous envoie plusieurs fichiers pour un m&ecirc;me chantier (cas assez rare). Il faut importer chaque table adresse et les mettre les unes &agrave; la suite des autres comme si il y en avait qu&rsquo;une seule.</p>\r\n\r\n<p>D&rsquo;apr&egrave;s votre mail ci-apr&egrave;s, l&rsquo;affection de l&rsquo; &laquo; ID_IMMEUBLE &raquo; fonctionnera dans les cas &laquo; 190 &raquo; et &laquo; 190 BIS &raquo; mais pas dans celui du &laquo; 190 XXX &raquo;. D&rsquo;apr&egrave;s ce que j&rsquo;ai compris, le cas &laquo; 190 &raquo; ou &laquo; 190 BIS &raquo; correspond &agrave; l&rsquo;Unit&eacute; d&rsquo;Archives sur laquelle est mentionn&eacute;e &agrave; la fois le n&deg; de COPRO et son adresse (et/ou nom de l&rsquo;immeuble), et pour le cas &laquo; 190 XXX &raquo; l&rsquo;UA ne mentionnerait que le n&deg; de COPRO.&nbsp;</p>', '2016-05-17 11:50:00', 0, 0, NULL);
INSERT INTO `version` (`ver_creator`, `ver_article`, `Id`, `ver_titre`, `ver_content`, `ver_date`, `ver_editable`, `ver_del`, `attachement`) VALUES
(48, 23, 14, 'Base de Donnée', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp;ORGANISATION DE LA BASE DE DONNEES</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> I.&nbsp;&nbsp; &nbsp;Fonctionnement de la base de donn&eacute;es</strong></p>\r\n\r\n<p>D&rsquo;une mani&egrave;re g&eacute;n&eacute;rale les diff&eacute;rentes interfaces permettent d&rsquo;&eacute;crire dans les BDD en respectant des masques et des r&egrave;gles de saisies. On utilise l&rsquo;interface web ou les ODBC pour effectuer des petites op&eacute;rations de maintenance sur les BDD. Une t&acirc;che effectu&eacute;e via les ODBC doit &ecirc;tre toujours interrog&eacute;e pour v&eacute;rifier si elle ne m&eacute;rite pas d&rsquo;&ecirc;tre impl&eacute;ment&eacute;e dans l&rsquo;interface web en tant qu&rsquo;outil permanent.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>1.&nbsp;&nbsp; &nbsp;Base Chantier Rapport</strong></p>\r\n\r\n<p>Elle contient une (1) table. Le contenu de cette table est impl&eacute;ment&eacute; lors d&#39;un chargement d&#39;un chantier en m&ecirc;me temps que la table_chantier de la BDD Chantier.</p>\r\n\r\n<p>Les champs importants de cette base sont :</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;<strong>Nom_Chantier</strong> : il est r&eacute;cup&eacute;r&eacute; lors du transfert du chantier</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;<strong>Total_photo</strong> : il est saisit au moment du transfert du chantier. C&#39;est le nombre de photo que le client dit avoir transf&eacute;r&eacute;</p>\r\n\r\n<p>-&nbsp;&nbsp; <strong>&nbsp;Date_transfert</strong> : correspond &agrave; la date &agrave; laquelle le client a d&eacute;pos&eacute; le chantier sur le serveur FTP</p>\r\n\r\n<p>-&nbsp;&nbsp; <strong>&nbsp;Compteur_photo</strong> : C&#39;est le N&deg; de compteur de la table client_archiviste renseign&eacute; au moment de l&#39;importation. Cette donn&eacute;e est statique &nbsp;-&nbsp;&nbsp; &nbsp;<strong>Date_restitution</strong> : lorsque la date d&#39;envoi est saisie, le chantier n&#39;apparait plus dans l&#39;interface web.</p>\r\n\r\n<p>Le contenue de cette table, dont le &laquo; r&eacute;sum&eacute; &raquo; est visible dans l&rsquo;interface web dans le module &laquo; avancement des travaux &raquo; doit &ecirc;tre rapproch&eacute; en permanence du tableau Excel <strong><span style="color:#000000">Suivi des chantiers.</span></strong> Notamment sur les quantit&eacute;s, dates, compteur,&hellip; Ces 2 outils doivent se lire en miroir l&rsquo;un de l&rsquo;autre. Ils racontent la m&ecirc;me chose l&rsquo;un saisie manuellement (Excel) et l&rsquo;autre automatis&eacute; (BDD Mysql-Interface web).</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>2.&nbsp;&nbsp; &nbsp;Base Chantier</strong></p>\r\n\r\n<p>Elle contient une (1) table</p>\r\n\r\n<p>Le contenu de cette table est impl&eacute;ment&eacute; lors d&#39;un chargement d&#39;un chantier en m&ecirc;me temps que la table Chantier_rapport. Il y a autant d&#39;enregistrements que de photos &agrave; saisir.</p>\r\n\r\n<p>Les champs importants de cette base sont :</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;<strong>Chantier_lien_photo </strong></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;<strong>Chantier_Pseudo_Saisie1 :</strong> qui correspondant &agrave; l&rsquo;op&eacute;ratrice qui effectue la 1&egrave;re saisie</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;<strong>Chantier_Pseudo_Saisie2 </strong>: qui correspondant &agrave; l&rsquo;op&eacute;ratrice qui effectue la 2&egrave;me saisie</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;<strong>Type_de_photo :</strong> qui correspond &agrave; l&rsquo;UA ou Ardoise C&rsquo;est dans cette table que se construit le principe de la double saisie.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>3.&nbsp;&nbsp; &nbsp;Base Proarchives </strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Elle contient cinq (5) tables.</p>\r\n\r\n<p>&nbsp;Une des 5 tables, la table Traitement sert &agrave; g&eacute;rer le Process : Saisie &ndash; Contr&ocirc;le &ndash; Correction &ndash; Contr&ocirc;le - Validation</p>\r\n\r\n<p>Cette table est utilis&eacute;e pour g&eacute;rer le process de traitement de la saisie de photo. &nbsp;A une photo correspond 2 enregistrements correspondants &agrave; la saisie de A et B. Les champs importants de cette table sont :</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Traitement_Type qui contient le statut de la Photo</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Traitement_Correction qui contient l&rsquo;ensemble des descriptions des champs &agrave; corriger. &nbsp;</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;4.&nbsp;&nbsp; &nbsp;Base Ago </strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Contient cinq (5) tables</p>\r\n\r\n<p>Pour des questions de coh&eacute;rence et d&rsquo;homog&eacute;n&eacute;it&eacute; on fait en sorte que les BDD soient similaires pour tous les clients m&ecirc;me si les champs ne sont pas tous utilis&eacute;s.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> 5.&nbsp;&nbsp; &nbsp;Base Recall</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Contient cinq (5) tables.</p>\r\n\r\n<p>Pour des questions de coh&eacute;rence et d&rsquo;homog&eacute;n&eacute;it&eacute; on fait en sorte que les BDD soient similaires pour tous les clients m&ecirc;me si les champs ne sont pas tous utilis&eacute;s.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp;6.&nbsp;&nbsp; &nbsp;Base caremploi </strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Elle contient cinq (5) tables.</p>\r\n\r\n<p>&nbsp;Une des 5 tables, la table Traitement sert &agrave; g&eacute;rer le Process : Saisie &ndash; Contr&ocirc;le &ndash; Correction &ndash; Contr&ocirc;le - Validation</p>\r\n\r\n<p>Cette table est utilis&eacute;e pour g&eacute;rer le process de traitement de la saisie de photo. &nbsp;A une photo correspond 2 enregistrements correspondants &agrave; la saisie de A et B. Les champs importants de cette table sont :</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Traitement_Type qui contient le statut de la Photo</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Traitement_Correction qui contient l&rsquo;ensemble des descriptions des champs &agrave; corriger. &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; <strong>&nbsp;II.&nbsp;&nbsp; &nbsp;Description du Process dans la table traitement </strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp;1&nbsp;&nbsp; &nbsp;Le cycle normal </strong></p>\r\n\r\n<p>Les photos &agrave; saisir suivent toutes le m&ecirc;me cycle.</p>\r\n\r\n<p>Elles sont d&rsquo;abord import&eacute;es dans la BDD chantier pour recevoir la saisie de A puis de B. L&rsquo;ordre des saisies se fait dans l&rsquo;ordre d&lsquo;importation c&#39;est-&agrave;-dire dans l&rsquo;ordre de leur r&eacute;pertoire Windows.</p>\r\n\r\n<p>Chaque saisie A et B g&eacute;n&egrave;re une ligne dans la table traitement.<u> Donc pour respecter la double saisie, toute URL photo totalement saisie doit avoir g&eacute;n&eacute;r&eacute;e 2 lignes dans la table traitement.</u></p>\r\n\r\n<p>Description des diff&eacute;rents 11 statuts dans la table traitement pour chaque ligne d&rsquo;enregistrement.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; TEMP = Saisie en cours pour l&rsquo;op&eacute;rateur dont le nom figure dans Traitement_Utilisateur_Pseudo</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; SAISIE = Saisie termin&eacute;e (= en attente de contr&ocirc;le) pour l&rsquo;op&eacute;rateur dont le nom figure dans Traitement_Utilisateur_Pseudo</p>\r\n\r\n<p><u><strong>&nbsp; Lorsque 2 lignes de la table traitement pour une m&ecirc;me URL photo portent le statut SAISIE, la photo est disponible pour le contr&ocirc;le.</strong></u> &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;CONTROL = L&rsquo;URL photo est en cours de contr&ocirc;le sur la 1ere boite pour l&#39;op&eacute;rateur dont le nom figure dans Traitement_Control &nbsp;&nbsp;&nbsp; &nbsp;CCTION_tmp = L&rsquo;URL photo est en cours de contr&ocirc;le sur les autres boites pour l&#39;op&eacute;rateur dont le nom figure dans Traitement_Control &nbsp;</p>\r\n\r\n<p>A l&rsquo;issue de la phase de contr&ocirc;le, la photo part ou non en correction pour l&rsquo;un ou les 2 op&eacute;rateurs. Pour les 2 enregistrements de la table traitement, je peux avoir une des lignes en statut SAISIE et l&rsquo;autre en statut CORRECTION. Ou les 2 en statuts CORRECTIONS !</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;CORRECTION = en attente de Correction pour l&rsquo;op&eacute;rateur dont le nom figure dans Traitement_Utilisateur_Pseudo &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;TEMP_CORRECT = en cours de Correction pour l&rsquo;op&eacute;rateur dont le nom figure dans Traitement_Utilisateur_Pseudo</p>\r\n\r\n<p><u>A l&rsquo;issue de la phase de correction, la photo reprend le statut SAISIE. Elle peut donc &ecirc;tre pr&eacute;sent&eacute;e &agrave; nouveau au contr&ocirc;le.</u></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; VALIDEE = A = B. La photo n&rsquo;est plus disponible pour l&rsquo;interface de saisie ou de contr&ocirc;le ou de super-contr&ocirc;le. La table traitement stocke tous les enregistrements portant le statut VALIDEE (= historique).</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>2&nbsp;&nbsp; &nbsp;Le cycle &eacute;tendu </strong></p>\r\n\r\n<p>Il arrive qu&rsquo;une photo pr&eacute;sente des caract&eacute;ristiques qui n&eacute;cessitent une intervention d&rsquo;un super contr&ocirc;leur. Les photos sont isol&eacute;es dans des SAS d&rsquo;attentes. &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;<strong> a)</strong>&nbsp;&nbsp; <u><strong>&nbsp;Attente administrateur</strong></u></p>\r\n\r\n<p>Seul un op&eacute;rateur ayant le r&ocirc;le de super contr&ocirc;leur peut r&eacute;cup&eacute;rer la photo et effectuer des corrections pour tous les champs manuellement (tr&egrave;s sensible)</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ATTENTE_ADMIN = la photo est mis &agrave; l&rsquo;&eacute;cart du cycle normal. &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; SUPER_CONTROL = L&rsquo;URL photo est en cours de Super-contr&ocirc;le sur la 1ere boite pour l&#39;op&eacute;rateur dont le nom figure dans Traitement_Control</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;SSTION_tmp = L&rsquo;URL photo est en cours de Super-contr&ocirc;le sur les autres boites pour l&#39;op&eacute;rateur dont le nom figure dans Traitement_Control A l&rsquo;issue de la phase de Super-contr&ocirc;le, la photo reprend le statut SAISIE. Elle peut donc &ecirc;tre pr&eacute;sent&eacute;e &agrave; nouveau au contr&ocirc;le.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; <strong>&nbsp; b)</strong>&nbsp;&nbsp; &nbsp;<u><strong>Attente Client </strong></u></p>\r\n\r\n<p>ATTENTE_CLIENT. Il arrive qu&rsquo;une photo doive &ecirc;tre sortie du cycle normal ou du Super-contr&ocirc;le par manque d&rsquo;informations du client. Elle est alors non disponible pour les op&eacute;rateurs, les contr&ocirc;leurs et le super-contr&ocirc;leur. &nbsp;</p>\r\n\r\n<p>Attention !!! &nbsp;Pour la remettre dans le cycle normal, il faut modifier manuellement les ODBC en passant ATTENTE_ADMIN en Statut SAISIE. La photo peut alors revenir au contr&ocirc;leur et en transmettant &agrave; l&rsquo;&eacute;quipe les consignes du client. &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp;c)&nbsp;&nbsp; &nbsp;<u>Remarques importantes</u> </strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;1.&nbsp;&nbsp; &nbsp;Le seul &eacute;cran o&ugrave; une photo peut &ecirc;tre d&eacute;finitivement VALIDEE est l&rsquo;&eacute;cran de contr&ocirc;le.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;2.&nbsp;&nbsp; &nbsp;C&rsquo;est au moment o&ugrave; l&rsquo;on contr&ocirc;le et valide une photo que l&rsquo;on d&eacute;clenche un certain nombre d&rsquo;automate comme l&rsquo;incr&eacute;mentation des compteurs. Tant qu&rsquo;une photo n&rsquo;est pas valid&eacute;e, il n&rsquo;est pas n&eacute;cessaire de mouvementer le compteur. Par ailleurs si je souhaite relancer l&rsquo;incr&eacute;mentation du compteur, il suffit de passer du Statut VALIDEE au statut SAISIE et reprendre un cycle.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; 3.&nbsp;&nbsp; &nbsp;Toute modification via les ODBC n&eacute;cessite une prudence particuli&egrave;re pour modifier un statut. Il faut notamment bien comprendre s&rsquo;il faut modifier les 2 lignes de la table traitement ou 1 seule. Au final, on a le choix entre SAISIE (renvoyer au contr&ocirc;le= 90 % des cas), ATTENTE_ADMIN (envoyer au super-contr&ocirc;le).</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; 4.&nbsp;&nbsp; &nbsp;On ne modifie jamais un statut qui pr&eacute;sente une signification en-cours de modification de l&rsquo;enregistrement (TEMP_CORRECT, TEMP, CONTROL, SUPER_CONTROL, CCTION_tmp, SSTION_tmp) sauf op&eacute;rations de maintenance. Cela revient &agrave; &laquo; CASSER &raquo; le travail qu&rsquo;une op&eacute;ratrice est en train d&rsquo;effectuer.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; 5.&nbsp;&nbsp; &nbsp; lorsque l&rsquo;automate de l&rsquo;interface enregistre le statut il &eacute;crit le statut + le pseudo de l&rsquo;op&eacute;rateur. (Exemple : SAISIE A_Danhin) mais le pseudo n&rsquo;est pas obligatoire pour faire fonctionner l&rsquo;interface (fonction contient &hellip; et non &eacute;gal&hellip;)</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; 6.&nbsp;&nbsp; &nbsp;l&rsquo;ordre des saisies se fait dans l&rsquo;ordre des enregistrements de la table d&rsquo;importation chantier. L&rsquo;ordre du contr&ocirc;le se fait dans l&rsquo;ordre historique. D&rsquo;abord la plus ancienne puis la plus r&eacute;cente de la table traitement d&egrave;s lors qu&rsquo;elles sont doubles. L&rsquo;ordre des corrections se fait dans l&rsquo;ordre historique. Un num&eacute;ro d&rsquo;index plus petit dans la table traitement d&eacute;signe une photo plus ancienne. &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp;1&nbsp;&nbsp; &nbsp;Quelques probl&egrave;mes rencontr&eacute;s</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> 1.1&nbsp;&nbsp; &nbsp;</strong><u><strong>Le nombre &laquo; photos d&eacute;clar&eacute;es &raquo; diff&eacute;rent &laquo; photos re&ccedil;ues &raquo; </strong></u></p>\r\n\r\n<p>Dans l&rsquo;interface Web nous remarquons que le nombre de photos d&eacute;clar&eacute;es n&rsquo;est pas &eacute;gale au nombre de photos re&ccedil;ues et la ligne de ce chantier est en rouge. Deux cas de figures se pr&eacute;sentent :</p>\r\n\r\n<p><strong>a)&nbsp;&nbsp; &nbsp;Le client oublie une photo</strong></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Copiez la photo dans le r&eacute;pertoire correspondant</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Allez dans Ms Access, ouvrez la base chantier</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;S&eacute;lectionnez et copiez le nom de la photo dans chantier_photo sans oublier d&rsquo;attribuer un num&eacute;ro d&rsquo;index&hellip;.compl&eacute;tez les autres champs -&nbsp;&nbsp; &nbsp;Enregistrez</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Allez dans l&rsquo;interface Web et actualiser la page.</p>\r\n\r\n<p>&nbsp;<strong>b)&nbsp;&nbsp; &nbsp;La quantit&eacute; d&eacute;clar&eacute;e par le client est erron&eacute;e </strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;&nbsp; &nbsp;Dans Ms ACCESS, ouvrez la table chantier_rapport</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; - &nbsp; &nbsp;Dans le champ total_photo, changez le nombre de photos</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;&nbsp; &nbsp;Enregistrez</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;&nbsp; &nbsp;Allez dans l&rsquo;interface Web et actualisez la page.</p>\r\n\r\n<p><strong>1.&nbsp;&nbsp; &nbsp;Le triplet</strong></p>\r\n\r\n<p>La couleur de ce chantier est orange. Le triplet se manifeste quand la m&ecirc;me photo est saisie 3 ou 4 fois. Pour le corriger :</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-&nbsp;&nbsp; &nbsp;S&eacute;lectionnez le chantier en question</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-&nbsp;&nbsp; &nbsp;Cliquez sur <strong>Nettoyage</strong> (Cf. la figure ci-apr&egrave;s) &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-&nbsp;&nbsp; &nbsp;Dans la liste d&eacute;roulante de Rechercher, choisir Triplet puis valider</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-&nbsp;&nbsp; &nbsp;Une nouvelle fen&ecirc;tre s&rsquo;ouvre qui affiche les photos en triplet ou en quadruplet. Attention !!! Avant de proc&eacute;der &agrave; toute modification, il faut regarder le statut de la photo (correction, contr&ocirc;le&hellip;), dans ce cas, ne faites rien. Par contre si la photo est en saisie, -&nbsp;&nbsp; &nbsp;Cliquez sur nettoyage. Et la saisie reprend. &nbsp;</p>\r\n\r\n<p><strong>2.&nbsp;&nbsp; &nbsp;Blocage sur une photo </strong></p>\r\n\r\n<p>Il y a des bugs qui s&rsquo;affichent sur les interfaces pendant la <strong>correction ou contr&ocirc;le</strong>, pour le r&eacute;soudre :</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;S&eacute;lectionnez le chantier</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Cliquez sur Nettoyage</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Dans la liste d&eacute;roulante, choisir D&eacute;bloquer contr&ocirc;le, si la photo est en contr&ocirc;le ou sur D&eacute;bloquer correction si la photo est en correction.</p>\r\n\r\n<p>&nbsp;<strong>3.&nbsp;&nbsp; &nbsp;Supprimer une saisie d&rsquo;une photo (rare)</strong></p>\r\n\r\n<p>Pour supprimer totalement la saisie d&rsquo;une photo.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;&nbsp; &nbsp;S&eacute;lectionner l&rsquo;URL photo dans la <strong>table traitement</strong> et supprimer les enregistrements (1 ou 2 lignes pour A et B)</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;S&eacute;lectionner l&rsquo;URL photo dans la table photo et supprimer les enregistrements (toutes les lignes ou variables selon A et B !)</p>\r\n\r\n<p><strong>Attention </strong>: &agrave; ce stade, la photo ne pourra pas &ecirc;tre RE-saisie, car il subsiste les enregistrements des pseudos dans la table chantier.</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;S&eacute;lectionner l&rsquo;URL photo dans la table chantier et effacer les 2 pseudos (ou 1 seul pour A ou B).</p>\r\n\r\n<p>&nbsp;<strong>4.&nbsp;&nbsp; &nbsp;Chantier mal charg&eacute; Si une importation se passe mal</strong></p>\r\n\r\n<p>Ne pas h&eacute;siter et supprimer les enregistrements li&eacute;s &agrave; l&rsquo;importation</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Via ODBC supprimer la ou les lignes de<strong> rapport_chantier </strong>contenant exactement le nom du <strong>chantier</strong> dans le champ &laquo; url_chantier &raquo;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Via ODBC supprimer la ou les lignes de chantier contenant exactement le nom du chantier dans le champ <strong>&laquo; Chantier_Dossier_Travail &raquo;</strong></p>', '2016-05-17 13:04:00', 1, 0, NULL),
(48, 25, 15, 'des bases de données', '<p>dsdvssgsdg</p>', '2016-05-17 16:58:00', 1, 0, NULL),
(48, 26, 16, 'Base de Donnée', '<p style="text-align:justify"><span style="color:#0000CD"><strong>Maintenance des bases de donn&eacute;es</strong></span> &nbsp;</p>\r\n\r\n<p style="text-align:justify"><span style="color:#0000FF">A.&nbsp;&nbsp; &nbsp;Pr&eacute;ambule </span></p>\r\n\r\n<p style="text-align:justify">J&rsquo;ai 2 fichiers Excel dans &nbsp;dropbox\\activit&eacute; qui s&rsquo;appelle :</p>\r\n\r\n<p style="text-align:justify">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Base ago live et Base proarchive live.</p>\r\n\r\n<p style="text-align:justify">(Dans la base Ago j&rsquo;ai Cr&eacute;dit Agricole). &nbsp;</p>\r\n\r\n<p style="text-align:justify">Ces &nbsp;deux tableaux me permettent de connaitre l&rsquo;avancement des chantiers (proarchives ou CA) Ils sont construit sur le m&ecirc;me principe Dans un onglet l&rsquo;importation de toute la base (colonne N jusqu&#39;&agrave; la derni&egrave;re colonne) les premiers colonnes permettent d&rsquo;analyser l&rsquo;importation pour faire un tableau crois&eacute; dynamique (qui est donc une synth&egrave;se des informations contenus dans la base).Dans l&rsquo;onglet ou se trouve le TCD je peux voir l&rsquo;avancement &nbsp;des chantiers(en cliquant dans actualiser tout) puis dans le TCD refaire actualiser avec le clic droit</p>\r\n\r\n<p style="text-align:justify">A droite du TCD je renseigne la colonne entr&eacute;e stock par les valeurs que j&rsquo;ai saisies dans le tableau de suivi des commandes.</p>\r\n\r\n<p style="text-align:justify">&nbsp; Les colonnes stock a saisir et stock a valider sont calculer si le chiffre est n&eacute;gatif cela signifie qu&rsquo;il y a plus de saisie de photos &nbsp; dans la base qu&rsquo;il a de photos dans le chantier : &nbsp;il faudra donc supprimer les enregistrements dans la base si le chiffre est positif c&rsquo;est qu&rsquo;il reste des photos a saisir &nbsp;s&rsquo;il est nul c&rsquo;est que le chantier est termin&eacute;</p>\r\n\r\n<p style="text-align:justify">Quand une photo est dans la colonne informer paris c&rsquo;est quelle a un mauvais statut et qu&rsquo;il faut intervenir dans la base pour corriger l&rsquo;anomalie.</p>\r\n\r\n<p style="text-align:justify">On a autre TCD qui permet de comprendre le d&eacute;tail de l&rsquo;anomalie par photo. Il faut s&eacute;lectionner le num&eacute;ro d&rsquo;envoi et ensuite s&eacute;lectionner le chantier sur le quel on souhaite comprendre les anomalies Pour d&eacute;bloquer il faut ouvrir Access</p>\r\n\r\n<p style="text-align:justify">&nbsp;Menu d&eacute;marrer</p>\r\n\r\n<p style="text-align:justify">Application Access</p>\r\n\r\n<p style="text-align:justify">je retrouve les &nbsp;deux bases ago et proarchives (pr&eacute;c&eacute;der d&rsquo;un Z)</p>\r\n\r\n<p style="text-align:justify">trois tables sont tr&egrave;s importantes pour d&eacute;bloquer</p>\r\n\r\n<p style="text-align:justify">On a la table traitement :&nbsp;&nbsp; &nbsp;pour chaque saisie de la photo j&rsquo;ai son statut et le nom de la personne qui a fait la saisie (c&rsquo;est le champ utilisateur pseudo)</p>\r\n\r\n<p style="text-align:justify">Table photo :&nbsp;&nbsp; &nbsp;pour chaque saisie de la photo j&rsquo;ai toutes les boites saisies avec leur d&eacute;tail et le nom de la personne qui a fait la saisie</p>\r\n\r\n<p style="text-align:justify">Et table chantier :&nbsp;&nbsp; &nbsp;pour chaque photo (une ligne par photo) j&rsquo;ai les 2 noms des operateurs qui ont fait la saisie</p>\r\n\r\n<p style="text-align:justify">Pour d&eacute;bloquer une photo il faut que j&rsquo;aille modifier son statut et donc que j&rsquo;aille dans la table traitement. Une fois que je connais le nom du fichier de la photo je eux utiliser &nbsp; le filtre et coller le nom de la photo dans &laquo; contient &raquo; et les photos s&rsquo;affichent. &nbsp;</p>\r\n\r\n<p style="text-align:justify">Il existe &agrave; ce jour plusieurs type de blocage</p>\r\n\r\n<p style="text-align:justify">&nbsp;1&deg;) Blocage d&rsquo;un &eacute;cran de correction (y compris avec correcteur magique) &nbsp;</p>\r\n\r\n<p style="text-align:justify">Aller dans Access attach&eacute; &agrave; la base (&agrave; l&rsquo;interface) du blocage (Proarchives, Ago,&hellip;) qui se trouve dans</p>\r\n\r\n<p style="text-align:justify">Z:\\Administration\\Connexion Base ODBC\\</p>\r\n\r\n<p style="text-align:justify">Ouvrir</p>\r\n\r\n<p style="text-align:justify">Afficher/Ouvrir la table traitement (enlever le filtre)</p>\r\n\r\n<p style="text-align:justify">Faire un filtre dans la colonne &laquo; Traitement Type &raquo; contient &laquo; correction &raquo;</p>\r\n\r\n<p style="text-align:justify">&nbsp;On affiche ainsi tous les saisis de photos en attente de correction</p>\r\n\r\n<p style="text-align:justify">V&eacute;rifier que la photo bloquante (et d&rsquo;autres !!!) ne contiennent pas de double {{</p>\r\n\r\n<p style="text-align:justify">Normalement il ne doit y en avoir qu&rsquo;une seule mais il arrive que l&rsquo;interface en g&eacute;n&egrave;re une deuxi&egrave;me</p>\r\n\r\n<p style="text-align:justify">&nbsp; Nous utilisons 2 bases de donn&eacute;es distinctes pour faire la saisie. L&rsquo;une exclusivement consacr&eacute;e &agrave; Proarchives et l&rsquo;autre &agrave; Ago pour tous les autres clients (Cr&eacute;dit Agricole,&hellip;) &nbsp;</p>\r\n\r\n<p style="text-align:justify">On peut acc&eacute;der &agrave; ces 2 bases en utilisant le logiciel Access qui avec ses connecteurs ODBC, permet de se connecter &agrave; la fois pour en faire la lecture mais aussi des modifications en direct. Attention, ces modifications de la base sont d&eacute;finitives et les retours en arri&egrave;res tr&egrave;s limit&eacute;s. Les interventions dans les bases n&eacute;cessitent une formation et une pratique r&eacute;guli&egrave;re.</p>\r\n\r\n<p style="text-align:justify">&nbsp;La compr&eacute;hension des bases et des &nbsp;tables est fondamentale pour effectuer des op&eacute;rations de maintenance. &nbsp;</p>\r\n\r\n<p style="text-align:justify">BASE DE DONNEES &nbsp; &nbsp;TABLES&nbsp;&nbsp; &nbsp;FONCTIONS &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; Utilisateurs&nbsp;&nbsp; &nbsp;utilisateur&nbsp;&nbsp; &nbsp;Gestion des loggins, r&ocirc;le, choix du chantier de travail,&hellip; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; Chantier&nbsp;&nbsp; &nbsp;table_chantier&nbsp;&nbsp; &nbsp;Importation des photos des chantiers et des pseudos de la saisie A ou B &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; Chantier_rapport&nbsp;&nbsp; &nbsp;chantier_rapport_Table&nbsp;&nbsp; &nbsp;Suivi des envois, stocks &agrave; saisir, &agrave; valider, compteur &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; Proarchives&nbsp;&nbsp; &nbsp;Traitement&nbsp;&nbsp; &nbsp;Gestion des statuts par pseudo (saisie, correction, contr&ocirc;le, attente_admin,&hellip;) &nbsp;&nbsp; &nbsp;Photo&nbsp;&nbsp; &nbsp;Ecritures des informations sur les boites &nbsp;&nbsp; &nbsp;gestion&nbsp;&nbsp; &nbsp;R&egrave;gle de comptage des caract&egrave;res &nbsp;&nbsp; &nbsp;client_archiviste&nbsp;&nbsp; &nbsp;compteur des historiques &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; Ago&nbsp;&nbsp; &nbsp;Traitement&nbsp;&nbsp; &nbsp;Gestion des statuts par pseudo (saisie, correction, contr&ocirc;le, attente_admin,&hellip;) &nbsp;&nbsp; &nbsp;Photo&nbsp;&nbsp; &nbsp;Ecritures des informations sur les boites &nbsp;&nbsp; &nbsp;gestion&nbsp;&nbsp; &nbsp;R&egrave;gle de comptage des caract&egrave;res &nbsp;&nbsp; &nbsp;client_archiviste&nbsp;&nbsp; &nbsp;compteur des historiques</p>\r\n\r\n<p style="text-align:justify">&nbsp;<span style="color:#0000CD">B.&nbsp;&nbsp; &nbsp;Organisation des bases de donn&eacute;es </span></p>\r\n\r\n<p style="text-align:justify"><span style="color:#0000CD">1.&nbsp;&nbsp; &nbsp;Table traitement </span>&nbsp;</p>\r\n\r\n<p style="text-align:justify">1 ligne pour chaque saisie A ou B. Donc la double saisie g&eacute;n&egrave;re 2 lignes par photo. Chaque saisie re&ccedil;oit un statut &nbsp;</p>\r\n\r\n<p style="text-align:justify"><span style="color:#0000CD">2.&nbsp;&nbsp; &nbsp;Table photo</span></p>\r\n\r\n<p style="text-align:justify">&nbsp;C&rsquo;est dans cette table que l&rsquo;on trouve toutes les saisies des boites. Il y a autant de lignes qu&rsquo;il y a de boites sur 1 photo. Dans le cas de la multi copropri&eacute;t&eacute;, on a autant de lignes que de multi copropri&eacute;t&eacute;s. &nbsp;</p>\r\n\r\n<p style="text-align:justify"><span style="color:#0000FF">C.&nbsp;&nbsp; &nbsp;Type d&rsquo;anomalies pr&eacute;sentes dans la base </span></p>\r\n\r\n<p style="text-align:justify"><strong>1.&nbsp;&nbsp; &nbsp;Une photo a &eacute;t&eacute; saisie plus de 2 fois (anomalies interface) </strong></p>\r\n\r\n<p style="text-align:justify">&nbsp;On les rep&egrave;re dans Excel avec le tableau crois&eacute; Envoi-Chantier-Photos &nbsp;Une saisie A est compt&eacute;e 0,5 et la saisie B &eacute;galement 0,5. Si le total d&eacute;passe 1 cela signifie que la photo a &eacute;t&eacute; saisie plus de 2 fois, ce qui d&rsquo;une part est inutile et d&rsquo;autre part fausse le stock &agrave; saisir. Objectif : supprimer l&rsquo;enregistrement correspondant &agrave; des saisies C, D,&hellip;</p>\r\n\r\n<p style="text-align:justify">&nbsp;Allez dans la base Access Proarchives</p>\r\n\r\n<p style="text-align:justify">Allez sur la table traitement + double clicc pour actualiser les donn&eacute;es</p>\r\n\r\n<p style="text-align:justify">&nbsp;L&rsquo;int&eacute;gralit&eacute; des enregistrements apparait &nbsp;</p>\r\n\r\n<p style="text-align:justify">Enlever les filtres (clic sur ic&ocirc;ne en bas &agrave; gauche de &laquo; rechercher &raquo;)</p>\r\n\r\n<p style="text-align:justify">Dans Excel, copier l&rsquo;URL de la photo &gt;1</p>\r\n\r\n<p style="text-align:justify">Dans Access, dans Traitement_Photo_URL, s&eacute;lectionner &laquo; contient &raquo; et coller la valeur de l&rsquo;URL. (On s&rsquo;&eacute;pargne ainsi en permanence d&rsquo;&eacute;crire un nom d&rsquo;URL avec le risque d&rsquo;erreur que cela suppose) Apparaisse toutes les lignes concernant la saisie de cette photo en URL</p>\r\n\r\n<p style="text-align:justify">Selon le statut de l&rsquo;URL, on supprime l&rsquo;enregistrement inadapt&eacute;. En g&eacute;n&eacute;ral celui qui poss&egrave;de l&rsquo;ID le plus grand.</p>\r\n\r\n<p style="text-align:justify">A noter que cette triple saisie, n&rsquo;emp&ecirc;che pas la validation d&rsquo;une photo.</p>\r\n\r\n<p style="text-align:justify">Exemple : &nbsp;Traitement_ID&nbsp;&nbsp; &nbsp;Traitement_Photo_Url&nbsp;&nbsp; &nbsp;Traitement_Utilisateur_Pseudo&nbsp;&nbsp; &nbsp;Traitement_Type&nbsp;&nbsp; &nbsp;Traitement_Control 25971&nbsp;&nbsp; &nbsp;Y:/Photos_AGO/ENVOI 2011.025/PFB001_FURGE_MULHAUSER_2011-10-28/PFB001_2011-10-28/PFB001_2011-10-28_AD_25.JPG&nbsp;&nbsp; &nbsp;B_Johnson&nbsp;&nbsp; &nbsp;SAISIE B_Johnson&nbsp;&nbsp; &nbsp; &nbsp;25960&nbsp;&nbsp; &nbsp;Y:/Photos_AGO/ENVOI 2011.025/PFB001_FURGE_MULHAUSER_2011-10-28/PFB001_2011-10-28/PFB001_2011-10-28_AD_25.JPG&nbsp;&nbsp; &nbsp;B_Johnson&nbsp;&nbsp; &nbsp;VALIDEE B_Johnson Wed Nov 30 12:41:49 2011&nbsp;&nbsp; &nbsp;R_Tchala 25962&nbsp;&nbsp; &nbsp;Y:/Photos_AGO/ENVOI 2011.025/PFB001_FURGE_MULHAUSER_2011-10-28/PFB001_2011-10-28/PFB001_2011-10-28_AD_25.JPG&nbsp;&nbsp; &nbsp;OperateurA&nbsp;&nbsp; &nbsp;VALIDEE OperateurA Wed Nov 30 12:41:49 2011&nbsp;&nbsp; &nbsp;R_Tchala &nbsp;</p>\r\n\r\n<p style="text-align:justify">La photo URL Y:/Photos_AGO/ENVOI 2011.025/PFB001_FURGE_MULHAUSER_2011-10-28/PFB001_2011-10-28/PFB001_2011-10-28_AD_25.JPG a &eacute;t&eacute; saisie &nbsp;fois. 2 fois par Johnson et 1 fois par Op&eacute;rateur A. C&rsquo;est Tachala qui a fait le dernier contr&ocirc;le de la photo. Les 2 derni&egrave;res lignes de traitement sont valid&eacute;es, ce qui signifie que la premi&egrave;re avec la statut SAISIE peut &ecirc;tre supprim&eacute;e. &nbsp;</p>\r\n\r\n<p style="text-align:justify"><span style="color:#0000FF">2.&nbsp;&nbsp; &nbsp;Probl&egrave;mes de statuts dans la table traitement &nbsp;</span></p>\r\n\r\n<p style="text-align:justify">Certains enregistrements de la table traitement suite &agrave; des op&eacute;rations de sorties de la base&hellip; restent dans un statut inappropri&eacute;e. &nbsp;</p>\r\n\r\n<p style="text-align:justify">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style="color:#0000FF">a)&nbsp;&nbsp; &nbsp;Statut Control</span></p>\r\n\r\n<p style="text-align:justify">Lorsque plus personne n&rsquo;est sur la base, dans la table traitement</p>\r\n\r\n<p style="text-align:justify">Filtre afficher tout</p>\r\n\r\n<p style="text-align:justify">Filtre contient dans &laquo; Traitement_Type &raquo; contient CONTROL</p>\r\n\r\n<p style="text-align:justify">Ce statut d&eacute;signe une photo en cours de contr&ocirc;le mais si personne n&rsquo;est sur la base, il faut le modifier en &laquo; SAISIE &raquo; &nbsp;</p>\r\n\r\n<p style="text-align:justify">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style="color:#0000CD"> a)&nbsp;&nbsp; &nbsp;Statut Super_Contr</span><span style="color:#0000FF">ol</span></p>\r\n\r\n<p style="text-align:justify">&nbsp;Ce statut d&eacute;signe une photo en cours de correction, mais si personne n&rsquo;est sur la base, il n&rsquo;a pas de raison d&rsquo;&ecirc;tre. &nbsp;Filtre afficher tout Filtre contient dans &laquo; Traitement_Type &raquo; contient Super_Control &nbsp;&nbsp; &nbsp;Ce statut d&eacute;signe une photo en cours de contr&ocirc;le mais si personne n&rsquo;est sur la base, il faut le modifier en &laquo; ATTENTE_ADMIN &raquo; &nbsp;</p>\r\n\r\n<p style="text-align:justify">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style="color:#0000FF">b)&nbsp;&nbsp; &nbsp; Statut tmp &nbsp;</span></p>\r\n\r\n<p style="text-align:justify">Ce statut d&eacute;signe une photo en cours de correction, mais si personne n&rsquo;est sur la base, il n&rsquo;a pas de raison d&rsquo;&ecirc;tre. Filtre afficher tout Filtre contient dans &laquo; Traitement_Type &raquo; contient tmp &nbsp;&nbsp; &nbsp;Ce statut d&eacute;signe une photo en cours de contr&ocirc;le mais si personne n&rsquo;est sur la base, il faut le modifier en &laquo; SAISIE &raquo;</p>\r\n\r\n<p style="text-align:justify">&nbsp; &nbsp; &nbsp; &nbsp; <span style="color:#0000FF">&nbsp; c)&nbsp;&nbsp; &nbsp;Statut TEMP </span>&nbsp;</p>\r\n\r\n<p style="text-align:justify">C&rsquo;est le statut d&rsquo;une photo en cours de saisie. Le nettoyage s&rsquo;effectue en 2 temps. Il faut regarder dans la table_chantier les noms des pseudos. Et comparer avec la table traitement. Si je supprime une ligne dans traitement en statut TEMP il faut que j&rsquo;enl&egrave;ve le pseudo dans la table_chantier correspondant de mani&egrave;re &agrave; refaire la double saisie.</p>', '2016-05-17 19:12:59', 0, 0, NULL);
INSERT INTO `version` (`ver_creator`, `ver_article`, `Id`, `ver_titre`, `ver_content`, `ver_date`, `ver_editable`, `ver_del`, `attachement`) VALUES
(48, 27, 17, 'Restitution', '<p>RESTITUTION</p>\r\n\r\n<p>A.&nbsp;&nbsp; &nbsp;Restitution AGO</p>\r\n\r\n<p>Interface<strong> Restit_AGo_Sans_repertoire</strong> pour les chantiers sans r&eacute;pertoires et <strong>Ago</strong> standard avec &nbsp;r&eacute;pertoires.</p>\r\n\r\n<p>1.&nbsp;&nbsp; &nbsp;L&rsquo;interface de connexion pour faire la restitution d<strong>es chantiers sans r&eacute;pertoires</strong> est <strong>Restit_AGo_Sans_repertoire</strong> qui se trouve dans Y :\\Source.</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Y:\\Source &hellip;Restit_AGo_Sans_repertoire</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Cochez la case Modification Config Login BDD</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Changez 192.168.3.55 en <strong>localhost</strong></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Connection</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Entrez votre <strong>Login</strong> puis le <strong>Mot de Passe </strong></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Choisir le chantier &agrave; restituer</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Cliquez sur <strong>Reconstruire fichier Client</strong> (le bouton en rouge au dessus de Pseudo_utilisateur). &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Apr&egrave;s quelques minutes, une boite de dialogue affiche le nombre de photos saisies. Le v&eacute;rifier dans l&rsquo;<strong>Interface Web </strong>dans la colonne <strong>Fichier &agrave; traiter</strong>.</p>\r\n\r\n<p>Trois (3) fichiers sont automatiquement cr&eacute;es dans le dossier de l&rsquo;Envoi en question sous 3 formats ;txt, csv, csv2007. &nbsp;</p>\r\n\r\n<p>2.&nbsp;&nbsp; &nbsp;On retourne dans :</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp; Y:\\...Photos_Ago\\AZERTWIN 2012.0XX</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Choisir un mod&egrave;le de fichier Excel pr&eacute;sent dans DropBox\\Service_Client\\Ago (avec macro)</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Importer le fichier.csv qui porte le nom du chantier &nbsp;</p>\r\n\r\n<p>3.&nbsp;&nbsp; &nbsp;Ouvrir le Mod&egrave;le&hellip;Donn&eacute;es&hellip;externes choisir &laquo; &agrave; partir du texte &raquo;&hellip;choisir le fichier portant le nom du chantier.csv&hellip; puis importer.</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;V&eacute;rifier dans la 1&egrave;re fen&ecirc;tre Windows &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Choisir D&eacute;limiter puis dans la liste d&eacute;roulante &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;de <strong>Origine du fichier</strong> choisir <strong>Windows (ANSI)</strong> faire suivant. &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Une nouvelle fen&ecirc;tre s&rsquo;ouvre, choisir comme s&eacute;parateur Point Virgule (;) et Tabulation&hellip;suivant&hellip; -&nbsp;&nbsp; &nbsp;S&eacute;lectionner toutes les colonnes et mettre au format Texte puis cliquer sur Terminer.</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Vous avez votre fichier Excel &agrave; pr&eacute;parer suivant les consignes du client.</p>\r\n\r\n<p><strong>Remarque</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; a.&nbsp;&nbsp; &nbsp;On peut remplacer le chemin d&rsquo;acc&egrave;s \\AZERTWIN 2012.0XX par vide dans la colonne Lien_photo pour pouvoir visionner les photos (&agrave; faire avant de lancer la macro)</p>\r\n\r\n<p><strong>&nbsp;4.</strong>&nbsp;&nbsp; &nbsp;Supprimez les lignes 3 et 4 (en-t&ecirc;te du fichier extrait)</p>\r\n\r\n<p><strong>5.&nbsp;</strong>&nbsp; &nbsp;Onglet Affichage&hellip;.Appliquez la Macro puis fermer. Le fichier est enregistr&eacute; dans Y:\\Photos_Ago <strong>6.</strong>&nbsp;&nbsp; &nbsp;D&eacute;placer le fichier nom_chantier de Y:\\Photos_Ago &nbsp;vers son dossier chantier. Testez le lien pour voir si la photo s&rsquo;affiche = V&eacute;rifiez les liens dynamiques</p>\r\n\r\n<p><strong>7.</strong>&nbsp;&nbsp; &nbsp;V&eacute;rifiez si le nom de l&rsquo;onglet, du fichier, du code_client correspondent au nom du chanter</p>\r\n\r\n<p><strong>8.</strong>&nbsp;&nbsp; &nbsp;V&eacute;rifiez si toutes les colonnes correspondent aux consignes du client. Cette v&eacute;rification se fait en rapport avec le fichier PDF du client &nbsp;</p>\r\n\r\n<p><strong>9.</strong>&nbsp;&nbsp; &nbsp;Copiez les formules de la ligne 1 &agrave; partir de la colonne BC &agrave; fin</p>\r\n\r\n<p><strong>10</strong>.&nbsp;&nbsp; &nbsp;Collez les formules en dessous de la ligne 2 de la colonne BC &agrave; fin puis jusqu&rsquo;&agrave; de la ligne vers le bas. Selon les consignes, effectuez les calculs date destruction &hellip;. Compl&eacute;tez les formules recopi&eacute;es (exemple CPCAM ou client 1635 avec quanti&egrave;me + 33 mois). &nbsp;</p>\r\n\r\n<p><strong>11</strong>.&nbsp;&nbsp; &nbsp;Si je modifie des valeurs &nbsp;de champ je v&eacute;rifie que mes calculs (BC &agrave; B ?) sont corrects</p>\r\n\r\n<p><strong>12</strong>.&nbsp;&nbsp; &nbsp;Pour plus de v&eacute;rification, faire un tableau crois&eacute; dans une autre feuille de calcul pour voir si les services+ r&eacute;f&eacute;rence conteneur correspondent bien s&ucirc;r avec le fichier PDF du client</p>\r\n\r\n<p><strong>13.</strong>&nbsp;&nbsp; &nbsp;S&eacute;lectionnez les colonnes <strong>BC &agrave; BH</strong>, <strong>copiez</strong> puis <strong>collage sp&eacute;ciale</strong> en choisissant <strong>valeurs</strong> dans la petite fen&ecirc;tre de c<strong>ollage sp&eacute;ciale</strong>&hellip;enregistrez</p>\r\n\r\n<p><strong>14.</strong>&nbsp;&nbsp; &nbsp;Supprimer les colonnes A &amp; B puis E &agrave; BB. On garde le nom de la photo et le lien dynamique. 15.&nbsp;<strong>&nbsp; &nbsp;Copiez puis coller dans Bloc-notes&hellip;remplacer les espaces par point-virgule (;)&hellip;les tirets (-) </strong>par point-virgule (;)</p>\r\n\r\n<p><strong>16.&nbsp;</strong>&nbsp; &nbsp;Enregistrez&hellip;copier et le fichier.txt et le fichier.xls dans DropBox\\Entrep&ocirc;t_Ago-Proarchives\\Ago.</p>\r\n\r\n<p><strong>17.&nbsp;</strong>&nbsp; &nbsp;Je restitue AGO au fil de l&rsquo;eau. Lorsque tous les chantiers d&rsquo;un envoi sont termin&eacute;s, je cr&eacute;e dans dropbox un fichier compress&eacute; de l&rsquo;envoi .zip. J&rsquo;ajoute dans .zip le pdf du client (et les copies des ardoises tordues&hellip;). &nbsp;</p>\r\n\r\n<p><strong>18.&nbsp;&nbsp; &nbsp;Quelques v&eacute;rifications </strong></p>\r\n\r\n<p><strong>a.&nbsp;&nbsp; &nbsp;Colonne</strong></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Les colonnes 1 &agrave; 6 ne sont jamais vides et les formules colonnes BZ rectifie si anomalie</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Comparaison <strong>PDF</strong> client qui est obligatoire m&ecirc;me si l&rsquo;analyse des ardoises dans Ms Access est correcte.</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;2 fois le m&ecirc;me contr&ocirc;le : dans Ms Access au moment de la pr&eacute;paration des ardoises par le service qualit&eacute; et une derni&egrave;re fois juste avant la restitution.</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Toujours v&eacute;rifier les liens dynamiques pour le fichier dans le chantier</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Attention &agrave; ce que le .txt cr&eacute;&eacute; &agrave; partir d&rsquo;Excel soit homog&egrave;ne &agrave; Excel</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Si Borne Sup&eacute;rieure = vide ou z&eacute;ro (0), remplacez par XXX</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Le Quanti&egrave;me se situe toujours entre 1 &agrave; 365 &nbsp;</p>\r\n\r\n<p><strong>19.&nbsp;&nbsp; &nbsp;Quelques v&eacute;rifications</strong></p>\r\n\r\n<p>Apr&egrave;s avoir termin&eacute; le fichier &agrave; restituer, pr&eacute;parez deux (2) colonnes &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Quanti&egrave;me &agrave; renseigner &nbsp;et Ann&eacute;e Sup &nbsp;&agrave; renseigner. &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Faire un filtre sur &laquo; destruction &raquo; en ressortant les XXX Le client renseignera les 2 colonnes ou l&rsquo;un ou l&rsquo;autre &nbsp;</p>\r\n\r\n<p><strong>B.&nbsp;&nbsp; &nbsp;Restitution PROARCHIVES </strong></p>\r\n\r\n<p>Les &eacute;tats de restitution doivent &ecirc;tre envoy&eacute;s par lot (la totalit&eacute; de l&rsquo;envoi)</p>\r\n\r\n<p>Elle se fait &agrave; partir de l&rsquo;Interface Web.</p>\r\n\r\n<p>1.&nbsp;&nbsp; &nbsp;Cliquez sur l&rsquo;outil en forme de Papier&amp;crayon</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;Dans la nouvelle page, choisir <strong>Proarchives</strong> dans la liste d&eacute;roulante de <strong>INTERFACE </strong></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Choisir le chantier &agrave; restituer dans la liste d&eacute;roulante de CHANTIER</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;<strong>Proarchives</strong> dans la liste d&eacute;roulante de <strong>PARAMETRE</strong></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Choisir <strong>Tout</strong> pour avoir les fichiers .txt et xls dans la liste d&eacute;roulante de <strong>G&eacute;n&eacute;rer -&nbsp;&nbsp; &nbsp;Valider</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; 2.&nbsp;&nbsp; &nbsp;Une nouvelle page s&rsquo;affiche vous affichant les fichiers &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Quelques instants apr&egrave;s, vous aurez les fichiers restitu&eacute;s, le nombre (&agrave; valider avec l&rsquo;interface web) de photo, le nombre de lignes pour les photos valid&eacute;es et le temps de restitution</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;A droite se trouvent la restitution correspondant aux fichiers .txt et xlsx et restitution XXX qui correspond aux fichiers XXX.xlsx &nbsp;</p>\r\n\r\n<p>3.&nbsp;&nbsp; &nbsp;Pour retrouver ces fichiers,</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;C:\\ Wamp&hellip;www&hellip;azertwin&hellip;restitution&hellip;Proarchives</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Les 3 fichiers restitu&eacute;s &agrave; savoir .txt, .xlsx et xxx.xlsx dans le dossier d&rsquo;Envoi &nbsp;</p>\r\n\r\n<p><strong>4.&nbsp;&nbsp; &nbsp;V&eacute;rifications</strong></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;V&eacute;rifiez si le nombre de photos affich&eacute; dans le point 2 correspond &agrave; celui du tableau de <strong>Suivi des commandes</strong></p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;Pour visionner les photos, d&eacute;placez le fichier dans le dossier Y:\\Photos_Ago\\ENVOI 2012.0XX (m&ecirc;me chose que pour Ago pour v&eacute;rifier que le lien dynamique fonctionne)</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp; 5.&nbsp;&nbsp; &nbsp;Traitement du fichier de restitution</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Des 3 fichiers, ouvrir le .xlsx qui se pr&eacute;sente sous cette forme &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Un fichier propre mais &agrave; v&eacute;rifier.</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;V&eacute;rifiez les doublons dans la colonne N&deg; Dossier</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Si probl&egrave;me de macro doublons, copier l&rsquo;int&eacute;gralit&eacute; dans un nouveau fichier Excel (collage sp&eacute;cial valeur) et lancer la macro de doublon.</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;V&eacute;rifiez <strong>N&deg; DE CONTENEUR </strong>: si 0, remplacer par XXX &nbsp;</p>\r\n\r\n<p><strong>a.&nbsp;&nbsp; &nbsp;Colonnes</strong></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;V&eacute;rifiez s&rsquo;il y a des cellules vides dans les colonnes de 6,7,8,9,10,11,12,20 et corriger</p>\r\n\r\n<p>o&nbsp;&nbsp; &nbsp;Pour date inf = 01/01/1910</p>\r\n\r\n<p>o&nbsp;&nbsp; &nbsp;Pour date sup = XXX alors forcement destruction= XXX</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Colonne 9 vide &agrave; 99,9 % Il s&rsquo;agit de mettre un cabinet si mentionn&eacute; sur le conteneur</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Colonne 10 : 75% &nbsp;vide. = petit num&eacute;ro sur la boite</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Colonne 15 : si copropri&eacute;t&eacute; = 50% sinon toujours vide</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp; Colonne 16 : si colonne 15 renseign&eacute; 95% renseign&eacute;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Colonne 17 : vide si description compl&egrave;te = date ou d&eacute;tail. 90 % renseign&eacute;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Colonne 18,19 : seulement copro ou g&eacute;rance (20%). Si 18 alors 19 ET si 19 alors 18 (renseign&eacute;s ensemble) ATTENTION !!! SI EXCEL EST MODIFIE ALORS LES 2 AUTRES FICHIERS DOIVENT ETRE MODIFIES (Doivent &ecirc;tre homog&egrave;ne) C&rsquo;est la raison pour laquelle il est plus facile parfois de faire corriger. Donc de remettre la photo &agrave; la saisie.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<u><strong>Particuli&egrave;rement vrai pour les doublons N&deg; dossier</strong></u></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;V&eacute;rifier que le client (PAF013, &hellip;.) ne revient pas plusieurs fois dans un envoi. Sinon consolider les fichiers.</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Lancer la macro doublon</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Trouver les N&deg; url photo en doublon</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Avec les ODBC attaquez la base traitement de Proarchives</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Filtre sur l&rsquo;URL et modifier VALIDEE par SAISIE pour les 2 lignes. Comme elle &agrave; un ID ancien, elle arrive au contr&ocirc;le tout de suite et sera valid&eacute;e rapidement.</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Relancer la restitution et tout refaire depuis la 1ere &eacute;tape.</p>\r\n\r\n<p><strong>Remarque :</strong> le fait de repasser au contr&ocirc;le permet d&rsquo;affecter &agrave; la validation un nouveau N&deg; de compteur. Cela signifie que la table client de l&rsquo;archiviste a &eacute;t&eacute; modifi&eacute;e. Si bien que si par hasard je fais la modification manuellement dans le fichier Excel, je dois penser &agrave; mettre la table client de l&rsquo;archiviste &agrave; jour. Le plus grand num&eacute;ro historique de mon fichier est celui de la table client de l&rsquo;archiviste de PROARCHIVES.</p>\r\n\r\n<p>&nbsp;<strong>NB :</strong> J&rsquo;envoi au client l&rsquo;ensemble des fichiers de l&rsquo;envoi en .zip. Lorsque tous les chantiers sont finis. &nbsp;</p>\r\n\r\n<p><strong>C.&nbsp;&nbsp; &nbsp;La multicopropri&eacute;t&eacute;</strong></p>\r\n\r\n<p>&nbsp;VALABLE QUE POUR LE SERVICE COPROPRIETE</p>\r\n\r\n<p>&nbsp;Si j&rsquo;ai un S dans N&deg; dossier alors 1 boite = 1 UA = 1 ligne</p>\r\n\r\n<p>Si j&rsquo;ai un M dans N&deg; dossier alors &nbsp;1 boite = plusieurs UA = plusieurs lignes &nbsp;</p>\r\n\r\n<p>Si j&rsquo;ai plusieurs &nbsp;M pour 1 m&ecirc;me boite alors</p>\r\n\r\n<p>Pour chacune des lignes j&rsquo;ai la m&ecirc;me description compl&egrave;te, m&ecirc;me intitul&eacute;, m&ecirc;me N&deg; archive. &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; <strong>&nbsp;D.&nbsp;&nbsp; &nbsp;Restitution CARREFOURS_EMPLOI</strong></p>\r\n\r\n<p>&nbsp;On utilise la restitution Proarchives qui donne 3 fichiers. &nbsp;</p>\r\n\r\n<p>M&ecirc;me proc&eacute;d&eacute; que Proarchives &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>', '2016-05-17 19:46:01', 1, 0, NULL),
(48, 28, 18, 'Procédure de sauvegarde de la base de données Mysql', '<p>A.&nbsp;&nbsp; &nbsp;Pr&eacute;ambule</p>\r\n\r\n<p>Cette sauvegarde doit se faire :&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;Quotidiennement (en attente d&rsquo;une proc&eacute;dure automatis&eacute;e)</p>\r\n\r\n<p>Alors que les utilisateurs ne sont plus logg&eacute;s sur l&rsquo;interface (pause d&eacute;jeun&eacute;) Ou bien en faisant un STOP saisie</p>\r\n\r\n<p>Toujours conserver au moins 3 sauvegardes sur 3 jours diff&eacute;rents</p>\r\n\r\n<p>B.&nbsp;&nbsp; &nbsp;Description</p>\r\n\r\n<p>Sur le serveur aller sur l&rsquo;ic&ocirc;ne verte de la barre d&rsquo;outil Wampserver&hellip; PhpMyAdmin Sur l&lsquo;&eacute;cran apparait &agrave; gauche apparait l&rsquo;ensemble des bases de donn&eacute;es. Toutes ne font pas l&rsquo;objet d&rsquo;une sauvegarde. Nous int&eacute;resse :</p>\r\n\r\n<p>Ago (5)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;C&rsquo;est la base o&ugrave; l&rsquo;on stocke cr&eacute;dit agricole,&hellip; (5 tables)</p>\r\n\r\n<p>Chantier (1)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Tous les liens des adresses photos sur le serveur (1 table) &nbsp; &nbsp;</p>\r\n\r\n<p>Chantier_rapport (1)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Toutes les commandes du client (1 table) &nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;Proarchives (5) &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;Caremploi (5)&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>C&rsquo;est la base o&ugrave; l&rsquo;on stocke Proarchives (5 tables).</p>\r\n\r\n<p>Cliquer sur la base &agrave; sauvegarder. Par exemple Ago (5) &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;Sur l&lsquo;&eacute;cran apparait &agrave; gauche l&rsquo;ensemble des tables de la base de donn&eacute;es Ago (5) soit 5 tables. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;A droite dans des onglets apparaissent des actions</p>\r\n\r\n<p>S&eacute;lectionner &laquo; Exporter &raquo; &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>Ne rien modifier, les valeurs pas d&eacute;faut sont justes (les 5 tables doivent &ecirc;tre surlign&eacute;s en bleu fonc&eacute;) &nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;Tout En bas :&nbsp;&nbsp; &nbsp;Ne pas oublier compression = zipp&eacute; &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>Puis &laquo; Ex&eacute;cuter &raquo; (la dur&eacute;e de la sauvegarde d&eacute;pend de la taille de la base)</p>\r\n\r\n<p>A l&rsquo;issue de l&rsquo;action apparait une fen&ecirc;tre &nbsp;demandant de pr&eacute;ciser l&rsquo;endroit et le nom du fichier a enregistrer. Renommer la sauvegarde tout en conservant les extensions &laquo; .sql .gz &raquo; pour ne pas &eacute;craser les pr&eacute;c&eacute;dentes.</p>\r\n\r\n<p>Ago (5)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Quotidienne</p>\r\n\r\n<p>Chantier (1)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Quotidenne et au m&ecirc;me moment que Ago(5) ou Proarchives (5) &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>_rapport (1)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Quotidienne &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>Proarchives (5)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Quotidienne &nbsp;&nbsp; &nbsp;Utilisateurs&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Hebdomadaire ou si cr&eacute;ation de loggins &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>caremploi</p>\r\n\r\n<p>Ce fichier de sauvegarde doit &ecirc;tre enregistr&eacute; toujours au m&ecirc;me endroit dans &nbsp; Y :_Dropbox\\Proweb\\Back_up_base_de_donn&eacute;es &nbsp;A cet endroit les fichiers sont imm&eacute;diatement transmis &agrave; Paris</p>\r\n\r\n<p>Pour revenir dans l&rsquo;&eacute;cran de s&eacute;lection des bases de donn&eacute;es, cliquez sur l&rsquo;ic&ocirc;ne de la petite maison en haut &agrave; gauche. &nbsp;</p>\r\n\r\n<p>Termin&eacute; !</p>\r\n\r\n<p>&nbsp;Remarque 1 : si par hasard vous observez lors d&rsquo;une sauvegarde un message ou quelque chose de particulier et d&rsquo;inattendu : SORTIR, NE RIEN FAIRE ET INFORMER PARIS &nbsp;</p>\r\n\r\n<p>Remarque 2 : cette proc&eacute;dure de sauvegarde manuelle n&eacute;cessite beaucoup de pr&eacute;cautions car il s&rsquo;agit d&rsquo;intervenir dans la base de donn&eacute;es de Proweb. Suivre exactement cette proc&eacute;dure, pas &agrave; pas et sans &laquo; cr&eacute;ativit&eacute; &raquo;.</p>\r\n\r\n<p>Quand tout est fini, quitter le navigateur sans rien faire d&rsquo;autres.</p>\r\n\r\n<p>&nbsp;</p>', '2016-05-18 11:07:19', 0, 0, NULL),
(48, 29, 19, 'TRANSFERT  ET VERIFICATION DES PHOTOS DU CLIENT', '<p><strong>I.&nbsp;&nbsp; &nbsp;Transfert des envois</strong></p>\r\n\r\n<p><strong>&nbsp;Pr&eacute;ambule </strong></p>\r\n\r\n<p>Le client d&eacute;pose les photos sur un serveur Proweb Paris et informe Azertwin Paris de la mise &agrave; disposition d&rsquo;un envoi.</p>\r\n\r\n<p>&nbsp;Azertwin Paris informe &agrave; son tour Proweb Togo qu&rsquo;un envoi ou une nouvelle commande doit &ecirc;tre transf&eacute;r&eacute;e</p>\r\n\r\n<p>&nbsp; On a 2 m&eacute;thodes pour transf&eacute;rer les photos : &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1&deg;) Via Dropbox : utilisation d&rsquo;un dossier commun virtuel sur un autre serveur d&eacute;di&eacute; Dropbox Proweb (Paris)-Azertwin (Paris)-Proweb (Togo). Les 3 dossiers sont synchronis&eacute;s sur les 3 serveurs en permanence. C&rsquo;est plut&ocirc;t Azertwin (de par la rapidit&eacute; de la connexion) qui initie le transfert vers le Togo</p>\r\n\r\n<p>2&deg;) Via Filezilla : logiciel qui permet de transf&eacute;rer les photos par serveur FTP entre Proweb Paris et Proweb Togo mais sensible aux ruptures de connexion. Les &eacute;quipes du Togo doivent donc s&rsquo;assurer de la continuit&eacute; de l&rsquo;op&eacute;ration et la relancer si n&eacute;cessaire &nbsp;</p>\r\n\r\n<p>Les 2 m&eacute;thodes ont des avantages et des inconv&eacute;nients &nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;1&deg;) Dropbox : inconv&eacute;nient, on ne voit pas la progression du transfert mais avantage si interruption, le transfert est relanc&eacute; automatiquement &nbsp;</p>\r\n\r\n<p>2&deg;) Filezilla : on voit la progression mais il faut relancer manuellement si interruptions de connexion = surveillance &nbsp;</p>\r\n\r\n<p>Sauf d&eacute;rogation, la m&eacute;thode retenue &agrave; ce jour consiste &agrave; lancer Filezilla du Togo et d&rsquo;enregistrer le transfert des photos dans Dropbox au Togo. Paris est synchronis&eacute;</p>\r\n\r\n<p>Proweb Togo assure le suivi du bon d&eacute;roulement du transfert &nbsp;</p>\r\n\r\n<p><strong>A.&nbsp;&nbsp; &nbsp;Transfert avec Filezilla </strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; <strong>&nbsp; 1.&nbsp;&nbsp; &nbsp;Quand r&eacute;aliser le transfert ? </strong></p>\r\n\r\n<p>On ex&eacute;cute le transfert d&egrave;s qu&rsquo;on a connaissance que des nouvelles photos ont &eacute;t&eacute; d&eacute;pos&eacute;es. &nbsp;</p>\r\n\r\n<p><strong>2.&nbsp;&nbsp; &nbsp;Description du gestionnaire de site</strong></p>\r\n\r\n<p>Dans le menu Gestionnaire de site de Filezilla, on a les caract&eacute;ristiques suivantes :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>MDP : proarchive &nbsp;</p>\r\n\r\n<p><strong>3.&nbsp;&nbsp; &nbsp;Transfert des photos avec Filezilla </strong></p>\r\n\r\n<p>Ouvrir Filezilla sur le serveur. &nbsp;S&eacute;lectionner en haut &agrave; gauche la petite ic&ocirc;ne en forme de serveur et dans liste prendre Proweb Paris pour &eacute;tablir la connexion entre les 2 serveurs France-Togo. A gauche : le serveur local au Togo = Image de l&rsquo;explorateur Windows &nbsp;A droite : le serveur distant o&ugrave; le client d&eacute;pose les photos (l&rsquo;envoi du client) &nbsp;</p>\r\n\r\n<p><strong><u>Avertissement !</u> &nbsp;</strong></p>\r\n\r\n<p><strong>ON NE MODIFIE JAMAIS l&rsquo;ORGANISATION DU SERVEUR CLIENT DISTANT. ON TRANSFERT A L&rsquo;IDENTIQUE TOUTE L&rsquo;ORGANISATION EN CONCERVANT LES NOMS DES REPERTOIRES.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>On s&eacute;lectionne l&rsquo;envoi du client qui est le plus souvent un dossier compress&eacute; et on le glisse dans le r&eacute;pertoire Y:\\Photos_AGO &nbsp;</p>\r\n\r\n<p>En bas il y a 3 onglets qui permettent de faire le suivi de la progression du transfert.</p>\r\n\r\n<p>&nbsp;Lorsque filezilla interrompt le transfert, NE PAS FERMER LE LOGICIEL. On peut le relancer en s&eacute;lectionnant le ou les fichiers en cours (en bas de l&rsquo;&eacute;cran) + clic droit relancer le transfert Une fen&ecirc;tre s&rsquo;affiche dans laquelle il faut r&eacute;pondre &laquo; reprendre le transfert l&agrave; ou il s&rsquo;est arr&ecirc;t&eacute; &raquo;. &nbsp;</p>\r\n\r\n<p>Il faut compter environ 5mn par photo. Cette proc&eacute;dure &eacute;tant longue il est important de la surveiller (toutes les 2h) r&eacute;guli&egrave;rement pour la relancer aussit&ocirc;t que l&rsquo;on a constat&eacute; un arr&ecirc;t.</p>\r\n\r\n<p>&nbsp;Si le logiciel a &eacute;t&eacute; ferm&eacute;, il faut repartir du d&eacute;but. Mais lorsque Filezilla va voir qu&rsquo;une partie de l&rsquo;envoi existe d&eacute;j&agrave; sur le serveur Proweb Togo, il va repartir aussi de l&rsquo;endroit o&ugrave; il s&rsquo;est arr&ecirc;t&eacute;. &nbsp;</p>\r\n\r\n<p><strong>B.&nbsp;&nbsp; &nbsp;Contr&ocirc;le du transfert et d&eacute;compression des fichiers </strong></p>\r\n\r\n<p>A la fin du transfert, il faut contr&ocirc;ler avant la d&eacute;compression que la taille du fichier est identique sur les 2 serveurs. &nbsp;</p>\r\n\r\n<p>Une fois le transfert termin&eacute;, il faut d&eacute;compresser les fichiers. &nbsp;</p>\r\n\r\n<p><strong>Exemple</strong></p>\r\n\r\n<p>Apr&egrave;s le transfert</p>\r\n\r\n<p>Y:\\Photos_AGO &nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Azertwin 2011.005 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1610_3120501_fich1(332).zip &nbsp;</p>\r\n\r\n<p>On ouvre la fen&ecirc;tre du .zip et on a :</p>\r\n\r\n<p>1610_3120501_fich1(332).zip &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1610_3120501_fich1(332) &nbsp;</p>\r\n\r\n<p>On fait glisser 1610_3120501_fich1(332) dans Azertwin 2011.005 &nbsp;</p>\r\n\r\n<p>Au final on a: &nbsp;</p>\r\n\r\n<p>Y:\\Photos_AGO &nbsp;&nbsp; &nbsp;Azertwin 2011.005 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1610_3120501_fich1(332).zip &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1610_3120501_fich1(332) &nbsp;</p>\r\n\r\n<p><strong>C.&nbsp;&nbsp; &nbsp;Probl&egrave;mes rencontr&eacute;s lors du transfert photos </strong></p>\r\n\r\n<p><strong>&nbsp; &nbsp; 1.&nbsp;&nbsp; &nbsp;Photo partielle</strong> &nbsp;</p>\r\n\r\n<p>Pendant la saisie dans l&rsquo;interface, il arrive qu&rsquo;une photo cr&eacute;e un bug dans l&rsquo;interface car elle est partielle ou mal transf&eacute;r&eacute;e. Il faut v&eacute;rifier dans l&rsquo;explorateur Windows si la photo est bien transf&eacute;r&eacute;e en v&eacute;rifiant sa taille en Kilo octet. Puis : Envoyer un email au client (&agrave; Fred).</p>\r\n\r\n<p>&nbsp;A l&rsquo;aide de l&rsquo;interface web, bloqu&eacute;e cette photo &agrave; la saisie tant que le client ne nous a pas retourn&eacute; une photo correcte. &nbsp;</p>\r\n\r\n<p>2 solutions possibles :</p>\r\n\r\n<p>1&deg;) Le client nous retourne la photo correctement Il faut rep&eacute;rer son emplacement (dans le bon sous r&eacute;pertoire) et remplacer l&rsquo;ancienne photo qui ne s&rsquo;ouvre pas par la nouvelle du client. Puis d&eacute;bloquer l&rsquo;interface web &nbsp;</p>\r\n\r\n<p>2&deg;) Le client n&rsquo;a pas de photo meilleure mais la photo a &eacute;t&eacute; import&eacute;e et doit &ecirc;tre saisie avec des codes XXX Dans le dossier dropbox\\transfert photo se trouve une photo g&eacute;n&eacute;rique que l&rsquo;on doit copier puis renommer de la m&ecirc;me fa&ccedil;on que la photo mal transf&eacute;r&eacute;e et qui ne nous seras jamais envoy&eacute;e correctement. Remplacer la mauvaise photo par cette photo g&eacute;n&eacute;rique. La saisie peut alors &ecirc;tre r&eacute;alis&eacute;e. Puis d&eacute;bloquer l&rsquo;interface web</p>\r\n\r\n<p>&nbsp;Remarque 1 : attention cette photo ne doit pas &ecirc;tre consid&eacute;r&eacute;e comme une ardoise mais comme une photo d&rsquo;unit&eacute;s d&rsquo;archives &agrave; saisir. &nbsp;</p>\r\n\r\n<p><strong>2.&nbsp;&nbsp; &nbsp;Interruption spontan&eacute;e du transfert</strong></p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;<strong>Cas o&ugrave; le serveur red&eacute;marre ou il y a coupure &eacute;lectrique</strong></p>\r\n\r\n<p>Ouvrir Filezilla, et recommencer exactement le m&ecirc;me d&eacute;placement de dossier comme si on recommen&ccedil;ait tout le transfert.</p>\r\n\r\n<p>Une fen&ecirc;tre apparait demandant ce que l&rsquo;on souhaite faire car le dossier existe d&eacute;j&agrave; (normal puisque le d&eacute;but du transfert a eu lieu) il faut cocher : <strong>&laquo; Reprendre &raquo;</strong>.</p>\r\n\r\n<p>Et en bas cocher <strong>&laquo; appliquer cette r&egrave;gle &agrave; chaque fois &raquo;</strong>, alors le transfert reprend exactement l&agrave; o&ugrave; il s&rsquo;est arr&ecirc;t&eacute; !! &nbsp;</p>\r\n\r\n<p><strong>&bull;&nbsp;&nbsp; &nbsp;Transfert &eacute;chou&eacute;</strong></p>\r\n\r\n<p>Le fichier est pass&eacute; dans l&rsquo;onglet Transfert &eacute;chou&eacute;</p>\r\n\r\n<p>S&eacute;lectionner l&rsquo;&eacute;l&eacute;ment + clic droit : r&eacute;initialiser et remettre dans traitement</p>\r\n\r\n<p>&nbsp;Dans les menus, s&eacute;lectionner Transfert + traiter la file d&rsquo;attente</p>\r\n\r\n<p>Filezilla sait que le transfert a &eacute;t&eacute; interrompu et repart de l&rsquo;endroit o&ugrave; il s&rsquo;est arr&ecirc;t&eacute;. &nbsp;</p>\r\n\r\n<p><strong>Remarque : </strong></p>\r\n\r\n<p>Dans Livraison_AGO on y d&eacute;pose tous les chantiers termin&eacute;s (fichiers de restitution envoy&eacute;s au client) = commande livr&eacute;e au client &nbsp; &nbsp;</p>\r\n\r\n<p><strong>II.&nbsp;&nbsp; &nbsp;V&eacute;rification des envois apr&egrave;s transfert </strong></p>\r\n\r\n<p>Il &nbsp;est n&eacute;cessaire de v&eacute;rifier si les donn&eacute;es d&eacute;pos&eacute;es sur le serveur par le client sont les m&ecirc;mes que celles transf&eacute;r&eacute;es (disponible sur &lsquo;&rsquo;Y&rsquo;&rsquo; &nbsp;dans Photos-AGO). Pour cela nous avons deux m&eacute;thodes :</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;possibilit&eacute; de contr&ocirc;ler les fichiers (noms des chantiers) lignes par lignes renseigner pr&eacute;c&eacute;demment dans le tableau &lsquo;&rsquo;suivi des chantiers.xls&rsquo;&rsquo;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;g&eacute;n&eacute;ralement lorsque le client d&eacute;pose un nouvel envoi, il pr&eacute;cise le nombre de photos que &nbsp;contient l&rsquo;envoi ainsi dans la colonne stock toujours du &nbsp;document &lsquo;&rsquo;suivi des chantiers&rsquo;&rsquo; vous faire le total &nbsp;du nombre des photos que vous avez normalement &nbsp;il doit &ecirc;tre le m&ecirc;me que celui que le &nbsp;client &nbsp;vous a &nbsp;signal&eacute;, &nbsp;si ce n&rsquo;est pas le cas &nbsp;alors &nbsp;votre tableau &nbsp;renseigner est &nbsp;Faux.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2016-05-18 11:54:30', 0, 0, NULL);
INSERT INTO `version` (`ver_creator`, `ver_article`, `Id`, `ver_titre`, `ver_content`, `ver_date`, `ver_editable`, `ver_del`, `attachement`) VALUES
(48, 30, 20, 'Organisation base de donnée', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ORGANISATION DE LA BASE DE DONNEES &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;I. &nbsp; &nbsp;Fonctionnement de la base de donn&eacute;es &nbsp;</p>\r\n\r\n<p>D&rsquo;une mani&egrave;re g&eacute;n&eacute;rale les diff&eacute;rentes interfaces permettent d&rsquo;&eacute;crire dans les BDD en respectant des masques et des r&egrave;gles de saisies. On utilise l&rsquo;interface web ou les ODBC pour effectuer des petites op&eacute;rations de maintenance sur les BDD. Une t&acirc;che effectu&eacute;e via les ODBC doit &ecirc;tre toujours interrog&eacute;e pour v&eacute;rifier si elle ne m&eacute;rite pas d&rsquo;&ecirc;tre impl&eacute;ment&eacute;e dans l&rsquo;interface web en tant qu&rsquo;outil permanent. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>1. &nbsp; &nbsp;Base Chantier Rapport</p>\r\n\r\n<p>&nbsp;Elle contient une (1) table. Le contenu de cette table est impl&eacute;ment&eacute; lors d&#39;un chargement d&#39;un chantier en m&ecirc;me temps que la table_chantier de la BDD Chantier. &nbsp;Les champs importants de cette base sont : &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;Nom_Chantier : il est r&eacute;cup&eacute;r&eacute; lors du transfert du chantier</p>\r\n\r\n<p>&nbsp;- &nbsp; &nbsp;Total_photo : il est saisit au moment du transfert du chantier. C&#39;est le nombre de photo que le client dit avoir transf&eacute;r&eacute; &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;Date_transfert : correspond &agrave; la date &agrave; laquelle le client a d&eacute;pos&eacute; le chantier sur le serveur FTP &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;Compteur_photo : C&#39;est le N&deg; de compteur de la table client_archiviste renseign&eacute; au moment de l&#39;importation. Cette donn&eacute;e est statique &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;Date_restitution : lorsque la date d&#39;envoi est saisie, le chantier n&#39;apparait plus dans l&#39;interface web. &nbsp;Le contenue de cette table, dont le &laquo; r&eacute;sum&eacute; &raquo; est visible dans l&rsquo;interface web dans le module &laquo; avancement des travaux &raquo; doit &ecirc;tre rapproch&eacute; en permanence du tableau Excel Suivi des chantiers. Notamment sur les quantit&eacute;s, dates, compteur,&hellip; Ces 2 outils doivent se lire en miroir l&rsquo;un de l&rsquo;autre. Ils racontent la m&ecirc;me chose l&rsquo;un saisie manuellement (Excel) et l&rsquo;autre automatis&eacute; (BDD Mysql-Interface web). &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2. &nbsp; &nbsp;Base Chantier</p>\r\n\r\n<p>&nbsp;Elle contient une (1) table</p>\r\n\r\n<p>&nbsp;Le contenu de cette table est impl&eacute;ment&eacute; lors d&#39;un chargement d&#39;un chantier en m&ecirc;me temps que la table Chantier_rapport. Il y a autant d&#39;enregistrements que de photos &agrave; saisir.</p>\r\n\r\n<p>_______________________________________</p>\r\n\r\n<p><span style="font-size:12px">&nbsp;1 Ce num&eacute;ro de compteur est &eacute;gal &agrave; mon dernier enregistrement VALIDEE pour ce client ou bien du plus grand num&eacute;ro de l&#39;inventaire complet que me retourne syst&eacute;matiquement le client. Il peut varier du mien si le client ajoute manuellement des enregistrements chez lui.</span></p>\r\n\r\n<p>&nbsp;Les champs importants de cette base sont :</p>\r\n\r\n<p><strong>&nbsp;- &nbsp; &nbsp;Chantier_lien_photo </strong></p>\r\n\r\n<p><strong>&nbsp;- &nbsp; &nbsp;Chantier_Pseudo_Saisie1</strong> : qui correspondant &agrave; l&rsquo;op&eacute;ratrice qui effectue la 1&egrave;re saisie &nbsp;</p>\r\n\r\n<p><strong>&nbsp;- &nbsp; &nbsp;Chantier_Pseudo_Saisie2 :</strong> qui correspondant &agrave; l&rsquo;op&eacute;ratrice qui effectue la 2&egrave;me saisie &nbsp;</p>\r\n\r\n<p><strong>&nbsp;- &nbsp; &nbsp;Type_de_photo </strong>: qui correspond &agrave; l&rsquo;UA ou Ardoise C&rsquo;est dans cette table que se construit le principe de la double saisie. &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; 3. &nbsp; &nbsp;Base Proarchives</strong> &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Elle contient cinq (5) tables. &nbsp; Une des 5 tables, la table Traitement sert &agrave; g&eacute;rer le Process : Saisie &ndash; Contr&ocirc;le &ndash; Correction &ndash; Contr&ocirc;le - Validation &nbsp;Cette table est utilis&eacute;e pour g&eacute;rer le process de traitement de la saisie de photo. &nbsp;A une photo correspond 2 enregistrements correspondants &agrave; la saisie de A et B. Les champs importants de cette table sont : &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;Traitement_Type qui contient le statut de la Photo</p>\r\n\r\n<p>&nbsp;- &nbsp; &nbsp;Traitement_Correction qui contient l&rsquo;ensemble des descriptions des champs &agrave; corriger. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;4. &nbsp; &nbsp;Base Ago &nbsp; &nbsp; </strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>Contient cinq (5) tables &nbsp;Pour des questions de coh&eacute;rence et d&rsquo;homog&eacute;n&eacute;it&eacute; on fait en sorte que les BDD soient similaires pour tous les clients m&ecirc;me si les champs ne sont pas tous utilis&eacute;s. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; 5. &nbsp; &nbsp;Base Recall</strong> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Contient cinq (5) tables. &nbsp;Pour des questions de coh&eacute;rence et d&rsquo;homog&eacute;n&eacute;it&eacute; on fait en sorte que les BDD soient similaires pour tous les clients m&ecirc;me si les champs ne sont pas tous utilis&eacute;s. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp;6. &nbsp; &nbsp;Base caremploi &nbsp;</strong> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp;Elle contient cinq (5) tables. &nbsp; Une des 5 tables, la table Traitement sert &agrave; g&eacute;rer le Process :</p>\r\n\r\n<p>Saisie &ndash; Contr&ocirc;le &ndash; Correction &ndash; Contr&ocirc;le - Validation &nbsp;</p>\r\n\r\n<p>Cette table est utilis&eacute;e pour g&eacute;rer le process de traitement de la saisie de photo. &nbsp;</p>\r\n\r\n<p>A une photo correspond 2 enregistrements correspondants &agrave; la saisie de A et B. Les champs importants de cette table sont : &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;Traitement_Type qui contient le statut de la Photo &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;Traitement_Correction qui contient l&rsquo;ensemble des descriptions des champs &agrave; corriger. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p><strong>II. &nbsp; &nbsp;Description du Process dans la table traitement &nbsp; &nbsp;</strong> &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp;<strong> &nbsp; &nbsp; 1 &nbsp; &nbsp;Le cycle normal &nbsp;</strong></p>\r\n\r\n<p>Les photos &agrave; saisir suivent toutes le m&ecirc;me cycle. &nbsp;Elles sont d&rsquo;abord import&eacute;es dans la BDD chantier pour recevoir la saisie de A puis de B. L&rsquo;ordre des saisies se fait dans l&rsquo;ordre d&lsquo;importation c&#39;est-&agrave;-dire dans l&rsquo;ordre de leur r&eacute;pertoire Windows. &nbsp;</p>\r\n\r\n<p>Chaque saisie A et B g&eacute;n&egrave;re une ligne dans la table traitement.<u> Donc pour respecter la double saisie, toute URL photo totalement saisie doit avoir g&eacute;n&eacute;r&eacute;e 2 lignes dans la table traitement.</u> &nbsp;</p>\r\n\r\n<p>Description des diff&eacute;rents 11 statuts dans la table traitement pour chaque ligne d&rsquo;enregistrement. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;TEMP = Saisie en cours pour l&rsquo;op&eacute;rateur dont le nom figure dans Traitement_Utilisateur_Pseudo &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; SAISIE = Saisie termin&eacute;e (= en attente de contr&ocirc;le) pour l&rsquo;op&eacute;rateur dont le nom figure dans Traitement_Utilisateur_Pseudo &nbsp; &nbsp;Lorsque 2 lignes de la table traitement pour une m&ecirc;me URL photo portent le statut SAISIE, la photo est disponible pour le contr&ocirc;le. &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;CONTROL = L&rsquo;URL photo est en cours de contr&ocirc;le sur la 1ere boite pour l&#39;op&eacute;rateur dont le nom figure dans Traitement_Control &nbsp; &nbsp; &nbsp;CCTION_tmp = L&rsquo;URL photo est en cours de contr&ocirc;le sur les autres boites pour l&#39;op&eacute;rateur dont le nom figure dans Traitement_Control</p>\r\n\r\n<p>&nbsp; &nbsp;A l&rsquo;issue de la phase de contr&ocirc;le, la photo part ou non en correction pour l&rsquo;un ou les 2 op&eacute;rateurs. Pour les 2 enregistrements de la table traitement, je peux avoir une des lignes en statut SAISIE et l&rsquo;autre en statut CORRECTION. Ou les 2 en statuts CORRECTIONS ! &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>CORRECTION = en attente de Correction pour l&rsquo;op&eacute;rateur dont le nom figure dans Traitement_Utilisateur_Pseudo &nbsp; &nbsp; &nbsp; &nbsp; TEMP_CORRECT = en cours de Correction pour l&rsquo;op&eacute;rateur dont le nom figure dans Traitement_Utilisateur_Pseudo &nbsp;</p>\r\n\r\n<p><u>A l&rsquo;issue de la phase de correction, la photo reprend le statut SAISIE. Elle peut donc &ecirc;tre pr&eacute;sent&eacute;e &agrave; nouveau au contr&ocirc;le.</u> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>VALIDEE = A = B. La photo n&rsquo;est plus disponible pour l&rsquo;interface de saisie ou de contr&ocirc;le ou de super-contr&ocirc;le. La table traitement stocke tous les enregistrements portant le statut VALIDEE (= historique).</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>2 &nbsp; &nbsp;Le cycle &eacute;tendu</strong></p>\r\n\r\n<p>&nbsp;Il arrive qu&rsquo;une photo pr&eacute;sente des caract&eacute;ristiques qui n&eacute;cessitent une intervention d&rsquo;un super contr&ocirc;leur. Les photos sont isol&eacute;es dans des SAS d&rsquo;attentes. &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp;a) &nbsp; &nbsp;<u>Attente administrateur</u></p>\r\n\r\n<p>&nbsp;Seul un op&eacute;rateur ayant le r&ocirc;le de super contr&ocirc;leur peut r&eacute;cup&eacute;rer la photo et effectuer des corrections pour tous les champs manuellement (tr&egrave;s sensible) &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;ATTENTE_ADMIN = la photo est mis &agrave; l&rsquo;&eacute;cart du cycle normal. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;SUPER_CONTROL = L&rsquo;URL photo est en cours de Super-contr&ocirc;le sur la 1ere boite pour l&#39;op&eacute;rateur dont le nom figure dans Traitement_Control &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>SSTION_tmp = L&rsquo;URL photo est en cours de Super-contr&ocirc;le sur les autres boites pour l&#39;op&eacute;rateur dont le nom figure dans Traitement_Control</p>\r\n\r\n<p><u><strong>A l&rsquo;issue de la phase de Super-contr&ocirc;le, la photo reprend le statut SAISIE. Elle peut donc &ecirc;tre pr&eacute;sent&eacute;e &agrave; nouveau au contr&ocirc;le. </strong></u>&nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p><strong>&nbsp;b) &nbsp; &nbsp;Attente Client </strong></p>\r\n\r\n<p>&nbsp;ATTENTE_CLIENT. Il arrive qu&rsquo;une photo doive &ecirc;tre sortie du cycle normal ou du Super-contr&ocirc;le par manque d&rsquo;informations du client. Elle est alors non disponible pour les op&eacute;rateurs, les contr&ocirc;leurs et le super-contr&ocirc;leur. &nbsp; &nbsp;</p>\r\n\r\n<p><strong>Attention !!! </strong>&nbsp; &nbsp; Pour la remettre dans le cycle normal, il faut modifier manuellement les ODBC en passant ATTENTE_ADMIN en Statut SAISIE. La photo peut alors revenir au contr&ocirc;leur et en transmettant &agrave; l&rsquo;&eacute;quipe les consignes du client. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p><strong>c) &nbsp; &nbsp;Remarques importantes &nbsp; &nbsp; </strong>&nbsp;</p>\r\n\r\n<p>1. &nbsp; &nbsp;Le seul &eacute;cran o&ugrave; une photo peut &ecirc;tre d&eacute;finitivement VALIDEE est l&rsquo;&eacute;cran de contr&ocirc;le. &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; 2. &nbsp; &nbsp;C&rsquo;est au moment o&ugrave; l&rsquo;on contr&ocirc;le et valide une photo que l&rsquo;on d&eacute;clenche un certain nombre d&rsquo;automate comme l&rsquo;incr&eacute;mentation des compteurs. Tant qu&rsquo;une photo n&rsquo;est pas valid&eacute;e, il n&rsquo;est pas n&eacute;cessaire de mouvementer le compteur. Par ailleurs si je souhaite relancer l&rsquo;incr&eacute;mentation du compteur, il suffit de passer du Statut VALIDEE au statut SAISIE et reprendre un cycle. &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;3. &nbsp; &nbsp;Toute modification via les ODBC n&eacute;cessite une prudence particuli&egrave;re pour modifier un statut. Il faut notamment bien comprendre s&rsquo;il faut modifier les 2 lignes de la table traitement ou 1 seule. Au final, on a le choix entre SAISIE (renvoyer au contr&ocirc;le= 90 % des cas), ATTENTE_ADMIN (envoyer au super-contr&ocirc;le). &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>4. &nbsp; &nbsp;On ne modifie jamais un statut qui pr&eacute;sente une signification en-cours de modification de l&rsquo;enregistrement (TEMP_CORRECT, TEMP, CONTROL, SUPER_CONTROL, CCTION_tmp, SSTION_tmp) sauf op&eacute;rations de maintenance. Cela revient &agrave; &laquo; CASSER &raquo; le travail qu&rsquo;une op&eacute;ratrice est en train d&rsquo;effectuer. &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>5. &nbsp; &nbsp; lorsque l&rsquo;automate de l&rsquo;interface enregistre le statut il &eacute;crit le statut + le pseudo de l&rsquo;op&eacute;rateur. (Exemple : SAISIE A_Danhin) mais le pseudo n&rsquo;est pas obligatoire pour faire fonctionner l&rsquo;interface (fonction contient &hellip; et non &eacute;gal&hellip;) &nbsp; &nbsp; &nbsp; &nbsp;6. &nbsp; &nbsp;l&rsquo;ordre des saisies se fait dans l&rsquo;ordre des enregistrements de la table d&rsquo;importation chantier. L&rsquo;ordre du contr&ocirc;le se fait dans l&rsquo;ordre historique. D&rsquo;abord la plus ancienne puis la plus r&eacute;cente de la table traitement d&egrave;s lors qu&rsquo;elles sont doubles. L&rsquo;ordre des corrections se fait dans l&rsquo;ordre historique. Un num&eacute;ro d&rsquo;index plus petit dans la table traitement d&eacute;signe une photo plus ancienne. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; <strong>1 &nbsp; &nbsp;Quelques probl&egrave;mes rencontr&eacute;s &nbsp;</strong> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>1.1 &nbsp; &nbsp;Le nombre &laquo; photos d&eacute;clar&eacute;es &raquo; diff&eacute;rent &laquo; photos re&ccedil;ues &raquo; &nbsp;</p>\r\n\r\n<p>Dans l&rsquo;interface Web nous remarquons que le nombre de photos d&eacute;clar&eacute;es n&rsquo;est pas &eacute;gale au nombre de photos re&ccedil;ues et la ligne de ce chantier est en rouge. Deux cas de figures se pr&eacute;sentent :</p>\r\n\r\n<p><strong>&nbsp;a) &nbsp; &nbsp;Le client oublie une photo &nbsp;</strong></p>\r\n\r\n<p>- &nbsp; &nbsp;Copiez la photo dans le r&eacute;pertoire correspondant &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;Allez dans Ms Access, ouvrez la base chantier &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;S&eacute;lectionnez et copiez le nom de la photo dans chantier_photo sans oublier d&rsquo;attribuer un num&eacute;ro d&rsquo;index&hellip;.compl&eacute;tez les autres champs</p>\r\n\r\n<p>- &nbsp; &nbsp;Enregistrez &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;Allez dans l&rsquo;interface Web et actualiser la page. &nbsp;</p>\r\n\r\n<p><strong>b) &nbsp; &nbsp;La quantit&eacute; d&eacute;clar&eacute;e par le client est erron&eacute;e </strong>&nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;- &nbsp; &nbsp;Dans Ms ACCESS, ouvrez la table chantier_rapport &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;- &nbsp; &nbsp;Dans le champ total_photo, changez le nombre de photos &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;- &nbsp; &nbsp;Enregistrez &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;Allez dans l&rsquo;interface Web et actualisez la page. &nbsp;</p>\r\n\r\n<p><strong>1. &nbsp; &nbsp;Le triplet &nbsp;La couleur de ce chantier est orange.</strong></p>\r\n\r\n<p>Le triplet se manifeste quand la m&ecirc;me photo est saisie 3 ou 4 fois.</p>\r\n\r\n<p>Pour le corriger : &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;S&eacute;lectionnez le chantier en question &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;Cliquez sur Nettoyage (Cf. la figure ci-apr&egrave;s) &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;Dans la liste d&eacute;roulante de Rechercher, choisir Triplet puis valider &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;Une nouvelle fen&ecirc;tre s&rsquo;ouvre qui affiche les photos en triplet ou en quadruplet.</p>\r\n\r\n<p><strong>Attention !!!</strong>&nbsp; &nbsp; Avant de proc&eacute;der &agrave; toute modification, il faut regarder le statut de la photo (correction, contr&ocirc;le&hellip;), dans ce cas, ne faites rien. Par contre si la photo est en saisie,</p>\r\n\r\n<p>- &nbsp; &nbsp;Cliquez sur nettoyage. Et la saisie reprend. &nbsp; &nbsp;</p>\r\n\r\n<p><strong>2. &nbsp; &nbsp;Blocage sur une photo </strong></p>\r\n\r\n<p>&nbsp;Il y a des bugs qui\r\n s&rsquo;affichent sur les interfaces pendant la correction ou contr&ocirc;le, pour le r&eacute;soudre : &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;S&eacute;lectionnez le chantier &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;Cliquez sur Nettoyage &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;Dans la liste d&eacute;roulante, choisir D&eacute;bloquer contr&ocirc;le, si la photo est en contr&ocirc;le ou sur D&eacute;bloquer correction si la photo est en correction. &nbsp;</p>\r\n\r\n<p>3. &nbsp; &nbsp;Supprimer une saisie d&rsquo;une photo (rare) &nbsp;Pour supprimer totalement la saisie d&rsquo;une photo. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;- &nbsp; &nbsp;S&eacute;lectionner l&rsquo;URL photo dans la table traitement et supprimer les enregistrements (1 ou 2 lignes pour A et B) &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;S&eacute;lectionner l&rsquo;URL photo dans la table photo et supprimer les enregistrements (toutes les lignes ou variables selon A et B !) &nbsp;</p>\r\n\r\n<p>Attention : &agrave; ce stade, la photo ne pourra pas &ecirc;tre RE-saisie, car il subsiste les enregistrements des pseudos dans la table chantier. &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;S&eacute;lectionner l&rsquo;URL photo dans la table chantier et effacer les 2 pseudos (ou 1 seul pour A ou B). &nbsp; 4. &nbsp; &nbsp;Chantier mal charg&eacute; Si une importation se passe mal &nbsp;Ne pas h&eacute;siter et supprimer les enregistrements li&eacute;s &agrave; l&rsquo;importation</p>\r\n\r\n<p>&nbsp;- &nbsp; &nbsp;Via ODBC supprimer la ou les lignes de rapport_chantier contenant exactement le nom du chantier dans le champ &laquo; url_chantier &raquo; &nbsp;</p>\r\n\r\n<p>- &nbsp; &nbsp;Via ODBC supprimer la ou les lignes de chantier contenant exactement le nom du chantier dans le champ &laquo; Chantier_Dossier_Travail &raquo;</p>', '2016-05-18 12:21:00', 1, 0, NULL),
(48, 31, 21, 'Préparation Ardoise', '<p><span style="color:#0000FF"><strong>CONSIGNES PREPARATION ARDOISES &nbsp;- &nbsp;CLIENT AGO&nbsp;</strong></span></p>\r\n\r\n<p><u>Rappel &nbsp;sur les QUANTIEMES</u></p>\r\n\r\n<p>Un quanti&egrave;me : est &nbsp;une &nbsp;s&eacute;quence &nbsp;de chiffres &nbsp;permettant &nbsp;au client &nbsp;de se retrouver &nbsp;la p&eacute;riode respective du traitement de ces fichiers, le num&eacute;ro de quanti&egrave;me varie de 1 &agrave; 365 (soit 1 jours &agrave; 365 jours).<br />\r\nIl &nbsp;est &nbsp;donc &nbsp;impossible de retrouver en borne sup en quanti&egrave;me sup&eacute;rieur &agrave; 365.<br />\r\n<u><strong>Attention :</strong></u> ne pas &nbsp;confondre &nbsp;un num&eacute;ro &nbsp;d&rsquo;identification &agrave; un quanti&egrave;me.<br />\r\nNum&eacute;ro d&rsquo;identification peut prendre au del&agrave; &nbsp;de 3 chiffres : exple &nbsp;35652<br />\r\nNum&eacute;ro de quanti&egrave;me est compris &nbsp;uniquement &nbsp;entre &nbsp;1 et 365<br />\r\n<strong>PS :</strong> &nbsp;Si &nbsp;une &nbsp;boite &nbsp;ne contient pas de num&eacute;ro de quanti&egrave;me &nbsp;<strong>ne JAMAIS Laisser le champs &nbsp;borne sup &nbsp;vide &nbsp;mettre &nbsp;&lsquo;&rsquo; XXX &rsquo;&rsquo;.</strong><br />\r\n<strong>EXEMPLE</strong><span style="color:#0000FF"><strong> </strong></span>de saisie &nbsp;de quanti&egrave;me : &nbsp; 126/2010 &agrave; FIN<br />\r\nEn saisie nous avons : 126/2010 a&nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; FIN (365).<br />\r\nBorne sup : 635<br />\r\nNous &nbsp;saisissons 365 puisque c&rsquo;est le quanti&egrave;me de fin, BORNE SUP ne prends pas en compte &nbsp;les lettres.<br />\r\nComment proc&egrave;de-t-on &agrave; la pr&eacute;paration des ardoises pour le traitement des chantiers AGO</p>\r\n\r\n<p><span style="color:#0000FF"><strong>LES ARDOISES</strong></span></p>\r\n\r\n<p><span style="color:#0000FF"><u>Qu&rsquo;est ce qu&rsquo;une ardoise ?</u></span></p>\r\n\r\n<p>C&rsquo;est &nbsp;un &nbsp;tableau (blanc ou noir) &nbsp;sur lequel on peut laisser des &nbsp;inscriptions permettant &nbsp;de donner &nbsp;des informations de fa&ccedil;on claire et pr&eacute;cise.</p>\r\n\r\n<p><span style="color:#0000FF"><u><strong><em>Importance d&rsquo;une &nbsp;ardoise &nbsp;en AGO :</em></strong></u></span></p>\r\n\r\n<p>L&rsquo;ardoise &nbsp;dans le traitement du chantier AGO nous permet &nbsp;d&rsquo;avoir certaines &nbsp;informations &nbsp;&agrave; savoir ; &nbsp;le &nbsp;service &nbsp;que nous traitons ; la m&eacute;thode de saisies &nbsp;que nous &nbsp;devons adopter, un &nbsp;exemple de saisie, le nom &nbsp;du client , etc.&hellip;)<br />\r\nContrairement &nbsp;&agrave; pro archives &nbsp;ici, &nbsp;le services &nbsp;peut &ecirc;tre &nbsp;identiques (fig&eacute;) &nbsp;pour &nbsp;un chantier &nbsp;ayant soit un &nbsp;grand &nbsp;nombre &nbsp;de photos ou &nbsp;un petit &nbsp;nombres d&rsquo;o&ugrave; &nbsp;la n&eacute;cessit&eacute; &nbsp;pour &nbsp;nous &nbsp;et pour ne pas &nbsp;perdre de temps d&rsquo;aller le saisir dans la &nbsp;base. Il &nbsp;peut aussi varier &nbsp;d&rsquo;une &nbsp;photo &agrave; une &nbsp;autre (cas &nbsp;un peu rare)<br />\r\nPour &nbsp;chaque &nbsp;chantier &nbsp;l&rsquo;interface d&eacute;coupe &nbsp;en &nbsp;petit &nbsp;dossier &nbsp;de 400 photos, en &nbsp;gros &nbsp;plus le chantier est &nbsp;grand nombre de fois lors du chargement nous aurons des sous r&eacute;pertoires &nbsp;au nombre du d&eacute;coupage par 400.<br />\r\n<strong>Exemple :</strong> chantier UGE &ndash; BERLIOT_975photos &nbsp;</p>\r\n\r\n<p>Ici &nbsp;lors &nbsp;du chargement du chantier &nbsp;nous &nbsp; aurons &nbsp;3 &nbsp;dossiers &nbsp;du m&ecirc;me &nbsp;chantier &nbsp;en claire :<br />\r\nChantier UGE &ndash; BERLIOT_400photos &nbsp;<br />\r\nChantier UGE &ndash; BERLIOT_400photos &nbsp;<br />\r\nChantier UGE &ndash; BERLIOT_175photos &nbsp;<br />\r\nSoit &nbsp; au total 975 photos &nbsp;a &nbsp;visualiser pour &nbsp;d&eacute;terminer &nbsp;les &nbsp;ardoises</p>\r\n\r\n<p>Nb : une fois que le traitement des ardoises est totalement termin&eacute; et que le chantier est pass&eacute; en &lsquo;&rsquo;statut Ready&rsquo;&rsquo; .le chantier &nbsp;revient en &nbsp;1seul &nbsp;sur l&rsquo;interface web apr&egrave;s actualisation. En claire, ce processus d&rsquo;&eacute;clatement des chantiers en groupe de 400 photos a &eacute;t&eacute; cr&eacute;er afin d&rsquo;all&eacute;ger dans le traitement des ardoises il disparait lorsque le traitement est achev&eacute;.</p>\r\n\r\n<p><span style="color:#FF0000">ATTENTION &nbsp;le &nbsp;traitement des ardoises &nbsp;est &nbsp;tr&egrave;s &nbsp;important &nbsp;raison pour laquelle &nbsp;il est &nbsp;n&eacute;cessaire &nbsp;de ne pas se presser &nbsp;et de prendre tout &nbsp;son temps &nbsp;pour &nbsp;visualiser les photos &nbsp; &nbsp;et n&rsquo;oublier &nbsp;aucune &nbsp;ardoises .</span></p>\r\n\r\n<p>Imaginons &nbsp;maintenant &nbsp;que sur &nbsp;ce m&ecirc;me chantier le client &nbsp;d&eacute;cide &nbsp;d&rsquo;introduire &nbsp;vers a 870eme &nbsp;photo &nbsp;une ardoise &nbsp;qu&rsquo;il ne nous aurait pas pr&eacute;ciser &nbsp;sur le &nbsp;fichier &nbsp;PDF. Cela voudrais que &nbsp;si &nbsp;l&rsquo;ardoise na pas &nbsp;&eacute;t&eacute; &nbsp;identifi&eacute; &nbsp;au pr&eacute;alable &nbsp;par &nbsp;les &nbsp;op&eacute;ratrices &nbsp;alors &nbsp;une &nbsp;erreur &nbsp; de &nbsp;saisie &nbsp;du num&eacute;ro de &nbsp;service &nbsp;se serait produite &nbsp;sur un &nbsp;grand nombre &nbsp;de photos &nbsp; pr&eacute;cis&eacute;ment de la &nbsp;photo 871 a 975. Cr&eacute;ant &nbsp;ainsi &nbsp;une &nbsp;&eacute;norme &nbsp;perte de temps &nbsp;au cas ou &nbsp;nous &nbsp;nous &nbsp;en rendons &nbsp;compte &nbsp;a temps &nbsp;avant &nbsp;la restitution au client &nbsp;car &nbsp;il &nbsp;faudra retraiter &nbsp;ces &nbsp;photos &nbsp;ou &nbsp;encore &nbsp;un risque plus &nbsp;grave &nbsp;de &nbsp;&lsquo;&rsquo;NON QUALITE&rsquo;&rsquo; si la restitution avait &nbsp;d&eacute;j&agrave; &nbsp;&eacute;t&eacute; &nbsp;faite &nbsp;et que &nbsp;c4est le client &nbsp;lui-m&ecirc;me ; &nbsp; qui &nbsp;nous &nbsp; informe &nbsp;par mail de la constatation &nbsp;de l&rsquo;erreur &nbsp;commise par tous &nbsp;le staff archivage.</p>\r\n\r\n<p>Il &nbsp;est &nbsp;donc &nbsp;tr&egrave;s &nbsp;important &nbsp; de &nbsp;faire &nbsp;tr&egrave;s attention &nbsp;et de passer &nbsp;le &nbsp;nombres &nbsp;de temps &nbsp;qu&rsquo;il &nbsp;faut, s&rsquo;assurer &nbsp;que &nbsp;rien &nbsp;n&rsquo;a &eacute;t&eacute; &nbsp;oubli&eacute; &nbsp;et surtout &nbsp;&ecirc;tre tr&egrave;s vigilante &nbsp;et &nbsp; a la moindre &nbsp;incompr&eacute;hension ou &nbsp;doute &nbsp;demander aux &nbsp;responsables &nbsp;directe ou &nbsp;informer la Paris &nbsp;en &nbsp;cas de leurs absences</p>\r\n\r\n<p><strong><span style="color:#0000FF">1ERE ETAPE : CHARGEMENT DU CHANTIER DANS &nbsp;LA BASE :</span>&nbsp;</strong></p>\r\n\r\n<p>Charg&eacute; de la mise en &oelig;uvre : &nbsp; Christelle, JL &nbsp;et Fr&eacute;deric</p>\r\n\r\n<p>Apres chargement &nbsp;du chantier, Il est &nbsp;indispensable de revenir dans l&rsquo;interface web &nbsp;et actualiser la page en cours pour que les modifications que &nbsp;vous avez faites soient &nbsp;en compte. Une fois que la page est actualis&eacute;e le chantier &nbsp;que vous &nbsp;venez d&rsquo;ins&eacute;rez ce &nbsp;retrouve dans la file des chantiers a traiter &nbsp;mais &nbsp;en &nbsp;statut <span style="color:#0000FF">&lsquo;&rsquo;STAND &nbsp;BY&rsquo;&rsquo;</span>. Pour &ecirc;tre plus prudent &nbsp;et &nbsp;&eacute;viter &nbsp;qu&rsquo;une op&eacute;ratrice ne &nbsp;d&eacute;cide de mettre le chantier en traitement mettre &nbsp;le chantier &nbsp;en &lsquo;&rsquo;ATTENTE &lsquo;&rsquo; &nbsp;avant le &nbsp;traitement des ardoises &nbsp;puis &nbsp;passer &nbsp;au traitement des ardoises</p>\r\n\r\n<p><span style="color:#0000FF"><strong>2EME ETAPE : TRAITEMENT DES ARDOISES</strong></span></p>\r\n\r\n<p><span style="color:#0000FF">Comment &nbsp;renseigne t-on les ardoises ?</span></p>\r\n\r\n<p><span style="color:#0000FF">Le fichier PDF / Qu&rsquo;est ce que c&rsquo;est ?</span></p>\r\n\r\n<p>Un &nbsp;fichier PDF &nbsp;appel &eacute; FICHE D&rsquo;INVENTAIRE : est une feuille sur laquelle le client, nous donne des d&eacute;tails et &nbsp;pr&eacute;cisions par &eacute;crit &nbsp;sur la &nbsp;restitution qu&rsquo;il &nbsp;attends du traitement. ; il &nbsp;comporte obligatoirement le nombre de photos que contient le chantier, les diff&eacute;rents service &nbsp;qu&rsquo;il y contient, le nom du client, et d&rsquo;autres &nbsp;d&eacute;tails .ce &nbsp;fichier &nbsp;vient &nbsp;en secours pour le traitement des ardoises car il permet &nbsp;de savoir a parfois avec pr&eacute;cision o&ugrave; les modifications sont &nbsp;op&egrave;res &nbsp;sur les services. Il est donc &nbsp;n&eacute;cessaire &nbsp;de garder &nbsp;le fichier &nbsp;avant le traitement des ardoises</p>\r\n\r\n<p>Tout d&rsquo;abord &nbsp;retenons &nbsp;que &nbsp;le processus &nbsp;de renseignement des &nbsp;ardoises est &nbsp;simple, &nbsp;a l&rsquo;id&eacute;e &nbsp;d&rsquo;une &nbsp;saisie il est n&eacute;cessaire &nbsp;que plusieurs personnes &nbsp;est &nbsp;fait la saisie &nbsp;pour &nbsp;un control &nbsp;puis une &nbsp;validation ultime.<br />\r\nIci &nbsp;nous &nbsp;avons 3 USERS le 1er, le 2eme, et le 3eme ; chacune doit pour sa part &nbsp;faire &nbsp;son traitement d&rsquo;ardoises avec son login et ensuite attendre &nbsp;une &nbsp;validation de son traitement ou &nbsp;faire &nbsp;sa correction.</p>\r\n\r\n<p>1er &nbsp;User : proc&eacute;dure &agrave; suivre</p>\r\n\r\n<p><br />\r\nCliquez sur son login + MDP ensuite &nbsp;choisir le chantier &nbsp;que vous d&eacute;sirez traiter qui est dans la liste d&eacute;roulante dans l&rsquo;interface &nbsp;puis cliquez sur le chantier concern&eacute; apr&egrave;s &nbsp;quelques minutes de chargement toute les photos que contiennent ce chantiers s&rsquo;affichent vous donnant ainsi la possibilit&eacute; d&rsquo;identifier les photos vous servant d&rsquo;ardoises et donc a ne pas saisir. L&rsquo;interface &nbsp; nous permettant &nbsp;de faire le traitement des ardoises &nbsp;contient plusieurs &nbsp;champs :</p>\r\n\r\n<p><br />\r\n<u>Les champs &nbsp;d&rsquo;informations&nbsp;</u></p>\r\n\r\n<p>n&deg; : ordre &nbsp;chronologique num&eacute;rotation des fichiers<br />\r\nVignette : il s&rsquo;agit de l&rsquo;aper&ccedil;u des photos<br />\r\nAdresse compl&egrave;te de la photo : il s&rsquo;agit du lien complet de la photo<br />\r\nNum&eacute;ro de la photo : num&eacute;ro de la photo &lsquo;nombre suivi du .JPG</p>\r\n\r\n<p><u>Les champs &agrave; remplir&nbsp;</u></p>\r\n\r\n<p><br />\r\nDur&eacute;e de conservation : &nbsp;La dur&eacute;e de conservation a ce jour est de &lsquo;&rsquo;0&rsquo;&rsquo;, elle &nbsp;est &nbsp;renseign&eacute; sur la premi&egrave;re ardoises obtenu dans le chantier<br />\r\nService : le service vari selon les chantiers, il faut donc s&rsquo;assurer de respecter a la lettre les consignes du client dans le fichier PDF qui donne des d&eacute;tails sur ses attentes<br />\r\n&nbsp;R&eacute;f conteneur&nbsp;<br />\r\n&nbsp;R&egrave;gle de saisie<br />\r\n&nbsp;Exemple de saisie&nbsp;<br />\r\n&nbsp;Divers</p>\r\n\r\n<p>&nbsp;Lorsque vous glisser le curseur sur l&rsquo;ic&ocirc;ne de la photo &nbsp;vous avez la totalit&eacute; de l&rsquo;aper&ccedil;u de la photo, vous pouvez renseigner la photo en ardoise &nbsp;en mettant le chiffre &nbsp;&lsquo;&rsquo;0&rsquo;&rsquo; sauf &nbsp;pour &nbsp;la colonne &nbsp;<span style="color:#0000FF"><strong>&lsquo;&rsquo;SERVICE &lsquo;&rsquo; </strong></span>puis en validant la totalit&eacute; des actions que vous avez menez sur le bouton &nbsp;<span style="color:#0000FF"><strong>&lsquo;&rsquo;valider&rsquo;&rsquo;</strong> </span>qui se trouve tout en haut a droite du tableau ainsi toutes les actions que vous aurez menez seront prises en compte par l&rsquo;interface. ; Votre &nbsp;statut passe donc &nbsp;en <span style="color:#0000FF">&lsquo;&rsquo;attente &nbsp;v&eacute;rif&rsquo;&rsquo; &nbsp;de l&rsquo;interface &nbsp;AGO</span></p>\r\n\r\n<p><br />\r\n<strong>Ps : avant de valider votre traitement vous avez la possibilit&eacute; de visualiser &nbsp;uniquement les ardoises que vous avez s&eacute;lectionn&eacute; &nbsp;et ainsi faire une modification en cas d&rsquo;erreur, en haut de votre interface de traitement des ardoises vous avez 3 boutons dont :&nbsp;<br />\r\n&nbsp;&lsquo;&rsquo;visualiser les ardoises &lsquo;&rsquo; : il vous &nbsp;affiche uniquement les ardoises que vous avez d&eacute;sign&eacute;es<br />\r\nvisualiser les &nbsp;U.A (Unit&eacute; d&rsquo;archives) : il s&rsquo;agit des boites &nbsp;qui passeront en &nbsp;saisie, l&rsquo;interface retire les ardoises que vous avez identifi&eacute;es<br />\r\n&lsquo;&rsquo;visualiser Tout&rsquo;&rsquo; : l&rsquo;interface &nbsp;vous remet tout le chantier UA + Ardoises</strong></p>\r\n\r\n<p><br />\r\nPareil &nbsp;pour USER 2 et 3</p>\r\n\r\n<p><br />\r\n<strong>Lorsque le dernier &nbsp;&lsquo;&rsquo;User &lsquo;&rsquo; valide &nbsp;son traitement l&rsquo;interface lance alors une proc&eacute;dure de contr&ocirc;le de traitement pour le chargement ardoise. Ainsi les &nbsp;&eacute;carts &nbsp;se font remarquer, et donc chacun &nbsp;des utilisateurs fait ses corrections. Nombre de fois que les &lsquo;&rsquo;3 User &lsquo;&rsquo; n&rsquo;auront pas les m&ecirc;mes &nbsp;r&eacute;sultats nombres de fois les corrections seront demand&eacute; par l&rsquo;interface &nbsp;jusqu&#39;&agrave; obtention d&rsquo;un m&ecirc;me r&eacute;sultat sur les 3 traitements d&rsquo;ardoise pour que le chantier passe &nbsp;en statut &lsquo;&rsquo;READY&rsquo;&rsquo;. Ainsi &nbsp;votre chantier est pr&ecirc;t pour la saisie, remettre le chantier &nbsp;en &lsquo;&rsquo;NORMAL&rsquo;&rsquo; ; faire passer correctement les derni&egrave;res consignes a l&rsquo;&eacute;quipe &nbsp;au &nbsp;besoin &nbsp;et &nbsp; commencer le traitement.</strong></p>\r\n\r\n<p><br />\r\nEt donc &nbsp;si le nombre des photos du chantier &nbsp;d&eacute;clar&eacute; &eacute;tait de 99 fichiers et que vous venez de s&eacute;lectionner 6 ardoises alors le nombre a saisir sera &eacute;gal a 93 fichiers soit :<br />\r\nFichiers d&eacute;clar&eacute;s (99) &nbsp; &nbsp;ardoises(6) &nbsp;photos &agrave; saisir = 99 &ndash; 6 &nbsp; &nbsp;========= &nbsp;93 photos</p>\r\n\r\n<p>L&rsquo;&eacute;quipe de production pourra donc commencer son travail<br />\r\n&nbsp;</p>', '2016-05-18 16:58:00', 1, 0, NULL),
(48, 32, 22, 'Importation des chantiers', '<p><span style="color:#0000FF"><strong>IMPORTATION DES CHANTIERS<br />\r\nAGO - &nbsp;PROARCHIVES - CAREMPLOI</strong></span></p>\r\n\r\n<p><strong>⦁&nbsp;&nbsp; &nbsp;Proarchives</strong><br />\r\nApr&egrave;s avoir t&eacute;l&eacute;charg&eacute; l&rsquo;envoi, proc&eacute;dez &agrave; la v&eacute;rification des &eacute;l&eacute;ments suivants :<br />\r\n⦁&nbsp;&nbsp; &nbsp;V&eacute;rifiez si le nombre de photos envoy&eacute; correspond au rapport de photos envoy&eacute; par le client<br />\r\n⦁&nbsp;&nbsp; &nbsp;V&eacute;rifiez s&rsquo;il y a table adresse ou pas /G&eacute;rance ou Copro<br />\r\n⦁&nbsp;&nbsp; &nbsp;V&eacute;rifiez s&rsquo;il y a l&rsquo;historique si oui lancez la macro pour avoir le num&eacute;ro de compteur</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;<strong>Importation du chantier</strong><br />\r\nLancez l&rsquo;application <strong>Importation Proarchives&hellip;</strong>apr&egrave;s identification vous avez la figure 1 suivante</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Fig.1</strong></p>\r\n\r\n<p><br />\r\n⦁&nbsp;&nbsp; &nbsp;Cliquez sur <strong>SETTINGS CHANTIER</strong><br />\r\n⦁&nbsp;&nbsp; &nbsp;Cliquez sur <strong>R&eacute;pertoire Envois&hellip;Y:\\Photo_AGO&hellip;puis OK</strong><br />\r\n⦁&nbsp;&nbsp; &nbsp;Ensuite sur cliquez sur Scan R&eacute;pertoire<br />\r\nUne fen&ecirc;tre suivante s&rsquo;ouvre</p>\r\n\r\n<p>&nbsp;</p>', '2016-05-18 17:39:21', 1, 0, 'uploads/wiki/57397.jpeg');
INSERT INTO `version` (`ver_creator`, `ver_article`, `Id`, `ver_titre`, `ver_content`, `ver_date`, `ver_editable`, `ver_del`, `attachement`) VALUES
(48, 33, 23, 'Interface_Web', '<p><span style="color:#0000FF">Interface Web AGO/Proarchives &ndash; Manuel Utilisateur</span></p>\r\n\r\n<p><span style="color:#0000FF">-Pr&eacute;sentation</span></p>\r\n\r\n<p>L&rsquo;interface web que nous mettons &agrave; votre disposition permet principalement :<br />\r\n-De suivre en temps r&eacute;el les travaux de saisies externalis&eacute;s<br />\r\n-D&rsquo;envoyer des ordres de priorit&eacute;<br />\r\n-D&rsquo;effectuer des recherches sur les photographies pr&eacute;sentant des anomalies XXX</p>\r\n\r\n<p>Demande de login :<br />\r\nL&rsquo;interface web permet d&rsquo;effectuer des actions qui vont avoir des cons&eacute;quences sur notre organisation comme les d&eacute;lais de traitement des fichiers de restitution. A ce titre, le droit d&rsquo;utilisation de l&rsquo;interface est accord&eacute; exclusivement &agrave; la soci&eacute;t&eacute; AGO et &agrave; son personnel habilit&eacute; &agrave; manipuler des informations confidentielles, comp&eacute;tent &agrave; donner des ordres de travail et &agrave; modifier un bon de commande. Chaque demande de login et de mot de passe devra &ecirc;tre valid&eacute;e par le responsable des op&eacute;rations d&rsquo;AGO avant d&rsquo;&ecirc;tre transmis &agrave; <span style="color:#0000FF">frederic.malbrel@neuf.fr .</span></p>\r\n\r\n<p>Pour vous connecter il suffit d&rsquo;entrer dans votre navigateur Firefox &nbsp;l&rsquo;url suivant :<br />\r\n<span style="color:#0000FF">-http://41.207.172.122/azertwin</span></p>\r\n\r\n<p><span style="color:#0000FF">Installation de l&rsquo;interface</span></p>\r\n\r\n<p>Avant tout il est n&eacute;cessaire d&rsquo;installer une version de Firefox (navigateur open source et libre de droit) que vous pouvez t&eacute;l&eacute;charger sur le site :</p>\r\n\r\n<p><span style="color:#0000FF">http://www.01net.com/telecharger/windows/Internet/navigateur/fiches/25711.html</span></p>\r\n\r\n<p>Ensuite il faut t&eacute;l&eacute;charger une petite extension qui facilite l&rsquo;affichage des photos dans votre navigateur. Il suffit de suivre les indications de t&eacute;l&eacute;chargement o&ugrave; tout est indiqu&eacute;.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br />\r\n<span style="color:#0000FF">https://addons.mozilla.org/en-US/firefox/addon/locallink/</span></p>\r\n\r\n<p><br />\r\nEnfin pour l&rsquo;affichage des photos : pour des raisons de s&eacute;curit&eacute; propre aux environnements clients/serveur de la soci&eacute;t&eacute; AGO, il est n&eacute;cessaire d&rsquo;installer une pr&eacute;f&eacute;rence r&eacute;seau dans votre navigateur Firefox dont le descriptif complet est donn&eacute; en Annexe. Cependant si cette extension n&rsquo;est pas install&eacute;e, le module de recherche reste op&eacute;rationnel. Seul l&rsquo;affichage de la photo sera indisponible.</p>\r\n\r\n<p>A la premi&egrave;re requ&ecirc;te d&rsquo;affichage de la photo dans l&rsquo;interface, Firefox va vous demander d&rsquo;autoriser l&rsquo;affichage des fen&ecirc;tres pop up en provenance du site o&ugrave; se d&eacute;roule la saisie externalis&eacute;e. R&eacute;pondre &laquo; oui pour tous les pop-up &raquo; pour le site 41.207.172.122.</p>\r\n\r\n<p>Dor&eacute;navant vous pouvez afficher les photos stock&eacute;s sur votre r&eacute;seau d&rsquo;entreprise avec une IP priv&eacute;e directement &agrave; partir de votre navigateur. Celle qui nous a &eacute;t&eacute; communiqu&eacute;e au moment de la r&eacute;daction de ce manuel, est la suivante :&nbsp;<br />\r\n<span style="color:#0000FF">http://192.168.1.8</span><br />\r\n<span style="color:#000080">-Description de l&rsquo;interface web</span><br />\r\n<span style="color:#0000FF">&nbsp; &nbsp; *Ecran Avancement des travaux</span></p>\r\n\r\n<p>En haut &agrave; gauche 2 boutons :<br />\r\n&nbsp; &nbsp; &nbsp;-rafraichissement des donn&eacute;es<br />\r\n&nbsp; &nbsp; &nbsp;-d&eacute;connexion&nbsp;</p>\r\n\r\n<p>A droite 3 onglets de nature des travaux avec les 2 typologies diff&eacute;rentes :<br />\r\n&nbsp; &nbsp; -Proarchives<br />\r\n&nbsp; &nbsp; -Caremploi<br />\r\n&nbsp; &nbsp; -AGO</p>\r\n\r\n<p>Tous les chantiers sont regroup&eacute;s par envoi suivi de la date d&rsquo;envoi. Ils restent affich&eacute;s &agrave; l&rsquo;&eacute;cran environ 2 &agrave; 3 jours apr&egrave;s l&rsquo;envoi des fichiers de restitution.</p>\r\n\r\n<p><strong>Chantiers </strong>: les noms complets des chantiers tels qu&rsquo;ils figurent au moment du transfert par AGO</p>\r\n\r\n<p><strong>Fichiers d&eacute;clar&eacute;s</strong> : il s&rsquo;agit des quantit&eacute;s de photos que l&rsquo;on trouve dans rapport chantier pour Proarchives et dans le nom du chantier pour AGO</p>\r\n\r\n<p><strong>Fichiers re&ccedil;us</strong> : il s&rsquo;agit des quantit&eacute;s de photos que l&rsquo;interface a int&eacute;gr&eacute;es.&nbsp;</p>\r\n\r\n<p><strong>Total valid&eacute;es </strong>: il s&rsquo;agit du nombre total de photos valid&eacute;es par l&rsquo;&eacute;quipe de contr&ocirc;le. Les saisies peuvent &ecirc;tre modifi&eacute;es &agrave; l&rsquo;issue du contr&ocirc;le qualit&eacute; et avant restitution mais rarement.</p>\r\n\r\n<p><strong>Total en-cours</strong> : il s&rsquo;agit du nombre total de photos en cours de saisies/corrections et qui peuvent &ecirc;tre modifi&eacute;es &agrave; tout moment.</p>\r\n\r\n<p><strong>Stock &agrave; saisir </strong>: quantit&eacute; de photos restante n&rsquo;ayant fait l&rsquo;objet d&rsquo;aucune saisie. &nbsp;</p>\r\n\r\n<p><strong>Stock &agrave; valider</strong> : quantit&eacute; de photos en stock et en-cours de traitement</p>\r\n\r\n<p><strong>D&eacute;part compteur</strong> : il s&rsquo;agit du num&eacute;ro de d&eacute;part du compteur des unit&eacute;s d&rsquo;archives par client. Pour AGO il n&rsquo;existe pas. Ce num&eacute;ro nous est communiqu&eacute; par le service des op&eacute;rations. Il arrive n&eacute;anmoins que ce num&eacute;ro diff&egrave;re lorsque le chantier est &laquo; &eacute;clat&eacute; &raquo; et encore pr&eacute;sent dans un envoi r&eacute;cent et non restitu&eacute;. Dans ce cas AGO ne peut pas conna&icirc;tre le num&eacute;ro le plus r&eacute;cent. C&rsquo;est aussi ce num&eacute;ro qui est repris dans la colonne N&deg; de dossier du fichier de restitution.</p>\r\n\r\n<p><strong>Date retour</strong> : il s&rsquo;agit de la date de restitution pr&eacute;vue par rapport &agrave; la livraison des &eacute;l&eacute;ments.</p>\r\n\r\n<p><strong>Priorit&eacute;</strong> : il existe 5 statuts possibles pour un chantier</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;Urgent : AGO souhaite r&eacute;cup&eacute;rer le plus rapidement possible son fichier de restitution et acc&eacute;l&egrave;re le traitement global. AGO indique aussi la date &agrave; laquelle il souhaite recevoir son fichier. Attention, un changement d&rsquo;un jour sur le d&eacute;lai normal g&eacute;n&egrave;re une modification de 2% du tarif de base<br />\r\nPriorit&eacute; 1 : m&ecirc;me demande qu&rsquo;urgent mais sans volont&eacute; de recevoir plus rapidement le fichier de restitution. Cela permet toutefois de lancer les requ&ecirc;tes sur l&rsquo;int&eacute;gralit&eacute; d&rsquo;un chantier.</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;Priorit&eacute; 2 ou 3 : ordre de traitement des chantiers suivants<br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp;&nbsp; &nbsp;Attendre : un probl&egrave;me a &eacute;t&eacute; identifi&eacute; (doublon table adresse, nouveau service,&hellip;) qui n&eacute;cessite de bloquer la saisie d&rsquo;un chantier pour un compl&eacute;ment d&rsquo;informations&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;Normal : la saisie se fait au fil de l&rsquo;eau&hellip;</p>\r\n\r\n<p><strong>Date urgence</strong> : il s&rsquo;agit de la date de restitution modifi&eacute;e par le service des op&eacute;rations d&rsquo;AGO. Elle indique que le fichier de restitution doit &ecirc;tre retourn&eacute; dans des d&eacute;lais plus courts. Le respect de ce d&eacute;lai d&eacute;pend n&eacute;anmoins de sa faisabilit&eacute; op&eacute;rationnelle !</p>\r\n\r\n<p><span style="color:#0000FF">-Remarques&nbsp;</span></p>\r\n\r\n<p>La modification d&rsquo;une priorit&eacute; rel&egrave;ve de la seule d&eacute;cision du service des op&eacute;rations d&rsquo;AGO qui est seul comp&eacute;tent pour d&eacute;clencher cette action. Lors de la cr&eacute;ation d&rsquo;un login, la direction g&eacute;n&eacute;rale d&rsquo;AGO aura pr&eacute;alablement valid&eacute;e les comp&eacute;tences de l&rsquo;op&eacute;rateur &agrave; d&eacute;clencher des actions.</p>\r\n\r\n<p>La date d&rsquo;urgence est non modifiable pour &eacute;viter les multiples changements qui mobilisent d&egrave;s la premi&egrave;re modification l&rsquo;ensemble des taches des &eacute;quipes de saisie.</p>\r\n\r\n<p>Les ardoises pour AGO sont prises en compte dans les colonnes totaux, re&ccedil;us, d&eacute;clar&eacute;es, valid&eacute;es,&hellip;</p>\r\n\r\n<p>Si &eacute;cart entre fichiers d&eacute;clar&eacute;s et fichiers re&ccedil;us (perte pendant le transfert, rapport de chantier erron&eacute;) les 2 champs passent en rouge. Cependant la saisie n&rsquo;est pas bloqu&eacute;e, la restitution oui tant que l&rsquo;anomalie n&rsquo;a pas &eacute;t&eacute; identifi&eacute;e.</p>\r\n\r\n<p>Une ligne de chantier peut apparaitre en orange. Notre service qualit&eacute; a identifi&eacute; une saisie difficile et ordonn&eacute; une saisie suppl&eacute;mentaire pour une photo. Pendant une courte p&eacute;riode de contr&ocirc;le les quantit&eacute;s trait&eacute;es sont sup&eacute;rieures aux quantit&eacute;s d&eacute;clar&eacute;es (stock &agrave; saisir prend une valeur n&eacute;gative).&nbsp;<br />\r\nAu final, lorsque toutes les photos sont valid&eacute;es, le chantier passe au vert.</p>\r\n\r\n<p>Le contenu de la colonne Stock &agrave; saisir est une information pr&eacute;cieuse qui informe AGO sur le niveau d&rsquo;activit&eacute; de nos &eacute;quipes et de la n&eacute;cessit&eacute; de renouveler des transferts.</p>\r\n\r\n<p><span style="color:#0000FF">-Fen&ecirc;tres de suivi</span></p>\r\n\r\n<p>1 fen&ecirc;tre en haut de l&rsquo;&eacute;cran permet de suivre la synth&egrave;se des priorit&eacute;s et de visualiser les chantiers actuellement en-cours de saisie.</p>\r\n\r\n<p>Lorsqu&rsquo;un chantier est d&eacute;clar&eacute; en urgent ou en priorit&eacute; 1, il est transmis imm&eacute;diatement aux &eacute;quipes de saisie et prend la place des chantiers en-cours. Nos &eacute;quipes ont n&eacute;anmoins la possibilit&eacute; de traiter des corrections ant&eacute;rieures mais toute nouvelle saisie se fait sur les chantiers d&eacute;clar&eacute;s en urgence puis en priorit&eacute; 1,2,3. Ces informations se v&eacute;rifient ais&eacute;ment par l&rsquo;observation de la diminution des stocks dans l&rsquo;heure qui suit la demande d&rsquo;AGO et la possibilit&eacute; d&rsquo;&eacute;tendre alors les requ&ecirc;tes sur un plus grand nombre de photos.</p>\r\n\r\n<p><span style="color:#0000FF">-Modules de requ&ecirc;tes</span></p>\r\n\r\n<p>S&eacute;lectionner un ou plusieurs chantiers dans 1 ou plusieurs envois (pratique lorsqu&rsquo;un inventaire est fractionn&eacute; dans plusieurs envois)</p>\r\n\r\n<p>Une fen&ecirc;tre de recherche vous permet de choisir si la recherche d&rsquo;anomalies XXX s&rsquo;effectue dans les zones de conteneur ou d&rsquo;unit&eacute; d&rsquo;archives. Les r&eacute;sultats de la requ&ecirc;te sont affich&eacute;s et peuvent &ecirc;tre enregistr&eacute;s ou recopi&eacute;s dans un autre document (Microsoft office par exemple).</p>\r\n\r\n<p>Les requ&ecirc;tes sont lanc&eacute;es sur l&rsquo;int&eacute;gralit&eacute; des donn&eacute;es saisies qu&rsquo;elles soient en-cours, valid&eacute;es, au contr&ocirc;le qualit&eacute;, &agrave; la restitution. Et ceci pour vous permettre d&rsquo;avoir le maximum d&rsquo;informations de saisies disponibles d&egrave;s l&rsquo;entr&eacute;e dans notre interface. Lorsqu&rsquo;un chantier passe au vert, les informations sont fiabilis&eacute;es (contr&ocirc;le/correction) et sont en attente de l&rsquo;approbation du service qualit&eacute;.</p>\r\n\r\n<p>A l&rsquo;issue de la requ&ecirc;te vous pouvez afficher la photo dans votre navigateur et pr&eacute;parer ainsi vos travaux.</p>\r\n\r\n<p>Pour permettre d&rsquo;afficher les photographies dans un autre environnement client/serveur le champ racine de l&rsquo;url est modifiable et permet d&rsquo;afficher le chemin d&rsquo;entr&eacute;e jusqu&rsquo;au r&eacute;pertoire o&ugrave; sont stock&eacute;s les photos.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#000080"><strong>-Annexe</strong></span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;<span style="color:#0000FF">-Contenu du fichier User.js</span></p>\r\n\r\n<p>Firefox comme n&rsquo;importe quel autre navigateur, consid&egrave;re &agrave; juste titre qu&#39;une adresse en http ne doit pas pouvoir appeler directement un fichier sur le syst&egrave;me de fichiers en r&eacute;seau de l&#39;utilisateur. Et cela pour des raisons de s&eacute;curit&eacute; r&eacute;seau &eacute;videntes.<br />\r\nPour autoriser le navigateur &agrave; activer des liens d&#39;un serveur vers des fichiers locaux (sur un disque r&eacute;seau partag&eacute; en entreprise par exemple) il faut cr&eacute;er une autorisation sp&eacute;cifique de s&eacute;curit&eacute;.&nbsp;</p>\r\n\r\n<p>Voici l&rsquo;int&eacute;gralit&eacute; du contenu du fichier user.js qui doit &ecirc;tre plac&eacute; dans le profil de l&rsquo;utilisateur de Firefox. Il contient l&rsquo;adresse IP du poste o&ugrave; sont enregistr&eacute;s les fichiers photographiques.</p>\r\n\r\n<p><span style="color:#0000FF">/* Objectif : afficher les photos AGO situ&eacute; sur un serveur 192.168.1.8 &agrave; partir d&#39;un autre poste du r&eacute;seau.<br />\r\n&nbsp;*/</span><br />\r\n<strong>user_pref(&quot;capability.policy.policynames&quot;,&quot;politiquelocale&quot;);<br />\r\nuser_pref(&quot;capability.policy.politiquelocale.sites&quot;,&quot;http://localhost ; <span style="color:#0000FF"><u>http://192.168.1.8</u></span>&quot;);<br />\r\nuser_pref(&quot;capability.policy.politiquelocale.checkloaduri.enabled&quot;,&quot;allAccess&quot;);</strong></p>\r\n\r\n<p><span style="color:#0000FF">-Proc&eacute;dure d&rsquo;installation du fichier User.js</span></p>\r\n\r\n<p>S&eacute;lectionner tout le Texte en gras ci-dessus (6 lignes)<br />\r\nOuvrir bloc note et coller<br />\r\nEnregistrer sous le nom de fichier <strong>user.js</strong> (ne pas oublier l&rsquo;extension dans le nom du fichier)<br />\r\nQuitte bloc note<br />\r\nS&eacute;lectionner le fichier <strong>user.js</strong> dans Windows et copier (sans l&rsquo;ouvrir)<br />\r\nOuvrir Firefox<br />\r\nMenu ?/Information de d&eacute;pannage dans la barre d&rsquo;outil<br />\r\nCliquer sur le bouton &laquo; Ouvrir le dossier correspondant &raquo;<br />\r\nEt coller <strong>user.js</strong><br />\r\nRelancer Firefox</p>\r\n\r\n<p>Maintenant Firefox a l&rsquo;autorisation d&rsquo;ouvrir un fichier en local de votre poste, pour un fichier stock&eacute; sur un serveur sp&eacute;cifique de votre r&eacute;seau, et &agrave; partir d&rsquo;une application distante web !</p>', '2016-05-18 17:40:00', 1, 0, NULL),
(48, 34, 24, 'Les_grands_principes', '<p><span style="color:#0000FF"><strong>Les grands principes de la saisie externalis&eacute;e</strong></span></p>\r\n\r\n<p><span style="color:#0000FF">-R&egrave;gle m&eacute;tier de base</span></p>\r\n\r\n<p>Principe<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Saisir &agrave; l&rsquo;identique, sans interpr&eacute;tation, ni modifications<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Saisir dans des outils sp&eacute;cifiques (Interface) et restituer selon les typologies du client</p>\r\n\r\n<p>Double saisie : seule proc&eacute;d&eacute; pour obtenir la qualit&eacute; sur la r&egrave;gle m&eacute;tier.</p>\r\n\r\n<p><span style="color:#0000FF">Les 3 &eacute;tapes de l&rsquo;externalisation</span><br />\r\nPour chaque affaire 2 services vont intervenir en &eacute;troite collaboration :<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Service de la relation client<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Service de production</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pour chaque affaire on &agrave; 3 &eacute;tapes identifi&eacute;es :</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;Etape 1 : La pr&eacute;paration<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Le transfert des &eacute;l&eacute;ments num&eacute;ris&eacute;s<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Pr&eacute;paration des &eacute;l&eacute;ments (table adresse, compteur historique,&hellip;)<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Renseigner le tableau suivi des commandes<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Importation des &eacute;l&eacute;ments<br />\r\nTransmettre les typologies aux &eacute;quipes de saisie</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;Etape 2 : La saisie<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Saisie &agrave; l&rsquo;identique<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Saisie structur&eacute;e</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;Etape 3 : La restitution<br />\r\nContr&ocirc;le qualit&eacute;, derni&egrave;res v&eacute;rifications<br />\r\nEdition des &eacute;tats de restitution<br />\r\nCalculs compl&eacute;mentaires<br />\r\nEnvoi des fichiers de restitution<br />\r\nRenseigner le tableau suivi des commandes<br />\r\nMise &agrave; jour Dossier client<br />\r\nBack up des BDD</p>\r\n\r\n<p><span style="color:#0000FF">Service de la relation client</span></p>\r\n\r\n<p><br />\r\n&nbsp;&nbsp; &nbsp;Objectifs Interne<br />\r\nPlanification des &eacute;quipes et anticipation de la sous-activit&eacute;&nbsp;<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Formation des &eacute;quipes aux outils et typologies</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;Objectifs externe<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Accompagnement client sur le process<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Respect des d&eacute;lais<br />\r\nMaintenance des interfaces web clients (suivi externalis&eacute;e)<br />\r\nEn suivant des mod&egrave;les de courrier par messagerie</p>\r\n\r\n<p><br />\r\nLes qualit&eacute;s : organisation, m&eacute;thodes, process !</p>\r\n\r\n<p><span style="color:#0000FF">Service de Production</span></p>\r\n\r\n<p>On a 2 types de saisie</p>\r\n\r\n<p>Saisie &agrave; l&rsquo;identique (exemple : proarchives,&hellip;.)<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Saisie de tout + champs d&rsquo;analyses + champs calculs<br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\nSaisie structur&eacute;e (exemple : cr&eacute;dit agricole,&hellip;)<br />\r\nS&eacute;lection et saisie partielle des informations + r&egrave;gles d&rsquo;&eacute;critures + restitution identifiant des informations sp&eacute;cifiques</p>\r\n\r\n<p>L&rsquo;ennemi de la saisie : 2 op&eacute;ratrices qui font la m&ecirc;me erreur. Lorsque la photo est contr&ocirc;l&eacute;e il existe un facteur important que le contr&ocirc;leur passe &agrave; c&ocirc;t&eacute; !</p>\r\n\r\n<p><br />\r\nA chaque type de saisie correspond une Typologie (l&rsquo;ensemble des r&egrave;gles)</p>\r\n\r\n<p><br />\r\nAnalyse des &eacute;tats de restitution. On peut classer en 5 types, les champs d&rsquo;informations qui font l&rsquo;objet d&rsquo;une restitution</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;Les champs automatiques restitu&eacute;s<br />\r\nPar importation (exemple : nom_du_fichier.jpg)<br />\r\nPar un automate en saisie (exemple : compteur d&rsquo;UA)</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;Les champs de saisies restitu&eacute;s<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Combin&eacute;s ensemble (exemple : description compl&egrave;te)<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Ind&eacute;pendant (exemple : Service)</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;Les champs d&rsquo;analyses restitu&eacute;s<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Syst&eacute;matiques et contr&ocirc;lables (exemple : date sup)<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Contr&ocirc;le de champ &agrave; la saisie<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Occasionnel et pas obligatoire (exemple : intitul&eacute;)<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;A = R&eacute;pond &agrave; une probl&eacute;matique dans un champ vide tandis que B = corrige une r&eacute;ponse dans un champ pr&eacute; renseign&eacute;</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;Les champs calculs restitu&eacute;s<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Directement dans l&rsquo;interface pour les chantiers r&eacute;currents (Proarchives : date destruction)<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Uniquement dans la restitution pour les traitements occasionnels (CPCAM : calcul 33 mois de conservation)</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;Les champs de correspondances<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Table externe &agrave; la saisie (exemple : table adresse)<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Table interne pour la restitution (exemple : code service pour AGO)</p>\r\n\r\n<p>La distinction entre Zone d&rsquo;en t&ecirc;te et Contenu d&eacute;taill&eacute;s</p>\r\n\r\n<p><br />\r\n<span style="color:#0000FF">Vocabulaire</span></p>\r\n\r\n<p>Interface : outil param&eacute;tr&eacute;e pour g&eacute;rer une typologie</p>\r\n\r\n<p>Typologie : ensemble de r&egrave;gles de saisies ou de restitutions valable pour un client ou un chantier</p>\r\n\r\n<p>Conteneur (ou zone d&rsquo;en-t&ecirc;te) : zone d&rsquo;informations commune &agrave; plusieurs UA&nbsp;</p>\r\n\r\n<p>UA : Unit&eacute; d&rsquo;archives ou enregistrement ou plus petit &eacute;l&eacute;ment de la BDD. Le plus souvent une boite d&rsquo;archives ou une copropri&eacute;t&eacute; &hellip;</p>', '2016-05-18 17:52:00', 1, 0, NULL),
(48, 35, 25, 'Aide à l''animation proweb', '<p><strong>Aide &agrave; l&rsquo;animation</strong>&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p><u>Finalit&eacute; et objectifs</u>&nbsp;&nbsp;</p>\r\n\r\n<p>Le travail d&rsquo;une animatrice consiste &agrave; animer les utilisateurs ! &nbsp;</p>\r\n\r\n<p>Ca ne consiste pas simplement &agrave; r&eacute;pondre &agrave; des messages le plus vite possible sans se pr&eacute;occuper de ce qu&rsquo;on raconte. &nbsp;Une animatrice a pour but de cr&eacute;er un dialogue avec chaque utilisateur, en lui r&eacute;pondant rapidement&nbsp;<strong>ET</strong>&nbsp;en lui r&eacute;pondant de fa&ccedil;on int&eacute;ressante, afin qu&rsquo;il ait envie : &nbsp;</p>\r\n\r\n<p>1)&nbsp;&nbsp; &nbsp;de continuer la conversation en envoyant de nouveaux messages</p>\r\n\r\n<p>2)&nbsp;&nbsp; &nbsp;de revenir le lendemain et les jours suivants</p>\r\n\r\n<p>3)&nbsp;&nbsp; &nbsp;d&rsquo;approfondir sa connaissance de son interlocutrice (photos, vid&eacute;os, autres)</p>\r\n\r\n<p>4)&nbsp;&nbsp; &nbsp;de prendre contact avec d&rsquo;autres interlocutrices aussi charmantes que la premi&egrave;re &nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;********************</p>\r\n\r\n<p>&nbsp; Contenu et qualit&eacute; &nbsp; Il y a 3 points essentiels pour d&eacute;finir une bonne animation :</p>\r\n\r\n<p>&nbsp;&bull;&nbsp;&nbsp; &nbsp;Rapidit&eacute; (limiter l&rsquo;attente)</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Qualit&eacute; (produire des messages int&eacute;ressants)</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Fid&eacute;lisation (faire en sorte que l&rsquo;utilisateur ait envie de rester et de revenir, donc de renouveller son abbo.) &nbsp;</p>\r\n\r\n<p>&nbsp;<strong>La rapidit&eacute;&nbsp;</strong>: l&rsquo;utilisateur ne doit pas attendre ind&eacute;finiment la r&eacute;ponse &agrave; son dernier message. &nbsp;</p>\r\n\r\n<p>Apprenez &agrave; d&eacute;chiffrer rapidement chaque message re&ccedil;u, au besoin en vous familiarisant avec le style d&rsquo;&eacute;criture &laquo; sms &raquo; et &agrave; rep&eacute;rer les mots-cl&eacute;s dans un message afin de comprendre le plus vite possible le sens de ce que l&rsquo;utilisateur a &eacute;crit. &nbsp;</p>\r\n\r\n<p>Apprenez &agrave; identifier rapidement le type de dialogue que cherche l&rsquo;utilisateur (sympa, sexy soft, sexy hard, SM, etc.) pour fournir une r&eacute;ponse adapt&eacute;e sans avoir &agrave; r&eacute;fl&eacute;chir longuement.</p>\r\n\r\n<p>&nbsp;Adaptez la longueur de vos messages : si la file d&rsquo;attente est mod&eacute;r&eacute;e, vous pouvez prendre un peu plus de temps et soigner le contenu. Si la file est longue, r&eacute;duisez la longueur des messages et utilisez davantage l&rsquo;&eacute;criture sms pour gagner du temps&nbsp;<strong>MAIS</strong>&nbsp;m&ecirc;me dans ce cas, le message devra comporter suffisamment de mots et de contenu pour &ecirc;tre int&eacute;ressant. Un utilisateur qui a attendu 10 minutes pour recevoir &laquo; ok bb &raquo; est un utilisateur d&eacute;&ccedil;u et un client perdu ! &nbsp;</p>\r\n\r\n<p>Exercez-vous r&eacute;guli&egrave;rement &agrave; la frappe rapide en essayant d&rsquo;&eacute;viter les fautes de frappe. &nbsp;</p>\r\n\r\n<p><strong>En r&eacute;sum&eacute;</strong>&nbsp;: la rapidit&eacute; est tr&egrave;s importante. Lire rapidement, r&eacute;fl&eacute;chir rapidement, taper rapidement. Une animatrice trop lente n&rsquo;est pas une bonne animatrice. Mais une animatrice qui r&eacute;pond &agrave; la vitesse de la lumi&egrave;re en &eacute;crivant n&rsquo;importe quoi n&rsquo;est pas non plus une bonne animatrice. Rapidit&eacute;, pas &laquo; pr&eacute;cipitation &raquo;. &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;************************ &nbsp;</p>\r\n\r\n<p><strong>La qualit&eacute; :</strong>&nbsp;c&rsquo;est ce qui diff&eacute;rencie le travail d&rsquo;animation d&rsquo;une simple conversation entre deux individus. &laquo; tkt po bb &raquo; est un message acceptable de la part d&rsquo;un utilisateur, mais pas de la part d&rsquo;une animatrice ! &nbsp;<u>Votre travail consiste &agrave; rendre la conversation int&eacute;ressante pour l&rsquo;utilisateur et le pousser &agrave; continuer les &eacute;changes, au moment pr&eacute;sent et &agrave; l&rsquo;avenir</u>. &nbsp;</p>\r\n\r\n<p>Identifiez le style de dialogue que cherche l&rsquo;utilisateur. Chacun a une recherche, des envies, des d&eacute;sirs diff&eacute;rents. Vous devez comprendre rapidement ce que cherche l&rsquo;utilisateur, et entrer dans son univers. &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;le sympa (conversation courante peu ou pas sexuelle)</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;le coquin (conversation sensuelle sexy mais sans &ecirc;tre trop crue)</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;le X (conversation sexuelle hard)</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;le SM (dominateur qui donne des ordres et cherche une F soumise)</p>\r\n\r\n<p>&nbsp;Il peut y avoir d&rsquo;autres types mais la majorit&eacute; des utilisateurs sont dans une de ces cat&eacute;gories.</p>\r\n\r\n<p>Vous devez donc adapter votre langage et le contenu au style de l&rsquo;utilisateur et lui donner ainsi l&rsquo;impression que vous &ecirc;tes celle qu&rsquo;il cherche, afin qu&rsquo;il poursuive l&rsquo;&eacute;change : &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Avec un &laquo; sympa &raquo;, on ne se lance pas dans une description physique intime ou un sc&eacute;nario d&rsquo;acte sexuel, surtout s&rsquo;il ne le fait pas lui-m&ecirc;me. On utilise l&rsquo;humour, la gentillesse, on peut parler musique, cin&eacute;ma, etc.&nbsp;<u>Il cherche sans doute une petite amie, il doit avoir l&rsquo;impression qu&rsquo;il a trouv&eacute; une bonne candidate.</u></p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;Avec un &laquo; coquin &raquo;, soyez coquine. Il faut avoir l&rsquo;air un tout petit peu timide au d&eacute;but, mais en lui faisant comprendre qu&rsquo;il peut aller plus loin dans le sexy. Si vous &ecirc;tes seulement sympa, il va s&rsquo;ennuyer, et si vous &ecirc;tes sexuelle trop rapidement, il va avoir peur et se dire que vous &ecirc;tes trop chaude pour lui. Titillez-le, sugg&eacute;rez, faites des allusions sexuelles pas trop ouvertes, juste assez pour qu&rsquo;il soit excit&eacute; et qu&rsquo;il ait envie de vous emmener plus loin.&nbsp;<u>Le &laquo; coquin &raquo; aime avoir l&rsquo;impression que c&rsquo;est lui qui vous d&eacute;vergonde, laissez-le guider le dialogue mais en participant.</u></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Avec un hardcore, soyez hardcore. Il veut lire des mots tr&egrave;s crus, des descriptions d&eacute;taill&eacute;s du corps et des gestes, il faut lui donner ce qu&rsquo;il attend. Votre travail dans ce cas consiste &agrave; faire durer l&rsquo;&eacute;change en entra&icirc;nant l&rsquo;utilisateur vers un sc&eacute;nario hot, une sc&egrave;ne de film X. L&rsquo;utilisateur hard aime penser que la fille en face de lui est aussi hard que lui,&nbsp;<u>donc prenez les commandes du dialogue</u>, ajoutez sans cesse des d&eacute;tails, des nouvelles positions, demandez-lui qu&rsquo;il vous fasse telle ou telle chose, faites-lui aussi des choses qu&rsquo;il n&rsquo;avait pas demand&eacute;es, etc. Un utilisateur dans ce type de dialogue est souvent en train de se masturber, si vous le laissez diriger le dialogue, il risque fortement de finir trop vite et de cesser l&rsquo;&eacute;change.&nbsp;<u>A vous de garder les choses en main&hellip;</u>&nbsp;&nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Avec un user de type &laquo; dominateur &raquo;, il est important de jouer le r&ocirc;le qu&rsquo;il attend. La relation qu&rsquo;il cherche est tr&egrave;s sc&eacute;naris&eacute;e. Si vous refusez votre r&ocirc;le (&laquo; moi j&rsquo;m pas k&rsquo;on me donne des ordres &raquo;), si vous lui donnez du &laquo; mon amour, mon bb, mon tr&eacute;sor &raquo;, si vous essayez de changer son fantasme (&laquo;stp sois gentil ac mwa &raquo;), le dialogue s&rsquo;arr&ecirc;tera l&agrave;.&nbsp;<u>Utilisez les mots-cl&eacute;s qui l&rsquo;excitent et qui le confortent dans son r&ocirc;le</u>. Appelez-le &laquo; Ma&icirc;tre &raquo;, dites-lui que vous &ecirc;tes &laquo; sa petite chienne soumise, son esclave, ki attend ses ordres &raquo; etc. Soyez excit&eacute;e mais effray&eacute;e, ayez l&rsquo;air d&rsquo;h&eacute;siter &agrave; faire telle ou telle chose, &ccedil;a l&rsquo;excitera encore plus et il insistera pour continuer.&nbsp;<u>L&agrave; aussi, laissez-le mener le dialogue en apparence, et stoppez-le r&eacute;guli&egrave;rement avec des &laquo; j&rsquo;ose pas, ma&icirc;tre, g 1 peu peur &raquo; pour relancer l&rsquo;int&eacute;r&ecirc;t</u>. &nbsp;</p>\r\n\r\n<p>Ce qu&rsquo;on doit &eacute;viter le plus possible : &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;R&eacute;pondre &agrave; l&rsquo;utilisateur dans un autre style que le sien</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Critiquer ses fantasmes et/ou insister pour qu&rsquo;il change</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Refuser de jouer le r&ocirc;le qu&rsquo;il vous demande &nbsp;</p>\r\n\r\n<p><strong>En r&eacute;sum&eacute; :</strong>&nbsp;on identifie le style de dialogue recherch&eacute; et on s&rsquo;adapte, avec le vocabulaire et avec le contenu. Le reste d&eacute;pend de votre imagination&hellip; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; *********************** &nbsp;</p>\r\n\r\n<p><strong>La fid&eacute;lisation :</strong>&nbsp;gardez &agrave; l&rsquo;esprit que votre travail n&rsquo;a pas que des implications sur le moment,&nbsp;<u>il en a aussi sur les jours suivants</u>.</p>\r\n\r\n<p>&nbsp;Nous avons vu que la rapidit&eacute; et la qualit&eacute; sont les cl&eacute;s d&rsquo;une bonne animation ; elles sont aussi le moyen de fid&eacute;liser un utilisateur. &nbsp;Un user qui est mal anim&eacute;, qui attend bien trop longtemps, ou qui re&ccedil;oit des messages sans int&eacute;r&ecirc;t, non seulement va s&rsquo;en aller, ce qui n&rsquo;est pas bien, mais risque fort de ne plus revenir en se disant que le produit est &laquo; bidon &raquo; ou que les filles qui sont en ligne sont stupides. Et &ccedil;a c&rsquo;est encore plus mauvais ! &nbsp;Ce que fait chaque animatrice a donc des cons&eacute;quences, bonnes ou mauvaises, non seulement sur son propre travail, mais aussi sur l&rsquo;ensemble du plateau et de ses coll&egrave;gues.</p>\r\n\r\n<p><u>&nbsp;Ce qu&rsquo;on ne doit pas faire&nbsp;</u>: &nbsp;</p>\r\n\r\n<p>Insulter, vexer, repousser un utilisateur (sauf demandes ill&eacute;gales, bien s&ucirc;r). &nbsp;Laisser un utilisateur mettre en doute la qualit&eacute; du produit ou sa cr&eacute;dibilit&eacute; (&laquo; c pourri ici ya ke des animatrices &raquo;) sans r&eacute;agir et sans essayer de le faire changer d&rsquo;avis. &nbsp;Donner des rendez-vous bidons, &laquo; poser des lapins &raquo;, encourager l&rsquo;utilisateur &agrave; demander une vraie rencontre ou le laisser croire de fa&ccedil;on certaine qu&rsquo;il y en aura une &agrave; une heure pr&eacute;cise dans un lieu pr&eacute;cis, etc.&nbsp;<u>En faisant cela, vous nuisez &agrave; votre propre travail mais aussi &agrave; la cr&eacute;dibilit&eacute; des autres animatrices et du produit dans son ensemble.</u>&nbsp;&nbsp;</p>\r\n\r\n<p>Dire &agrave; un utilisateur qui &laquo; reconna&icirc;t &raquo; votre pseudo &laquo; ah non jme souviens pas de toi &raquo; &nbsp;</p>\r\n\r\n<p>Vous trouverez dans les pages qui suivent de nombreux exemples &laquo; en situation &raquo; qui vous aideront &agrave; r&eacute;agir de la fa&ccedil;on appropri&eacute;e et &agrave; envoyer les bonnes r&eacute;ponses. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<u><strong>&nbsp;Illustrations</strong></u>&nbsp;&nbsp;</p>\r\n\r\n<p><u>&nbsp;Rep&eacute;rer le mot-cl&eacute; dans le message et le reprendre dans la r&eacute;ponse :</u></p>\r\n\r\n<p>&nbsp;Utilisateur : T&rsquo;m le cin&eacute;ma ?</p>\r\n\r\n<p>Bon : wai j&rsquo;adore aller au cin&eacute; mais g jamais le tps, et toi ? Mauvais : wai c kool &nbsp; Utilisateur : t&rsquo;m bien la bouffe chinoise ? Bon : ah wai cler la cuisine asiate c trop bon t&rsquo;m pas twa ?</p>\r\n\r\n<p><span style="color:rgb(255, 0, 0)"><strong>Mauvais : oui jadore &ccedil;a &nbsp;</strong></span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;************</p>\r\n\r\n<p>&nbsp;<u>Elargir &ndash; enrichir la discussion :</u></p>\r\n\r\n<p>&nbsp;Utilisateur : c koi tes loisirs ?</p>\r\n\r\n<p>Bon : moi mon truc c la musique, danser chanter tout &ccedil;a et toi t&rsquo;m &ccedil;a, tu danses ?</p>\r\n\r\n<p><strong><span style="color:rgb(255, 0, 0)">Mauvais : un tas d trucs &ccedil;a depend&nbsp;</span>&nbsp;</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; *********** &nbsp;</p>\r\n\r\n<p><u>Relancer le dialogue par une question le plus souvent possible :&nbsp;</u>&nbsp;</p>\r\n\r\n<p>Utilisateur : t&rsquo;aime les animos ?</p>\r\n\r\n<p>Bon : ah oui, surtout les chiens jen ai 2 c mes ch&eacute;ris t&rsquo;as un chien toi ?</p>\r\n\r\n<p><strong><span style="color:rgb(255, 0, 0)">Mauvais : wai je kiffe les chiens &nbsp;</span></strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;*********** &nbsp;</p>\r\n\r\n<p><u>Sugg&eacute;rer qu&rsquo;on est disponible pour aller plus loin&nbsp;</u>:</p>\r\n\r\n<p>&nbsp;Utilisateur : t&rsquo;es celib toi ?</p>\r\n\r\n<p>Bon : malheureusement oui, depuis un moment m&eacute; jcompte pas le rester&hellip; et twa ?</p>\r\n\r\n<p><span style="color:rgb(255, 0, 0)"><strong>Mauvais : wai c cool d etre seule &nbsp;</strong></span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ************ &nbsp; &nbsp;</p>\r\n\r\n<p><u>D&eacute;samorcer l&rsquo;agressivit&eacute; ou les soup&ccedil;ons :&nbsp;</u>&nbsp;</p>\r\n\r\n<p>Utilisateur : tu t fous de ma gueule t&eacute; k&rsquo;une pute</p>\r\n\r\n<p>Bon : m&eacute; pk tu dis &ccedil;a ? j&rsquo;ai du mal &agrave; comprendre pourquoi t&rsquo;es fach&eacute; contre moi, tu veux bien me dire ce que j&rsquo;ai fait de mal ?</p>\r\n\r\n<p><span style="color:rgb(255, 0, 0)"><strong>Mauvais : et toi t k&rsquo;un sal con &nbsp;Utilisateur : t&eacute; bidon com toute les autres ici</strong></span></p>\r\n\r\n<p>Bon : c pas sympa d dire &ccedil;a on vient juste de se conna&icirc;tre kess g fait ?</p>\r\n\r\n<p><strong><span style="color:rgb(255, 0, 0)">Mauvais : non on est pas bidon &nbsp; &nbsp;</span></strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;********** &nbsp;</p>\r\n\r\n<p><u>D&eacute;tourner les demandes de rdv, ne pas les encourager, ne pas promettre :</u></p>\r\n\r\n<p>&nbsp;Utilisateur : ok pr ce soir 19h devant la gare ?</p>\r\n\r\n<p>Bon : tu m plais mais c un peu trop tot dis men plus sur toi ?</p>\r\n\r\n<p>Bon : jpeu pas trop le soir jprefere le wkend c plus cool non ?</p>\r\n\r\n<p>Bon : tu penses &agrave; koi, resto, boite, juste un verre ?</p>\r\n\r\n<p>Bon : ca me tente mais ce soir pas possible, ct koi l&rsquo;id&eacute;e ?</p>\r\n\r\n<p>Bon : pas tro cool comme endroit pr un 1er rdv tas une autre id&eacute;e ?</p>\r\n\r\n<p>Bon : ca dpend de ce ke tu veux faire apres, donne moi envie ?</p>\r\n\r\n<p>Bon : je sais pa trop, j&rsquo;ai un peu peur , on essaie de se conna&icirc;tre mieux dabord ?</p>\r\n\r\n<p>Bon : comment tu imagines ke ca va se passer notre rencontre ?</p>\r\n\r\n<p>Bon : ben je pensais plutot &agrave; un truc romantik moi, la gare bofff &nbsp;Mauvais : ok pr 19h Mauvais : daccord et on va ou apr&egrave;s ?</p>\r\n\r\n<p><strong><span style="color:rgb(255, 0, 0)">Mauvais : non jve pas</span></strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ***********</p>\r\n\r\n<p><u>&nbsp;D&eacute;tourner les demandes de num&eacute;ro de mobile :&nbsp;</u>&nbsp;</p>\r\n\r\n<p>Utilisateur : donne ton tel jappel now Bon : euh c un peu rapide on se connait &agrave; peine faut que tu me rassures un peu ?</p>\r\n\r\n<p>Bon : le prefere pas trop maintenant mais plus tard si on est ok ts les 2</p>\r\n\r\n<p>Bon : je peux pas trop l&agrave; j&rsquo;ai plein de trucs a faire faudrat se mettre daccord sur une heure.</p>\r\n\r\n<p>Bon : j&rsquo;aime pas trop laisser mon tel donne le tien c plus kool pr moi. &nbsp;</p>\r\n\r\n<p><strong><span style="color:rgb(255, 0, 0)">Mauvais : ok tiens (+ num&eacute;ro bidon) &nbsp;</span></strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;********** &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;<u>&nbsp;Rattraper ses erreurs :</u></p>\r\n\r\n<p>&nbsp;Utilisateur : hier t blonde et maintenan t brune ??</p>\r\n\r\n<p>Bon : j&rsquo;ai dit quee j&rsquo;&eacute;tais blonde, pas ke ct ma vraie couleur lol tu veux tt savoir ?</p>\r\n\r\n<p>Bon : ca d&eacute;pend ou tu regardes bb suis pas blonde partout tu veux voir ?</p>\r\n\r\n<p><span style="color:rgb(255, 0, 0)"><strong>Mauvais : portnawak t as hallucin&eacute; toi &nbsp;</strong></span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ************</p>\r\n\r\n<p>&nbsp; Les possibilit&eacute;s ne se limitent pas aux exemples &eacute;tudi&eacute;s. Si vous n&rsquo;&ecirc;tes pas certaine de ce qu&rsquo;il convient de r&eacute;pondre, n&rsquo;h&eacute;sitez pas &agrave; prendre quelques instants pour poser la question &agrave; une superviseuse. Mieux vaut perdre une minute qu&rsquo;un utilisateur, et vous saurez quoi faire lorsque ce cas se pr&eacute;sentera &agrave; nouveau la fois suivante. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>&nbsp;Annexe &nbsp; &nbsp; &nbsp;</strong>&nbsp;&nbsp; &nbsp; &nbsp;&nbsp;</p>', '2016-05-20 12:35:00', 1, 0, NULL);
INSERT INTO `version` (`ver_creator`, `ver_article`, `Id`, `ver_titre`, `ver_content`, `ver_date`, `ver_editable`, `ver_del`, `attachement`) VALUES
(48, 36, 26, 'Animation Proweb', '<p><strong>Aide &agrave; l&rsquo;animation</strong>&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p><u>Finalit&eacute; et objectifs</u>&nbsp;&nbsp;</p>\r\n\r\n<p>Le travail d&rsquo;une animatrice consiste &agrave; animer les utilisateurs ! &nbsp;</p>\r\n\r\n<p>Ca ne consiste pas simplement &agrave; r&eacute;pondre &agrave; des messages le plus vite possible sans se pr&eacute;occuper de ce qu&rsquo;on raconte. &nbsp;Une animatrice a pour but de cr&eacute;er un dialogue avec chaque utilisateur, en lui r&eacute;pondant rapidement&nbsp;<strong>ET</strong>&nbsp;en lui r&eacute;pondant de fa&ccedil;on int&eacute;ressante, afin qu&rsquo;il ait envie : &nbsp;</p>\r\n\r\n<p>1)&nbsp;&nbsp; &nbsp;de continuer la conversation en envoyant de nouveaux messages</p>\r\n\r\n<p>2)&nbsp;&nbsp; &nbsp;de revenir le lendemain et les jours suivants</p>\r\n\r\n<p>3)&nbsp;&nbsp; &nbsp;d&rsquo;approfondir sa connaissance de son interlocutrice (photos, vid&eacute;os, autres)</p>\r\n\r\n<p>4)&nbsp;&nbsp; &nbsp;de prendre contact avec d&rsquo;autres interlocutrices aussi charmantes que la premi&egrave;re &nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;********************</p>\r\n\r\n<p>&nbsp; Contenu et qualit&eacute; &nbsp; Il y a 3 points essentiels pour d&eacute;finir une bonne animation :</p>\r\n\r\n<p>&nbsp;&bull;&nbsp;&nbsp; &nbsp;Rapidit&eacute; (limiter l&rsquo;attente)</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Qualit&eacute; (produire des messages int&eacute;ressants)</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Fid&eacute;lisation (faire en sorte que l&rsquo;utilisateur ait envie de rester et de revenir, donc de renouveller son abbo.) &nbsp;</p>\r\n\r\n<p>&nbsp;<strong>La rapidit&eacute;&nbsp;</strong>: l&rsquo;utilisateur ne doit pas attendre ind&eacute;finiment la r&eacute;ponse &agrave; son dernier message. &nbsp;</p>\r\n\r\n<p>Apprenez &agrave; d&eacute;chiffrer rapidement chaque message re&ccedil;u, au besoin en vous familiarisant avec le style d&rsquo;&eacute;criture &laquo; sms &raquo; et &agrave; rep&eacute;rer les mots-cl&eacute;s dans un message afin de comprendre le plus vite possible le sens de ce que l&rsquo;utilisateur a &eacute;crit. &nbsp;</p>\r\n\r\n<p>Apprenez &agrave; identifier rapidement le type de dialogue que cherche l&rsquo;utilisateur (sympa, sexy soft, sexy hard, SM, etc.) pour fournir une r&eacute;ponse adapt&eacute;e sans avoir &agrave; r&eacute;fl&eacute;chir longuement.</p>\r\n\r\n<p>&nbsp;Adaptez la longueur de vos messages : si la file d&rsquo;attente est mod&eacute;r&eacute;e, vous pouvez prendre un peu plus de temps et soigner le contenu. Si la file est longue, r&eacute;duisez la longueur des messages et utilisez davantage l&rsquo;&eacute;criture sms pour gagner du temps&nbsp;<strong>MAIS</strong>&nbsp;m&ecirc;me dans ce cas, le message devra comporter suffisamment de mots et de contenu pour &ecirc;tre int&eacute;ressant. Un utilisateur qui a attendu 10 minutes pour recevoir &laquo; ok bb &raquo; est un utilisateur d&eacute;&ccedil;u et un client perdu ! &nbsp;</p>\r\n\r\n<p>Exercez-vous r&eacute;guli&egrave;rement &agrave; la frappe rapide en essayant d&rsquo;&eacute;viter les fautes de frappe. &nbsp;</p>\r\n\r\n<p><strong>En r&eacute;sum&eacute;</strong>&nbsp;: la rapidit&eacute; est tr&egrave;s importante. Lire rapidement, r&eacute;fl&eacute;chir rapidement, taper rapidement. Une animatrice trop lente n&rsquo;est pas une bonne animatrice. Mais une animatrice qui r&eacute;pond &agrave; la vitesse de la lumi&egrave;re en &eacute;crivant n&rsquo;importe quoi n&rsquo;est pas non plus une bonne animatrice. Rapidit&eacute;, pas &laquo; pr&eacute;cipitation &raquo;. &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;************************ &nbsp;</p>\r\n\r\n<p><strong>La qualit&eacute; :</strong>&nbsp;c&rsquo;est ce qui diff&eacute;rencie le travail d&rsquo;animation d&rsquo;une simple conversation entre deux individus. &laquo; tkt po bb &raquo; est un message acceptable de la part d&rsquo;un utilisateur, mais pas de la part d&rsquo;une animatrice ! &nbsp;<u>Votre travail consiste &agrave; rendre la conversation int&eacute;ressante pour l&rsquo;utilisateur et le pousser &agrave; continuer les &eacute;changes, au moment pr&eacute;sent et &agrave; l&rsquo;avenir</u>. &nbsp;</p>\r\n\r\n<p>Identifiez le style de dialogue que cherche l&rsquo;utilisateur. Chacun a une recherche, des envies, des d&eacute;sirs diff&eacute;rents. Vous devez comprendre rapidement ce que cherche l&rsquo;utilisateur, et entrer dans son univers. &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;le sympa (conversation courante peu ou pas sexuelle)</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;le coquin (conversation sensuelle sexy mais sans &ecirc;tre trop crue)</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;le X (conversation sexuelle hard)</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;le SM (dominateur qui donne des ordres et cherche une F soumise)</p>\r\n\r\n<p>&nbsp;Il peut y avoir d&rsquo;autres types mais la majorit&eacute; des utilisateurs sont dans une de ces cat&eacute;gories.</p>\r\n\r\n<p>Vous devez donc adapter votre langage et le contenu au style de l&rsquo;utilisateur et lui donner ainsi l&rsquo;impression que vous &ecirc;tes celle qu&rsquo;il cherche, afin qu&rsquo;il poursuive l&rsquo;&eacute;change : &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Avec un &laquo; sympa &raquo;, on ne se lance pas dans une description physique intime ou un sc&eacute;nario d&rsquo;acte sexuel, surtout s&rsquo;il ne le fait pas lui-m&ecirc;me. On utilise l&rsquo;humour, la gentillesse, on peut parler musique, cin&eacute;ma, etc.&nbsp;<u>Il cherche sans doute une petite amie, il doit avoir l&rsquo;impression qu&rsquo;il a trouv&eacute; une bonne candidate.</u></p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;Avec un &laquo; coquin &raquo;, soyez coquine. Il faut avoir l&rsquo;air un tout petit peu timide au d&eacute;but, mais en lui faisant comprendre qu&rsquo;il peut aller plus loin dans le sexy. Si vous &ecirc;tes seulement sympa, il va s&rsquo;ennuyer, et si vous &ecirc;tes sexuelle trop rapidement, il va avoir peur et se dire que vous &ecirc;tes trop chaude pour lui. Titillez-le, sugg&eacute;rez, faites des allusions sexuelles pas trop ouvertes, juste assez pour qu&rsquo;il soit excit&eacute; et qu&rsquo;il ait envie de vous emmener plus loin.&nbsp;<u>Le &laquo; coquin &raquo; aime avoir l&rsquo;impression que c&rsquo;est lui qui vous d&eacute;vergonde, laissez-le guider le dialogue mais en participant.</u></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Avec un hardcore, soyez hardcore. Il veut lire des mots tr&egrave;s crus, des descriptions d&eacute;taill&eacute;s du corps et des gestes, il faut lui donner ce qu&rsquo;il attend. Votre travail dans ce cas consiste &agrave; faire durer l&rsquo;&eacute;change en entra&icirc;nant l&rsquo;utilisateur vers un sc&eacute;nario hot, une sc&egrave;ne de film X. L&rsquo;utilisateur hard aime penser que la fille en face de lui est aussi hard que lui,&nbsp;<u>donc prenez les commandes du dialogue</u>, ajoutez sans cesse des d&eacute;tails, des nouvelles positions, demandez-lui qu&rsquo;il vous fasse telle ou telle chose, faites-lui aussi des choses qu&rsquo;il n&rsquo;avait pas demand&eacute;es, etc. Un utilisateur dans ce type de dialogue est souvent en train de se masturber, si vous le laissez diriger le dialogue, il risque fortement de finir trop vite et de cesser l&rsquo;&eacute;change.&nbsp;<u>A vous de garder les choses en main&hellip;</u>&nbsp;&nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Avec un user de type &laquo; dominateur &raquo;, il est important de jouer le r&ocirc;le qu&rsquo;il attend. La relation qu&rsquo;il cherche est tr&egrave;s sc&eacute;naris&eacute;e. Si vous refusez votre r&ocirc;le (&laquo; moi j&rsquo;m pas k&rsquo;on me donne des ordres &raquo;), si vous lui donnez du &laquo; mon amour, mon bb, mon tr&eacute;sor &raquo;, si vous essayez de changer son fantasme (&laquo;stp sois gentil ac mwa &raquo;), le dialogue s&rsquo;arr&ecirc;tera l&agrave;.&nbsp;<u>Utilisez les mots-cl&eacute;s qui l&rsquo;excitent et qui le confortent dans son r&ocirc;le</u>. Appelez-le &laquo; Ma&icirc;tre &raquo;, dites-lui que vous &ecirc;tes &laquo; sa petite chienne soumise, son esclave, ki attend ses ordres &raquo; etc. Soyez excit&eacute;e mais effray&eacute;e, ayez l&rsquo;air d&rsquo;h&eacute;siter &agrave; faire telle ou telle chose, &ccedil;a l&rsquo;excitera encore plus et il insistera pour continuer.&nbsp;<u>L&agrave; aussi, laissez-le mener le dialogue en apparence, et stoppez-le r&eacute;guli&egrave;rement avec des &laquo; j&rsquo;ose pas, ma&icirc;tre, g 1 peu peur &raquo; pour relancer l&rsquo;int&eacute;r&ecirc;t</u>. &nbsp;</p>\r\n\r\n<p>Ce qu&rsquo;on doit &eacute;viter le plus possible : &nbsp;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;R&eacute;pondre &agrave; l&rsquo;utilisateur dans un autre style que le sien</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Critiquer ses fantasmes et/ou insister pour qu&rsquo;il change</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Refuser de jouer le r&ocirc;le qu&rsquo;il vous demande &nbsp;</p>\r\n\r\n<p><strong>En r&eacute;sum&eacute; :</strong>&nbsp;on identifie le style de dialogue recherch&eacute; et on s&rsquo;adapte, avec le vocabulaire et avec le contenu. Le reste d&eacute;pend de votre imagination&hellip; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; *********************** &nbsp;</p>\r\n\r\n<p><strong>La fid&eacute;lisation :</strong>&nbsp;gardez &agrave; l&rsquo;esprit que votre travail n&rsquo;a pas que des implications sur le moment,&nbsp;<u>il en a aussi sur les jours suivants</u>.</p>\r\n\r\n<p>&nbsp;Nous avons vu que la rapidit&eacute; et la qualit&eacute; sont les cl&eacute;s d&rsquo;une bonne animation ; elles sont aussi le moyen de fid&eacute;liser un utilisateur. &nbsp;Un user qui est mal anim&eacute;, qui attend bien trop longtemps, ou qui re&ccedil;oit des messages sans int&eacute;r&ecirc;t, non seulement va s&rsquo;en aller, ce qui n&rsquo;est pas bien, mais risque fort de ne plus revenir en se disant que le produit est &laquo; bidon &raquo; ou que les filles qui sont en ligne sont stupides. Et &ccedil;a c&rsquo;est encore plus mauvais ! &nbsp;Ce que fait chaque animatrice a donc des cons&eacute;quences, bonnes ou mauvaises, non seulement sur son propre travail, mais aussi sur l&rsquo;ensemble du plateau et de ses coll&egrave;gues.</p>\r\n\r\n<p><u>&nbsp;Ce qu&rsquo;on ne doit pas faire&nbsp;</u>: &nbsp;</p>\r\n\r\n<p>Insulter, vexer, repousser un utilisateur (sauf demandes ill&eacute;gales, bien s&ucirc;r). &nbsp;Laisser un utilisateur mettre en doute la qualit&eacute; du produit ou sa cr&eacute;dibilit&eacute; (&laquo; c pourri ici ya ke des animatrices &raquo;) sans r&eacute;agir et sans essayer de le faire changer d&rsquo;avis. &nbsp;Donner des rendez-vous bidons, &laquo; poser des lapins &raquo;, encourager l&rsquo;utilisateur &agrave; demander une vraie rencontre ou le laisser croire de fa&ccedil;on certaine qu&rsquo;il y en aura une &agrave; une heure pr&eacute;cise dans un lieu pr&eacute;cis, etc.&nbsp;<u>En faisant cela, vous nuisez &agrave; votre propre travail mais aussi &agrave; la cr&eacute;dibilit&eacute; des autres animatrices et du produit dans son ensemble.</u>&nbsp;&nbsp;</p>\r\n\r\n<p>Dire &agrave; un utilisateur qui &laquo; reconna&icirc;t &raquo; votre pseudo &laquo; ah non jme souviens pas de toi &raquo; &nbsp;</p>\r\n\r\n<p>Vous trouverez dans les pages qui suivent de nombreux exemples &laquo; en situation &raquo; qui vous aideront &agrave; r&eacute;agir de la fa&ccedil;on appropri&eacute;e et &agrave; envoyer les bonnes r&eacute;ponses. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<u><strong>&nbsp;Illustrations</strong></u>&nbsp;&nbsp;</p>\r\n\r\n<p><u>&nbsp;Rep&eacute;rer le mot-cl&eacute; dans le message et le reprendre dans la r&eacute;ponse :</u></p>\r\n\r\n<p>&nbsp;Utilisateur : T&rsquo;m le cin&eacute;ma ?</p>\r\n\r\n<p>Bon : wai j&rsquo;adore aller au cin&eacute; mais g jamais le tps, et toi ? Mauvais : wai c kool &nbsp; Utilisateur : t&rsquo;m bien la bouffe chinoise ? Bon : ah wai cler la cuisine asiate c trop bon t&rsquo;m pas twa ?</p>\r\n\r\n<p><span style="color:rgb(255, 0, 0)"><strong>Mauvais : oui jadore &ccedil;a &nbsp;</strong></span>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;************</p>\r\n\r\n<p>&nbsp;<u>Elargir &ndash; enrichir la discussion :</u></p>\r\n\r\n<p>&nbsp;Utilisateur : c koi tes loisirs ?</p>\r\n\r\n<p>Bon : moi mon truc c la musique, danser chanter tout &ccedil;a et toi t&rsquo;m &ccedil;a, tu danses ?</p>\r\n\r\n<p><strong><span style="color:rgb(255, 0, 0)">Mauvais : un tas d trucs &ccedil;a depend&nbsp;</span>&nbsp;</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; *********** &nbsp;</p>\r\n\r\n<p><u>Relancer le dialogue par une question le plus souvent possible :&nbsp;</u>&nbsp;</p>\r\n\r\n<p>Utilisateur : t&rsquo;aime les animos ?</p>\r\n\r\n<p>Bon : ah oui, surtout les chiens jen ai 2 c mes ch&eacute;ris t&rsquo;as un chien toi ?</p>\r\n\r\n<p><strong><span style="color:rgb(255, 0, 0)">Mauvais : wai je kiffe les chiens &nbsp;</span></strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;*********** &nbsp;</p>\r\n\r\n<p><u>Sugg&eacute;rer qu&rsquo;on est disponible pour aller plus loin&nbsp;</u>:</p>\r\n\r\n<p>&nbsp;Utilisateur : t&rsquo;es celib toi ?</p>\r\n\r\n<p>Bon : malheureusement oui, depuis un moment m&eacute; jcompte pas le rester&hellip; et twa ?</p>\r\n\r\n<p><span style="color:rgb(255, 0, 0)"><strong>Mauvais : wai c cool d etre seule &nbsp;</strong></span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ************ &nbsp; &nbsp;</p>\r\n\r\n<p><u>D&eacute;samorcer l&rsquo;agressivit&eacute; ou les soup&ccedil;ons :&nbsp;</u>&nbsp;</p>\r\n\r\n<p>Utilisateur : tu t fous de ma gueule t&eacute; k&rsquo;une pute</p>\r\n\r\n<p>Bon : m&eacute; pk tu dis &ccedil;a ? j&rsquo;ai du mal &agrave; comprendre pourquoi t&rsquo;es fach&eacute; contre moi, tu veux bien me dire ce que j&rsquo;ai fait de mal ?</p>\r\n\r\n<p><span style="color:rgb(255, 0, 0)"><strong>Mauvais : et toi t k&rsquo;un sal con &nbsp;Utilisateur : t&eacute; bidon com toute les autres ici</strong></span></p>\r\n\r\n<p>Bon : c pas sympa d dire &ccedil;a on vient juste de se conna&icirc;tre kess g fait ?</p>\r\n\r\n<p><strong><span style="color:rgb(255, 0, 0)">Mauvais : non on est pas bidon &nbsp; &nbsp;</span></strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;********** &nbsp;</p>\r\n\r\n<p><u>D&eacute;tourner les demandes de rdv, ne pas les encourager, ne pas promettre :</u></p>\r\n\r\n<p>&nbsp;Utilisateur : ok pr ce soir 19h devant la gare ?</p>\r\n\r\n<p>Bon : tu m plais mais c un peu trop tot dis men plus sur toi ?</p>\r\n\r\n<p>Bon : jpeu pas trop le soir jprefere le wkend c plus cool non ?</p>\r\n\r\n<p>Bon : tu penses &agrave; koi, resto, boite, juste un verre ?</p>\r\n\r\n<p>Bon : ca me tente mais ce soir pas possible, ct koi l&rsquo;id&eacute;e ?</p>\r\n\r\n<p>Bon : pas tro cool comme endroit pr un 1er rdv tas une autre id&eacute;e ?</p>\r\n\r\n<p>Bon : ca dpend de ce ke tu veux faire apres, donne moi envie ?</p>\r\n\r\n<p>Bon : je sais pa trop, j&rsquo;ai un peu peur , on essaie de se conna&icirc;tre mieux dabord ?</p>\r\n\r\n<p>Bon : comment tu imagines ke ca va se passer notre rencontre ?</p>\r\n\r\n<p>Bon : ben je pensais plutot &agrave; un truc romantik moi, la gare bofff &nbsp;Mauvais : ok pr 19h Mauvais : daccord et on va ou apr&egrave;s ?</p>\r\n\r\n<p><strong><span style="color:rgb(255, 0, 0)">Mauvais : non jve pas</span></strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ***********</p>\r\n\r\n<p><u>&nbsp;D&eacute;tourner les demandes de num&eacute;ro de mobile :&nbsp;</u>&nbsp;</p>\r\n\r\n<p>Utilisateur : donne ton tel jappel now Bon : euh c un peu rapide on se connait &agrave; peine faut que tu me rassures un peu ?</p>\r\n\r\n<p>Bon : le prefere pas trop maintenant mais plus tard si on est ok ts les 2</p>\r\n\r\n<p>Bon : je peux pas trop l&agrave; j&rsquo;ai plein de trucs a faire faudrat se mettre daccord sur une heure.</p>\r\n\r\n<p>Bon : j&rsquo;aime pas trop laisser mon tel donne le tien c plus kool pr moi. &nbsp;</p>\r\n\r\n<p><strong><span style="color:rgb(255, 0, 0)">Mauvais : ok tiens (+ num&eacute;ro bidon) &nbsp;</span></strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;********** &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;<u>&nbsp;Rattraper ses erreurs :</u></p>\r\n\r\n<p>&nbsp;Utilisateur : hier t blonde et maintenan t brune ??</p>\r\n\r\n<p>Bon : j&rsquo;ai dit quee j&rsquo;&eacute;tais blonde, pas ke ct ma vraie couleur lol tu veux tt savoir ?</p>\r\n\r\n<p>Bon : ca d&eacute;pend ou tu regardes bb suis pas blonde partout tu veux voir ?</p>\r\n\r\n<p><span style="color:rgb(255, 0, 0)"><strong>Mauvais : portnawak t as hallucin&eacute; toi &nbsp;</strong></span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ************</p>\r\n\r\n<p>&nbsp; Les possibilit&eacute;s ne se limitent pas aux exemples &eacute;tudi&eacute;s. Si vous n&rsquo;&ecirc;tes pas certaine de ce qu&rsquo;il convient de r&eacute;pondre, n&rsquo;h&eacute;sitez pas &agrave; prendre quelques instants pour poser la question &agrave; une superviseuse. Mieux vaut perdre une minute qu&rsquo;un utilisateur, et vous saurez quoi faire lorsque ce cas se pr&eacute;sentera &agrave; nouveau la fois suivante. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>&nbsp;Annexe &nbsp; &nbsp; &nbsp;</strong>&nbsp; &nbsp; &nbsp; &nbsp;</p>', '2016-05-20 13:15:00', 1, 0, NULL),
(48, 37, 27, 'ABREVIATIONS /TERMES UTILISES - PRO ARCHIVES', '<p><strong>ABREVIATIONS /TERMES UTILISES - PRO ARCHIVES</strong><br />\r\n<strong>TERMES METIERS</strong>&nbsp;:<br />\r\n<strong>A.D.B : ADMINISTRATEURS DE BIENS&nbsp;</strong>: clients<br />\r\nLe syndic de copropri&eacute;t&eacute; est le mandataire du syndicat des copropri&eacute;taires. Il assure l&#39;ex&eacute;cution de ses d&eacute;cisions prises en assembl&eacute;e g&eacute;n&eacute;rale et administre l&#39;immeuble au nom du syndicat</p>\r\n\r\n<p><strong>S.D.C : SYNDICAT DE COPROPRIETAIRES</strong>&nbsp;: regroupe l&#39;ensemble des propri&eacute;taires des lots&nbsp;<br />\r\nNous utilisons aussi les termes moins officiels de : &laquo; copropri&eacute;t&eacute; (copro), immeuble, r&eacute;sidence &raquo;<br />\r\n<strong>C.S</strong>&nbsp;: CONSEIL SYNDICAL : charg&eacute; d&#39;assister le syndic mais aussi de contr&ocirc;ler ses actes, c&rsquo;est l&#39;organe de contr&ocirc;le au sein du syndicat de copropri&eacute;taires<br />\r\n<strong>LOTS</strong>&nbsp;: Lots principaux (xx) : &agrave; ne pas confondre avec les lots secondaires (xx)<br />\r\n<strong>MANDANTS</strong>&nbsp;: propri&eacute;taires &nbsp;<br />\r\n<strong>MANDAT</strong>&nbsp;:<br />\r\n<strong>TERMES PRO ARCHIVES</strong>&nbsp;:<br />\r\n<strong>P.E.C</strong>&nbsp;: PRISE EN CHARGE : il s&rsquo;agit du premier chantier du client, signifie aussi l&rsquo;action de prendre en charge des archives chez le client&nbsp;<br />\r\n<strong>E.E</strong>&nbsp;: ENLEVEMENT EN ETAT : archives enlev&eacute;es par le prestataire directement chez le client (mise en conteneur des boites) puis trait&eacute; par PRO DOCS ult&eacute;rieurement dans les entrep&ocirc;ts du prestataire (prise de photos, rapport fin de chantier etc.)<br />\r\n<strong>C.T&nbsp;</strong>: CONTRAT<br />\r\n<strong>CT UNIQUE</strong>&nbsp;: un contrat pour l&rsquo;ensemble des immeubles (facturation directe &agrave; la copropri&eacute;t&eacute; de nos prestations)<br />\r\n<strong>CT COPRO</strong>&nbsp;: un contrat par immeuble (facturation directe &agrave; la copropri&eacute;t&eacute; de nos prestations)<br />\r\n<strong>CT GERANCE</strong>&nbsp;: contrat pour l&rsquo;activit&eacute; &laquo; G&eacute;rance &raquo;, le Cabinet &nbsp;paye directement nos prestations pours ses propri&eacute;taires (mandants)<br />\r\n<strong>CT CAB</strong>&nbsp;: contrat liant PRO ARCHIVES et le Cabinet qui paye directement nos prestations pour ses immeubles.<br />\r\n<strong>CT CONT</strong>&nbsp;: contrat liant PRO ARCHIVES et le Cabinet qui paye directement nos prestations au nombre de conteneurs conserv&eacute;s<br />\r\n<strong>CONT</strong>&nbsp;: CONTENEUR (contient 3 &agrave; 5 boites d&rsquo;archives) en fonction de sa contenance (50 litres chez RECALL, 60 litres chez AGO), peut aussi &ecirc;tre abr&eacute;g&eacute; en &laquo; CT &raquo;<br />\r\n<strong>U.A&nbsp;</strong>: UNITE D&rsquo;ARCHIVAGE : boite d&rsquo;archives, classeur, dossier &agrave; sangle etc.<br />\r\n<strong>REAPPRO</strong>&nbsp;: REAPPROVISIONNEMENTS : il s&rsquo;agit des chantiers annuels chez nos clients pour l&rsquo;enl&egrave;vement des nouvelles archives dormantes<br />\r\n<strong>D.I&nbsp;</strong>: DEMANDE D&rsquo;INTERVENTION : faite &agrave; PRO DOCS<br />\r\n<strong>D.D</strong>&nbsp;: DEMANDE DE DEVIS : faite au prestataire<br />\r\n<strong>H.P</strong>&nbsp;: HORS PERIODE : archives vivantes (ann&eacute;e en cours + 2 ans) ou p&eacute;rim&eacute;es (ayant d&eacute;pass&eacute;es les dur&eacute;es l&eacute;gales de conservation)<br />\r\n<strong>H.L</strong>&nbsp;: HORS LISTE : il s&rsquo;agit d&rsquo;immeubles non d&eacute;clar&eacute;s par le client sur sa liste de syndicats, il peut s&rsquo;agir de nouveaux immeubles ou d&rsquo;immeubles perdus<br />\r\n<strong>P.S</strong>&nbsp;: PLUS SYNDIC : Immeuble perdu par un de nos clients au profit d&rsquo;un nouveau syndic (client ou successeur)<br />\r\n<strong>P.D.A</strong>&nbsp;: PAS D&rsquo;ARCHIVE : immeuble sans archive stock&eacute;e chez nous donc non factur&eacute;<br />\r\n<strong>A.M</strong>&nbsp;: AUTRE MOTIF : tous motifs de non facturation pour un immeuble&nbsp;<br />\r\n<strong>GER</strong>&nbsp;: GERANCE : activit&eacute; du client (location de biens immobilier)<br />\r\n<strong>CAB</strong>&nbsp;: CABINET : client, Syndic, ADB<br />\r\n<strong>S.D&nbsp;</strong>: SORTIE DEFINITIVE : remise des archives au client pour PS au &agrave; son successeur ou pour archivage dans l&rsquo;immeuble (quelques fois pour refus)<br />\r\n<strong>PEC CAB&nbsp;</strong>: PRISE EN CHARGE CABINET : Immeubles factur&eacute;s directement au Syndic<br />\r\n<strong>REFUS</strong>&nbsp;: REFUS de notre contrat d&rsquo;archivage par L&rsquo;immeuble<br />\r\n<strong>A.G&nbsp;</strong>: ASSEMBLEE GENERALE (ORDINAIRE en g&eacute;n&eacute;ral) : r&eacute;union annuelle entre le Syndic et les Copropri&eacute;taires pour voter diff&eacute;rents points mis &agrave; l&rsquo;ordre du jour (O.J)&nbsp;<br />\r\n<strong>ATT A.G</strong>&nbsp;: ATTENTE D&rsquo;ASSEMBLEE GENERALE : Immeubles factur&eacute;s directement au Syndic en attendant que l&rsquo;AG se tienne et qu&rsquo;une d&eacute;cision soit prise concernant notre contrat d&rsquo;archivage par ce dernier (dur&eacute;e d&rsquo;attente maximum = 1 an)</p>', '2016-06-08 14:35:00', 1, 0, NULL),
(48, 38, 28, 'CONSIGNE SAISIE', '<p><span style="color:#0000FF"><span style="font-size:22px">A reprendre pour fred</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#0000FF">R&egrave;gles de bonnes pratiques de la saisie</span></p>\r\n\r\n<p>Lorsque dans le champ description compl&egrave;te nous avons comme information une date ou que des dates alors Intitul&eacute; reste vide<br />\r\nExemple : sur la boite description compl&egrave;te = &laquo; 2007 &raquo; alors Intitul&eacute; = vide</p>\r\n\r\n<p>Lorsque nous croisons l&rsquo;expression ANO (avec le O &eacute;tant l&rsquo;ensemble vide math&eacute;matique) alors on &eacute;crit AN0 avec le 0 pour d&eacute;signer n&rsquo;importe quelle ann&eacute;e<br />\r\nN&eacute;anmoins l&rsquo;analyse Date Inf et Date Sup porte sur les dates de la boite clairement identifi&eacute;es. AN0 ne rentre donc pas dans le champ d&rsquo;analyse</p>\r\n\r\n<p><br />\r\n<span style="color:#0000FF">Table adresse</span></p>\r\n\r\n<p>Elle doit &ecirc;tre pr&eacute;par&eacute;e apr&egrave;s le transfert des envois et avant l&rsquo;importation dans l&rsquo;interface. Le temps d&rsquo;intervention peut &ecirc;tre minime si l&rsquo;&eacute;quipe manque de photos. Il faut donc l&rsquo;anticiper en fonction de la quantit&eacute; de photos restant &agrave; saisir.</p>\r\n\r\n<p>Elle est utilis&eacute;e que lorsque Service=Copropri&eacute;t&eacute;<br />\r\nSi elle ne figure pas dans l&rsquo;envoi, c&rsquo;est :<br />\r\n&nbsp;&nbsp; &nbsp;Ou un oubli du client<br />\r\n&nbsp;&nbsp; &nbsp;Ou parce que le service n&rsquo;est pas copropri&eacute;t&eacute;</p>\r\n\r\n<p>Pour &ecirc;tre charg&eacute;e dans l&rsquo;interface, il faut proc&eacute;der &agrave; quelques &laquo; manutentions &raquo;&hellip;</p>\r\n\r\n<p>Ouvrir la table adresse correspondant au chantier<br />\r\nOuvrir dans&nbsp;</p>\r\n\r\n<p><br />\r\n<span style="color:#0000FF">Num&eacute;rotation automatique</span></p>\r\n\r\n<p>Chaque boite d&rsquo;archive au moment de la validation finale est num&eacute;rot&eacute;e. Ce num&eacute;ro est automatique et invisible &agrave; l&rsquo;&eacute;cran.</p>\r\n\r\n<p>A chaque nouveau chantier, au moment de l&rsquo;importation des photos, on renseigne le num&eacute;ro de d&eacute;part de l&rsquo;incr&eacute;mentation du compteur.</p>\r\n\r\n<p>Lorsque le client d&eacute;pose un chantier il d&eacute;pose &eacute;galement l&rsquo;historique des inventaires pr&eacute;c&eacute;dents.<br />\r\nSi son client est un nouveau client</p>', '2016-06-08 17:26:00', 1, 0, NULL),
(48, 39, 29, 'Consigne', '<p><span style="color:#0000FF"><span style="font-size:20px">Relation Client : Consignes</span></span></p>\r\n\r\n<p>Client AGO : &nbsp;&nbsp; &nbsp;Proarchives<br />\r\nInterface : &nbsp;&nbsp; &nbsp;Proarchives<br />\r\nType : &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;R&eacute;current&nbsp;<br />\r\nD&eacute;lais :&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;15 j + D&egrave;s que c&rsquo;est pr&ecirc;t</p>\r\n\r\n<p><span style="color:#0000FF">*Importation</span><br />\r\nChoisir l&rsquo;interface Proarchives<br />\r\nCompteur : Suivre la PROCEDURE COMPTEUR CLIENT d&eacute;taill&eacute;e<br />\r\nFichier rapport_chantier : choisir la photo se trouvant dans le dossier Rapport Chantier pour ne pas qu&rsquo;elle soit import&eacute;e.</p>\r\n\r\n<p><span style="color:#0000FF">*Consignes Pr&eacute;paration</span></p>\r\n\r\n<p><br />\r\nSuivre la PROCEDURE TABLE ADRESSE d&eacute;taill&eacute;e</p>\r\n\r\n<p><br />\r\n<span style="color:#0000FF">*Consignes Saisie-Contr&ocirc;le</span></p>\r\n\r\n<p>Le client nous demande pour<strong> tous les services</strong><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; De bien reprendre la zone d&rsquo;en-t&ecirc;te du conteneur (4 champs dont 3 obligatoires)<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; De reprendre les expressions sur les boites &agrave; l&rsquo;<u>identique sans modifications ni interpr&eacute;tations</u> (sauf l&rsquo;ann&eacute;e qui s&rsquo;&eacute;crit toujours sur 4 chiffres)<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; D&rsquo;analyser les champs dates inf et sup (plus petite, plus grande). Date sup n&rsquo;est jamais vide<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; D&rsquo;analyser les champs intitul&eacute;s en reprenant les expressions sans d&eacute;tail (dates,&hellip;)<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; De rep&eacute;rer les N&deg; archive</p>\r\n\r\n<p>Pour le service <strong>G&eacute;rance</strong><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; La m&ecirc;me chose que tous les services +<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Analyses des bornes inf et sup (s&eacute;quence ininterrompue). Attention les s&eacute;quences sont forc&eacute;ment des noms propres pour le service G&eacute;rance</p>\r\n\r\n<p>Pour le service <strong>Copropri&eacute;t&eacute;</strong><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; La m&ecirc;me chose que tous les services +&nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Analyses des bornes inf et sup (s&eacute;quence ininterrompue). Attention les s&eacute;quences sont forc&eacute;ment des N&deg; de Copro pour le service Copropri&eacute;t&eacute;. En cas de doute les renseigner.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; D&rsquo;analyser le N&deg; de Copro, le nom Copro, l&rsquo;adresse Copro (les isoler dans des champs sp&eacute;cifiques)<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Si multi copropri&eacute;t&eacute; de subdiviser chaque boite en autant de copropri&eacute;t&eacute; (Bouton ajouter copro)<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; De faire le lien avec la table adresse une fois la copropri&eacute;t&eacute; identifi&eacute;e dans la table (par son N&deg;, nom, ou adresse)</p>\r\n\r\n<p>Remarque :&nbsp;<br />\r\n*Toutes les s&eacute;quences ininterrompues ne sont pas forc&eacute;ment des bornes inf et sup. Par exemple des s&eacute;quences de N&deg; de factures ne doivent pas &ecirc;tre analys&eacute;es. Que Nom pour service G&eacute;rance et N&deg; de Copro pour services copropri&eacute;t&eacute;. En cas de doute sur la nature des s&eacute;quences, on analyse les bornes.<br />\r\n*Si une s&eacute;quence est &eacute;crite N&deg;4 &agrave; N&deg;5, on ne reporte que les nombres dans bornes inf et sup et pas les lettres<br />\r\n*La zone intitul&eacute; doit &ecirc;tre renseign&eacute; des que c&rsquo;est possible. Elle doit &ecirc;tre vide le moins souvent possible.<br />\r\n*L&rsquo;utilisation du copi&eacute;/coll&eacute; par le contr&ocirc;leur doit &ecirc;tre faite avec prudence. En effet la recopie d&rsquo;une phrase compl&egrave;te dans la zone d&rsquo;information peut g&eacute;n&eacute;rer des anomalies car on force A=B. On recommande de faire uniquement des copies de mots et pas des phrases compl&egrave;tes.&nbsp;<br />\r\n*L&rsquo;interface de contr&ocirc;le analyse la premi&egrave;re faute rencontr&eacute;e entre A et B. Il vaut mieux renvoyer en correction autant de fois qu&rsquo;il le faut sans toujours chercher &agrave; corriger toutes les fautes en un seul passage. C&rsquo;est cette pr&eacute;occupation de tout corriger qui favorise l&rsquo;utilisation du copi&eacute;/coll&eacute; sur l&rsquo;expression compl&egrave;te alors qu&rsquo;il serait pr&eacute;f&eacute;rable de faire du mot par mot en multipliant les passages en correction.</p>\r\n\r\n<p><span style="color:#0000FF">*Consignes Restitution</span></p>\r\n\r\n<p><u>Contr&ocirc;le Qualit&eacute;</u></p>\r\n\r\n<p>Date sup ne peut pas &ecirc;tre vide (sinon mettre XXXX). Automate de contr&ocirc;le en cours d&rsquo;impl&eacute;mentation.<br />\r\nSi bornes Sup existe, borne inf existe<br />\r\nPas de doublon pour N&deg; de dossier (Si doublon remettre une des 2 photos en doublon en Statut Saisie)<br />\r\nA 1 photo, j&rsquo;ai 1 N&deg; de conteneur et inversement. V&eacute;rifier que pour 1 N&deg; de conteneur, j&rsquo;ai une unique photo (TC dans excel).</p>\r\n\r\n<p><u>Format restitution</u></p>\r\n\r\n<p>Format 1 : Excel avec lien hypertexte pour toutes les photos<br />\r\nFormat 2 : Excel avec lien hypertexte uniquement les photos avec des XXX<br />\r\nFormat 3 : Txt qui est exactement &eacute;gal au format 1 (Pas de discordance !)</p>\r\n\r\n<p>Colonage Final:<br />\r\nVoir exemple &agrave; 19 colonnes.</p>', '2016-06-08 17:40:00', 1, 0, NULL),
(48, 40, 30, 'Control_qualité', '<p><span style="color:#0000FF">&nbsp;INTERFACE WEB : CONTROLE QUALITE</span></p>\r\n\r\n<p>Lancer un protocole pour chaque interface qui va chainer les actions ci-dessous. Il faut un rapport final &agrave; l&rsquo;&eacute;cran qui synth&eacute;tise les r&eacute;sultats</p>\r\n\r\n<p><span style="color:#0000FF">Proarchives</span></p>\r\n\r\n<p>1&deg;) Le champ Photo_Compteur dans table photo doit &ecirc;tre unique (sans doublon) pour les chantiers non restitu&eacute;s comportant le m&ecirc;me code client (PAF001, PAG012,&hellip;). Il ne peut pas &ecirc;tre &eacute;gal &agrave; 0.<br />\r\n&nbsp;&nbsp; &nbsp;Action : remettre la photo la plus r&eacute;cente (N&deg; index de table traitement le plus grand) comportant un doublon en Statut Saisie dans la table traitement. Pas les 2 ! (on devrait donc avoir peu de trou de s&eacute;quence !) + message dans tous les champs Photo_Observation de la table photo &laquo; Date/heure-Contr&ocirc;le Qualit&eacute; : incr&eacute;mentation du compteur automatique. Valider la photo. &raquo;<br />\r\n2&deg;) Si le service n&rsquo;est pas copropri&eacute;t&eacute; alors le champ Photo_Numero_Dossier est forc&eacute;ment = S<br />\r\nAction : Si M, alors il faut tout refaire ! Pas le choix !<br />\r\n&nbsp;&nbsp; &nbsp;Supprimer les 2 lignes de la table traitement + supprimer les lignes de la table photo + effacer les pseudos de la table chantier !&nbsp;&nbsp; &nbsp;<br />\r\n3&deg;) Si le service n&rsquo;est pas copropri&eacute;t&eacute; et que les champs Photo_linked_Num_copro OU Photo_linked_Nom_copro OU Photo_linked_adr_copro OU Photo_linked_Zip OU Photo_linked_City non vides<br />\r\nAction : effacer le contenu de ces 4 champs de la table photo&nbsp;&nbsp; &nbsp;<br />\r\n4&deg;) Pour une UA (=1 enregistrement), si bornes inf existe alors borne sup existe. Si borne sup existe alors borne inf existe.<br />\r\n&nbsp;&nbsp; &nbsp;Action : remettre la photo contenant l&rsquo;UA avec l&rsquo;anomalie sur les bornes en Statut Saisie dans la table traitement + message dans le champ Photo_Observation de la table photo pour l&rsquo;UA en anomalie &laquo; Date/heure-Contr&ocirc;le Qualit&eacute; : renseigner les bornes &raquo;<br />\r\n5&deg;) Pour une UA (=1 enregistrement), si Service = Copropri&eacute;t&eacute; OU G&eacute;rance ET bornes inf OU Borne Sup existe (non vide)<br />\r\n&nbsp;&nbsp; &nbsp;Action : effacer le contenu de borne inf et sup si Service DIFFERENT de Copropri&eacute;t&eacute; OU G&eacute;rance<br />\r\n6&deg;) Pour chaque UA de la table photo v&eacute;rifier que Photo_exercice_A n&rsquo;est pas vide<br />\r\n&nbsp;&nbsp; &nbsp;Action : remettre la photo contenant l&rsquo;UA avec l&rsquo;anomalie en Statut Saisie dans la table traitement + message dans le champ Photo_Observation de la table photo pour l&rsquo;UA en anomalie &laquo; Date/heure-Contr&ocirc;le Qualit&eacute; : renseigner date sup &raquo;<br />\r\n7&deg;) A chaque photo, j&rsquo;ai une r&eacute;f&eacute;rence conteneur unique. Attention, c&rsquo;est une v&eacute;rification qui ne doit pas &ecirc;tre bloquante pour la restitution (=si erreur archiviste, je conserve l&rsquo;erreur)<br />\r\n&nbsp;&nbsp; &nbsp;Action : remettre toutes les &nbsp;photos comportant cette anomalies en Statut Saisie dans la table traitement + message dans tous les champs Photo_Observation de la table photo en anomalie &laquo; Date/heure-Contr&ocirc;le Qualit&eacute; : v&eacute;rifier la r&eacute;f&eacute;rence conteneur&raquo;</p>\r\n\r\n<p>Si les points 1 &agrave; 6 contiennent des anomalies alors le champ Etat_Chantier de la BDD rapport_chantier passe &agrave; Contr&ocirc;le_qualit&eacute;<br />\r\nSi les points 1 &agrave; 6 ne contiennent pas des anomalies alors le champ Etat_Chantier de la BDD rapport_chantier passe &agrave; Terminer<br />\r\nLe point 7 n&rsquo;est pas bloquant et le champ Etat_Chantier de la BDD rapport_chantier passe &agrave; Terminer<br />\r\nRemarque : le fichier peut &ecirc;tre restitu&eacute; (bouton op&eacute;rationnel) que si toutes les photos sont valid&eacute;es ET Etat_Chantier de la BDD rapport_chantier = Terminer</p>', '2016-06-08 18:06:00', 1, 0, NULL),
(48, 41, 31, 'Procédure Numéro Comp.', '<p><strong><span style="color:#0000FF"><span style="font-size:20px">Proc&eacute;dure de d&eacute;termination du N&deg; Compteur</span></span></strong></p>\r\n\r\n<p><span style="color:#0000FF">Historique et compteur</span></p>\r\n\r\n<p>Le client d&eacute;pose en m&ecirc;me temps que les photos un historique Excel des inventaires pr&eacute;c&eacute;dents.&nbsp;<br />\r\nLe fichier historique se trouve toujours &agrave; la racine du chantier, &agrave; c&ocirc;t&eacute; de la table adresse. Ce fichier Excel s&rsquo;appelle : code client + nom du client.xlsx (= le nom du chantier sans la date a la fin).</p>\r\n\r\n<p>Chaque ligne d&rsquo;inventaire de l&rsquo;historique porte dans la colonne N&deg; Dossier, un num&eacute;ro UNIQUE, qui est g&eacute;n&eacute;r&eacute; automatiquement au moment de la validation d&rsquo;une photo. Dans notre interface ce num&eacute;ro est g&eacute;n&eacute;r&eacute; &agrave; chaque validation d&rsquo;une photo et donc &agrave; la fin du contr&ocirc;le A=B. Il est donc invisible aux op&eacute;ratrices</p>\r\n\r\n<p>Le client nous demande que les num&eacute;ros de compteur par Unit&eacute; d&rsquo;archive (boite, multicopro,&hellip;) ne soit pas en doublon. Il n&rsquo;impose pas une num&eacute;rotation sans interruption. Les trous de s&eacute;quences ne sont pas une anomalie.</p>\r\n\r\n<p>Ce num&eacute;ro est indispensable pour r&eacute;aliser l&rsquo;importation des photos car l&rsquo;interface nous signale le dernier num&eacute;ro connu qui peut varier de celui de l&rsquo;historique du client. Il faut donc analyser et trancher.</p>\r\n\r\n<p><span style="color:#FF0000">Le num&eacute;ro de compteur est une donn&eacute;e tr&egrave;s sensible pour le client. Il est donc tr&egrave;s important de ne pas se tromper en voulant le renseigner dans l&rsquo;interface. Si le num&eacute;ro de compteur est mal renseign&eacute; tous les chantiers seront &agrave; RECONTROLER sans aucune autre alternative possible.&nbsp;</span></p>\r\n\r\n<p><br />\r\nToutefois la pr&eacute;sence de l&rsquo;historique n&rsquo;est pas syst&eacute;matique.</p>\r\n\r\n<p><strong>Sans historique </strong>: il n&rsquo;y a pas d&rsquo;historique Excel associ&eacute; au chantier dans l&rsquo;envoi (= premier inventaire d&rsquo;un nouveau client de l&rsquo;archiviste par exemple)<br />\r\n2 cas de figure :</p>\r\n\r\n<p><span style="color:#0000FF">*L&rsquo;interface signale qu&rsquo;il existe un num&eacute;ro diff&eacute;rent de 0. On aurait du avoir un historique.</span></p>\r\n\r\n<p><span style="color:#FF0000">On demande au client de confirmer l&rsquo;absence d&rsquo;historique avant d&rsquo;effectuer l&rsquo;importation ! On reporte le N&deg; trouv&eacute; dans le module d&rsquo;importation de l&rsquo;interface dans le tableau suivi des commandes et l&rsquo;on mentionne la difficult&eacute; dans la colonne Observation.</span></p>\r\n\r\n<p><span style="color:#0000FF">*Notre interface est aussi &agrave; 0. On part donc de 0. On &eacute;crit &laquo; 0 &raquo; dans le suivi des chantiers.</span></p>\r\n\r\n<p><strong>Avec historique</strong> : on utilise une macro qui se trouve dans Dropbox/Service_Client/suivi des commandes et qui permet d&rsquo;identifier dans l&rsquo;historique Excel le plus grand num&eacute;ro du fichier.</p>\r\n\r\n<p>*on ouvre le fichier et on lance la macro qui va chercher dans la colonne G = NUMERO DE DOSSIER (le plus grand nombre pr&eacute;sent dans la colonne).</p>\r\n\r\n<p>*On reporte ce num&eacute;ro dans le tableau suivi des commandes = Compteur fichier historique d&eacute;part.</p>\r\n\r\n<p>4 cas de figure et 3 valeurs possibles (0, Interface, Nombre) :</p>\r\n\r\n<p><span style="color:#0000FF">&nbsp;*Le num&eacute;ro de compteur est identique entre l&rsquo;historique Excel et l&rsquo;interface. Pas de probl&egrave;me on r&eacute;alise l&rsquo;importation et on reporte le m&ecirc;me num&eacute;ro dans suivi des commandes.</span></p>\r\n\r\n<p><span style="color:#0000FF">*L&rsquo;historique du client pr&eacute;sente un num&eacute;ro plus grand que celui de l&rsquo;interface. Cela signifie que le client &agrave; int&eacute;grer des nouvelles lignes d&rsquo;archives depuis notre dernier inventaire dont nous n&rsquo;avons pas eu connaissances et il faut prendre le sien.</span></p>\r\n\r\n<p><span style="color:#0000FF">*L&rsquo;historique Excel a un num&eacute;ro de compteur plus petit que le notre dans l&rsquo;interface. Par ailleurs nous sommes en train de travailler sur un chantier en-cours qui n&rsquo;a pas encore &eacute;t&eacute; restitu&eacute; au client. Il est donc normal que l&rsquo;historique du client soit incomplet. C&rsquo;est donc notre num&eacute;ro d&rsquo;interface qui est correct. On &eacute;crit &laquo; Interface &raquo; dans le suivi des chantiers.</span></p>\r\n\r\n<p><span style="color:#0000FF">*L&rsquo;historique Excel a un num&eacute;ro de compteur plus petit que le notre dans l&rsquo;interface et aucun chantier en cours pour ce m&ecirc;me client de l&rsquo;archiviste.</span> <span style="color:#FF0000"><u>On demande au client de confirmer son num&eacute;ro de compteur avant d&rsquo;effectuer l&rsquo;importation !</u></span></p>\r\n\r\n<p>Remarque 1 : le fichier historique du client ne doit pas jamais &ecirc;tre modifi&eacute; par Proweb. On ouvre, on ferme sans enregistrer des modifications.</p>\r\n\r\n<p>Remarque 2 : dans cette colonne N&deg; dossier, il ya des chiffres pr&eacute;c&eacute;d&eacute;s de M (multicopro) ou S (mono copro).&nbsp;</p>\r\n\r\n<p>Remarque 3 : dans l&rsquo;interface web d&rsquo;avancement des travaux, on retrouve la valeur de compteur qui a &eacute;t&eacute; retenue au moment de l&rsquo;importation des photos dans l&rsquo;interface. Les nouveaux inventaires trait&eacute;s par Proweb seront incr&eacute;mentes de +1 a partir de ce chiffre.</p>\r\n\r\n<p><span style="color:#0000FF">*Comment utiliser la macro &laquo; Plus Grand Num&eacute;ro Historique &raquo;</span></p>\r\n\r\n<p>Comment trouver les bons num&eacute;ros de compteur ?<br />\r\nDeux fichiers principaux doivent &ecirc;tre ouverts :<br />\r\n&nbsp; &nbsp; *tableau Excel suivi des commandes o&ugrave; se trouve la macro&nbsp;<br />\r\n&nbsp; &nbsp; *l&rsquo;historique Excel du chantier o&ugrave; l&rsquo;on cherche le plus grand num&eacute;ro de compteur</p>\r\n\r\n<p>Une fois que le tableau est ouvert (historique) cliquez sur &lsquo;&rsquo;affichage &lsquo;dans la barre des menus tout en haut de votre tableau puis dans le coin gauche &lsquo;&rsquo;MACROS&rsquo;&rsquo; ensuite &lsquo;&rsquo;afficher les macros&rsquo;&rsquo; choisir &lsquo;&rsquo; PLUS GRAND NUMERO HISTORIQUE &lsquo;&rsquo; et Excel vous affiche le plus grand num&eacute;ro de dossier trouv&eacute;.</p>\r\n\r\n<p>Pour &ecirc;tre sure que vous avez le bon num&eacute;ro. Faire un petit test. Supposons que le num&eacute;ro que l&rsquo;interface vous donne soit le : 5146</p>\r\n\r\n<p>Cliquez dans la colonne num&eacute;ro de dossier (icone filtre) puis &lsquo;&rsquo;filtre textuels &lsquo;&rsquo; choisir &lsquo;&rsquo;contient&rsquo;&rsquo; et taper une valeur plus grande que celle que l&rsquo;interface vous aura donner pour voir si il l&rsquo;a retrouve exemple taper 5147.</p>\r\n\r\n<p>Si une donn&eacute;e est trouv&eacute;e cela veux dire que ce n&rsquo;est pas le bon num&eacute;ro de compteur qui vous a &eacute;t&eacute; donn&eacute; par la macro et donc vous reprenez la recherche manuellement. G&eacute;n&eacute;ralement les cas d&rsquo;erreur sont tr&egrave;s rares mais il est n&eacute;cessaire de faire le test pour &ecirc;tre sure.&nbsp;</p>\r\n\r\n<p>Le compteur &lsquo;&rsquo;fichier historique d&eacute;part&rsquo;&rsquo; est une information d&eacute;licate et sensible.&nbsp;<br />\r\nTypes de difficult&eacute; :&nbsp;</p>\r\n\r\n<p><span style="color:#0000FF">* &nbsp;Par exemple, il faut v&eacute;rifier si le client de l&rsquo;archiviste est en cours de saisie dans l&rsquo;interface web auquel cas le client ne peut avoir dans son historique les derniers inventaires.</span></p>\r\n\r\n<p><span style="color:#0000FF">* &nbsp;On observe un &eacute;crt entre l&rsquo;historique et le compteur de l&rsquo;interface que l&rsquo;on cherche &agrave; analyser. Dans le tableau de suivi des commandes sont list&eacute;s tous les chantiers trait&eacute;s par Proweb. Avec barres des taches faire un clique sur &lsquo;&rsquo; rechercher et s&eacute;lectionner &lsquo;&rsquo; puis copier le nom du client (PAF001,&hellip;) que vous rechercher puis valider : vous affichez les uns &agrave; la suite des autres tous les chantiers d&eacute;j&agrave; restitu&eacute;s.</span></p>', '2016-06-08 18:16:00', 1, 0, NULL);
INSERT INTO `version` (`ver_creator`, `ver_article`, `Id`, `ver_titre`, `ver_content`, `ver_date`, `ver_editable`, `ver_del`, `attachement`) VALUES
(48, 42, 32, 'Client_821_Consignes', '<p><span style="font-size:22px"><span style="color:#0000CD">Relation Client : Consignes</span></span></p>\r\n\r\n<p><strong>Client AGO : &nbsp;&nbsp; &nbsp;821</strong></p>\r\n\r\n<p>Interface : &nbsp;&nbsp; &nbsp;AGO</p>\r\n\r\n<p>Type : &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Fr&eacute;quent&nbsp;</p>\r\n\r\n<p>D&eacute;lais :&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;D&egrave;s que c&rsquo;est pr&ecirc;t</p>\r\n\r\n<p><span style="color:#0000FF">*Importation</span></p>\r\n\r\n<p>Choisir l&rsquo;interface AGO</p>\r\n\r\n<p>Compteur : indiff&eacute;rent</p>\r\n\r\n<p>Fichier rapport_chantier : laisser vide !</p>\r\n\r\n<p>Consignes Pr&eacute;paration</p>\r\n\r\n<p>1&egrave;re &eacute;tape : Important : v&eacute;rifier que les photos sont &agrave; l&rsquo;endroit (gain de temps pour toute l&rsquo;&eacute;quipe)</p>\r\n\r\n<p>Code service sur 3 caract&egrave;res.</p>\r\n\r\n<p>Identifier et saisir la ref conteneur en triple saisie</p>\r\n\r\n<p>Mettre dur&eacute;e conservation = 0&nbsp;&nbsp; &nbsp;sur la 1ere photo de la 1ere partie du chantier (il suffit qu&rsquo;elle y soit</p>\r\n\r\n<p>qu&rsquo;une seule fois)</p>\r\n\r\n<p>Ann&eacute;e destruction ne sera plus &agrave; saisir</p>\r\n\r\n<p><span style="color:#0000FF">*Consignes Saisie-Contr&ocirc;le</span></p>\r\n\r\n<p><u>Zone en t&ecirc;te</u></p>\r\n\r\n<p>Ref Conteneur : pas de 0 devant</p>\r\n\r\n<p>Dur&eacute;e Conservation = 0</p>\r\n\r\n<p><u>Zone Unit&eacute; d&rsquo;archives</u></p>\r\n\r\n<p>Exp 1 : Saisir le libell&eacute; coch&eacute; sur la boite ou &eacute;crit &agrave; la main</p>\r\n\r\n<p><br />\r\nExp 2 : Puis le Num&eacute;ro. Exemple 1724. En g&eacute;n&eacute;ral au dessus de la s&eacute;quence</p>\r\n\r\n<p><br />\r\nSi s&eacute;quence avec les num&eacute;ros mettre &laquo; A &raquo; &agrave; la fin du champ et changer de champs</p>\r\n\r\n<p><br />\r\nExemple&nbsp;&nbsp; &nbsp;Expression 3&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;245 A</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Expression 4&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;345</p>\r\n\r\n<p><br />\r\nSi un seul num&eacute;ro ne pas mettre &laquo; A &raquo;</p>\r\n\r\n<p>Exp 5 : saisir la date accol&eacute;e. Exemple 02052011</p>\r\n\r\n<p>Bornes inf et sup : <u>ne pas saisir.</u></p>\r\n\r\n<p>Renseigner Ann&eacute;e Inf et Ann&eacute;e Sup</p>\r\n\r\n<p><span style="color:#0000FF">*Consignes Restitution</span></p>\r\n\r\n<p><u>Contr&ocirc;le Qualit&eacute;</u></p>\r\n\r\n<p>Statistique</p>\r\n\r\n<p><u>Format restitution</u></p>\r\n\r\n<p><br />\r\nFormat : Excel avec lien hypertexte</p>\r\n\r\n<p>Mod&egrave;le : 0 AGO_CPCAM_Restitution_Client.xltm</p>\r\n\r\n<p>Utiliser ce mod&egrave;le avec macro permettant lien hypertexte</p>\r\n\r\n<p>Colonage Final:</p>\r\n\r\n<p>N&deg; Photo ; Lien hypertexte ; Service ; N&deg; Conteneur ; Ann&eacute;e Inf ; Ann&eacute;e Sup ; Destruction (laisser vide) ; Description compl&egrave;te</p>', '2016-06-14 13:20:00', 1, 0, NULL),
(48, 43, 33, 'Client_1635_consignes', '<p><span style="font-size:22px"><span style="color:#0000FF">Relation Client : Consignes</span></span></p>\r\n\r\n<p><br />\r\n<strong>Client AGO : &nbsp;&nbsp; &nbsp;1635 CPCAM</strong></p>\r\n\r\n<p>Interface : &nbsp;&nbsp; &nbsp;AGO</p>\r\n\r\n<p>Type : &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;R&eacute;current&nbsp;</p>\r\n\r\n<p>D&eacute;lais :&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;D&egrave;s que c&rsquo;est pr&ecirc;t</p>\r\n\r\n<p><span style="color:#0000FF">*Importation</span></p>\r\n\r\n<p>Choisir l&rsquo;interface AGO</p>\r\n\r\n<p>Compteur : indiff&eacute;rent</p>\r\n\r\n<p>Fichier rapport_chantier : laisser vide !</p>\r\n\r\n<p><span style="color:#0000FF">*Consignes Pr&eacute;paration</span></p>\r\n\r\n<p>Code service sur 3 caract&egrave;res.</p>\r\n\r\n<p>Le client nous demande de calculer la date de destruction en ajoutant 33 mois au quanti&egrave;me.<br />\r\nCe calcul sera effectu&eacute; en restitution finale<br />\r\nMettre dur&eacute;e conservation = 0&nbsp;&nbsp; &nbsp;sur la 1ere photo<br />\r\nAnn&eacute;e destruction ne sera plus &agrave; saisir</p>\r\n\r\n<p><span style="color:#0000FF"><span style="font-size:18px">*Consignes Saisie-Contr&ocirc;le</span></span></p>\r\n\r\n<p><u>Zone en t&ecirc;te</u></p>\r\n\r\n<p>Ref Conteneur : pas de 0 devant</p>\r\n\r\n<p>Dur&eacute;e Conservation = 0</p>\r\n\r\n<p><u>Zone Unit&eacute; d&rsquo;archives</u></p>\r\n\r\n<p>Date : comme sur la boite et Ann&eacute;e sur 4 caract&egrave;res</p>\r\n\r\n<p>Rappel sur les QUANTIEMES :</p>\r\n\r\n<p>Un quanti&egrave;me : est une s&eacute;quence de chiffres permettant au client de retrouver le jour exact de l&rsquo;ann&eacute;e</p>\r\n\r\n<p>le num&eacute;ro de quanti&egrave;me varie de 1 &agrave; 365 (soit 1 jour a 365 jours).</p>\r\n\r\n<p>1 Num&eacute;ro de quanti&egrave;me est compris uniquement entre 1 et 365</p>\r\n\r\n<p>Attention : &nbsp; Si &nbsp; un seul &nbsp;num&eacute;ro de &nbsp;quanti&egrave;me, &nbsp;remettre &nbsp;le m&ecirc;me &nbsp;num&eacute;ro de quanti&egrave;me &nbsp;en &nbsp;borne &nbsp;sup.</p>\r\n\r\n<p>Exple : QT236 &nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p>Borne sup : 236</p>\r\n\r\n<p>Reporter le quanti&egrave;me le plus grand dans borne sup</p>\r\n\r\n<p>Attention : ne pas confondre un num&eacute;ro d&rsquo;identification a un quanti&egrave;me. 1 num&eacute;ro d&rsquo;identification</p>\r\n\r\n<p>peut prendre au del&agrave; de 3 chiffres : exemple 35652</p>\r\n\r\n<p>Si s&eacute;quence avec les quanti&egrave;mes mettre &laquo; A &raquo; et changer de champs</p>\r\n\r\n<p>Exemple&nbsp;&nbsp; &nbsp;Expression 1&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;245/2010 A<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Expression 2&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;345<br />\r\nSi un seul quanti&egrave;me ne pas mettre &laquo; A &raquo;</p>\r\n\r\n<p>Attention : &nbsp;&nbsp; &nbsp;<strong>45/2010 est plus grand que 255/2009 !</strong></p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Reporter 45 dans borne sup</p>\r\n\r\n<p>Analyse Borne Sup ne doit pas &ecirc;tre vide (si pas de quanti&egrave;me mettre XXX)</p>\r\n\r\n<p>Borne Sup ne contient qu&rsquo;un nombre : si 325/2011 mettre 325 et 2011 sera en Ann&eacute;e Sup.</p>\r\n\r\n<p>Autres cas&nbsp;</p>\r\n\r\n<p>1&deg;) Exemple sur la boite nous &nbsp;avons &nbsp;245/2010 -------FIN</p>\r\n\r\n<p>Le mot FIN signifie le dernier Quanti&egrave;me d&rsquo;o&ugrave; 365.</p>\r\n\r\n<p>La zone restitution ne peut prendre en compte un mot mais uniquement des chiffres, si nous devons</p>\r\n\r\n<p>suivre la &nbsp;logique normalement la borne sup doit &ecirc;tre &lsquo;&rsquo;FIN&rsquo;&rsquo; ce qui n&rsquo;est pas possible. Donc en saisie</p>\r\n\r\n<p>pour ce cas de figure il &nbsp;faut saisir &nbsp;&lsquo;&rsquo;FIN (365)&rsquo;&rsquo;</p>\r\n\r\n<p>Exemple : &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Expression 1 : 245/2010 A</p>\r\n\r\n<p>Expression 2 : FIN (365)</p>\r\n\r\n<p>Analyse &nbsp;borne sup : &nbsp; &nbsp;365&nbsp;</p>\r\n\r\n<p>2&deg;) S&rsquo;il n&rsquo;y a pas de quanti&egrave;me du tout, laisser le champ &agrave; blanc</p>\r\n\r\n<p>Borne &nbsp;peut donc &ecirc;tre &nbsp;vide &nbsp;en &nbsp;saisie-contr&ocirc;le &nbsp;s&rsquo;il &nbsp;n&rsquo;ya effectivement pas de quanti&egrave;me sur la boite.</p>\r\n\r\n<p><span style="color:#0000FF">*Consignes Restitution</span></p>\r\n\r\n<p><u>Contr&ocirc;le Qualit&eacute;</u></p>\r\n\r\n<p>Borne sup ne peut pas &ecirc;tre vide (sinon XXX)</p>\r\n\r\n<p>Borne sup contient 1 nombre et pas de lettre (pour calcul)</p>\r\n\r\n<p>Ann&eacute;e sup ne peu pas &ecirc;tre vide (sinon XXX)</p>\r\n\r\n<p>Effectuer calcul pour date destruction au format JJ/MM/AAAA en utilisant la macro</p>\r\n\r\n<p>Format restitution</p>\r\n\r\n<p>Format : Excel avec lien hypertexte</p>\r\n\r\n<p>Mod&egrave;le : 0 AGO_CPCAM_Restitution_Client.xltm</p>\r\n\r\n<p>Utiliser ce mod&egrave;le avec macro permettant lien hypertexte puis calcul</p>\r\n\r\n<p>Colonage Final:</p>\r\n\r\n<p>Lien hypertexte ; Service ; N&deg; Conteneur ; Ann&eacute;e Inf ; Ann&eacute;e Sup ; Destruction ; Description compl&egrave;te</p>', '2016-06-14 13:30:00', 1, 0, NULL),
(48, 44, 34, 'Consigne_AZERTWIN 2012.011', '<p>CONSIGNES DE SAISIE<br />\r\nAZERTWIN 2012.011<br />\r\nCHANTIER : 339_3508501_fich 1_(463)</p>\r\n\r\n<p>S&eacute;parer saisie de l&rsquo;analyse<br />\r\nInsister sur le format des dates qui figurent en expression<br />\r\n&nbsp;</p>\r\n\r\n<p>CONSIGNES &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;CORRECTION<br />\r\nChamps de saisie d&rsquo;analyse&nbsp;&nbsp; &nbsp;<br />\r\n1&egrave;re ligne en expr. : assemblage maroc&nbsp;&nbsp; &nbsp;<br />\r\n2&egrave;me ligne Expr. : production&nbsp;&nbsp; &nbsp;<br />\r\n3&egrave;me ligne Expr. : contenu (ex : PF 852)&nbsp;&nbsp; &nbsp;<br />\r\n4&egrave;me ligne : R&eacute;f. Boite (ex : MA &ndash; 2011 &ndash; 3702)&nbsp;&nbsp; &nbsp;<br />\r\nAnn&eacute;e Inf :&hellip;&hellip;. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; MM AAAA<br />\r\nAnn&eacute;e Sup :&hellip;&hellip; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;MM AAAA<br />\r\nAnn&eacute;e de destruction :&hellip;. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Non demand&eacute; &ndash; Non restitu&eacute;<br />\r\nBorne sup reste vide &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Vide&nbsp;<br />\r\n&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p><strong>CHANTIER : 339_3508501_fich 2_(439)</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>CONSIGNES&nbsp;&nbsp; &nbsp;CORRECTION<br />\r\n1&egrave;re ligne en expr. : Logistique (import ou export) selon les boites&nbsp;&nbsp; &nbsp;<br />\r\n2&egrave;me ligne Expr. : Pays (ex : France Europe)&nbsp;&nbsp; &nbsp;<br />\r\n3&egrave;me ligne Expr. : par fedex (mais sur certaines boites, il n&rsquo;y en a pas)&nbsp;&nbsp; &nbsp;<br />\r\n4&egrave;me ligne : R&eacute;f. Boite (ex : LI &ndash; 2011 &ndash; 813)&nbsp;&nbsp; &nbsp;<br />\r\n5&egrave;me ligne : Date A&nbsp;&nbsp; &nbsp;<br />\r\n6&egrave;me ligne : Date&nbsp;&nbsp; &nbsp;<br />\r\nAnn&eacute;e Inf :&hellip;&hellip;.&nbsp;&nbsp; &nbsp;<br />\r\nAnn&eacute;e Sup :&hellip;&hellip;&nbsp;&nbsp; &nbsp;<br />\r\nAnn&eacute;e de destruction :&hellip;.&nbsp;&nbsp; &nbsp;<br />\r\nBorne sup reste vide&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>CHANTIER : 783_3435901_fich1_(146)</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;<br />\r\nCONSIGNES &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; CORRECTION<br />\r\n1&egrave;re ligne en expr. : JAF&nbsp;&nbsp; &nbsp;<br />\r\n2&egrave;me ligne Expr. : VM&nbsp;&nbsp; &nbsp;<br />\r\n3 &egrave;me ligne : R&eacute;f. Boite &nbsp;(ex :3000)&nbsp;&nbsp; &nbsp;<br />\r\n4&egrave;me ligne : s&eacute;quence (ex : 8913 A&nbsp;&nbsp; &nbsp;<br />\r\n5&egrave;me ligne : 8917&nbsp;&nbsp; &nbsp;<br />\r\nAnn&eacute;e Inf :&hellip;&hellip;.&nbsp;&nbsp; &nbsp;<br />\r\nAnn&eacute;e Sup :&hellip;&hellip;&nbsp;&nbsp; &nbsp;<br />\r\nBorne sup reste vide&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>CHANTIER : 841_3381101_fich 1_3256 photos</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>CONSIGNES &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;CORRECTION<br />\r\n1&egrave;re ligne Expr. : AMPI&nbsp;&nbsp; &nbsp;<br />\r\n2&egrave;me ligne Expr. : IRIS&nbsp;&nbsp; &nbsp;<br />\r\n3 &egrave;me ligne : N&deg; de la case 1&nbsp;&nbsp; &nbsp;<br />\r\n4&egrave;me et 5&egrave;me ligne : la s&eacute;quence&nbsp;&nbsp; &nbsp;<br />\r\n6&egrave;me ligne : date accol&eacute;e&nbsp;&nbsp; &nbsp;<br />\r\nAnn&eacute;e Inf :&hellip;&hellip;. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;MM AAAA<br />\r\nAnn&eacute;e Sup :&hellip;&hellip; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; MM AAAA<br />\r\nBorne sup reste vide&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>CHANTIER : 1649_3321301_fichier1_(454)</strong><br />\r\n&nbsp;<br />\r\nCONSIGNES &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; CORRECTION<br />\r\n1&egrave;re ligne Expr. : s&eacute;quence &nbsp;&nbsp; &nbsp;<br />\r\n2&egrave;me ligne Expr. : s&eacute;quence&nbsp;&nbsp; &nbsp;<br />\r\n3 &egrave;me ligne : N&deg; de la boite&nbsp;&nbsp; &nbsp;<br />\r\nAnn&eacute;e Inf :&hellip;&hellip;. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; MM AAAA&nbsp;<br />\r\nAnn&eacute;e Sup :&hellip;&hellip; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; MM AAAA&nbsp;<br />\r\nBorne sup reste vide&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p><br />\r\n<strong>CHANTIER : 1649_3321301_fichier2_(777)</strong></p>\r\n\r\n<p>&nbsp;<br />\r\nCONSIGNES &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;CORRECTION<br />\r\n1&egrave;re ligne en expr. : Nom et Pr&eacute;nom&nbsp;&nbsp; &nbsp;<br />\r\n2&egrave;me ligne Expr. : date de naissance&nbsp;&nbsp; &nbsp;<br />\r\n3&egrave;me ligne : N&deg; boite&nbsp;&nbsp; &nbsp;<br />\r\nAnn&eacute;e Inf :&hellip;&hellip;. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; MM AAAA ou MM XXXX<br />\r\nAnn&eacute;e Sup :&hellip;&hellip; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;MM AAAA ou MM XXXX<br />\r\nBorne sup reste vide&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p><strong>CHANTIER : 1649_3321301_fichier3_(765)</strong></p>\r\n\r\n<p>&nbsp;<br />\r\nCONSIGNES &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;CORRECTION<br />\r\n1&egrave;re ligne en expr. : Nom et Pr&eacute;nom&nbsp;&nbsp; &nbsp;<br />\r\n2&egrave;me ligne Expr. : date de naissance&nbsp;&nbsp; &nbsp;<br />\r\n3&egrave;me ligne : N&deg; boite&nbsp;&nbsp; &nbsp;<br />\r\nAnn&eacute;e Inf :&hellip;&hellip;. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; MM AAAA ou MM XXXX<br />\r\nAnn&eacute;e Sup :&hellip;&hellip; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;MM AAAA ou MM XXXX<br />\r\nBorne sup reste vide&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2016-06-14 13:40:00', 1, 0, NULL),
(48, 45, 35, 'Manuel_de_formation_à_l_interface_de_contrôle', '<p><span style="color:rgb(0, 0, 255)">MANUEL DE FORMATION A L&rsquo;INTERFACE DE CONT&Ocirc;LE</span></p>\r\n\r\n<p><br />\r\nEn rouge les informations nouvelles depuis la V1 du manuel</p>\r\n\r\n<p>1&deg;) ATTENTION, si pendant l&rsquo;utilisation de l&rsquo;interface vous avez un bug, vous devez informer Paris avec la proc&eacute;dure suivante.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Sur le poste o&ugrave; est constat&eacute; le bug, apparait une fen&ecirc;tre sp&eacute;ciale. Appuyer sur la touche &laquo; Imp&eacute;cr &raquo; (= photographie de l&rsquo;&eacute;cran de travail)<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Ouvrir Word et faire coller (l&rsquo;image apparait) et enregistrer le contenu.</p>\r\n\r\n<p>Envoyer &agrave; Paris le document Word en pi&egrave;ce jointe en d&eacute;crivant le plus pr&eacute;cis&eacute;ment dans le corps de l&rsquo;email comment le bug est apparu.</p>\r\n\r\n<p>Quel bouton, quel &eacute;cran, quel saisie de photo,&hellip; le plus synth&eacute;tiquement possible. Le document Word est insuffisant pour r&eacute;soudre le</p>\r\n\r\n<p>probl&egrave;me.</p>\r\n\r\n<p>Dans tous les cas vous devez ensuite FERMER l&rsquo;applicatif sur le poste o&ugrave; il s&rsquo;est produit. En effet, les informations apr&egrave;s un bug ne sont</p>\r\n\r\n<p>plus saisies correctement dans la base de donn&eacute;es m&ecirc;me si &agrave; priori cela semble fonctionner &agrave; l&rsquo;&eacute;cran.</p>\r\n\r\n<p>2&deg;) Il se peut qu&rsquo;&agrave; l&rsquo;ouverture du logiciel &nbsp;un utilisateur soit d&eacute;clar&eacute;e en ligne lorsque l&rsquo;on s&eacute;lectionne son pseudo. Ce n&rsquo;est pas grave ;&nbsp;</p>\r\n\r\n<p>c&rsquo;est parce que l&rsquo;applicatif a mal &eacute;t&eacute; ferm&eacute; la fois pr&eacute;c&eacute;dente sur ce pseudo. Il suffit de s&eacute;lectionner le pseudo et de quitter l&rsquo;interface. A</p>\r\n\r\n<p>l&rsquo;ouverture suivante, cette anomalie aura disparue.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<span style="color:rgb(0, 0, 255)">*Les grands principes du contr&ocirc;le</span></p>\r\n\r\n<p><br />\r\nL&rsquo;utilisation de l&rsquo;interface de contr&ocirc;le n&eacute;cessite une bonne connaissance des r&egrave;gles de saisies.</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*D&eacute;roulement du traitement</span></p>\r\n\r\n<p>L&rsquo;interface est compos&eacute;e de 3 modules principaux et d&rsquo;un &eacute;cran d&rsquo;accueil. Chaque utilisateur de l&rsquo;interface peut selon sa fonction acc&eacute;der &agrave;</p>\r\n\r\n<p>diff&eacute;rents niveaux d&rsquo;utilisation de l&rsquo;interface.</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*La saisie</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*La correction</span></p>\r\n\r\n<p>Le second principe de base du contr&ocirc;le est qu&rsquo;un contr&ocirc;leur ne modifie pas une saisie mais fait &laquo; refaire &raquo; la saisie aux op&eacute;rateurs en</p>\r\n\r\n<p>indiquant sur quel champ pr&eacute;cis&eacute;ment porte la correction.</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*La validation</span><br />\r\nLe premier principe du fonctionnement de l&rsquo;interface est que la saisie d&rsquo;une photo est totalement valid&eacute;e que si la saisie de l&rsquo;op&eacute;rateur A</p>\r\n\r\n<p>est &eacute;gal &agrave; la saisie de l&rsquo;op&eacute;rateur B.</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Comment fonctionne l&rsquo;interface de saisie</span></p>\r\n\r\n<p>Pr&eacute;sentation de l&rsquo;automate</p>\r\n\r\n<p>Lors de la validation, il remet la photo &agrave; probl&egrave;me dans le &laquo; pool &raquo; des photos &agrave; corriger. A la sortie du module de contr&ocirc;le, la photo est ou valid&eacute;e ou &agrave; corriger.<br />\r\nLes diff&eacute;rents intervenants&nbsp;<br />\r\nLe r&ocirc;le de l&rsquo;op&eacute;rateur de saisie<br />\r\nEn mode correction, seul l&rsquo;op&eacute;rateur ayant fait la saisie principale a acc&egrave;s &agrave; la correction de sa photo. L&rsquo;&eacute;cran de correction s&rsquo;affiche pour l&rsquo;op&eacute;rateur de saisie d&egrave;s qu&rsquo;une correction est &agrave; faire. Une correction est toujours prioritaire sur la saisie de nouvelles photos. L&rsquo;op&eacute;rateur de saisie ne choisit donc pas le traitement qu&rsquo;il fait mais c&rsquo;est l&rsquo;automate qui lui pr&eacute;sente dans l&rsquo;ordre (correction puis saisie) son travail &agrave; ex&eacute;cuter.&nbsp;</p>\r\n\r\n<p>Le r&ocirc;le du contr&ocirc;leur<br />\r\nSi bien que le traitement du chantier du client avance au fur et &agrave; mesure que les photos les plus anciennes sont valid&eacute;es. Le cycle de traitement est :<br />\r\n*saisie principale par 2 op&eacute;rateurs A et B<br />\r\n*contr&ocirc;le des 2 saisies par 1 contr&ocirc;leur<br />\r\n*correction de A ou B ou des 2<br />\r\n*contr&ocirc;le des 2 saisies par 1 contr&ocirc;leur<br />\r\n*correction de A ou B ou des 2<br />\r\n*etc. autant de fois qu&rsquo;il est n&eacute;cessaire pour aboutir &agrave; saisie A= saisie B</p>\r\n\r\n<p>Contrairement aux op&eacute;rateurs de saisie qui sont atttach&eacute;s au traitement d&rsquo;une photo, des contr&ocirc;leurs diff&eacute;rents peuvent intervenir sur une m&ecirc;me photo. sans &ecirc;tre l&rsquo;auteur des premi&egrave;res demandes de corrections.&nbsp;</p>\r\n\r\n<p>Lorsque les 2 saisies sont identiques pour le contr&ocirc;leur alors le fichier de restitution est automatiquement g&eacute;n&eacute;r&eacute; par l&rsquo;interface. Le fichier s&rsquo;enrichit ainsi au fur et &agrave; mesure de la validation des photos.</p>\r\n\r\n<p>C&rsquo;est le contr&ocirc;leur qui est responsable de la qualit&eacute; du fichier restitu&eacute; au client et du respect des d&eacute;lais. A ce titre, il transmet aux op&eacute;rateurs de saisie toute l&rsquo;information n&eacute;cessaire et en particulier les &laquo; r&egrave;gles de bonnes pratiques de la saisie &raquo; (cf Cahier des r&egrave;gles de saisie &raquo;). Ces r&egrave;gles peuvent varier d&rsquo;un client &agrave; l&rsquo;autre et sont maintenues &agrave; jour.</p>\r\n\r\n<p><br />\r\n<span style="color:rgb(0, 0, 255)">*Le r&ocirc;le de l&rsquo;administrateur</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Les diff&eacute;rentes phases du contr&ocirc;le</span></p>\r\n\r\n<p><br />\r\nPlusieurs taches sont n&eacute;cessaires pour garantir la qualit&eacute; du fichier de restitution. On distingue 4 phases distinctes propres aux op&eacute;rations de contr&ocirc;le :<br />\r\n*La r&eacute;ception des &eacute;l&eacute;ments<br />\r\n*La pr&eacute;paration du chantier<br />\r\n*Le contr&ocirc;le qualit&eacute;<br />\r\n*L&rsquo;envoi des fichiers</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*La r&eacute;ception des &eacute;l&eacute;ments sur le serveur</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Organisation des documents sur le serveur</span></p>\r\n\r\n<p>La mise &agrave; disposition des &eacute;l&eacute;ments par le client a lieu 1 fois par semaine. Nous disposons d&rsquo;un d&eacute;lai de 14 jours pour lui retourner le fichier de restitution ou moins si le client nous pr&eacute;sente des demandes urgentes.&nbsp;<br />\r\nLe contr&ocirc;leur est le garant du respect des d&eacute;lais de traitement (cf staffing de l&rsquo;&eacute;quipe de saisie)</p>\r\n\r\n<p>Le client nous fait savoir (par email) que des chantiers (ensemble d&rsquo;&eacute;l&eacute;ments num&eacute;ris&eacute;s pr&eacute;sents dans des dossiers Windows) sont &agrave; notre disposition. Il faut transf&eacute;rer les &eacute;l&eacute;ments de son serveur sur le serveur maison.&nbsp;<br />\r\nL&rsquo;interface est op&eacute;rationnelle &agrave; partir du moment o&ugrave; les chantiers sont plac&eacute;s dans le r&eacute;pertoire &laquo; Archivage-Photos &raquo;.</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">Les modifications interdites</span></p>\r\n\r\n<p>Tr&egrave;s Important et primordial pour pr&eacute;server l&rsquo;int&eacute;grit&eacute; des donn&eacute;es :</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;<span style="color:rgb(255, 0, 0)">On ne d&eacute;place jamais les fichiers du client &agrave; l&rsquo;int&eacute;rieur d&rsquo;un dossier (ou chantier)<br />\r\nOn ne renomme jamais les fichiers ou les dossiers du client<br />\r\nOn ne d&eacute;place que le dossier principal (ou chantier) avec tous les &eacute;l&eacute;ments qu&rsquo;il contient</span></p>\r\n\r\n<p>&nbsp;A l&rsquo;issue du traitement, les &eacute;l&eacute;ments du client pr&eacute;sents sur notre serveur sont exactement identiques &agrave; ceux qu&rsquo;il nous a transmis au d&eacute;but du chantier</p>\r\n\r\n<p>Les &eacute;l&eacute;ments num&eacute;ris&eacute;s transmis par le client peuvent &ecirc;tre des photographies (.jpg), des fichiers sons (.mp3) ou des scanners.&nbsp;</p>\r\n\r\n<p>Le contr&ocirc;leur est le garant de l&rsquo;organisation des fichiers sur le serveur. Il doit &ecirc;tre en contact r&eacute;gulier avec le service informatique pour garantir l&rsquo;int&eacute;grit&eacute; de fichiers, la s&eacute;curit&eacute;, les sauvegardes et la restauration des fichiers si besoin.</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*La pr&eacute;paration du chantier</span></p>\r\n\r\n<p>La phase de pr&eacute;paration consiste &agrave; pr&eacute;parer les fichiers num&eacute;ris&eacute;s pour les op&eacute;rateurs de saisie et &agrave; d&eacute;j&agrave; anticiper les probl&egrave;mes qu&rsquo;ils pourraient rencontrer.</p>\r\n\r\n<p><br />\r\n<span style="color:rgb(0, 0, 255)">*Comment l&rsquo;interface automatise le process</span></p>\r\n\r\n<p>Il s&rsquo;agit d&rsquo;un travail de pr&eacute;paration.&nbsp;<br />\r\nEn saisie et donc au contr&ocirc;le les premi&egrave;res photos affich&eacute;es dans l&rsquo;interface sont les plus anciennes du r&eacute;pertoire chantier. L&rsquo;archiviste codifiant les plus anciennes par 001.jpg, puis 002.jpg,&hellip;<br />\r\nLe premier travail consiste &agrave; prendre un peu d&rsquo;avance sur la saisie et &agrave; remettre &agrave; l&rsquo;endroit les photos en s&rsquo;aidant de la visionneuse de Windows. Si vous avez fait de la saisie, vous savez qu&rsquo;il vaut mieux que les photos apparaissent &laquo; &agrave; l&rsquo;endroit &raquo; c&#39;est-&agrave;-dire l&agrave; o&ugrave; le sens de la lecture est le plus facile. En effet les mouvements de rotations des images en saisie sont lourds &agrave; manipuler et il est pr&eacute;f&eacute;rable d&rsquo;anticiper cette op&eacute;ration avec Windows. On enregistre la photo sous son angle le plus facile &agrave; lire. Il faut environ 1 heure pour faire d&eacute;filer 100 photos et les positionner &laquo; &agrave; l&rsquo;endroit &raquo;. Mais c&rsquo;est un gain de temps tr&egrave;s appr&eacute;ciable en saisie. On gagne en fluidit&eacute;.</p>\r\n\r\n<p>Dans un fichier Excel &laquo; suivi des chantiers &raquo;, dans le r&eacute;pertoire Archivage-Gestion, on indique le nom du chantier et le nombre de photos qu&rsquo;il contient. On utilise pour cela l&rsquo;utilitaire propri&eacute;t&eacute; d&rsquo;un r&eacute;pertoire et on sait alors pr&eacute;cis&eacute;ment le nombre de photos qu&rsquo;il contient.</p>\r\n\r\n<p>Dans le m&ecirc;me fichier Excel, on doit &agrave; cette occasion lister les photos dont l&rsquo;analyse est plus complexe. Notamment celles qui portent un N&deg; d&rsquo;archive et une borne inf&eacute;rieures ou sup&eacute;rieures. En effet ces 3 champs peuvent &ecirc;tre oubli&eacute;s en saisie A et B (champs d&rsquo;analyse et de saisie) et donc ne pas &ecirc;tre consid&eacute;r&eacute;es en anomalies au contr&ocirc;le (cardans le cas d&rsquo;un oubli alors A=B !). Une simple liste des .jpg de ces photos complexes permettra de s&rsquo;assurer plus tard qu&rsquo;elles ont &eacute;t&eacute; correctement saisies. La liste devra &ecirc;tre imprim&eacute;e et transmise &agrave; la saisie pour les informer des photos qui n&eacute;cessitent une vigilance suppl&eacute;mentaire.</p>\r\n\r\n<p>De m&ecirc;me le contr&ocirc;leur durant ce premier balayage peut identifier les photos floues ou celles o&ugrave; le signe d&rsquo;illisibilit&eacute; XXX sera utilis&eacute;. La liste devra &ecirc;tre imprim&eacute;e et transmise &agrave; la saisie pour les informer des photos qui n&eacute;cessitent une saisie XXX particuli&egrave;re.</p>\r\n\r\n<p>L&rsquo;objectif de ce travail pr&eacute;paratoire est :<br />\r\n*de dimensionner le chantier (combien de photos dans le stock &agrave; traiter)<br />\r\n*de lister les photos complexes (n&deg; d&rsquo;archives, bornes inf et sup)<br />\r\n*d&rsquo;anticiper au maximum l&rsquo;utilisation des caract&egrave;res d&rsquo;illisibilit&eacute;</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Les r&egrave;gles de bonnes pratiques de la saisie</span></p>\r\n\r\n<p>Dans ce m&ecirc;me fichier Excel, les contr&ocirc;leurs tiennent un livre de bord dans lequel il explique les cas probl&eacute;matiques de saisie rencontr&eacute;s et la mani&egrave;re dont ils les ont r&eacute;solus. Les diff&eacute;rents manuels de formation (saisie ou contr&ocirc;le) seront enrichis par la suite des r&egrave;gles qui ont &eacute;t&eacute; appliqu&eacute;es. Logiquement avec le temps, on aura des manuels complets des cas de figures rencontr&eacute;s et comment il faut les r&eacute;soudre.<br />\r\nLa premi&egrave;re tache du contr&ocirc;leur consiste &agrave; bien r&eacute;ceptionner le chantier de l&rsquo;archiviste (stock de photos).</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Le contr&ocirc;le qualit&eacute;</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Les fichiers de restitution</span></p>\r\n\r\n<p>Les fichiers de restitutions sont g&eacute;n&eacute;r&eacute;s automatiquement par l&rsquo;interface.</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*D&eacute;finition d&rsquo;un enregistrement dans Excel</span></p>\r\n\r\n<p>A chaque photo valid&eacute;e par le contr&ocirc;leur, un fichier Excel structur&eacute; selon les exigences du client est enrichi des nouveaux enregistrements correspondants &agrave; la photo.<br />\r\n1 enregistrement (1 ligne dans Excel) est g&eacute;n&eacute;r&eacute; pour chaque boite d&rsquo;archives de la photo<br />\r\n1 enregistrement (1 ligne dans Excel) est g&eacute;n&eacute;r&eacute; pour chaque copropri&eacute;t&eacute; d&rsquo;une boite d&rsquo;archive<br />\r\nUne photo comprenant 4 boites d&rsquo;archives sera restitu&eacute; par 4 enregistrements<br />\r\nSi une boite contient 1 ou plusieurs copropri&eacute;t&eacute; on restitue autant de ligne d&rsquo;enregistrement qu&rsquo;il y a de copropri&eacute;t&eacute;<br />\r\n&nbsp;&nbsp; &nbsp;1 boite avec 1 copropri&eacute;t&eacute; pour 1 enregistrement dans le fichier<br />\r\n&nbsp;&nbsp; &nbsp;1 boite avec 2 copropri&eacute;t&eacute;s pour 2 enregistrements dans le fichier<br />\r\n&nbsp;&nbsp; &nbsp;2 boites avec 2 copropri&eacute;t&eacute;s chacune pour 4 enregistrements dans le fichier<br />\r\n2 boites avec 2 copropri&eacute;t&eacute;s pour l&rsquo;une et 1 copropri&eacute;t&eacute; pour l&rsquo;autre pour 3 enregistrements dans le fichier &hellip;</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Dessin des fichiers de restitution</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Emplacement du fichier de restitution client</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Pr&eacute;sentation de l&#39;&eacute;cran de contr&ocirc;le</span></p>\r\n\r\n<p>Lorsque vous ouvrez votre &eacute;cran de contr&ocirc;le les automates de comparaison sont d&eacute;j&agrave; intervenus. Ils vont vous guider dans la comparaison des 2 saisies A et B.&nbsp;</p>\r\n\r\n<p>Lorsque les saisies sont similaires les champs sont verts<br />\r\nLorsque les saisies sont diff&eacute;rentes les champs sont oranges</p>\r\n\r\n<p>Selon le choix A refaire, les champs passent au rouge (=&agrave; refaire) pour A ou B ou les deux.</p>\r\n\r\n<p>Donc lorsque tous les champs entre A et B sont &eacute;gaux alors tous les champs sont verts.</p>\r\n\r\n<p>Vous disposez d&rsquo;un champ communication pour A et B, qui peut vous permettre de pr&eacute;ciser votre contr&ocirc;le et d&rsquo;informer l&rsquo;op&eacute;rateur A ou B avec un message qui sera lisible lors de la correction.</p>\r\n\r\n<p>Concernant les expressions, vous pouvez d&eacute;placer un groupe Expression/N&deg; archive/Intitul&eacute; et le positionner sur un autre rang. Cela dans le cas ou A et B n&rsquo;ont pas saisie dans le m&ecirc;me ordre. Logiquement le cas doit &ecirc;tre rare.</p>\r\n\r\n<p>Vous pouvez &eacute;galement remettre sur 1 rang ce qui aurait &eacute;t&eacute; saisie sur 2 rangs en utilisant les petits num&eacute;ros sur les c&ocirc;t&eacute;s. Il se peut qu&rsquo;&agrave; l&rsquo;issue de cette op&eacute;ration de recadrage des informations la saisie soit alors conforme pour A et B. Cela peut &eacute;viter &agrave; remettre &agrave; la correction.</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Le contr&ocirc;le du texte saisie</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Contr&ocirc;le de la zone d&rsquo;en-t&ecirc;te</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Contr&ocirc;le des champs de saisie</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Contr&ocirc;le des champs d&rsquo;analyse</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Les probl&egrave;mes de structure</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*A et B n&rsquo;ont pas le m&ecirc;me nombre d&rsquo;enregistrements</span></p>\r\n\r\n<p>A l&rsquo;ouverture du contr&ocirc;le, une fen&ecirc;tre s&rsquo;affiche pour r&eacute;soudre cette diff&eacute;rence</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Un op&eacute;rateur a enregistr&eacute; 2 fois la m&ecirc;me saisie</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Un op&eacute;rateur a oubli&eacute; 1 saisie</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Supprimer &nbsp;un enregistrement &nbsp;de la saisie de A ou B</span></p>\r\n\r\n<p>Le contr&ocirc;leur ne fait que refaire ce qui a &eacute;t&eacute; fait et envoie en correction ses demandes.<br />\r\nPartant de ce partis pris il n&rsquo;a pas pouvoir de supprimer un enregistrement d&rsquo;une boite ou d&rsquo;une copropri&eacute;t&eacute; r&eacute;alis&eacute; par un op&eacute;rateur de saisie. Il fait supprimer l&rsquo;enregistrement par celui qui l&rsquo; a saisie.<br />\r\nPour faire supprimer un enregistrement, il faut qu&rsquo;il envoie en correction (l&rsquo;enregistrement) la boite ou la copropri&eacute;t&eacute; en cochant tous les champs ayant fait l&rsquo;objet d&rsquo;une saisie par &agrave; Refaire et en indiquant dans la boite Message sous la photo l&rsquo;indication de supprimer la boite. Lorsque le correcteur r&eacute;cup&egrave;re la photo et lit la recommandation, il sait qu&rsquo;il doit effacer tous les champs de saisie. Lors de la validation de son enregistrement (boite ou copropri&eacute;t&eacute;) vide l&rsquo;interface supprime l&rsquo;enregistrement<br />\r\nRemarque : les champs d&rsquo;en-t&ecirc;tes du conteneur ne sont pas concern&eacute;s. Seuls les champs boite/copro (&agrave; la droite de l&rsquo;&eacute;cran) doivent &ecirc;tre effac&eacute;s pour que la suppression soit effective.</p>\r\n\r\n<p><br />\r\nIl peut seulement ajouter des enregistrements &laquo; vides &raquo; et supprimer ces m&ecirc;mes enregistrements</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">A et B ont le m&ecirc;me nombre d&rsquo;enregistrements</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">A et B ont tous les 2 oubli&eacute; une saisie</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">A et B n&rsquo;ont pas saisi le m&ecirc;me nombre de copropri&eacute;t&eacute; et de boite</span></p>\r\n\r\n<p>En effet,&nbsp;<br />\r\n(A) peut pour une photo avoir saisie :&nbsp;&nbsp; &nbsp;4 boites, dont 1 avec 3 copropri&eacute;t&eacute;s soit 6 enregistrements<br />\r\n(B) peut pour une photo avoir saisie :&nbsp;&nbsp; &nbsp;5 boites, dont 1 avec 2 copropri&eacute;t&eacute;s soit 6 enregistrements<br />\r\n(A) et (B) ont bien le m&ecirc;me nombre d&rsquo;enregistrements</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">Comment utiliser le bouton &laquo; Mettre la photo en attente administrateur &raquo;</span></p>\r\n\r\n<p><br />\r\nA l&rsquo;issue du contr&ocirc;le il existe 2 possibilit&eacute;s pour une photo :<br />\r\n*Etre valid&eacute;e<br />\r\n*envoy&eacute;e en correction<br />\r\nIl existe une 3eme possibilit&eacute; &agrave; utiliser avec pr&eacute;caution car elle d&eacute;clenche une action &agrave; Paris. D&eacute;cider de mettre une photo en attente administrateur. Cette action permet de ne pas valider une photo (envoi au client) et de ne pas la remettre non plus en correction. Le processus de saisie/contr&ocirc;le/correction peut se poursuivre pour la photo suivante.&nbsp;</p>\r\n\r\n<p>Cela peut &ecirc;tre in&eacute;vitable lors d&rsquo;un probl&egrave;me tr&egrave;s particulier de saisie. Vous devez le plus rapidement possible informer par mail Paris qu&rsquo;une photo est en attente.&nbsp;</p>\r\n\r\n<p>Exemple de cas de mise en attente :</p>\r\n\r\n<p>*cr&eacute;ation d&rsquo;un service (car il doit &ecirc;tre valid&eacute; avec l&rsquo;archiviste)</p>\r\n\r\n<p>*un nombre de passage trop important entre la correction et le contr&ocirc;le. A partir d&rsquo;un nombre de passage d&eacute;fini, la photo est automatiquement bloqu&eacute;e pour &ecirc;tre supervis&eacute;</p>\r\n\r\n<p>*un probl&egrave;me jamais rencontr&eacute; et n&eacute;cessitant de nouvelles consignes</p>\r\n\r\n<p><br />\r\nCette option permet de faire intervenir une quatri&egrave;me personne dans le processus de v&eacute;rification et de restitution &agrave; l&rsquo;archiviste son fichier avec une exigence qualit&eacute; renforc&eacute;e.</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Utilisation de la zone &laquo; Message &raquo;</span></p>\r\n\r\n<p>N&rsquo;importe quel op&eacute;rateur peut utiliser cette zone de commentaire. Elle sert &agrave; &eacute;changer entre tous les intervenants tout au long du processus de saisie de la photo.&nbsp;<br />\r\nChaque enregistrement, boite ou copropri&eacute;t&eacute; dispose d&rsquo;une zone message.</p>\r\n\r\n<p>Attention &agrave; rester concis et clair.<br />\r\nExemple :&nbsp;</p>\r\n\r\n<p>*saisir B1<br />\r\n*sup Boite<br />\r\n*place du XXX</p>\r\n\r\n<p>On verra &agrave; mettre en place des abr&eacute;viations pour aller le plus vite possible (cf &laquo; R&egrave;gles de bonnes pratiques &raquo;)</p>\r\n\r\n<p>Lors de la mise en attente administrateur, il est n&eacute;cessaire d&rsquo;expliquer en quelques mots le pourquoi de l&rsquo;action. Par ailleurs, il est n&eacute;cessaire d&rsquo;envoyer un mail &agrave; Paris dans le but d&rsquo;informer l&rsquo;administrateur du blocage d&rsquo;une photo dans un sas.&nbsp;<br />\r\nTant qu&rsquo;une photo est bloqu&eacute;e, le fichier final ne peut pas &ecirc;tre retourn&eacute; au client. Il est donc important de veiller &agrave; ce que les photos en attentes ne le soient pas trop longtemps</p>\r\n\r\n<p>Disposition photo</p>\r\n\r\n<p>Remarque : le contr&ocirc;leur intervient &agrave; chaque r&eacute;ception des photographies pour pr&eacute;parer le travail des op&eacute;rateurs de saisie. Il dispose les photographies pour qu&rsquo;elles se pr&eacute;sentent de la mani&egrave;re la plus lisible possible. Verticalement ou horizontalement pour offrir le maximum de lecture &laquo; &agrave; l&rsquo;endroit &raquo;.</p>', '2016-06-15 19:23:18', 1, 0, NULL);
INSERT INTO `version` (`ver_creator`, `ver_article`, `Id`, `ver_titre`, `ver_content`, `ver_date`, `ver_editable`, `ver_del`, `attachement`) VALUES
(48, 46, 36, 'Interface_administrateur_web', '<p><span style="color:#0000FF">INTERFACE ADMINISTRATEUR WEB</span></p>\r\n\r\n<p><span style="color:#0000FF">D&eacute;finition </span>:&nbsp;</p>\r\n\r\n<p>C&rsquo;est une interface, qui nous permet de voir l&rsquo;&eacute;volution de tout le travail que nous effectuons (photos par photos !!) en temps r&eacute;el. Elle est structur&eacute;e autour de chaque Interface de saisie (Proarchives, Ago,&hellip;). Elle permet d&rsquo;effectuer des actions simples comme reconstruire la liste des dossiers de travail &agrave; venir, de lire des consignes du client concernant des priorit&eacute;s,&hellip;</p>\r\n\r\n<p>Nos clients disposent d&rsquo;une interface similaire (ou presque&hellip;) qui permet en tout cas d&rsquo;afficher les m&ecirc;mes r&eacute;sultats (valid&eacute;es, stock,&hellip;)</p>\r\n\r\n<p><span style="color:#0000FF">Comment y acc&eacute;der ?</span></p>\r\n\r\n<p>T&eacute;l&eacute;charg&eacute; FIREFOX sur le poste sur lequel vous travaill&eacute; s&rsquo;il ne s&rsquo;y trouve pas.</p>\r\n\r\n<p><br />\r\n<span style="color:#0000FF"><u>http://www.01net.com/telecharger/windows/Internet/navigateur/fiches/25711.html</u></span></p>\r\n\r\n<p>Ensuite Installer le pluggin Locallink en utilisant le lien suivant :</p>\r\n\r\n<p><span style="color:#0000FF"><u>http://www.dropbox.com/link/17.creHwmyggu.1ddb8c19c63f83c6?k=b22746a3fe3d4efc02d5c08ccaedf9c8</u></span></p>\r\n\r\n<p>Puis suivre les instructions&nbsp;<br />\r\nNb : tout ce que vous installerez doit &ecirc;tre &agrave; des fins &lsquo;&rsquo;personnelles &lsquo;&rsquo; et non commerciales.<br />\r\nUne fois seulement apr&egrave;s avoir install&eacute; le local Link alors il vous pouvez vous connecter a l&rsquo;interface administrateur web pour le site&nbsp;</p>\r\n\r\n<p><span style="color:#0000FF">&laquo; http://192.168.0.21/azertwin/</span></p>\r\n\r\n<p>Utilisateur : c_kenkou (exemple) &nbsp;&nbsp; &nbsp;ou &nbsp;&nbsp; &nbsp;utilisateur : a_koffi<br />\r\nMot de passe : kenkou &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;mot de passe : koffi</p>\r\n\r\n<p><br />\r\nET voil&agrave; le tour est jou&eacute; vous d&eacute;couvrez l&rsquo;interface web</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<span style="color:#0000FF">R&ocirc;le de l&rsquo;interface &nbsp;web :&nbsp;</span></p>\r\n\r\n<p>PS : seules les contr&ocirc;leurs ou personnes habilit&eacute;s &nbsp;doivent le manipuler entre outre Christelle, preenam, Carole, Yasminath &nbsp;etc &hellip;.</p>\r\n\r\n<p>Dor&eacute;navant &nbsp;le contr&ocirc;leur ou administrateur est capable de cr&eacute;er une liste des chantiers &agrave; &nbsp;traiter selon &nbsp;les besoins et les circonstances.<br />\r\nUne fois que le client aura lui sur son interface d&eacute;finit le OU les chantiers qui lui sont &nbsp;prioritaires ou &nbsp;encore &nbsp;urgents &nbsp;ceux &nbsp;ci iront s&rsquo;afficher automatiquement dans &nbsp;deux colonnes principal qui se &nbsp;trouvent sur interface de Archivage partie Environnement : ces &nbsp;chantiers s&rsquo;afficheront dans la &lsquo;&rsquo;colonne dossier actuel&rsquo;&rsquo; &nbsp;et en 1ere ligne dans la colonne &lsquo;&rsquo; choix &nbsp;du dossier &lsquo;&rsquo; &nbsp;ceci &nbsp;indiquant la place qu&rsquo;occupe r&eacute;ellement ces &nbsp;chantiers &nbsp;puisqu&rsquo;il s&rsquo;agit des choix du client et qu&rsquo;il est imp&eacute;ratif de respecter.</p>\r\n\r\n<p><span style="color:#0000CD"><u><em>Traitement des chantiers &nbsp; non prioritaire ou non urgent&nbsp;</em></u></span></p>\r\n\r\n<p>Ils &nbsp;se peut que &nbsp;le chantier &nbsp;dit prioritaire ou urgent soit &nbsp;compliqu&eacute; &nbsp;et donc &nbsp;n&eacute;cessite que &nbsp;ce soit les anciennes du &nbsp;l&rsquo;&eacute;quipe qui fassent la saisie pour &eacute;viter des &nbsp;erreurs et une perte de temps, dans ce cas de &nbsp;figure &nbsp;nous pouvons modifier cette liste &nbsp;que le client a cr&eacute;er , tout &nbsp;simplement en &nbsp;choisissant &nbsp;un &nbsp;ou plusieurs autres chantiers ( cochez les petites cases o&ugrave; &nbsp;se trouve les noms &nbsp;des chantiers de l&rsquo;envoi a traiter) puis &nbsp;cliquez &nbsp;sur l&rsquo;action &lsquo;&rsquo;COMMENCER&rsquo;&rsquo; tout &nbsp;en haut a gauche de l&rsquo;interface web &nbsp;.L&rsquo;on remarque alors que la &nbsp;nouvelle liste des chantiers &nbsp;qui rentre &nbsp;en action vient &nbsp;&eacute;craser &nbsp;celle &nbsp;que &nbsp;le client &nbsp;a mis en place, mais elle ne modifie en rien la priorit&eacute; des chantiers a saisir. Nous pouvons donc d&eacute;cidez a ce instant &nbsp;de repartir les chantiers urgent a une partie de l&rsquo;&eacute;quipe (ancienne) et &nbsp;choisir &nbsp;un &nbsp;autre &nbsp;chantier mois compliquer pour l&rsquo;&eacute;quipe consid&eacute;r&eacute;e comme nouvelle.</p>\r\n\r\n<p>Lorsque &nbsp;le stock a &nbsp;saisir &nbsp;d&rsquo;un chantier est &nbsp;a &nbsp;z&eacute;ro (stock a saisir = 0) alors &nbsp;l&rsquo;interface colorie la case du chantier &nbsp;en &nbsp;<strong><span style="font-size:22px">rouge</span></strong> signalisant &nbsp;qu&rsquo;il n&rsquo;y a &nbsp;plus rien a &nbsp;saisir et &nbsp;donc que le chantier ne peut pas &ecirc;tre rebasculer dans la liste de choix de dossier dans l&rsquo;interface archivage et donc en saisie.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>NB : Seul le contr&ocirc;leur &nbsp;ou l&rsquo;administrateur ont ce pouvoir ,mais il &nbsp;ne &nbsp;doit &nbsp;en aucun cas &nbsp;modifi&eacute; &nbsp;le &nbsp;statut &nbsp;des chantiers &nbsp;a &nbsp; traiter a la place &nbsp;du client</p>\r\n\r\n<p><br />\r\n<span style="font-size:20px"><span style="color:#0000FF">Pr&eacute;sentation de l&rsquo;interface Web</span></span></p>\r\n\r\n<p>L&rsquo;interface web contient plusieurs &eacute;l&eacute;ments pour suivre l&rsquo;avancement de nos travaux&nbsp;<br />\r\nPlusieur boutons sont disponible a cet effet :<br />\r\n1er bouton : UTILISATEUR<br />\r\n2eme : AVANCEMENTS DES &nbsp;TRAVAUX soit PROARCHIVES ou AGO<br />\r\n3eme : Bouton &nbsp;D&rsquo;ACTUALISATION des donnees<br />\r\n&nbsp;Et enfin le 4eme : Bouton EXIT(sortir)</p>\r\n\r\n<p>1-)UTILISATEUR</p>\r\n\r\n<p><br />\r\n2-)AVANCEMENT DES TRAVAUX PROARCHIVES ou AGO</p>\r\n\r\n<p>Ce qui vous importe sur cette interface sont les diff&eacute;rents tableaux avec des colonnes.<br />\r\nOn peut lire en ent&ecirc;te &lsquo;ENVOI 2012.013 &lsquo;&rsquo; c&rsquo;est l&rsquo;enregistrement du num&eacute;ro que porte l&rsquo;envoi du client, l&rsquo;envoi le plus r&eacute;cent &nbsp;se trouve tout en bas juste avant le tableau des grands totaux.<br />\r\nLes couleurs des lignes des chantiers peuvent vari&eacute;s dans notre cas pr&eacute;cis nous avons 3 types de colorations ; le vert, l&rsquo;orange et le Normal. Lorsque toutes les lignes sont au vert ca veut dire que le chantier est termin&eacute; c&rsquo;est a dire 0 photos a saisir,0 a valider,0 a contr&ocirc;ler bref tout est finis<br />\r\nLorsque nous observons la couleur orange cela veut dire qu&rsquo;a un moment donn&eacute; l&rsquo;interface a BUGGER et donc il ya eu plus de photos saisis que le nombre normal qu&rsquo;il fallait saisir.<br />\r\nEt la couleur Normal pr&eacute;cise les chantiers sur lesquelles nous n&rsquo;avons pas termin&eacute;, soit il reste de la saisie, du contr&ocirc;le, des attentes Admin. ou autres mais forcement il na pas &eacute;t&eacute; valider le nombre d&eacute;clar&eacute;.</p>\r\n\r\n<p><strong><span style="color:#0000FF">Chantier(s) </span></strong>: il s&rsquo;agit des noms des diff&eacute;rents chantiers.<br />\r\n&nbsp;&nbsp; &nbsp;<span style="color:#FF0000">Si le nom du chantier a une date qui n&rsquo;est pas au format AAAA-MM-JJ comme par exemple (underscore _ au lieu de tirets - ) alors&nbsp;</span><span style="color:rgb(255, 0, 0)">informer vite Paris.</span></p>\r\n\r\n<p><strong><span style="color:#000000">Date envoi</span></strong> : date a laquelle le chantier nous a &eacute;t&eacute; transmis (date de d&eacute;p&ocirc;t du client sur le serveur)</p>\r\n\r\n<p><strong>Fichiers d&eacute;clar&eacute;s</strong> : il s&rsquo;agit du nombre de fichier que nous a d&eacute;clar&eacute; le client dans les rapports de chantier</p>\r\n\r\n<p><strong>Fichiers re&ccedil;us </strong>: si le transfert c&rsquo;est bien d&eacute;roul&eacute; il s&rsquo;agit du nombre de fichiers t&eacute;l&eacute;charg&eacute;s<br />\r\nNB :&nbsp;</p>\r\n\r\n<p>Pour Proarchives : Fichiers d&eacute;clar&eacute;s = fichiers re&ccedil;us = fichiers a traiter</p>\r\n\r\n<p>Pour Ago : Fichiers d&eacute;clares = fichiers re&ccedil;us = fichiers a traiter &ndash; ardoises</p>\r\n\r\n<p><span style="color:#0000FF">Ardoises </span>: elles concernent le client AGO il s&rsquo;agit des consignes qu&rsquo;il donne sur la saisie et donc elles ne doivent pas &ecirc;tre consid&egrave;r&eacute;es comme des fichiers a traiter.</p>\r\n\r\n<p><strong>En cours de saisie :</strong> ce sont les photos qui sont entrain d&rsquo;&ecirc;tre saisie en premi&egrave;re fois<br />\r\n<strong>A contr&ocirc;ler </strong>: c&rsquo;est le nombre de photos en attente d&rsquo;&ecirc;tre contr&ocirc;l&eacute;es<br />\r\n<strong>En cours de contr&ocirc;le</strong> : ce sont les photos qui sont actuellement entrain d&rsquo;&ecirc;tre contr&ocirc;l&eacute;es<br />\r\n<strong>A corriger</strong> : il s&rsquo;agit des photos en attente de corrections, soit pour les op&eacute;ratrices pr&eacute;sentes (ou via correcteur magique en cas d&rsquo;absence)<br />\r\n<strong>En cours de correction</strong> : il s&rsquo;agit des photos actuellement en cours de correction<br />\r\n<strong>Attente super contr&ocirc;leur</strong> : il s&rsquo;agit du nombre de photos en attente Admin.<br />\r\n<strong>En cours super contr&ocirc;leur </strong>: les photos en cours de traitement en super control<br />\r\n<strong>Attente client</strong> : Il s&rsquo;agit des photos qui n&rsquo;ont pas pu &ecirc;tre trait&eacute; en attente Admin. et qui sont en attente client (traitement par FRED). L&rsquo;interface permet de les remettre dans le process.</p>\r\n\r\n<p><strong>Total valid&eacute;es</strong> : c&rsquo;est le nombre de photos d&eacute;j&agrave; valid&eacute; (info visible par le client)<br />\r\n<strong>Total en-cours </strong>: c&rsquo;est le total des en-cours (toutes sauf valid&eacute;es) et (info visible par le client)</p>\r\n\r\n<p><strong>Stock &agrave; saisir</strong> : c&rsquo;est ce qu&rsquo;il reste r&eacute;ellement a saisir (info visible par le client !!) donc notre client sait tr&egrave;s bien s&rsquo;il nous reste des photos !!!</p>\r\n\r\n<p><strong>Stock a valid&eacute;</strong> : c&rsquo;est ce qu&rsquo;il reste a valider (info visible par le client)</p>\r\n\r\n<p><strong>L&rsquo;interface</strong> : le client pour lequel nous travaillons<br />\r\n<strong>D&eacute;part compteur </strong>: c&rsquo;est le nombre a partir duquel l&rsquo;interface doit faire son d&eacute;compte. Ce num&eacute;ro est connu de nous si par exemple nous venons juste de saisir un chantier avec le m&ecirc;me code client (PAF003, PAG040,&hellip;) mais parfois c&rsquo;est le client qui nous donne le num&eacute;ro &agrave; partir duquel il faut partir ou repartir.<br />\r\n<strong>Date de retour</strong> : c&rsquo;est la date pr&eacute;visionnelle &agrave; laquelle le client doit &ecirc;tre livr&eacute; (il est n&eacute;cessaire de toujours finir 2 ou 3 jours a l&rsquo;avance)<br />\r\n<strong>Priorit&eacute; </strong>: le client peut par cette case pr&eacute;ciser le chantier qu&rsquo;il aimerait avoir en priorit&eacute; si ce n&rsquo;est pas le cas, alors la colonne reste en &lsquo;&rsquo;normale &lsquo;&rsquo; comme c&rsquo;est le cas actuellement.<br />\r\n&nbsp;&nbsp; &nbsp;Urgent : le client veut son fichier d&eacute;finitif &agrave; la date qui nous pr&eacute;cise dans la colonne date urgence.<br />\r\n&nbsp;&nbsp; &nbsp;Priorit&eacute; 1,2,3 : il nous donne l&rsquo;ordre dans lequel il souhaite voir se finaliser les chantiers.<br />\r\nNotre client dispose d&rsquo;un module de requ&ecirc;te qui lui permet de retrouver une boite d&rsquo;archives. Mais pour la retrouver, il a besoin de consulter notre saisie (en cours, valid&eacute;e, en attente,.. peu importe). On lui met &agrave; disposition la meilleure saisie possible dont on dispose &agrave; ce moment l&agrave;. Donc jouer sur les priorit&eacute;s lui permet de faire une recherche sur l&rsquo;int&eacute;gralit&eacute; des photos d&rsquo;un chantier !</p>\r\n\r\n<p><br />\r\n<span style="color:#FF0000">NB : Lorsque le client modifie une priorit&eacute;, cela modifie directement le chantier de travail que vous avez en cours de saisie !</span></p>\r\n\r\n<p><strong>Modification priorit&eacute; </strong>: elle permet de modifier la priorit&eacute; d&rsquo;un chantier (conf&egrave;re la colonne priorit&eacute;)</p>\r\n\r\n<p><br />\r\n<span style="color:#FF0000">NB : IL EST FORMELLEMENT INTERDIT DE TOUCHER A LA COLONNE &lsquo;&rsquo;MODIFICATION DE PRIORITE&rsquo;&rsquo; ni de valider une action cela affecterait tout le processus. Seul le client est habilit&eacute; &agrave; le faire !</span></p>\r\n\r\n<p>Ensuite viennent les colonnes Etat de chantier, date de restitution et Date URGENCE l&rsquo;interface n&rsquo;&eacute;tant qu&rsquo;en cr&eacute;ation ces colonnes ne sont pas pr&eacute;cis&eacute;es.<br />\r\nEn gros, voici ce qu&rsquo;il faut retenir :<br />\r\nLes colonnes STOCK A SAISIR-STOCK A CONTROLER-STOCK A VALIDER- sont tr&egrave;s importantes pour les contr&ocirc;leurs et op&eacute;ratrices de saisies.<br />\r\nLe contr&ocirc;leur doit pouvoir savoir si le nombre de photos a contr&ocirc;ler n&rsquo;est pas &eacute;norme par rapport a ce qui a d&eacute;j&agrave; &eacute;t&eacute; saisie et donc il doit essayer de d&eacute;cider soit de renforcer le contr&ocirc;le ou soit de renforcer de la saisie<br />\r\n&nbsp;S&rsquo;il n&rsquo;a presque rien a contr&ocirc;ler le nombre de photos a valider est plus grand que le nombre de photos a saisir alors c&rsquo;est le moment de renforcer le contr&ocirc;le pour valider plus de photos de donc chuter le stock a valider.<br />\r\n<u>Exemple :</u></p>\r\n\r\n<p>&nbsp;Photos &agrave; saisir &nbsp;photos &agrave; contr&ocirc;ler &nbsp;photos valider &nbsp;photos a valider<br />\r\n&nbsp; &nbsp; &nbsp; <span style="color:#FF0000">220 </span>&nbsp; &nbsp; &nbsp;940 &nbsp; &nbsp; &nbsp; &nbsp;22 &nbsp; &nbsp; &nbsp; <span style="color:#FF0000">&nbsp;918</span></p>\r\n\r\n<p>L&rsquo;on remarque ici que le nombre a contr&ocirc;le et a valider est &eacute;norme hors la saisie ne reste que 220 photos il est donc imp&eacute;ratif de basculer tout celles qui font du contr&ocirc;le pour r&eacute;duire le stock.</p>\r\n\r\n<p>Pour &nbsp;finir nous avons le tableau des grands totaux : il r&eacute;capitule par colonne les totaux de chaque &eacute;l&eacute;ment.</p>\r\n\r\n<p><br />\r\n<span style="color:#0000FF"><span style="font-size:20px"><u>Contr&ocirc;le &ndash; Affectation d&rsquo;un &nbsp;chantier &nbsp;specifique &nbsp;a un &nbsp;ou &nbsp;plusieurs &nbsp;contr&ocirc;leurs</u></span></span></p>\r\n\r\n<p>Dor&eacute;navant &nbsp;nous pouvons affecter &nbsp;a un contr&ocirc;leur un chantier a contr&ocirc;ler &nbsp;exclusivement ;il suffit &nbsp;de renseigner via l&rsquo;interface web un nom chantier dans chantier en-cours (comme pour la saisie)mais &nbsp;on conserve si cette &nbsp;zone n&rsquo;est pas renseign&eacute;e (Y:/) la possibilit&eacute; de contr&ocirc;ler &nbsp;au fil de l&rsquo;eau tous les chantiers</p>\r\n\r\n<p>Ce changement est &nbsp;important &nbsp;surtout pour AGO o&ugrave; les consignes peuvent &nbsp;varier d&rsquo;un chantier a &nbsp;l&rsquo;autre ; en isolant &nbsp;un contr&ocirc;leur sur 1seul chantier (mini chantier ) &nbsp;sans attendre que TOUS &nbsp;les &nbsp;chantiers soient &nbsp; finis.<br />\r\nNB. &nbsp;SI &nbsp;vous affectez un chantier a un contr&ocirc;leur et que vous souhait&eacute; le rendre &nbsp;libre de contr&ocirc;ler &nbsp;tout &nbsp; genre &nbsp;de &nbsp;photo donc &nbsp;l&rsquo;ensemble &nbsp;des chantiers &nbsp;il &nbsp;suffit &nbsp;d&rsquo;effacer le contenu de chantier &nbsp;en cours. Pour effacer, changer dans l&rsquo;interface web &nbsp;son interface (AGO, Pro archives&hellip;). Il reprendra automatiquement la valeur par &nbsp;d&eacute;faut Y:/<br />\r\nExple : &nbsp;Je suis &nbsp;sur &nbsp;un chantier &nbsp;sp&eacute;cifique &nbsp;en contr&ocirc;le, &nbsp;si &nbsp;sur &nbsp;on &eacute;cran &nbsp;il s&rsquo;affiche &nbsp; &nbsp;aucune &nbsp; photo &nbsp;a contr&ocirc;ler &nbsp;cela &nbsp;ne &nbsp;voudrais pas &nbsp;dire qu&rsquo;il n&rsquo;y a plus aucune &nbsp;photo &nbsp;a &nbsp;contr&ocirc;ler &nbsp;en &nbsp;g&eacute;n&eacute;ral. Pour &nbsp;retrouver les &nbsp;photos &nbsp;des &nbsp;autres chantiers &nbsp;et continuer mon contr&ocirc;le, je prends mon login je le &nbsp;met &nbsp;dans &nbsp;interface &nbsp;AGO, puis &nbsp;ensuite je le &nbsp;ram&egrave;ne &nbsp;dans &nbsp;pro archives &nbsp;et &nbsp;donc &nbsp;il ne s&rsquo;affichera plus &nbsp;aucun chantier &nbsp;et l&agrave; je pourrais contr&ocirc;ler des &nbsp;photos &nbsp;au fil &nbsp;des validation par l&rsquo;&eacute;quipe &nbsp;en saisie<br />\r\nRappel : &nbsp;la &nbsp;valeur Y:/ &nbsp;dans un chantier pour un contr&ocirc;leur d&eacute;signe &nbsp;tous les chantiers ou &nbsp;il &nbsp;y a du contr&ocirc;le a faire</p>\r\n\r\n<p><span style="color:#0000FF"><u>Ce &nbsp;qu&rsquo;il &nbsp;faut &nbsp;retenir :</u></span>Vous &nbsp;avez &nbsp;remarqu&eacute; que dans l&rsquo;interface web lorsqu&rsquo;un chantier est totalement saisie, il n&rsquo;est plus possible de l&rsquo;envoyer dans la liste des chantiers a saisir (il est rouge). Pensez y &eacute;galement pour le &nbsp;contr&ocirc;le ; &nbsp;il &nbsp;faut &nbsp;donc a tout prix &nbsp;affecter &nbsp;le chantier &nbsp;au contr&ocirc;leur avant &nbsp;que le chantier ne &nbsp;disparaisse de la liste &nbsp;des en-cours &nbsp;de &nbsp;saisie .</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#0000FF"><u>Comment &nbsp;-DE BUGGER - &nbsp;une &nbsp;photo &nbsp;qui &nbsp;bloque &nbsp;une animatrice</u></span></p>\r\n\r\n<p>IL &nbsp;arrive plusieurs fois &nbsp;ce m&ecirc;me probl&egrave;me &nbsp;une animatrice est &nbsp;bloquer sur son interface pour plusieurs raisons, soit en contr&ocirc;le, en saisie, ou &nbsp;en correction.</p>\r\n\r\n<p>Explication : une personne peut &nbsp;se retrouver dans ce cas pour plusieurs raisons soit la m&ecirc;me photo a &eacute;t&eacute; saisie 3 fois au lieu de 2 fois uniquement c&rsquo;est a dire saisie A et B soit , il &nbsp;ya eu un crash &nbsp;de la base de donn&eacute;e et donc &nbsp;il faut &nbsp;rendre tout au propre.<br />\r\nLorsque une &nbsp;photo est saisie par 3 personnes au lieu de 2 &nbsp;on appel cela &nbsp;un &nbsp;Triplet, la plupart du temps le contr&ocirc;leur remarque qu&rsquo;une photo &nbsp;lui &nbsp;vient avec une seul saisie et l&rsquo;autre animatrice n&rsquo;a rien saisie , c&rsquo;est quelque chose qui n&rsquo;est pas normal.</p>\r\n\r\n<p><br />\r\n<span style="color:#0000FF"><u>Comment &nbsp;nettoyer un triplet :</u></span></p>\r\n\r\n<p>S&eacute;lectionn&eacute; &nbsp;le &nbsp;chantier &nbsp;ou l&rsquo;envoi &nbsp;en cours de &nbsp;traitement , &nbsp;ensuite &nbsp;tout en haut &nbsp;cliquer sur le &nbsp;bouton &nbsp;&lsquo;&rsquo;NETTOYAGE&rsquo;&rsquo; Puis &lsquo;&rsquo;TRIPLET&rsquo;&rsquo; &nbsp;puis &nbsp;validez, attendez quelques secondes &nbsp;l&rsquo;interface &nbsp;vous &nbsp;ressort sur une &nbsp;autre page &nbsp;les r&eacute;sultats de triplet &nbsp;obtenu &nbsp;dans le traitement de l&rsquo;envoi &nbsp;et des chantiers respectifs. Ainsi &nbsp;vous pouvez commencer &nbsp;votre &nbsp;traitement, la colonne la plus importante est la colonne &nbsp;&lsquo;&rsquo;UNITES DARCHIVES&rsquo;&rsquo;.PS : lorsque l&rsquo;unit&eacute; d&rsquo;archive est a 0 &nbsp;cela voudrais &nbsp;dire qu&rsquo;aucune boite n&rsquo;a &eacute;t&eacute; &nbsp;saisis &nbsp;pour cette &nbsp;photo et donc que nous pouvons la supprimer &nbsp;sans risque de perte de donn&eacute;es. Cependant dans les cas un peu &nbsp;rares &nbsp;toutes les &nbsp;boites &nbsp;des triplets &nbsp;peuvent &ecirc;tre saisis &nbsp;et donc contiennent &nbsp;elles toutes des &nbsp;unit&eacute;s d&rsquo;archives &nbsp;dans ce cas, il &nbsp;est &nbsp;n&eacute;cessaire &nbsp;de &nbsp;vous referez &nbsp;a &nbsp;plusieurs &eacute;l&eacute;ment telles ID (1er colonne &nbsp;du tableau) et v&eacute;rifier les suites chronologique des num&eacute;ros &nbsp;d&rsquo;enregistrement, ou encore &nbsp;le temps de saisies &nbsp;des cartons &nbsp;trait&eacute;s.<br />\r\nPUIS ensuite clique sur &lsquo;&rsquo;DEBLOQUER&rsquo;&rsquo; puis vous avez &nbsp;un message vous &nbsp;demander si vous confirmez la suppression de la ligne &nbsp;faire &lsquo;&rsquo;OUI&rsquo;&rsquo; si vous &ecirc;tes &nbsp;sure de la modification que vous voulez faire ou &lsquo;&rsquo;NON&rsquo;&rsquo; &nbsp;et &nbsp;reprenez depuis le d&eacute;but<br />\r\nIl &nbsp;est &nbsp;imp&eacute;ratif de le faire &nbsp;2 fois dans la journ&eacute;e ou le plus de fois que possible lorsqu&rsquo;il ya de l&rsquo;activit&eacute;, &nbsp;de sorte &agrave; ce que les op&eacute;ratrices ne se plaignent pas d&rsquo;un &nbsp;blocage &nbsp;avant &nbsp;d&rsquo;intervenir.<br />\r\nCette &nbsp;proc&eacute;dure est &nbsp;la m&ecirc;me lorsqu&rsquo;une photo &nbsp;bloque en contr&ocirc;le, en saisie ou en correction &nbsp;il vous &nbsp;suffit &nbsp;de s&eacute;lectionner l&rsquo;onglet correspondant.</p>\r\n\r\n<p><span style="color:#0000FF"><u>Qu&rsquo;est qu&rsquo;une ANOMALIES POTENTIELLES</u></span></p>\r\n\r\n<p>C&rsquo;est &nbsp;un &nbsp;bug &nbsp;cr&eacute;e dans la &nbsp;base soit un crash &lsquo;coupure d&rsquo;&eacute;lectricit&eacute;, ou mauvaise manipulation de la base.</p>\r\n\r\n<p><span style="color:#0000FF"><u>Comment les identifier ?</u></span></p>\r\n\r\n<p>Normalement 1eseule photo ne peut &ecirc;tre en &lsquo;&rsquo;en cours &lsquo;&rsquo; &nbsp;lors du traitement d&rsquo;un chantier, lorsque vous avez plus d&rsquo;une photo ce n&rsquo;est pas normal il faut donc nettoyer le surplus.<br />\r\nChoisir le chantier &nbsp;ou l&rsquo;envoi &nbsp;de traitement puis cliquez &nbsp;sur &lsquo;&rsquo;ANOMALIES POTENTIELLES &lsquo;&rsquo; puis &lsquo;&rsquo;valider &lsquo;&rsquo;</p>\r\n\r\n<p><span style="color:#0000FF"><u>Comment les supprimer ?</u></span></p>\r\n\r\n<p>Pour nettoyer les anomalies, revenir dans l&rsquo;onglet avancement, v&eacute;rifier que l&rsquo;envoi ou le chantier en cours de traitement est &nbsp;s&eacute;lectionn&eacute; puis &lsquo;&rsquo; NETTOYAGE ANOMALIES&rsquo;&rsquo;.l&rsquo;interface &nbsp;vous ressort les r&eacute;sultats &nbsp;des &eacute;l&eacute;ments traites qui doivent &ecirc;tre &nbsp;nettoy&eacute;, il &nbsp;vous &nbsp;suffira de &nbsp;&lsquo;&rsquo;d&eacute;bloquer&rsquo;&rsquo; chaque ligne jusqu&#39;&agrave; la derni&egrave;re. <span style="color:#FF0000">ATTENTION, cette &nbsp;&eacute;tape est tr&egrave;s importante, assurer avant &nbsp;de faire cette manipulation que TOUT LE MONDE SOIT CORRECTEMENT SORTIS DE L&rsquo;INTERFACE</span> (saisie, contr&ocirc;le, correction, super contr&ocirc;le ; etc. &hellip;) bref, tout le monde dans &ecirc;tre en rouge sur les champs utilisateur.<br />\r\nCette &nbsp;intervention doit &ecirc;tre faite l&rsquo;hors du changement d&rsquo;&eacute;quipe de sorte &nbsp;a ceux que l&rsquo;activit&eacute; ne soit &nbsp;interrompu pendant une longue dur&eacute;e.</p>\r\n\r\n<p><br />\r\n<span style="color:#FF0000">ATTENTION : CAS D EXCEPTION</span></p>\r\n\r\n<p>Il &nbsp;arrive qu&rsquo;une m&ecirc;me &nbsp;op&eacute;ratrice est saisie &nbsp;une seul &nbsp;et m&ecirc;me photo deux fois et donc la photo pourrais apparaitre &nbsp;au contr&ocirc;le &nbsp;comme une saisie A et B ;pendant &nbsp;le &nbsp;traitement &nbsp;des triplets ou &nbsp;anomalies , &nbsp;il &nbsp;ne faut pas dans ce cas &nbsp;supprimer &nbsp;les &nbsp;saisies A et B de cette &nbsp;m&ecirc;me personne , il &nbsp;faut permettre &nbsp;qu&rsquo;un triplet &nbsp;se forme &nbsp;avec &nbsp;une saisie &nbsp;C avant &nbsp;d&rsquo;aller &nbsp;supprimer &nbsp;la &nbsp;saisie &nbsp;A ou &nbsp;B &nbsp;de &nbsp;l&rsquo;utilisateur 1er.</p>\r\n\r\n<p><br />\r\nExple :<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Adresse photo &nbsp; &nbsp; utilisateur &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Temps de saisie &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; statut<br />\r\nSAISIE A &nbsp; &nbsp; &nbsp;PHOTO 1JPG &nbsp; &nbsp; &nbsp; &nbsp; Nad&egrave;ge &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1.5sec &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; SAISIE<br />\r\nSAISIE B &nbsp; &nbsp; &nbsp;PHOTO 1JPG &nbsp; &nbsp; &nbsp; &nbsp; Nad&egrave;ge &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1.8sec &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Temp<br />\r\nPS :Ne pas faire de traitement d&rsquo;anomalie ni de traitement de triplet&nbsp;</p>\r\n\r\n<p>Laisser une 3eme saisie (triplet) se glisser &nbsp;afin de pouvoir &nbsp;supprimer &nbsp;le fichier anormal soit &nbsp;saisie A ou Saisie B du m&ecirc;me utilisateur.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Adresse photo &nbsp; &nbsp; utilisateur &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Temps de saisie &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; statut<br />\r\nSAISIE A &nbsp; &nbsp; &nbsp;PHOTO 1JPG &nbsp; &nbsp; &nbsp; &nbsp; Nad&egrave;ge &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1.5sec &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; SAISIE<br />\r\nSAISIE B &nbsp; &nbsp; &nbsp;PHOTO 1JPG &nbsp; &nbsp; &nbsp; &nbsp; Nad&egrave;ge &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1.8sec &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Temp<br />\r\nSAISIE C &nbsp; &nbsp; PHOTO 1JPG &nbsp; &nbsp; &nbsp; &nbsp; REINE &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2sec &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; SAISIE</p>\r\n\r\n<p>Comme &nbsp;l&rsquo;indique &nbsp;l&rsquo;exemple ci-dessus &nbsp;, &nbsp;vous pouvez &nbsp;supprimer a pr&eacute;sent &nbsp;la saisie B de Nad&egrave;ge &nbsp;statut &nbsp;Temp &nbsp;afin de &nbsp;r&eacute;cup&eacute;rer &nbsp;la photo n&deg;1 en contr&ocirc;le et la &nbsp;traiter normalement.</p>\r\n\r\n<p>Dans le cas de &nbsp;l&rsquo;exemple &nbsp;en dessous , &nbsp;il &nbsp;faut &nbsp;demander a &nbsp;JL d&rsquo;intervenir &nbsp;dans l&rsquo;ODBC afin de &nbsp;corriger &nbsp;et &nbsp;remettre &nbsp;la &nbsp;photo &nbsp;en contr&ocirc;le&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Adresse photo &nbsp; &nbsp; utilisateur &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Temps de saisie &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; statut<br />\r\nSAISIE A &nbsp; &nbsp; &nbsp;PHOTO 1JPG &nbsp; &nbsp; &nbsp; &nbsp; Nad&egrave;ge &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1.5sec &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; VALID<br />\r\nSAISIE B &nbsp; &nbsp; &nbsp;PHOTO 1JPG &nbsp; &nbsp; &nbsp; &nbsp; Nad&egrave;ge &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1.8sec &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; VALID<br />\r\nSAISIE C &nbsp; &nbsp; PHOTO 1JPG &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;REINE &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2sec &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; SAISIE</p>\r\n\r\n<p>Nb : &nbsp;il dois &nbsp;supprimer une ligne &nbsp;&lsquo;&rsquo;valid&rsquo;&rsquo; &nbsp;et &nbsp; remettre &nbsp;la &nbsp;seconde ligne en &nbsp;statut &nbsp;&lsquo;&rsquo;SAISIE&rsquo;&rsquo; afin que le contr&ocirc;le puisse se &nbsp;faire &nbsp;entre &nbsp;la saisie de Reine et &nbsp;la saisie de Nad&egrave;ge &nbsp;et &nbsp;non entre &nbsp;les 2 saisies &nbsp;appartenant a &nbsp;Nad&egrave;ge.</p>', '2016-06-14 18:20:00', 1, 0, NULL),
(48, 47, 37, 'Consigne_de_traitement', '<p><span style="font-size:20px"><span style="color:rgb(0, 0, 205)">Nouvelle Interface de saisie&nbsp;</span></span></p>\r\n\r\n<p><span style="font-size:20px"><span style="color:rgb(0, 0, 205)">&lsquo;&rsquo;Proarchives_v95-open&rsquo;&rsquo;</span></span></p>\r\n\r\n<p>Cette &nbsp;interface &nbsp;est &nbsp;mise en place afin de &nbsp;faciliter le traitement des cas de multi-copropri&eacute;t&eacute;s.<br />\r\nComme vous pouvez le constater &nbsp;sur l&rsquo;image en dessous &nbsp;tous les champs de l&rsquo;ancienne &nbsp;interface ont &eacute;t&eacute; &nbsp;repris &nbsp;sauf &nbsp;le &nbsp;champ &lsquo;&rsquo;Titre&rsquo;&rsquo; &nbsp;qui a &nbsp;&eacute;t&eacute; &nbsp;ins&eacute;r&eacute; au dessus &nbsp;des champs &nbsp;expression.<br />\r\nLe nom &nbsp;de la nouvelle &nbsp;appli : &nbsp;&nbsp;<span style="color:rgb(255, 0, 0)">&lsquo;&rsquo;proarchives_v95-open&rsquo;&rsquo;</span></p>\r\n\r\n<p>&nbsp;<br />\r\nAinsi &nbsp;donc la &nbsp;r&egrave;gle de saisie &nbsp;ne change pas &nbsp;pour les boites simples &nbsp;c&rsquo;est a dire une seul copro.<br />\r\n&nbsp;Par &nbsp;contre &nbsp;une nouvelle r&egrave;gle &nbsp;s&rsquo;applique &nbsp;pour &nbsp;les champs &agrave; plusieurs &nbsp;copropri&eacute;t&eacute;s. G&eacute;n&eacute;ralement lorsque &nbsp;nous &nbsp;saisissons les &nbsp;&eacute;l&eacute;ments &nbsp;d&rsquo;une &nbsp;boite a multi copros , tous les &eacute;l&eacute;ments &nbsp;n&rsquo;apparaissent &nbsp;que sur la 1ere &nbsp;copro et &nbsp;plus rien sur les &nbsp;autres copros de &nbsp;la &nbsp;boite en question. D&eacute;sormais il s&rsquo;agit pour nous de &nbsp;ressaisir &nbsp;pour chaque copros les m&ecirc;mes &eacute;l&eacute;ments.<br />\r\nExemple &nbsp; de la photo &nbsp;ci &ndash; dessous :<br />\r\n&nbsp;&nbsp;</p>\r\n\r\n<p>Nous avons 4 copropri&eacute;t&eacute;s :</p>\r\n\r\n<p><strong><u>Exemple de saisie &nbsp;a l&rsquo;ancienne :</u></strong><br />\r\nCopro &nbsp;1 : 202&nbsp;<br />\r\nExp 1 : &nbsp;&nbsp; &nbsp;RECOMMANDES CONVOC AG PV AG<br />\r\nExp 2 : AG DU 22/05/2007<br />\r\nCopro 2 : 229<br />\r\nExp 1 : AG 15-05-2007<br />\r\nCopro 3 : 240<br />\r\nExp 1 : AG 31-05-2007<br />\r\nCopro 4 : 9558<br />\r\nExp 1 : VIDE</p>\r\n\r\n<p><strong><u>ANCIENNE Restitution&nbsp;</u><br />\r\nCOPRO 202 - RECOMMANDES CONVOC AG PV AG - &nbsp;AG DU 22/05/2007</strong></p>\r\n\r\n<p><strong>COPRO 229 - AG 15-05-2007</strong></p>\r\n\r\n<p><strong>COPRO 240 - AG 31-05-2007</strong></p>\r\n\r\n<p><strong>COPRO 9558</strong></p>\r\n\r\n<p><u>Exemple nouvelle saisie :</u></p>\r\n\r\n<p>Saisir en Titre &lsquo;&rsquo;RECOMMANDES CONVOC AG PV AG&rsquo;&rsquo; (cochez la case afin que le titre se r&eacute;p&egrave;te pour les autres copros) et saisir &nbsp;l&rsquo;intitul&eacute;<br />\r\nCopro &nbsp;202&nbsp;<br />\r\nExp 1 : AG DU 22/05/2007<br />\r\nCopro &nbsp;229<br />\r\nExp 1 : AG 15-05-2007<br />\r\nCopro 240<br />\r\nExp 1: AG 31-05-2007<br />\r\nCopro &nbsp;9558<br />\r\nExp 1: VIDE</p>\r\n\r\n<p><u>Nouvelle Restitution&nbsp;</u></p>\r\n\r\n<p><strong>COPRO 202 - RECOMMANDES CONVOC AG PV AG - &nbsp;AG DU 22/05/200</strong></p>\r\n\r\n<p><strong>COPRO 229 - RECOMMANDES CONVOC AG PV AG - AG 15-05-2007</strong></p>\r\n\r\n<p><strong>COPRO240 &nbsp;- RECOMMANDES CONVOC AG PV AG - AG 31-05-2007</strong></p>\r\n\r\n<p><strong>COPRO 9558 - RECOMMANDES CONVOC AG PV A</strong></p>\r\n\r\n<p><span style="color:#000000"><strong>NB : La &nbsp;restitution ci-dessus &nbsp;est &nbsp;le r&eacute;el but de cette &nbsp;nouvelle &nbsp;interface</strong>.</span></p>\r\n\r\n<p><span style="color:#000000">ATTENTION : Si l&rsquo;hors de la saisie d&rsquo;une &nbsp;boite a multi-copropri&eacute;t&eacute;s l&rsquo;op&eacute;ratrice se rends compte qu&rsquo;elle n&rsquo;a pas coch&eacute; la petite case permettant de reprendre le m&ecirc;me &nbsp;titre pour les autres copros il &nbsp;lui &nbsp;faudra &nbsp;ressaisir dans le champ &nbsp;expression l&rsquo;&eacute;l&eacute;ment &lsquo;&rsquo;Titre&rsquo;&rsquo; de la boite.<br />\r\nA l&rsquo;exemple de la photo ci-dessus, il faudra &nbsp;ressaisir &nbsp;en exp 1 de la copro 2,3 et 4 le libell&eacute;</span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &laquo; RECOMMANDES CONVOC AG PV AG &raquo;.</p>\r\n\r\n<p>&nbsp;Un &nbsp;2eme nouvel &nbsp;exemple &nbsp;toujours pour le cas des multi-copropri&eacute;t&eacute;s&nbsp;</p>\r\n\r\n<p>L&rsquo;exemple &nbsp;ici est &nbsp;celui de la boite 1<br />\r\n&nbsp;<br />\r\nVoila &nbsp;comment la saisie se faisait :</p>\r\n\r\n<p>Copro MS 0030853 - 49 r&eacute;publique</p>\r\n\r\n<p>Exp 1 : 2006/2007</p>\r\n\r\n<p>Copro MS 0030938 &ndash; 11 Chaptal</p>\r\n\r\n<p>Exp 1 : 2007/2008 &nbsp;charges A</p>\r\n\r\n<p>&nbsp;NB : La saisie est &lsquo;&rsquo;<span style="color:rgb(255, 0, 0)">Fausse</span>&nbsp;&lsquo;&rsquo; &nbsp;&eacute;tant donn&eacute; &nbsp;que &nbsp; le titre &nbsp;de la boite &nbsp;est &nbsp;bien le mot &lsquo;&rsquo;charges&rsquo;&rsquo;.</p>\r\n\r\n<p><u><strong>Fichier restitution (FAUX)</strong></u></p>\r\n\r\n<p>Copro MS 0030853 - 49 r&eacute;publique - 2006/2007<br />\r\nCopro MS 0030938 &ndash; 11 Chaptal - 2007/2008 &nbsp;charges A</p>\r\n\r\n<p><u><strong>Fichier &nbsp;restitution (VRAI)</strong></u></p>\r\n\r\n<p>Copro MS 0030853 - 49 r&eacute;publique - charges A - 2006/2007<br />\r\nCopro MS 0030938 &ndash; 11 Chaptal - charges A - 2007/2008 &nbsp;<br />\r\n&nbsp;<br />\r\nPS :&nbsp;<br />\r\n⦁&nbsp;&nbsp; &nbsp;Dans le cas o&ugrave; il ne s&rsquo;agit que des photos &nbsp;simples, &nbsp;laisser &nbsp;le champ &lsquo;&rsquo;titre&rsquo;&rsquo; vide et &nbsp;saisir &nbsp;comme auparavant.<br />\r\n⦁&nbsp;&nbsp; &nbsp;Les champs &lsquo;&rsquo;MOIS inf et sup &lsquo;&rsquo; &nbsp;sont &nbsp; gris&eacute;s afin &nbsp;de permettre &nbsp;d&rsquo;aller &nbsp;un peu plus &nbsp;vite. D&eacute;sormais &nbsp;seul l&rsquo;ann&eacute;e &nbsp;inf &nbsp;et sup est a saisir.</p>\r\n\r\n<p><br />\r\nIL &nbsp;faut faire attention &nbsp;a ne pas &nbsp;confondre &nbsp;les multi copropri&eacute;t&eacute;s a certains &nbsp;&eacute;l&eacute;ments &nbsp;de la &nbsp;g&eacute;rance .<br />\r\n⦁&nbsp;&nbsp; &nbsp;Le &lsquo;&rsquo;service&rsquo;&rsquo; est le 1er &nbsp;element &nbsp;qui doit attirer &nbsp;sur la saisie &nbsp;qu il &nbsp;faut adapter a une boite donn&eacute;e &nbsp;meme &nbsp;si les elements &nbsp;inscrit &nbsp;paraissent flou (exple foto &nbsp;ci-dessus boite 1 et 2 )<br />\r\n⦁&nbsp;&nbsp; &nbsp;Ensuite &nbsp;viens &nbsp;la &nbsp;&lsquo;&rsquo;structure&rsquo;&rsquo; &nbsp;de la &nbsp;boite<br />\r\n⦁&nbsp;&nbsp; &nbsp;Puis &nbsp;enfin &nbsp;son contenu.</p>\r\n\r\n<p>&nbsp;<br />\r\n&nbsp;&nbsp; &nbsp;Dans &nbsp;ce cas &nbsp; precis &nbsp;, &nbsp;la &nbsp;saisie &nbsp;serait la suite&nbsp;<br />\r\nBoite 1&nbsp;<br />\r\nTitre : Impayes copro (cochez la case)<br />\r\nCopro 1 : 2 chemin de crepieux caluire (lien : &hellip;.)<br />\r\nLigne 1 : vermelin 24/03/2006&hellip;&hellip;.<br />\r\nCopro 2 : bois d&rsquo;oz rue piscine &hellip;..<br />\r\nLigne 1 : salanon &amp; virapin<br />\r\nEtc &hellip;.<br />\r\nIdem pour la boite 2<br />\r\nTitre : Impayes copro 2002 &nbsp;a 2007 (cochez la case)<br />\r\nCopro 1 :&hellip;&hellip;.</p>', '2016-06-15 18:59:57', 1, 0, NULL),
(48, 48, 38, 'Règle de bases propres à nous', '<p><strong><span style="font-size:20px">MANUEL DES REGLES DE BASES SAISIES DES PHOTOS</span></strong></p>\r\n\r\n<p><strong><span style="color:#0000FF">P</span></strong>our &nbsp;une bonne &nbsp;saisie &nbsp;il est &nbsp;indispensable de maitriser &nbsp;les &nbsp;r&egrave;gles &nbsp;de &nbsp;bases &nbsp;qui sont propres &agrave; chaque &nbsp;client.</p>\r\n\r\n<p><u>R&egrave;gles de bases saisies PROARCHIVES</u></p>\r\n\r\n<p>Nous connaissons tous la 1&egrave;re r&egrave;gle de base incontournable de Pro archives &nbsp;SAISIR &nbsp;A L&rsquo;IDENTIQUE &agrave; celle-ci s&rsquo;ajoute les r&egrave;gles de bases suivantes :</p>\r\n\r\n<p><span style="background-color:#A9A9A9">1) Les &nbsp;caract&egrave;res &nbsp;sp&eacute;ciaux tels</span> (: ! ;, . *) inscrits sur une boite ne sont pas saisie dans les champs en</p>\r\n\r\n<p>expression sauf dans la partie Adresse copro &nbsp;boite o&ugrave; nous pouvons retrouver :</p>\r\n\r\n<p>Exemple : 4, rue du chemin de fer</p>\r\n\r\n<p>A.G &nbsp;2012 devient AG 2012<br />\r\nAG. 2012 devient AG 2012<br />\r\nA.G.E 1999 a &nbsp;AGE 1999<br />\r\nB.P 8515 &nbsp;devient BP 8515<br />\r\nS.G.P.P 1988 devient SGPP 1988</p>\r\n\r\n<p><span style="background-color:#A9A9A9">2) L&rsquo;interpr&eacute;tation des &nbsp;champs &nbsp;dates</span></p>\r\n\r\n<p>Nous avons diff&eacute;rent types &nbsp;d&rsquo;analyses de champs</p>\r\n\r\n<p><strong>a-) <u>2008 &amp; ANT&nbsp;</u></strong></p>\r\n\r\n<p>Date inf. : RIEN<br />\r\nDate sup : 12/2008<br />\r\n<strong>NB </strong>: AVANT 2008 et ANTERIEUR A 2008 veulent dire la m&ecirc;me chose &nbsp;ils sont donc analys&eacute;s de la m&ecirc;me mani&egrave;re.<br />\r\n(On aurait pu mettre 12/2007 mais l&rsquo;interface ne retrouvera pas l&rsquo;ann&eacute;e 2007 puisqu&rsquo;elle ne figure pas sur la &nbsp;boite)</p>\r\n\r\n<p>b) <u><strong>Avant 2008</strong></u></p>\r\n\r\n<p>Date inf. : RIEN<br />\r\nDate sup : 01/2008</p>\r\n\r\n<p>c-) &nbsp;<strong><u>inf&eacute;rieur &agrave; 2008</u></strong></p>\r\n\r\n<p>Date inf. : RIEN<br />\r\nDate sup : 01/2008</p>\r\n\r\n<p>d-) <u><strong>2008&lt;2009</strong></u></p>\r\n\r\n<p>Date inf. : 01/2008<br />\r\nDate sup : 12/2009<br />\r\nLorsqu&rsquo;une date est illisible la r&egrave;gles des XXX est applicable c&rsquo;est &agrave; dire :<br />\r\nMois/jj/ann&eacute;e<br />\r\nXX/XX/XXXX<br />\r\nLorsque nous avons sur une boite des dates :<br />\r\nExemple : 01/01/1999<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 12/09/2009<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;25/01/2000<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2008 &amp; ant<br />\r\nDate inf. : RIEN<br />\r\nDate sup : 09/2009<br />\r\nL&rsquo;ann&eacute;e 1999 ne pr&eacute;cise en rien le d&eacute;but de l&rsquo;activit&eacute;.&nbsp;</p>\r\n\r\n<p>NB : Le champ date sup&eacute;rieur ne reste jamais vide. Supposons que nous ayons une boite sans date &nbsp;les champs doit &nbsp;&ecirc;tre renseigner comme suit :<br />\r\nDate inf. : VIDE<br />\r\nDate sup :&nbsp;<br />\r\nMois : XX<br />\r\nAnn&eacute;e : XXXX<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="background-color:#A9A9A9">3-)Saisir LIGNE 2 avec la LIGNE 1</span><br />\r\n&nbsp;<br />\r\nExemple 3&egrave;me &nbsp;boite&nbsp;<br />\r\nNous devons &nbsp;saisir :<br />\r\nExpression : Ravalement fa&ccedil;ade 2eme tranche<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2008 &amp; ant<br />\r\nEt &nbsp;NON : Ravalement&nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Fa&ccedil;ade 2eme tranche&nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2008 &amp; ant</p>\r\n\r\n<p><span style="background-color:#A9A9A9">4-) Les multi copropri&eacute;t&eacute;s</span></p>\r\n\r\n<p>Qu&rsquo;est ce qu&rsquo;une copropri&eacute;t&eacute;<br />\r\nUne copropri&eacute;t&eacute; c&rsquo;est une adresse, elle peut &ecirc;tre soit compl&egrave;te &lsquo;&rsquo;41 rue des occidents&rsquo;&rsquo; ou elle peut &ecirc;tre un num&eacute;ro &lsquo;&rsquo;code ville&rsquo;&rsquo; &agrave; partir duquel avec la table adresse nous faisons un lien pour retrouver l&rsquo;adresse correspondante.<br />\r\n⦁&nbsp;&nbsp; &nbsp;Il faut pouvoir analyser rapidement une photo &agrave; multi copropri&eacute;t&eacute;s en cas de doute ou d&rsquo;incompr&eacute;hension demander &agrave; l&rsquo;un des contr&ocirc;leurs ou au responsable<br />\r\n⦁&nbsp;&nbsp; &nbsp;Lorsque le num&eacute;ro copro ne correspond pas au lien dans la table adresse et que l&rsquo;adresse correspond &agrave; un autre num&eacute;ro, il faut reporter le num&eacute;ro qui ne correspond &agrave; RIEN dans le champ expression<br />\r\n⦁&nbsp;&nbsp; &nbsp;Lorsque et le num&eacute;ro de copro et l&rsquo;adresse ne se retrouvent pas dans la table adresse du client, il est indispensable de les saisir &agrave; leur endroit respectif c&rsquo;est &agrave; dire num&eacute;ro copro et adresse &nbsp;copro.<br />\r\nOn ne renseigne les bornes que si la s&eacute;quence est ininterrompue<br />\r\nSi la s&eacute;quence est interrompue j&#39;&eacute;clate par copro en autant de ligne que n&eacute;cessaire<br />\r\nSi j&#39;ai par exemple 40 &amp; 50 ca veut dire 2 copro et non pas 10 ...</p>\r\n\r\n<p><br />\r\nNB : Les ann&eacute;es ne se r&eacute;p&egrave;te pas dans le champ expression pour toutes les copros, il suffit de cocher la petite case qui se trouve &agrave; droite sur la 1&egrave;re ligne pour celle-ci se r&eacute;p&egrave;te sur toutes les copros juste au dessus des champs analyses date.<br />\r\nIl est donc important de ramener pour le cas des multi copros l&rsquo;ann&eacute;e ou les dates &agrave; la 1&egrave;re ligne.</p>\r\n\r\n<p>Exemple : FACTURES&nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; COMPTA<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2001<br />\r\nDEVIENT : FACTURES COMPTA 2001 &nbsp;(sur une seule ligne et vous cochez la case)</p>\r\n\r\n<p><span style="background-color:#A9A9A9">5-)LES ELEMENTS ENTRE PARENTHESES</span></p>\r\n\r\n<p>Les &eacute;l&eacute;ments entre les parenth&egrave;ses ne sont aucunement repris en intitul&eacute;. Ils sont consid&eacute;r&eacute;s comme des d&eacute;tails. Sauf exception d&rsquo;une boite n&rsquo;ayant que pour &eacute;l&eacute;ment d&rsquo;expression un &eacute;l&eacute;ment se trouvant dans la parenth&egrave;se.<br />\r\nExemple : Copropri&eacute;t&eacute;s<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(Factures) 2001 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; intitul&eacute;s FACTURES<br />\r\nIdem pour le mot &nbsp;&lsquo;&rsquo;DIVERS&rsquo;&rsquo; il &nbsp;ne se met pas &nbsp;en intitul&eacute; car il ne pr&eacute;cise en rien au client &agrave; ce dont il fait allusion ou ce &agrave; quoi.</p>\r\n\r\n<p><span style="background-color:#A9A9A9">6-)REORGANISATION &nbsp;ET &nbsp;SAISIE DES BOITES</span></p>\r\n\r\n<p>NB : La 1ere boites &agrave; saisir est la boite qui se trouve le plus &agrave; gauche ou au dessus des autres boites et la derni&egrave;re la plus &agrave; droite. Toujours saisir dans le sens de rotation d&rsquo;une aiguille d&rsquo;une montre.</p>\r\n\r\n<p><span style="background-color:#A9A9A9">7-)Les &nbsp;num&eacute;ros de comptes &nbsp;bancaires&nbsp;</span></p>\r\n\r\n<p>Exemple : N&deg;86011-066-258 au N&deg;851232-066-145 ne constituent pas des &nbsp;bornes inferieur et sup&eacute;rieur. Idem pour les num&eacute;ros de factures (facture doit n&deg;25 au N&deg;35). Sont consid&eacute;r&eacute;es comme des &nbsp;bornes inf. et sup des s&eacute;quences de chiffres ou de lettres tels : AP &agrave; ZP ; de 650 &agrave; 750 ou p40 &agrave; p66.</p>', '2016-06-15 19:50:08', 1, 0, NULL),
(48, 49, 39, 'Interpretation', '<p>&nbsp;<br />\r\nSaisie 3eme &nbsp; boite&nbsp;</p>\r\n\r\n<p>&nbsp; saisie 1 :<br />\r\n⦁&nbsp;&nbsp; &nbsp;Copro 1 : Recommand&eacute;s &ndash; convoc ag &ndash; pv ag &ndash; ag du 22/05/2007<br />\r\n⦁&nbsp;&nbsp; &nbsp;Copro 2 : Recommand&eacute;s &ndash; convoc ag &ndash; pv ag &ndash; ag 15-05-2007<br />\r\n⦁&nbsp;&nbsp; &nbsp;Copro 3 : Recommand&eacute;s &ndash; convoc ag &ndash; pv ag &ndash; ag 31-05-2007<br />\r\n&nbsp; saisie 2 :<br />\r\n⦁&nbsp;&nbsp; &nbsp;Copro 1 : Recommand&eacute;s &ndash; convoc ag &ndash; pv ag &ndash; ag du 22/05/2007<br />\r\n⦁&nbsp;&nbsp; &nbsp;Copro 2 : ag 15-05-2007<br />\r\n⦁&nbsp;&nbsp; &nbsp;Copro 3 : ag 31-05-2007</p>\r\n\r\n<p><br />\r\n&nbsp;<br />\r\nBoite 2</p>\r\n\r\n<p><br />\r\n<span style="color:#FF0000">&rsquo;&rsquo; Sinistres 2006 &nbsp;a 2009 + ventes 2007 &nbsp;a 2008 &lsquo;&rsquo; &nbsp;est a &nbsp; saisir &nbsp;sur copro 1 ? copro 2 ?ou &nbsp;toutes &nbsp;les 2 copro ?</span><br />\r\nExemple &nbsp;saisie 1<br />\r\n⦁&nbsp;&nbsp; &nbsp;Copro 1 : factures &nbsp;- comptes &ndash; ag - liquidation - comptes 2008 &ndash; 2009 &ndash; sinistres 2006 a 2009 + ventes 2007 a 2008<br />\r\n⦁&nbsp;&nbsp; &nbsp;Copro 2 : factures &nbsp;- ag &ndash; liquidation &ndash; comptes 2008 + 2009 + correspondance + sinistres 2006 a 2009 + ventes 2007 a 2008</p>\r\n\r\n<p>Exemple &nbsp;saisie 2 :<br />\r\n⦁&nbsp;&nbsp; &nbsp;Copro 1 : Copro 1 : factures &nbsp;- comptes &ndash; ag - liquidation - comptes 2008 &ndash; 2009 &ndash; sinistres 2006 a 2009 + ventes 2007 a 2008<br />\r\n⦁&nbsp;&nbsp; &nbsp;Copro 2 : factures &nbsp;- ag &ndash; liquidation &ndash; comptes 2008 + 2009 + correspondance</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;<br />\r\n<span style="color:#FF0000">&nbsp;Comparaison de &nbsp;B4 et &nbsp;B5</span></p>\r\n\r\n<p><br />\r\nLa &nbsp;saisie de la B4 &nbsp;est &nbsp; normale : en description compl&egrave;te &nbsp; nous avons&nbsp;<br />\r\nCopro 1 : charges 2007/2008<br />\r\nCopro 2 : charges 2007</p>\r\n\r\n<p>Saisie B5<br />\r\nsaisie A<br />\r\n⦁&nbsp;&nbsp; &nbsp;Copro 1 : 2006/2007-2007-2008<br />\r\n⦁&nbsp;&nbsp; &nbsp;Copro 2 : 2007/2008 &nbsp;charges ou charges 2007/2008</p>\r\n\r\n<p>saisie B<br />\r\n⦁&nbsp;&nbsp; &nbsp;Copro 1 : charges 2006/2007-2007-2008<br />\r\n⦁&nbsp;&nbsp; &nbsp;Copro 2 : charges 2007/2008</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;<br />\r\nBoite 2&nbsp;</p>\r\n\r\n<p>Exemple &nbsp;saisie 1</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Copro 1 : gesmo compta + pm &ndash; charges 2009<br />\r\n⦁&nbsp;&nbsp; &nbsp;Copro 2 : gesmo compta + pm &ndash; charges 2009 + charges 2008</p>\r\n\r\n<p>Exemple &nbsp;saisie 2&nbsp;</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Copro 1 : gesmo compta + pm &ndash; charges 2009<br />\r\n⦁&nbsp;&nbsp; &nbsp;Copro 2 : gesmo compta + pm + charges 2008</p>\r\n\r\n<p>&nbsp;</p>', '2016-06-16 12:27:00', 1, 0, NULL),
(48, 50, 40, 'Principes généraux', '<p><span style="color:#0000FF"><u><strong><span style="font-size:20px">Saisie</span></strong></u></span></p>\r\n\r\n<p>Ne pas mettre 2 op&eacute;ratrices d&eacute;butantes en saisie A et B</p>\r\n\r\n<p><span style="color:#0000FF"><strong><u><span style="font-size:20px">Contr&ocirc;le</span></u></strong></span></p>\r\n\r\n<p>Au moment de la cr&eacute;ation des plannings, toujours veiller &agrave; ce qu&rsquo;il y ait au moins 1 contr&ocirc;leur pour 3 op&eacute;ratrices de saisies.&nbsp;</p>\r\n\r\n<p>Les contr&ocirc;leurs doivent avant de terminer une journ&eacute;e, rebasculer en saisie pour faire leur correction sur leurs Login.</p>\r\n\r\n<p>L&rsquo;en cours des photos valid&eacute;es ne doit pas d&eacute;passer 100 photos pour permettre &agrave; l&rsquo;interface de fonctionner correctement</p>\r\n\r\n<p>Lors de saisie en mode liste, il est pr&eacute;f&eacute;rable au contr&ocirc;le de faire refaire A ou B plut&ocirc;t que les 2. En effet l&rsquo;interface identifie la faute au caract&egrave;re pr&egrave;s. Donc inutile de chercher plus et laisser faire l&rsquo;interface en privil&eacute;giant de multiples passages.</p>', '2016-06-16 12:33:00', 1, 0, NULL);
INSERT INTO `version` (`ver_creator`, `ver_article`, `Id`, `ver_titre`, `ver_content`, `ver_date`, `ver_editable`, `ver_del`, `attachement`) VALUES
(48, 51, 41, 'Problèmes matériels et logiciels rencontrés', '<p><span style="font-family:courier new,courier,monospace">Bonjour, aujourd&#39;hui le 18 juin 2016</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">Rappel:</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">1) Liaison pricipale 4Mo + 4IP</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">2) Liasion backup 2Mo</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">3) Caf&eacute; informatique 4Mo + 1 IP</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">Aux alentours de 15h30, nous avons perdu la connexion internet sur les 2 liaisons Togo T&eacute;l&eacute;com. Apr&egrave;s avoir red&eacute;marrer les 2 modems de Togo t&eacute;l&eacute;com, la liaison Backup est revenue mais par contre la liaison principale n&#39;est toujours pas revenue.</span></p>\r\n\r\n<p style="text-align:justify"><br />\r\n<span style="font-family:courier new,courier,monospace">Alors j&#39;ai fait un tour sur le routeur Cisco 2600 Series qui est reli&eacute; au Switch Catalyst Cisco 2950 Series qui nous sert de basculement de connexion entre la liaison principale et la liaison Caf&eacute;. Sur le routeur Cisco, j&rsquo;ai lanc&eacute; un Ping 8.8.8.8, un DNS de Google et l&agrave; la connexion ne passe pas. J&rsquo;ai refais un autre Ping sur un second DNS de Google 8.8.4.4 et la connexion passe. J&rsquo;ai alors modifi&eacute; le param&eacute;trage fait avant et qui demandait au routeur Cisco de v&eacute;rifier la connexion internet &agrave; partir de 8.8.8.8 en passant par Togo t&eacute;l&eacute;com par 8.8.4.4 en passant toujours par Togo T&eacute;l&eacute;com en le mettant en premi&egrave;re position et le 8.8.8.8 en seconde position.</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">Tout est redevenu normal. Par ailleurs pendant que j&#39;essayais de r&eacute;soudre le probl&egrave;me sur la liaison principale, tous les postes &eacute;taient connect&eacute;s sur la seconde liaison Backup.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">Maintenant j&rsquo;ai remis en place un autre Switch NetGear D1025 avec la connexion Backup, l&rsquo;objectif est de connecter tous les c&acirc;bles du Web sur ce Switch Cisco sur le Switch NetGear au cas o&ugrave; il n&rsquo;y aurait pas la connexion internet que la liaison principale.&nbsp; Le port n&deg;1 utilise cette connexion, au cas o&ugrave;&nbsp; il n&rsquo;y a pas internet sur la liaison Backup, on bascule sur Cafe Informatique. Donc tout ceci se fait manuellement.</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">................................................................................</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">Bonjour aujourd&rsquo;hui mardi 21 juin 2016</span></p>\r\n\r\n<p style="text-align:justify"><br />\r\n<span style="font-family:courier new,courier,monospace">A 11h25 la connexion est perdue sur la liaison principale. M&ecirc;me pas avoir red&eacute;marr&eacute; plusieurs fois le modem, il n&rsquo;y a toujours pas de connexion. C&rsquo;est &agrave; 14h55 que la connexion est revenue. Signal&eacute; &agrave; Togo T&eacute;l&eacute;com c&rsquo;est le lendemain qu&rsquo;ils m&rsquo;ont inform&eacute;&nbsp;qu&rsquo;ils avaient fait des travaux sur leur liaison. Que le plus souvent c&rsquo;est les Week-end qu&rsquo;ils profitent pour faire la maintenance sur certains serveurs.</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">...........................................................................</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">Aujourd&#39;hui mercredi 22 juin 2016,</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">Les filles du Web m&rsquo;ont interpel&eacute; sur un probl&egrave;me li&eacute; &agrave; leur application d&rsquo;animation. Les messages de celles qui interviennent sur l&rsquo;animation et sur la messagerie sont rest&eacute;s en attente et en plus ne re&ccedil;oivent pas de messages.</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">J&rsquo;ai inform&eacute; Beno&icirc;t sur le probl&egrave;me, il me dit qu&rsquo;ils &eacute;taient entrain de faires les travaux sur un serveur mais que rapidement l&rsquo;animation va reprendre. Apr&egrave;s son OK, Il a demand&eacute; que toutes les animatrices se d&eacute;connectent de l&#39;application et de se reconnecter, tous les messages en attente sont partis sur l&rsquo;animation que sur la messagerie et tout le travail a repris.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2016-06-24 14:23:20', 0, 0, NULL),
(48, 52, 42, 'Installation et Utilisatiion de WampServer', '<p>Manuel de Configuration des Outils de l&rsquo;activit&eacute; d&rsquo;archivage<br />\r\n⦁&nbsp;&nbsp; &nbsp;<br />\r\n⦁&nbsp;&nbsp; &nbsp;INSTALLATION ET UTILISATION DE WAMPSERVER 2.2</p>\r\n\r\n<p>&nbsp;Pr&eacute;sentation<br />\r\nWampServer &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; est une plateforme de d&eacute;veloppement Web de type WAMP, permettant de faire fonctionner localement (sans se connecter &agrave; un serveur externe) des scripts PHP.<br />\r\nWampServer &nbsp;n&#39;est pas en soi un logiciel, mais un environnement comprenant deux serveurs (Apache et MySQL), un interpr&eacute;teur de script (PHP), ainsi qu&#39;une administration pour SQL PhpMyAdmin.<br />\r\n&nbsp;Il dispose d&#39;une interface d&#39;administration permettant de g&eacute;rer et d&#39;administrer ses serveurs &agrave; l&rsquo;aide de son ic&ocirc;ne pr&egrave;s de l&#39;horloge de Windows.</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Installation de WampServer 2.2</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Ouvrez Drop Box&hellip; &nbsp;Proweb&hellip;Logiciels_Importants&nbsp;<br />\r\n⦁&nbsp;&nbsp; &nbsp;Double-cliquez sur le fichier WampServer2.2a-x32 pour lancer l&rsquo;installation<br />\r\n⦁&nbsp;&nbsp; &nbsp;Une fen&ecirc;tre Windows de contr&ocirc;le de compte utilisateur s&rsquo;ouvre et vous demandant si vous autoriser ce programme provenant d&rsquo;un &eacute;diteur inconnu de s&rsquo;installer, on clic sur OUI<br />\r\n&nbsp;Une fen&ecirc;tre de bienvenue s&rsquo;ouvre, nous pouvons commencer l&rsquo;installation en cliquant sur Next</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;La fen&ecirc;tre suivante nous demande de valider la licence d&#39;utilisation, on valide<br />\r\n⦁&nbsp;&nbsp; &nbsp;La fen&ecirc;tre suivante nous pr&eacute;sente le dossier dans lequel WampServer2 va &ecirc;tre install&eacute;. Il s&#39;agit du dossier : C:\\wamp. Pas de modification, on continue.<br />\r\nRemarque<br />\r\nDans le cadre d&rsquo;une r&eacute;installation, le dossier Data o&ugrave; sont stock&eacute;es les BDD ne sont pas supprim&eacute;s. En revanche les fichiers de configuration php.ini et my.ini sont &eacute;cras&eacute;s. Il faut donc s&rsquo;assurer d&rsquo;avoir tous les param&eacute;trages avant d&rsquo;effectuer une r&eacute;installation.</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;La fen&ecirc;tre suivante vous permet de choisir les raccourcis destin&eacute;s &agrave; lancer Wampserver2, on clic sur Create a desktop icon, ceci permet d&#39;ajouter une ic&ocirc;ne de lancement dans la barre des t&acirc;ches<br />\r\n⦁&nbsp;&nbsp; &nbsp;La fen&ecirc;tre suivante r&eacute;capitule tous vos choix. S&#39;ils vous conviennent, cliquez sur le bouton Install pour lancer l&#39;installation.<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Quelques instants apr&egrave;s, WampServer vous dit ceci &laquo; Firefox a &eacute;t&eacute; d&eacute;tect&eacute; sur votre ordinateur voulez-vous l&rsquo;utiliser comme navigateur par d&eacute;faut avec &nbsp;Wampserver2 ? &raquo; cliquez sur Oui<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\nNB : Si vous n&rsquo;avez pas Firefox, installez-le&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;La fen&ecirc;tre ci-apr&egrave;s s&rsquo;affiche<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Inutile de g&eacute;rer le SMTP, cliquez sur Oui pour continuer</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Lorsque l&#39;installation est termin&eacute;e, la fen&ecirc;tre ci-apr&egrave;s s&#39;affiche pour vous l&#39;indiquer<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n⦁&nbsp;&nbsp; &nbsp;Laissez la case Launch Wampserver 2 now coch&eacute;e. Cela lancera automatiquement WampServer lorsque vous cliquez sur Finish&hellip;&nbsp;</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Utilisation de WampServer 2.2</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Pour d&eacute;marrer Wampserver, faites D&eacute;marrer &gt; Tous les programmes &gt; Wampserver &gt; Start<br />\r\nWampserver. &nbsp;L&#39;ic&ocirc;ne de WampServer appara&icirc;t dans la barre des t&acirc;ches.</p>\r\n\r\n<p>&nbsp;L&rsquo;ic&ocirc;ne passe du rouge &agrave; l&rsquo;orange puis au vert pour signifier que &nbsp;WampServer est correctement d&eacute;marr&eacute;&nbsp;</p>\r\n\r\n<p><br />\r\n⦁&nbsp;&nbsp; &nbsp;Si L&rsquo;ic&ocirc;ne reste orange durant le d&eacute;marrage ou ne change pas au vert, c&#39;est qu&#39;un probl&egrave;me a &eacute;t&eacute; rencontr&eacute; et que le serveur Web ne fonctionne pas correctement.&nbsp;</p>\r\n\r\n<p>Remarque : tr&egrave;s souvent l&rsquo;utilisation de Skype emp&ecirc;che le fonctionnement de Wamp. Fermez Skype (enlever l&rsquo;option dans menu avanc&eacute;e/connexion sur le type de port pour laisser le port 80 &agrave; Mysql) et le rouvrir apr&egrave;s le lancement de Wamp.</p>\r\n\r\n<p>&nbsp;Lorsque WampServer2 est d&eacute;marr&eacute;, vous pouvez cliquer sur l&#39;ic&ocirc;ne pour faire appara&icirc;tre le menu de WampServer : Voici la description rapide des diff&eacute;rentes commandes du menu (de bas en haut):</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Passer en ligne/passer hors ligne<br />\r\n⦁&nbsp;&nbsp; &nbsp;Lorsque le serveur est &laquo; en ligne &raquo;, il est possible de s&#39;y connecter depuis un autre ordinateur du r&eacute;seau.<br />\r\n⦁&nbsp;&nbsp; &nbsp; Lorsque le serveur est &laquo; hors ligne &raquo;, il n&#39;est possible de s&#39;y connecter que depuis l&#39;ordinateur lui-m&ecirc;me.</p>\r\n\r\n<p><br />\r\n⦁&nbsp;&nbsp; &nbsp;D&eacute;marrer/Arr&ecirc;ter/Red&eacute;marrer les services<br />\r\n⦁&nbsp;&nbsp; &nbsp;Permet de d&eacute;marrer/arr&ecirc;ter/red&eacute;marrer tous les services du serveur Web (Apache, PHP et MySQL) en g&eacute;n&eacute;ral, apr&egrave;s une modification de la configuration.</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Apache/PHP/MySQL<br />\r\nCes sous-menus permettent d&#39;acc&eacute;der aux diff&eacute;rentes commandes des trois services Web :<br />\r\n⦁&nbsp;&nbsp; &nbsp;Apache : serveur HTTP<br />\r\n⦁&nbsp;&nbsp; &nbsp;PHP : le moteur de script<br />\r\n⦁&nbsp;&nbsp; &nbsp;MySQL : le syst&egrave;me de gestion de bases de donn&eacute;es</p>\r\n\r\n<p>Remarque<br />\r\nIl est judicieux &agrave; chaque red&eacute;marrage du serveur de relancer Wamp automatiquement</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Cr&eacute;ation du serveur miroir</p>\r\n\r\n<p>Cette m&eacute;thode permet de dupliquer les bases de donn&eacute;es et les outils du serveur sur un poste local. Cela permet d&rsquo;effectuer des traitements, de tester, sans risque sur les donn&eacute;es du serveur local, tr&egrave;s pratique pour les restitutions de chantiers termin&eacute;s par exemples.</p>\r\n\r\n<p>Configuration<br />\r\n⦁&nbsp;&nbsp; &nbsp;Dropbox&hellip;Proweb&hellip;Logiciels Importants, recopiez le dossier Azertwin pour l&rsquo;interface Web et le coller dans le c : \\wamp\\www sur le poste local</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Lancer le navigateur Firefox, ensuite tapez localhost/azetwin pour se connecter aux bases de donn&eacute;es via l&rsquo;interface Web.</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Chargez la base de donn&eacute;es via PhpMyAdmin</p>\r\n\r\n<p>Chargement de la BDD<br />\r\n⦁&nbsp;&nbsp; &nbsp;On commence par la modification de Php. Lancer Php, choisir&hellip;php.ini, recherchez &quot;upload_max_filesize&quot; et changez 2M en 100M<br />\r\n⦁&nbsp;&nbsp; &nbsp;Ensuite rechercher &quot;post_max_size&quot; et mettre 108M<br />\r\n⦁&nbsp;&nbsp; &nbsp;Rechercher &quot;max_execution_time&quot; et changer en 1200<br />\r\n⦁&nbsp;&nbsp; &nbsp;Maintenant on proc&egrave;de &agrave; la modification de MySQL. Lancer MySQL&hellip;my.ini, remplacer les 2 derni&egrave;res lignes par cette commande :<br />\r\n[mysqld]<br />\r\ninit_connect=&#39;SET collation_connection = utf8_general_ci&#39;<br />\r\ninit_connect=&#39;SET NAMES utf8&#39;<br />\r\n#default-character-set=utf8<br />\r\ncharacter-set-server=utf8<br />\r\ncollation-server=utf8_general_ci<br />\r\nskip-character-set-client-handshake<br />\r\nport=3306</p>\r\n\r\n<p>NB : N&rsquo;oubliez pas d&rsquo;enregistrer toutes les modifications que vous venez de faire</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Cr&eacute;ation de la BDD &agrave; partir du serveur<br />\r\nPour cela on proc&egrave;de ainsi :<br />\r\nWampServer&hellip;phpMyAdmin et on a cette fen&ecirc;tre<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Cliquez sur l&rsquo;onglet Bases de donn&eacute;es, dans le champ cr&eacute;er une base de donn&eacute;es on met par exemple : Proarchives / caremploi &hellip; caremploi_archives et dans le champ juste apr&egrave;s choisir &laquo; utf8_general_ci &raquo;&hellip; puis Cr&eacute;er.</p>\r\n\r\n<p>Et ainsi de suite&hellip; Veillez &agrave; nommer les BDD exactement comme sur le serveur pour que l&rsquo;interface web et de saisie puissent retrouver les donn&eacute;es sur le poste local et fonctionner.<br />\r\nMaintenant il faut importer la base en proc&eacute;dant ainsi.<br />\r\nNB/ Apr&egrave;s avoir cr&eacute;e la BDD &laquo; caremploi &raquo;, &nbsp;importer la BDD &laquo; traitement &raquo;, ensuite supprimer les champs inutiles qui ne serviront pas dans &laquo; caremploi &raquo; &agrave; l&rsquo;aide de la formule SQL suivante :</p>\r\n\r\n<p>delete from`traitement` where `Traitement_Photo_Url` regexp &#39;ENVOI&#39; &nbsp;;<br />\r\ndelete from`photo` where `Photo_Lien_Photo` regexp &#39;ENVOI&#39; &nbsp;;</p>\r\n\r\n<p>Ensuite videz le champ &laquo; Client_archiviste &raquo; en cochant la petite case &agrave; c&ocirc;t&eacute; et faire &laquo; vider &raquo; dans la fen&ecirc;tre &laquo; Pour la s&eacute;lection &raquo;</p>\r\n\r\n<p><br />\r\n⦁&nbsp;&nbsp; &nbsp;Importation de la BDD &agrave; partir du serveur<br />\r\nCliquez sur &nbsp;Proarchives que vous venez de cr&eacute;er, cliquez sur l&rsquo;onglet Importer<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\nEnsuite faites Parcourir et chercher la derni&egrave;re sauvegarde en date de Proarchives dans DropBox Proweb&hellip;BackUp Bases de donn&eacute;es, ouvrir. Pour terminer faites &nbsp;ex&eacute;cuter.<br />\r\nEnfin vous avez votre serveur miroir. &nbsp;</p>\r\n\r\n<p>Remarque<br />\r\n⦁&nbsp;&nbsp; &nbsp;Toute intervention dans la BDD install&eacute; sur le serveur doit &ecirc;tre transmise &agrave; Paris. Les interventions sur les BDD doivent &ecirc;tre minimis&eacute;es au maximum pour &eacute;viter toutes perturbations. On y va pour faire des interventions connues, &nbsp;test&eacute;es par ailleurs, toujours les m&ecirc;mes et approuv&eacute;s par plusieurs intervenants. Jamais en solo !!!</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Si utilisation de PhPMyadmin (et donc interventions sur les BDD), il est indispensable de s&rsquo;assurer que les op&eacute;ratrices ne sont pas en train de travailler sur les BDD.&nbsp;</p>\r\n\r\n<p><br />\r\n⦁&nbsp;&nbsp; &nbsp;Test de la base de donn&eacute;es<br />\r\nLancez l&rsquo;interface de saisie de Proarchives<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Cochez dans la case de &quot;Modification Config Login BDD&quot;<br />\r\n⦁&nbsp;&nbsp; &nbsp;Changer l&rsquo;adresse IP de la base en &quot;localhost&quot;<br />\r\n⦁&nbsp;&nbsp; &nbsp;Connection<br />\r\nVoil&agrave;, vous avez votre serveur en local sur votre ordinateur.</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;INTALLATION ET UTILISATION DE L&rsquo;INTERFACE WEB<br />\r\n⦁&nbsp;&nbsp; &nbsp;Installation de l&rsquo;Interface web&nbsp;<br />\r\nL&rsquo;interface web permet de :<br />\r\n⦁&nbsp;&nbsp; &nbsp;Suivre en temps r&eacute;el les travaux de saisis externalis&eacute;s<br />\r\n⦁&nbsp;&nbsp; &nbsp;Envoyer des ordres de priorit&eacute;<br />\r\n⦁&nbsp;&nbsp; &nbsp;Effectuer des recherches sur les photographies pr&eacute;sentant des anomalies<br />\r\n⦁&nbsp;&nbsp; &nbsp;Editer les fichiers de restitution<br />\r\n⦁&nbsp;&nbsp; &nbsp;Et d&rsquo;une mani&egrave;re g&eacute;n&eacute;rale d&egrave;s qu&rsquo;il s&rsquo;agit de manipuler les informations de la BDD pour &eacute;viter les interventions directes dans Mysql</p>\r\n\r\n<p>Pour se connecter, il suffit de lancer Firefox et de taper &quot; http://localhost/azertwin3/&quot;, une fen&ecirc;tre s&rsquo;ouvre, entrez votre compte d&rsquo;utilisateur et le mot de passe (la liste correspond aux enregistrements de la BDD Utilisateurs_web). &nbsp;Ensuite nous avons cette fen&ecirc;tre<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n⦁&nbsp;&nbsp; &nbsp;Param&eacute;trage de l&rsquo;interface dans wamp<br />\r\nL&rsquo;interface web doit &ecirc;tre configur&eacute;e avec les BDD (selon qu&rsquo;elles sont en local ou sur serveur)</p>\r\n\r\n<p>a&deg;) Dans wamp\\www\\azertwin\\az_fpu\\ modifiez le fichier azertwin.php de la mani&egrave;re suivante avec un &eacute;diteur de texte<br />\r\nUtilisation local<br />\r\n$myServer=&#39;http://127.0.0.1/azertwin&#39;;</p>\r\n\r\n<p>Utilisation sur serveur<br />\r\n$myServer=&#39;http:// 41.207.172.122/azertwin&#39;;</p>\r\n\r\n<p>b&deg;) Dans wamp\\www\\azertwin\\az_script\\ modifier le fichier azertwin.js de la mani&egrave;re suivante avec un &eacute;diteur de texte<br />\r\nUtilisation local<br />\r\nvar server =&#39;http://127.0.0.1/azertwin/az_.fpu/azertwin.php&#39;;<br />\r\nvar searchServer =&#39;http://127.0.0.1/azertwin&#39;;</p>\r\n\r\n<p>Utilisation sur serveur<br />\r\nvar server =&#39;http:// 41.207.172.121/azertwin/az_.fpu/azertwin.php&#39;;<br />\r\nvar searchServer =&#39;http:// 41.207.172.121/azertwin&#39;;</p>\r\n\r\n<p>c&deg;) Ajout de modules de classes<br />\r\nLe r&eacute;pertoire Azertwin situ&eacute; dans www doit poss&eacute;der des modules de classes pour faire fonctionner php avec Excel qui est tr&egrave;s utilis&eacute; dans les formats de restitution.<br />\r\nPour cela t&eacute;l&eacute;charger &laquo; 1.7.6.zip &raquo; qui contient le dossier Classes<br />\r\nDans logiciels importants d&eacute;compresser 1.7.6.zip<br />\r\nEt recopier tout le dossier &laquo; classes &raquo; dans le r&eacute;pertoire Azertwin.</p>\r\n\r\n<p>4&deg;) Restitution<br />\r\nEnfin pour faire fonctionner, il faut ajouter/cr&eacute;er le r&eacute;pertoire &laquo; Restitution &raquo; dans Azertwin.<br />\r\nLes &eacute;tats sont d&eacute;pos&eacute;s dans ce r&eacute;pertoire selon la m&ecirc;me organisation que dans l&rsquo;interface web : module avancement des travaux.<br />\r\nPar interface (Ago, Proarchives,&hellip;) puis par envoi (envoi 2012.027, Envoi 2012.028,&hellip;)</p>\r\n\r\n<p>Remarque<br />\r\nC&rsquo;est donc la m&ecirc;me interface qui est utilis&eacute;e pour l&rsquo;interface client (avancement des travaux simplifi&eacute;, module de recherche,&hellip;) que pour les outils internes de Proweb (module avancement des travaux, gestion des op&eacute;rateurs, module de restitution,&hellip;). C&rsquo;est le login + MDP de la table Utilisateurs_web qui permet d&rsquo;afficher le type d&rsquo;interface au lancement</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Param&eacute;trage de Firefox<br />\r\nCertains modules de l&rsquo;interface web permettent &eacute;galement l&rsquo;affichage de la photo. Les photos des clients sont stock&eacute;s sur le r&eacute;pertoire Y du serveur.<br />\r\nPour afficher la photo sur son poste local il faut n&eacute;anmoins param&eacute;trer Firefox qui va bloquer l&rsquo;affichage pour des questions de s&eacute;curit&eacute;.</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Manuel d&rsquo;Utilisateur de l&rsquo;Interface Web AGO/Proarchives du client</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Installation de l&rsquo;interface<br />\r\nTout d&rsquo;abord il est n&eacute;cessaire d&rsquo;installer une version de Firefox (navigateur open source et libre de droit) que vous pouvez t&eacute;l&eacute;charger sur le site :</p>\r\n\r\n<p>http://www.01net.com/telecharger/windows/Internet/navigateur/fiches/25711.html</p>\r\n\r\n<p>Ensuite il faut t&eacute;l&eacute;charger une petite extension qui facilite l&rsquo;affichage des photos dans votre navigateur. Il suffit de suivre les indications de t&eacute;l&eacute;chargement o&ugrave; tout est indiqu&eacute;.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br />\r\nhttps://addons.mozilla.org/en-FR/firefox/addon/locallink/</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Utilisation de l&rsquo;interface Web<br />\r\nL&rsquo;interface web que nous mettons &agrave; votre disposition permet principalement de:<br />\r\n⦁&nbsp;&nbsp; &nbsp;Suivre en temps r&eacute;el les travaux de saisies externalis&eacute;es<br />\r\n⦁&nbsp;&nbsp; &nbsp;Envoyer des ordres de priorit&eacute;<br />\r\n⦁&nbsp;&nbsp; &nbsp;Effectuer des recherches sur les photographies pr&eacute;sentant des anomalies XXX</p>\r\n\r\n<p>Demande de login :<br />\r\nL&rsquo;interface web permet d&rsquo;effectuer des actions qui vont avoir des cons&eacute;quences sur notre organisation comme les d&eacute;lais de traitement des fichiers de restitution. A ce titre, le droit d&rsquo;utilisation de l&rsquo;interface est accord&eacute; exclusivement &agrave; la soci&eacute;t&eacute; AGO et &agrave; son personnel habilit&eacute; &agrave; manipuler des informations confidentielles, comp&eacute;tent &agrave; donner des ordres de travail et &agrave; modifier un bon de commande. Chaque demande de login et de mot de passe devra &ecirc;tre valid&eacute;e par le responsable des op&eacute;rations d&rsquo;AGO avant d&rsquo;&ecirc;tre transmis &agrave; frederic.malbrel@neuf.fr .</p>\r\n\r\n<p>Pour vous connecter il suffit d&rsquo;entrer dans votre navigateur Firefox &nbsp;l&rsquo;url suivant :<br />\r\n⦁&nbsp;&nbsp; &nbsp;http://41.207.172.122/azertwin</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Entrez votre Login et votre mot de passe.<br />\r\n⦁&nbsp;&nbsp; &nbsp;Description de l&rsquo;interface web<br />\r\n⦁&nbsp;&nbsp; &nbsp;Ecran Avancement des travaux<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>En haut &agrave; gauche 2 boutons :<br />\r\n⦁&nbsp;&nbsp; &nbsp;rafraichissement des donn&eacute;es<br />\r\n⦁&nbsp;&nbsp; &nbsp;d&eacute;connexion&nbsp;</p>\r\n\r\n<p>A droite, 3 onglets de nature des travaux avec les 2 typologies diff&eacute;rentes :<br />\r\n⦁&nbsp;&nbsp; &nbsp;Proarchives<br />\r\n⦁&nbsp;&nbsp; &nbsp;Caremploi<br />\r\n⦁&nbsp;&nbsp; &nbsp;AGO<br />\r\nTous les chantiers sont regroup&eacute;s par envoi suivi de la date d&rsquo;envoi. Ils restent affich&eacute;s &agrave; l&rsquo;&eacute;cran environ 2 &agrave; 3 jours apr&egrave;s l&rsquo;envoi des fichiers de restitution.</p>\r\n\r\n<p>Chantiers : les noms complets des chantiers tels qu&rsquo;ils figurent au moment du transfert par AGO</p>\r\n\r\n<p>Fichiers d&eacute;clar&eacute;s : il s&rsquo;agit des quantit&eacute;s de photos que l&rsquo;on trouve dans rapport chantier pour Proarchives et dans le nom du chantier pour AGO</p>\r\n\r\n<p>Fichiers re&ccedil;us : il s&rsquo;agit des quantit&eacute;s de photos que l&rsquo;interface a int&eacute;gr&eacute;es.&nbsp;</p>\r\n\r\n<p>Total valid&eacute;es : il s&rsquo;agit du nombre total de photos valid&eacute;es par l&rsquo;&eacute;quipe de contr&ocirc;le. Les saisies peuvent &ecirc;tre modifi&eacute;es &agrave; l&rsquo;issue du contr&ocirc;le qualit&eacute; et avant restitution mais rarement.</p>\r\n\r\n<p>Total en-cours : il s&rsquo;agit du nombre total de photos en cours de saisies/corrections et qui peuvent &ecirc;tre modifi&eacute;es &agrave; tout moment.</p>\r\n\r\n<p>Stock &agrave; saisir : quantit&eacute; de photos restante n&rsquo;ayant fait l&rsquo;objet d&rsquo;aucune saisie. &nbsp;</p>\r\n\r\n<p>Stock &agrave; valider : quantit&eacute; de photos en stock et en-cours de traitement</p>\r\n\r\n<p>D&eacute;part compteur : il s&rsquo;agit du num&eacute;ro de d&eacute;part du compteur des unit&eacute;s d&rsquo;archives par client. Pour AGO il n&rsquo;existe pas. Ce num&eacute;ro nous est communiqu&eacute; par le service des op&eacute;rations. Il arrive n&eacute;anmoins que ce num&eacute;ro diff&egrave;re lorsque le chantier est &laquo; &eacute;clat&eacute; &raquo; et encore pr&eacute;sent dans un envoi r&eacute;cent et non restitu&eacute;. Dans ce cas AGO ne peut pas conna&icirc;tre le num&eacute;ro le plus r&eacute;cent. C&rsquo;est aussi ce num&eacute;ro qui est repris dans la colonne N&deg; de dossier du fichier de restitution.</p>\r\n\r\n<p>Date retour : il s&rsquo;agit de la date de restitution pr&eacute;vue par rapport &agrave; la livraison des &eacute;l&eacute;ments.</p>\r\n\r\n<p>Priorit&eacute; : il existe 5 statuts possibles pour un chantier</p>\r\n\r\n<p>Urgent : AGO souhaite r&eacute;cup&eacute;rer le plus rapidement possible son fichier de restitution et acc&eacute;l&egrave;re le traitement global. AGO indique aussi la date &agrave; laquelle il souhaite recevoir son fichier. Attention, un changement d&rsquo;un jour sur le d&eacute;lai normal g&eacute;n&egrave;re une modification de 2% du tarif de base</p>\r\n\r\n<p>Priorit&eacute; 1 : m&ecirc;me demande qu&rsquo;urgent mais sans volont&eacute; de recevoir plus rapidement le fichier de restitution. Cela permet toutefois de lancer les requ&ecirc;tes sur l&rsquo;int&eacute;gralit&eacute; d&rsquo;un chantier.</p>\r\n\r\n<p>Priorit&eacute; 2 ou 3 : ordre de traitement des chantiers suivants<br />\r\nAttendre : un probl&egrave;me a &eacute;t&eacute; identifi&eacute; (doublon table adresse, nouveau service,&hellip;) qui n&eacute;cessite de bloquer la saisie d&rsquo;un chantier pour un compl&eacute;ment d&rsquo;informations&nbsp;</p>\r\n\r\n<p>Normal : la saisie se fait au fil de l&rsquo;eau&hellip;<br />\r\nDate urgence : il s&rsquo;agit de la date de restitution modifi&eacute;e par le service des op&eacute;rations d&rsquo;AGO. Elle indique que le fichier de restitution doit &ecirc;tre retourn&eacute; dans des d&eacute;lais plus courts. Le respect de ce d&eacute;lai d&eacute;pend n&eacute;anmoins de sa faisabilit&eacute; op&eacute;rationnelle !</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Remarques&nbsp;<br />\r\nLa modification d&rsquo;une priorit&eacute; rel&egrave;ve de la seule d&eacute;cision du service des op&eacute;rations d&rsquo;AGO qui est seul comp&eacute;tent pour d&eacute;clencher cette action. Lors de la cr&eacute;ation d&rsquo;un login, la direction g&eacute;n&eacute;rale d&rsquo;AGO aura pr&eacute;alablement valid&eacute;e les comp&eacute;tences de l&rsquo;op&eacute;rateur &agrave; d&eacute;clencher des actions.</p>\r\n\r\n<p>La date d&rsquo;urgence est non modifiable pour &eacute;viter les multiples changements qui mobilisent d&egrave;s la premi&egrave;re modification l&rsquo;ensemble des taches des &eacute;quipes de saisie.</p>\r\n\r\n<p>Les ardoises pour AGO sont prises en compte dans les colonnes totaux, re&ccedil;us, d&eacute;clar&eacute;es, valid&eacute;es,&hellip;</p>\r\n\r\n<p>Si &eacute;cart entre fichiers d&eacute;clar&eacute;s et fichiers re&ccedil;us (perte pendant le transfert, rapport de chantier erron&eacute;) les 2 champs passent en rouge. Cependant la saisie n&rsquo;est pas bloqu&eacute;e, la restitution oui tant que l&rsquo;anomalie n&rsquo;a pas &eacute;t&eacute; identifi&eacute;e.</p>\r\n\r\n<p>Une ligne de chantier peut apparaitre en orange. Notre service qualit&eacute; a identifi&eacute; une saisie difficile et ordonn&eacute; une saisie suppl&eacute;mentaire pour une photo. Pendant une courte p&eacute;riode de contr&ocirc;le les quantit&eacute;s trait&eacute;es sont sup&eacute;rieures aux quantit&eacute;s d&eacute;clar&eacute;es (stock &agrave; saisir prend une valeur n&eacute;gative).&nbsp;<br />\r\nAu final, lorsque toutes les photos sont valid&eacute;es, le chantier passe au vert.</p>\r\n\r\n<p>Le contenu de la colonne Stock &agrave; saisir est une information pr&eacute;cieuse qui informe AGO sur le niveau d&rsquo;activit&eacute; de nos &eacute;quipes et de la n&eacute;cessit&eacute; de renouveler des transferts.</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Fen&ecirc;tres de suivi<br />\r\nUne fen&ecirc;tre en haut de l&rsquo;&eacute;cran permet de suivre la synth&egrave;se des priorit&eacute;s et de visualiser les chantiers actuellement en-cours de saisie.</p>\r\n\r\n<p>Lorsqu&rsquo;un chantier est d&eacute;clar&eacute; en urgent ou en priorit&eacute; 1, il est transmis imm&eacute;diatement aux &eacute;quipes de saisie et prend la place des chantiers en-cours. Nos &eacute;quipes ont n&eacute;anmoins la possibilit&eacute; de traiter des corrections ant&eacute;rieures mais toute nouvelle saisie se fait sur les chantiers d&eacute;clar&eacute;s en urgence puis en priorit&eacute; 1, 2, 3. Ces informations se v&eacute;rifient ais&eacute;ment par l&rsquo;observation de la diminution des stocks dans l&rsquo;heure qui suit la demande d&rsquo;AGO et la possibilit&eacute; d&rsquo;&eacute;tendre alors les requ&ecirc;tes sur un plus grand nombre de photos.</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Modules de requ&ecirc;tes<br />\r\nS&eacute;lectionnez un ou plusieurs chantiers dans un ou plusieurs envois (pratique lorsqu&rsquo;un inventaire est fractionn&eacute; dans plusieurs envois).</p>\r\n\r\n<p>Une fen&ecirc;tre de recherche vous permet de choisir si la recherche d&rsquo;anomalies XXX s&rsquo;effectue dans les zones de conteneur ou d&rsquo;unit&eacute; d&rsquo;archives. Les r&eacute;sultats de la requ&ecirc;te sont affich&eacute;s et peuvent &ecirc;tre enregistr&eacute;s ou recopi&eacute;s dans un autre document (Microsoft office par exemple).</p>\r\n\r\n<p>Les requ&ecirc;tes sont lanc&eacute;es sur l&rsquo;int&eacute;gralit&eacute; des donn&eacute;es saisies qu&rsquo;elles soient en-cours, valid&eacute;es, au contr&ocirc;le qualit&eacute;, &agrave; la restitution. Et ceci pour vous permettre d&rsquo;avoir le maximum d&rsquo;informations de saisies disponibles d&egrave;s l&rsquo;entr&eacute;e dans notre interface. Lorsqu&rsquo;un chantier passe au vert, les informations sont fiabilis&eacute;es (contr&ocirc;le/correction) et sont en attente de l&rsquo;approbation du service qualit&eacute;.</p>\r\n\r\n<p>A l&rsquo;issue de la requ&ecirc;te vous pouvez afficher la photo dans votre navigateur et pr&eacute;parer ainsi vos travaux.</p>\r\n\r\n<p>Pour permettre d&rsquo;afficher les photographies dans un autre environnement client/serveur le champ racine de l&rsquo;url est modifiable et permet d&rsquo;afficher le chemin d&rsquo;entr&eacute;e jusqu&rsquo;au r&eacute;pertoire o&ugrave; sont stock&eacute;s les photos.</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Affichage des photos&nbsp;<br />\r\nPour des raisons de s&eacute;curit&eacute; propre aux environnements clients/serveur de la soci&eacute;t&eacute; AGO, il est n&eacute;cessaire d&rsquo;installer une pr&eacute;f&eacute;rence r&eacute;seau dans votre navigateur Firefox dont voici le descriptif complet :</p>\r\n\r\n<p>Ouvrir bloc note copier et coller le texte &nbsp;en gras suivant</p>\r\n\r\n<p>/* Objectif : afficher les photos AGO situ&eacute; sur un serveur 192.168.1.8 &agrave; partir d&#39;un autre poste du r&eacute;seau.<br />\r\n&nbsp;*/<br />\r\nuser_pref(&quot;capability.policy.policynames&quot;,&quot;politiquelocale&quot;);<br />\r\nuser_pref(&quot;capability.policy.politiquelocale.sites&quot;,&quot;http://localhost ; http://192.168.1.8&quot;);<br />\r\nuser_pref(&quot;capability.policy.politiquelocale.checkloaduri.enabled&quot;,&quot;allAccess&quot;);</p>\r\n\r\n<p>Ensuite, enregistrez sous le nom de fichier user.js (ne pas oublier l&rsquo;extension dans le nom du fichier)<br />\r\nQuitte bloc note<br />\r\nS&eacute;lectionner le fichier user.js dans Windows et copier (sans l&rsquo;ouvrir)<br />\r\nOuvrir Firefox<br />\r\nMenu ?/Information de d&eacute;pannage dans la barre d&rsquo;outil<br />\r\nCliquer sur le bouton &laquo; Ouvrir le dossier correspondant &raquo;<br />\r\nEt coller user.js<br />\r\nRelancer Firefox</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\nSi cette extension n&rsquo;est pas install&eacute;e, le module de recherche reste op&eacute;rationnel. Seul l&rsquo;affichage de la photo sera indisponible.</p>\r\n\r\n<p>A la premi&egrave;re requ&ecirc;te d&rsquo;affichage de la photo dans l&rsquo;interface, Firefox va vous demander d&rsquo;autoriser l&rsquo;affichage des fen&ecirc;tres pop up en provenance du site o&ugrave; se d&eacute;roule la saisie externalis&eacute;e. R&eacute;pondre &laquo; oui pour tous les pop-up &raquo; pour le site 41.207.172.122.</p>\r\n\r\n<p>Dor&eacute;navant vous pouvez afficher les photos stock&eacute;es sur votre r&eacute;seau d&rsquo;entreprise avec une IP priv&eacute;e directement &agrave; partir de votre navigateur. Celle qui nous a &eacute;t&eacute; communiqu&eacute;e au moment de la r&eacute;daction de ce manuel, est la suivante : http://192.168.1.8</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Modules de requ&ecirc;tes</p>\r\n\r\n<p>S&eacute;lectionner un ou plusieurs chantiers dans 1 ou plusieurs envois (pratique lorsqu&rsquo;un inventaire est fractionn&eacute; dans plusieurs envois)</p>\r\n\r\n<p>Une fen&ecirc;tre de recherche vous permet de choisir si la recherche d&rsquo;anomalies XXX s&rsquo;effectue dans les zones de conteneur ou d&rsquo;unit&eacute; d&rsquo;archives. Les r&eacute;sultats de la requ&ecirc;te sont affich&eacute;s et peuvent &ecirc;tre enregistr&eacute;s ou recopi&eacute;s dans un autre document (Microsoft office par exemple).</p>\r\n\r\n<p>Les requ&ecirc;tes sont lanc&eacute;es sur l&rsquo;int&eacute;gralit&eacute; des donn&eacute;es saisies qu&rsquo;elles soient en-cours, valid&eacute;es, au contr&ocirc;le qualit&eacute;, &agrave; la restitution. Et ceci pour vous permettre d&rsquo;avoir le maximum d&rsquo;informations de saisies disponibles d&egrave;s l&rsquo;entr&eacute;e dans notre interface. Lorsqu&rsquo;un chantier passe au vert, les informations sont fiabilis&eacute;es (contr&ocirc;le/correction) et sont en attente de l&rsquo;approbation du service qualit&eacute;.</p>\r\n\r\n<p>A l&rsquo;issue de la requ&ecirc;te vous pouvez afficher la photo dans votre navigateur et pr&eacute;parer ainsi vos travaux.</p>\r\n\r\n<p>Pour permettre d&rsquo;afficher les photographies dans un autre environnement client/serveur le champ racine de l&rsquo;url est modifiable et permet d&rsquo;afficher le chemin d&rsquo;entr&eacute;e jusqu&rsquo;au r&eacute;pertoire o&ugrave; sont stock&eacute;s les photos.</p>\r\n\r\n<p><br />\r\n⦁&nbsp;&nbsp; &nbsp;INTALLATION ET UTILISATION DES ODBC ET DE MS ACCESS</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Rappel<br />\r\nODBC (Open DataBase Connectivity) est une interface con&ccedil;ue par Microsoft pour acc&eacute;der &agrave; des bases de donn&eacute;es dans un environnement h&eacute;t&eacute;rog&egrave;ne de Syst&egrave;mes de Gestion de Bases de Donn&eacute;es (SGBD) relationnels et non relationnels. Les ODBC doivent &ecirc;tre recr&eacute;&eacute;s lorsque des nouveaux champs ou tables sont ajout&eacute;s dans les BDD. L&rsquo;actualisation n&rsquo;est pas automatique.</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Installation de MySQL Connector ODBC<br />\r\n⦁&nbsp;&nbsp; &nbsp;Installer &quot;mysql-connector-odbc-5.1.8-win32&quot;</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Utilisation de ODBC et Ms ACCESS<br />\r\n&nbsp;Ensuite D&eacute;marrer&hellip;Tous les programmes&hellip;Accessoires&hellip;Ex&eacute;cuter &eacute;crire c:\\windows\\syswow64\\odbcad32.exe&hellip;.OK. La fen&ecirc;tre Administrateur de &nbsp;sources de donn&eacute;es ODBC s&rsquo;ouvre&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ensuite, cliquez sur l&rsquo;onglet Sources de donn&eacute;es syst&egrave;me&hellip;Ajouter&hellip;choisir MySQL ODBC5.1 Drivers&hellip;.terminer<br />\r\nLa petite fen&ecirc;tre de MySQL s&rsquo;ouvre et cr&eacute;er votre base en suivant l&rsquo;exemple suivante :<br />\r\n&nbsp;Date Source Name&nbsp;&nbsp; &nbsp;: localhost_Pro<br />\r\nDescription&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;: Localhost_Pro<br />\r\nTCP/IP&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;: localhost<br />\r\nUser&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;: root<br />\r\nPassword&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;:&nbsp;<br />\r\nDatabase&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;: Proarchives</p>\r\n\r\n<p>Eviter les caract&egrave;res espaces et mettre des underscore (_)!<br />\r\nTester puis vous validez.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;Lancez Ms ACCESS&hellip;cr&eacute;er une nouvelle base de donn&eacute;es&hellip;ouvrez la base et Importer les donn&eacute;es &agrave; partir de &hellip;Onglet Donn&eacute;es externes&hellip;Plus&hellip;dans la liste d&eacute;roulante, choisir &nbsp;Base de donn&eacute;es ODBC dans la fen&ecirc;tre suivante choisir dans la fen&ecirc;tre qui s&rsquo;affiche lier &agrave; la source de donn&eacute;es en cr&eacute;ant une table attach&eacute;e &hellip;puis validez.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;<br />\r\nDans la fen&ecirc;tre qui s&rsquo;affiche, cliquez sur l&rsquo;onglet Source de donn&eacute;es machine&hellip;Nouveau<br />\r\n&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\nContinuer avec Suivant,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>s&eacute;lectionner MySQL ODBC 5.1 Drivers puis Suivant<br />\r\n&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Et enfin Terminer</p>\r\n\r\n<p>Ensuite, renseigner la fen&ecirc;tre suivante en liant la table&hellip;Ok<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\nDans la fen&ecirc;tre de Ms ACCESS, vous avez les tables cr&eacute;&eacute;es<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n⦁&nbsp;&nbsp; &nbsp;La mise &agrave; jour 64 bits &agrave; 32 bits<br />\r\n&nbsp;Panneau de Configuration&hellip;Programmes&hellip;Programmes et fonctionnalit&eacute;s&hellip;choisir Activer ou d&eacute;sactiver&hellip;<br />\r\nUne petite fen&ecirc;tre Windows s&rsquo;ouvre&nbsp;<br />\r\nCochez la case Services Internet (IIS) puis OK</p>\r\n\r\n<p>Patientez un moment pendant que Windows modifie les fonctionnalit&eacute;s.</p>\r\n\r\n<p>Retournez dans Panneau de Configuration&hellip;Syst&egrave;me et S&eacute;curit&eacute;&hellip;Outils d&rsquo;Administration&hellip; double cliques sur Gestionnaires des Services Internet.</p>\r\n\r\n<p><br />\r\n&nbsp;A droite de la fen&ecirc;tre affich&eacute;e, cliquez sur Afficher les pools d&rsquo;Applications&hellip;dans la fen&ecirc;tre suivante, s&eacute;lectionnez DefaultAppPool&hellip;puis cliquez sur Param&egrave;tre Avanc&eacute;e &agrave; droite de l&rsquo;&eacute;cran. Windows affiche la fen&ecirc;tre suivante</p>\r\n\r\n<p>Cliquez sur Activer les applications 32 bits, s&eacute;lectionnez True&hellip;puis OK</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\n⦁&nbsp;&nbsp; &nbsp;AFFICHAGE DANS L&rsquo;I.WEB D&rsquo;UN ENVOI APRES RESTITUTION</p>\r\n\r\n<p>Le client demande de faire une modification sur un chantier d&eacute;j&agrave; restitu&eacute;. Par exemple : table adresse manquante, saisie erron&eacute;e, etc.</p>\r\n\r\n<p>Etape 1<br />\r\n⦁&nbsp;&nbsp; &nbsp;Retrouver la date de restitution du chantier.<br />\r\n⦁&nbsp;&nbsp; &nbsp;Allez dans Wamp&hellip;.phpMyAdmin&hellip;&hellip;..Table Chantier_Rapport &hellip;Cliquez sur la structure pour afficher tous les chantiers<br />\r\n⦁&nbsp;&nbsp; &nbsp;Onglet &laquo; Rechercher &raquo; &hellip;.dans le champ &laquo; date_restitution &raquo; affichez la date de restitution du chantier&hellip;puis ex&eacute;cuter.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\nTous les chantiers restitu&eacute;s &agrave; cette s&rsquo;afficheront.<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Cliquez sur modifier (le petit crayon) &agrave; c&ocirc;t&eacute; du chantier que l&rsquo;on veut faire appara&icirc;tre dans l&rsquo;Interface Web. La fen&ecirc;tre suivante s&rsquo;affiche</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Effacez la date de restitution du chantier &hellip;puis ex&eacute;cuter.<br />\r\n⦁&nbsp;&nbsp; &nbsp;Dans l&rsquo;Interface Web tout l&rsquo;envoi s&rsquo;affiche.</p>\r\n\r\n<p><br />\r\nEtape 2</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Modification &agrave; l&rsquo;aide de SQL<br />\r\n&nbsp;Si la correction concerne tout le chantier nous utilisons la commande suivante :</p>\r\n\r\n<p>update `traitement` set `Traitement_Type` = &#39;SAISIE&#39; where `Traitement_Photo_Url` REGEXP &#39;nom_chantier&#39; ;</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;La correction du chantier peut commencer.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;AJOUT D&rsquo;UNE NOUVELLE BDD DE CARREFOURS EMPLOI</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Base de donn&eacute;es : Caremploi</p>\r\n\r\n<p>Etape n&deg;1 : Cr&eacute;ation de la nouvelle BDD &laquo; caremploi &raquo; dans Wamp &hellip;PhpMyAdmin<br />\r\n⦁&nbsp;&nbsp; &nbsp;caremploi</p>\r\n\r\n<p>Etape n&deg;2 : Importation des donn&eacute;es de la BDD Proarchives dans la nouvelle base car elle a la m&ecirc;me structure que Proarchives et contient des donn&eacute;es Caremploi d&eacute;j&agrave; saisies.</p>\r\n\r\n<p>Etape n&deg;4 : Nettoyage de la base de donn&eacute;es nouvellement cr&eacute;&eacute;e. Pour cela, nous allons supprimer &nbsp;les donn&eacute;es de Proarchives et ne garder que celles de Caremploi. Nous allons lancer la commande SQL pour les supprimer dans les tables &laquo; photo &raquo; et &laquo; traitement &raquo;.</p>\r\n\r\n<p>Commande SQL</p>\r\n\r\n<p>delete from`photo` where `Photo_Lien_Photo` regexp &#39;ENVOI&#39; &nbsp;;<br />\r\ndelete from`traitement` where `Traitement_Photo_Url` regexp &#39;ENVOI&#39; &nbsp;;</p>\r\n\r\n<p>Apr&egrave;s cette op&eacute;ration, la BDD caremploi n&rsquo;aura que les donn&eacute;es de CARREFOURS EMPLOI.</p>\r\n\r\n<p>Etape n&deg;5 : Modification des donn&eacute;es de la table &laquo; table_chantier &raquo;</p>\r\n\r\n<p>Dans cette table, nous allons modifier le champ &laquo; Chantier_Interface &raquo; pour les envois correspondant &agrave; Carrefours_emploi. Nous allons lancer la commande SQL &nbsp;suivante :</p>\r\n\r\n<p>Commande SQL</p>\r\n\r\n<p>update `table_chantier` set `Chantier_Interface` = &#39;Caremploi&#39; where `Chantier_Lien_Photo` REGEXP &#39;CARREFOURS_EMPLOI&#39; ;</p>\r\n\r\n<p>Etape n&deg;6 : Modification des donn&eacute;es de la table &laquo; chantier_rapport &raquo;</p>\r\n\r\n<p>Dans cette table, nous allons modifier le champ &laquo; Interface_Chantier &raquo; pour les envois correspondant &agrave; Carrefours_emploi. Nous allons lancer la commande SQL &nbsp;suivante :</p>\r\n\r\n<p>Commande SQL</p>\r\n\r\n<p>update `table_chantier_rapport` set `Interface_Chantier` = &#39;Caremploi&#39; where `Url_Chantier ` REGEXP &#39;CARREFOURS_EMPLOI&#39; ;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Etape n&deg;7 : Modification des donn&eacute;es de la table &laquo; Utilisateur_Web &raquo;</p>\r\n\r\n<p>NB : Cette modification se fera dans l&rsquo;ODBC</p>\r\n\r\n<p>Dans cette table, nous allons modifier le champ &laquo; Interface_Groupe &raquo; en ajoutant la nouvelle BDD #caremploi.<br />\r\nAvant : Ago#Proarchives<br />\r\nApr&egrave;s : Ago#Proarchives#Caremploi</p>\r\n\r\n<p>Etape n&deg;8 : Modification des donn&eacute;es de la table &laquo; Photo &raquo; de la base Proarchives</p>\r\n\r\n<p>Soit la commande SQL suivante :&nbsp;</p>\r\n\r\n<p>UPDATE photo SET Photo_Expression_Ligne4 = LCASE(Photo_Expression_Ligne4);</p>', '2016-07-11 18:29:00', 1, 0, NULL),
(48, 53, 43, 'Ouvrir wamp', '<p><strong>Mise &agrave; jour de l&rsquo;applicatif Interface Web</strong></p>\r\n\r\n<p>Le dossier Restitution doit &ecirc;tre pr&eacute;sent dans azertwin3<br />\r\nLes modules de classes doivent &ecirc;tre install&eacute;es (liaison php avec Excel). Pour cela t&eacute;l&eacute;charger<br />\r\n1.7.6.zip qui contient le dossier Classes &agrave; d&eacute;placer vers azertwin3</p>\r\n\r\n<p><strong>1&deg;) Ourvir dans wamp/azertwin/az_.fpu</strong><br />\r\nOuvrir &nbsp;le fichier azertwin.php et modifier dans la premi&egrave;re ligne l&rsquo;IP du serveur</p>\r\n\r\n<p>$myServer=&#39;http://127.0.0.1/azertwin&#39;; si l&rsquo;appli est en local<br />\r\nDevient<br />\r\n$myServer=&#39;http:// 41.207.184.137/azertwin3&#39;; pour l&rsquo;appli du serveur</p>\r\n\r\n<p><strong>2&deg;) Ourvir dans wamp/azertwin/az_.script</strong><br />\r\nle fichier azertwin.js et modifier dans les 2 premi&egrave;res lignes l&rsquo;IP du serveur<br />\r\nvar server =&#39;<span style="color:#0000FF">http://127.0.0.1/azertwin/az_.fpu/azertwin.php</span>&#39;;<br />\r\nvar searchServer =&#39;<span style="color:#0000FF">http://127.0.0.1/azertwin</span>&#39;;<br />\r\nDevient<br />\r\nvar server =&#39;<span style="color:#0000FF">http://41.207.184.137/azertwin3/az_.fpu/azertwin.php</span>&#39;;<br />\r\nvar searchServer =&#39;<span style="color:#0000FF">http://41.207.184.137/azertwin3</span>&#39;;<br />\r\nRemarque : en ligne 1 on appelle bien azertwin.php et non azertwin3.php !!</p>', '2016-07-11 18:50:00', 1, 0, NULL);
INSERT INTO `version` (`ver_creator`, `ver_article`, `Id`, `ver_titre`, `ver_content`, `ver_date`, `ver_editable`, `ver_del`, `attachement`) VALUES
(48, 54, 44, 'Scratch de la BD', '<p><span style="color:#0000FF">Proc&eacute;dure de r&eacute;paration de la base de donn&eacute;es Mysql</span></p>\r\n\r\n<p><span style="color:#0000FF">⦁&nbsp;&nbsp; &nbsp;Pr&eacute;ambule</span><br />\r\nCette situation apparait notamment fr&eacute;quemment apr&egrave;s une panne de courant alors que la base de donn&eacute;es est ouverte, en cours d&rsquo;utilisation.</p>\r\n\r\n<p>Cette r&eacute;paration n&eacute;cessite que tous les postes clients soient &eacute;teints pour qu&rsquo;ils soient par la suite relanc&eacute;s proprement</p>\r\n\r\n<p>Une fois le serveur rallum&eacute;, il doit &ecirc;tre &eacute;teint &agrave; nouveau en utilisant cette fois le menu D&eacute;marrez/Eteindre de Windows.</p>\r\n\r\n<p>Puis d&eacute;marrer le serveur normalement (donc en fait le serveur est relanc&eacute; 2 fois).</p>\r\n\r\n<p>Le logiciel Wampserver &eacute;tant charg&eacute; et d&eacute;marr&eacute; avec Windows, s&rsquo;il est en orange, cela peut vouloir dire qu&rsquo;il est emp&ecirc;ch&eacute; par Skype ou Teamviewer principalement. Donc quitter Skype, Teamviewer,&hellip; tant que Wampserver n&rsquo;est pas au VERT. Sinon il faudra le r&eacute;installer (la r&eacute;installation ne d&eacute;truit pas les bases de donn&eacute;es).</p>\r\n\r\n<p>Avant d&rsquo;effectuer la moindre op&eacute;ration de maintenance, les bases de donn&eacute;es doivent &ecirc;tre sauvegard&eacute;es en suivant la proc&eacute;dure &laquo; Sauvegarde de la base de donn&eacute;es Mysql.docx &raquo;. On va sauvegarder une base abim&eacute;e mais ca peut servir&hellip; dans un sous r&eacute;pertoire before_scratch ou bien on veillera &agrave; enregistrer les sauvegardes en mentionnant dans les noms des sauvegardes &laquo; before scratch &raquo;</p>\r\n\r\n<p>Surtout on ne &laquo; se prom&egrave;ne pas &raquo; dans les menus PHPmYadmin ! C&rsquo;est tr&egrave;s important de respecter toutes les actions de la proc&eacute;dure et de ne pas en faire plus.</p>\r\n\r\n<p><span style="color:#0000FF">⦁&nbsp;&nbsp; &nbsp;Description de la r&eacute;paration</span><br />\r\nUne fois le serveur allum&eacute; &laquo; proprement &raquo; = seconde fois :<br />\r\nRelancer Teamviewer (acc&egrave;s France)<br />\r\nAller sur l&rsquo;ic&ocirc;ne verte de la barre d&rsquo;outil Wampserver et s&eacute;lectionner PhpMyAdmin</p>\r\n\r\n<p>Sur l&lsquo;&eacute;cran apparait &agrave; gauche apparait l&rsquo;ensemble des bases de donn&eacute;es. Toutes doivent faire l&rsquo;objet d&rsquo;une analyse/r&eacute;paration. Nous int&eacute;resse :<br />\r\n&nbsp;&nbsp; &nbsp;Ago (5)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;C&rsquo;est la base o&ugrave; l&rsquo;on stocke cr&eacute;dit agricole,&hellip; (5 tables)<br />\r\n&nbsp;&nbsp; &nbsp;Chantier (1)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Tous les liens des adresses photos sur le serveur (1 table)<br />\r\n&nbsp;&nbsp; &nbsp;_rapport (1)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Toutes les commandes du client (1 table)<br />\r\n&nbsp;&nbsp; &nbsp;Proarchives (5)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;C&rsquo;est la base o&ugrave; l&rsquo;on stocke Proarchives (5 tables).<br />\r\n&nbsp;&nbsp; &nbsp;Utilisateurs&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;C&rsquo;est la base o&ugrave; l&rsquo;on stocke les Loggins (1 table).</p>\r\n\r\n<p>Cliquer sur la base &agrave; analyser/r&eacute;parer.&nbsp;<br />\r\nPar exemple celle en cours au moment du scratch Ago (5) ou Proarchives (5)</p>\r\n\r\n<p>Sur l&lsquo;&eacute;cran apparait &agrave; gauche l&rsquo;ensemble des tables de la base de donn&eacute;es par exemple Ago (5) soit 5 tables.&nbsp;<br />\r\nA droite dans des onglets apparaissent des actions et la liste des tables</p>\r\n\r\n<p>ATTENTION : ne pas aller sur une table en particulier. Il faut rester sur l&rsquo;ic&ocirc;ne de la base de donn&eacute;es. C&rsquo;est pr&eacute;f&eacute;rable : cliquer sur une table scratch&eacute;e peut rendre les op&eacute;rations plus d&eacute;licates de r&eacute;cup&eacute;ration. Il faut laisser le logiciel faire exactement son job.</p>\r\n\r\n<p><br />\r\nS&eacute;lectionner toutes les tables avec les boites &agrave; cocher. On peut aussi utiliser l&rsquo;expression soulign&eacute; &laquo; tout cocher &raquo;&nbsp;</p>\r\n\r\n<p>A c&ocirc;t&eacute; se trouve un petit menu d&eacute;roulant &laquo; Pour la s&eacute;lection &raquo;.</p>\r\n\r\n<p>ATTENTION, le choix et l&rsquo;ordre de s&eacute;lection des ACTIONS DANS CE MENU SONT DEFINITIVES. On sera donc particuli&egrave;rement vigilant &agrave; ne pas utiliser (Vider, supprimer table,&hellip;)</p>\r\n\r\n<p>1&deg;) Utiliser Pour la s&eacute;lection = &laquo; V&eacute;rifier la table &raquo; (l&rsquo;ex&eacute;cution est imm&eacute;diate)</p>\r\n\r\n<p>Faire une copie &eacute;cran du r&eacute;sultat de l&rsquo;analyse et enregistr&eacute; le document &agrave; l&rsquo;endroit ou la sauvegarde before_scratch a &eacute;t&eacute; faite</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n2&deg;) Re-s&eacute;lectionner la Base de donn&eacute;es Proarchives(5)<br />\r\nRe-s&eacute;lectionner toutes les tables (tout cocher)</p>\r\n\r\n<p>Utiliser Pour la s&eacute;lection = &laquo; R&eacute;parer la table &raquo; (l&rsquo;ex&eacute;cution est imm&eacute;diate)</p>\r\n\r\n<p>Faire une copie &eacute;cran du r&eacute;sultat de l&rsquo;analyse et enregistr&eacute; le document &agrave; l&rsquo;endroit ou la sauvegarde before_scratch a &eacute;t&eacute; faite</p>\r\n\r\n<p>3&deg;) Recommencer les op&eacute;rations Analyse puis r&eacute;paration tant que les messages ne sont pas tous OK<br />\r\n4&deg;) Re-s&eacute;lectionner la Base de donn&eacute;es Proarchives(5)<br />\r\nRe-s&eacute;lectionner toutes les tables (tout cocher)</p>\r\n\r\n<p>Utiliser Pour la s&eacute;lection = &laquo; Optimiser la table &raquo; (l&rsquo;ex&eacute;cution est imm&eacute;diate)</p>\r\n\r\n<p>5&deg;) Recommencer les 3 op&eacute;rations pour les Base de donn&eacute;es suivantes. Pour revenir dans l&rsquo;&eacute;cran de s&eacute;lection des bases de donn&eacute;es, cliquez sur l&rsquo;ic&ocirc;ne de la petite maison en haut a gauche.<br />\r\nEn effet plusieurs bases sont ouvertes en m&ecirc;me temps dont il faut respecter la synchronisation de la r&eacute;paration.</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;Ago (5)<br />\r\n&nbsp;&nbsp; &nbsp;Chantier (1)<br />\r\n&nbsp;&nbsp; &nbsp;_rapport (1)<br />\r\n&nbsp;&nbsp; &nbsp;Proarchives (5)<br />\r\n&nbsp;&nbsp; &nbsp;Utilisateurs</p>\r\n\r\n<p>Si &agrave; l&rsquo;&eacute;tape 1&deg;) le r&eacute;sultat de l&rsquo;analyse est &laquo; OK &raquo;, vous pouvez passer &agrave; la base suivante.</p>\r\n\r\n<p>6&deg;) A l&rsquo;issue de cette r&eacute;paration, la proc&eacute;dure de sauvegarde doit &ecirc;tre r&eacute;alis&eacute;e en mentionnant dans le nom d&rsquo;enregistrement de chaque base &laquo; after_scratch &raquo; ou dans un sous r&eacute;pertoire</p>\r\n\r\n<p>7&deg;) A l&rsquo;issue des sauvegardes, le serveur doit &ecirc;tre &agrave; nouveau &eacute;teint via la commande Windows puis rallum&eacute;.</p>\r\n\r\n<p>C&rsquo;est seulement &agrave; ce moment l&agrave; que les postes clients peuvent &ecirc;tre rallum&eacute;s ou red&eacute;marr&eacute;s si possible avant toute utilisation de l&rsquo;interface.</p>\r\n\r\n<p><br />\r\nRemarque 1 : si par hasard vous observez lors d&rsquo;une sauvegarde un message ou quelque chose de particulier et d&rsquo;inattendu : SORTIR, NE RIEN FAIRE ET INFORMER PARIS</p>\r\n\r\n<p>Remarque 2 : &agrave; l&rsquo;issue de la sauvegarde, INFORMER PARIS des impressions &eacute;crans qui ont &eacute;t&eacute; r&eacute;alis&eacute;s. Si possible les nommer avec chronologie s&rsquo;ils sont nombreux voir les commenter dans Word.<br />\r\n(analyse1, analyse 2, r&eacute;paration 1, r&eacute;paration 2,&hellip;). Les messages d&rsquo;erreur peuvent justifier une maintenance plus tard. Une bonne pratique serait d&rsquo;ajouter au moment ou l&rsquo;interface red&eacute;marre la premi&egrave;re photo qui apparait en saisie, en correction et au contr&ocirc;le. Cela peut permettre de faire un cut-off.</p>\r\n\r\n<p>Remarque 3 : cette proc&eacute;dure de r&eacute;paration solutionne 95% des probl&egrave;mes. Si un probl&egrave;me persiste il sera n&eacute;cessaire de recharger la derni&egrave;re sauvegarde.</p>\r\n\r\n<p><br />\r\n⦁&nbsp;&nbsp; &nbsp;Recharge d&rsquo;une sauvegarde</p>\r\n\r\n<p>La date de la derni&egrave;re sauvegarde nous dit le temps de travail qui sera perdu&hellip;<br />\r\nSi l&rsquo;on en vient &agrave; recharger une sauvegarde, c&rsquo;est qu&rsquo;une table est irr&eacute;cup&eacute;rable. Les op&eacute;rations de maintenance ci-dessus sont inefficaces.&nbsp;<br />\r\nLorsqu&rsquo;on recharge une base de donn&eacute;es, on recharge toutes les tables &agrave; une m&ecirc;me date de toutes les bases. C&rsquo;est la raison pour laquelle une sauvegarde des diff&eacute;rentes bases doit se faire au m&ecirc;me moment pour toutes les bases durant les op&eacute;rations r&eacute;currentes de sauvegarde (sauf d&eacute;rogation).&nbsp;</p>\r\n\r\n<p>&nbsp;L&rsquo;op&eacute;ration va consister &agrave; supprimer les bases de donn&eacute;es totalement, &agrave; les recr&eacute;er puis &agrave; recharger la sauvegarde.</p>\r\n\r\n<p><br />\r\n1&deg;) Ouvrir Wampserver\\PhpMyAdmin<br />\r\n2&deg;) S&eacute;lectionner la base de donn&eacute;es (sans s&eacute;lectionner les tables en dessous)<br />\r\n3&deg;) S&eacute;lectionner l&rsquo;onglet &laquo; Supprimer &raquo; en haut &agrave; droite et confirmer<br />\r\nNormalement &agrave; ce moment l&agrave; on est tr&egrave;s &eacute;prouv&eacute; &hellip; mais il faut le faire&hellip;<br />\r\n4&deg;) Dans le menu d&rsquo;accueil, on recr&eacute;e toutes les bases en respectant scrupuleusement l&rsquo;othographe (minuscule, majuscule,&hellip;)<br />\r\n&nbsp;&nbsp; &nbsp;proarchives<br />\r\n&nbsp;&nbsp; &nbsp;ago<br />\r\n&nbsp;&nbsp; &nbsp;utilisateurs<br />\r\n&nbsp;&nbsp; &nbsp;chantier<br />\r\n&nbsp;&nbsp; &nbsp;chantier_rapport</p>\r\n\r\n<p>Le petit num&eacute;ro &agrave; droite du nom indique le nombre de table dans la base. Il ne faut pas le saisir !<br />\r\nQue le nom (exemple &agrave; l&rsquo;image)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dans Cr&eacute;er une base de donn&eacute;es &eacute;crire le nom exact<br />\r\nDans Interclassement, choisir &laquo; utf8_unicode_ci &raquo;<br />\r\nDans Interclassement pour la base Mysql choisir &nbsp;&laquo; utf8_unicode_ci &raquo; puis cr&eacute;er</p>\r\n\r\n<p>5&deg;) Une fois la base cr&eacute;&eacute;, aller dans &laquo;le menu onglet &laquo; Importer &raquo; et choisir le fichier de sauvegarde<br />\r\nEn .sql.gz correspondant au m&ecirc;me nom de la base puis Ex&eacute;cuter</p>\r\n\r\n<p>6&deg;) Refaire l&rsquo;op&eacute;ration pour toutes les bases de donn&eacute;es. Toutes les tables sont alors avec leur structure et les donn&eacute;es.</p>\r\n\r\n<p>Termin&eacute; !</p>\r\n\r\n<p>&nbsp;</p>', '2016-07-11 19:01:45', 1, 0, NULL),
(48, 55, 45, 'Operation via MySQL', '<p>QUESTIONS<br />\r\nModification du code client sur un chantier&nbsp;</p>\r\n\r\n<p>Proarchives</p>\r\n\r\n<p>Si la saisie a d&eacute;j&agrave; commenc&eacute;</p>\r\n\r\n<p>N&deg;&nbsp;&nbsp; &nbsp;BDD&nbsp;&nbsp; &nbsp;Table&nbsp;&nbsp; &nbsp;Champs<br />\r\n1&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Chantier&nbsp;&nbsp; &nbsp;Chantier_Dossier_travail<br />\r\n&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;Chantier_Sub_Dir<br />\r\n&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;Chantier_photo<br />\r\n&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;Chantier_Lien_Photo<br />\r\n2&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Chantier_rapport&nbsp;&nbsp; &nbsp;Nom_chantier<br />\r\n&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;url_chantier<br />\r\n&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;Fichier_rapport_chantier<br />\r\n3&nbsp;&nbsp; &nbsp;Proarchives&nbsp;&nbsp; &nbsp;Client_archiviste&nbsp;&nbsp; &nbsp;Client<br />\r\n&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;Photo&nbsp;&nbsp; &nbsp;Photo_Repertoire_Principal<br />\r\n&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;Photo_Sous_Repertoire<br />\r\n&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;Photo_Numero_Photo<br />\r\n&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;Photo_Line_Photo<br />\r\n&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;Traitement&nbsp;&nbsp; &nbsp;Traitement_Photo_Url<br />\r\n4&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>Si la saisie n&rsquo;a pas encore commenc&eacute;<br />\r\nSi la saisie n&rsquo;a pas encore, tranquillement je recommence l&rsquo;importation</p>\r\n\r\n<p>Chantier d&eacute;j&agrave; restitu&eacute;<br />\r\nLes modifications porteront sur les colonnes suivantes :<br />\r\nR&eacute;pertoire principal<br />\r\nSous r&eacute;pertoire<br />\r\nNom photo<br />\r\nLien photo<br />\r\nTous les 3 fichiers seront modifi&eacute;s</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>AGO<br />\r\nPr&eacute;paration des ardoises encours</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\nOp&eacute;ration dans la BDD via MySQL</p>\r\n\r\n<p>Chantier termin&eacute; et valid&eacute; &agrave; la saisie</p>\r\n\r\n<p>Cas1 : Table adresse oubli&eacute;e<br />\r\nDans la table Traitement (Gestion du Process) de PROARCHIVES / AGO, je remplace le Statut VALIDEE par SAISIE du coup, les photos repartent dans le cycle normal.<br />\r\nAttention : Pour Proarchives, il faut toujours se poser la question du compteur c&#39;est-&agrave;-dire quelle cons&eacute;quence sur l&rsquo;incr&eacute;mentation automatique du compteur ?<br />\r\nExplication : l&rsquo;incr&eacute;mentation se faisant au moment de la validation, toutes les photos d&eacute;j&agrave; valid&eacute;es vont recevoir un nouveau num&eacute;ro. Il faut toujours se demander si la r&eacute;ponse de l&rsquo;automate est adapt&eacute;e.&nbsp;<br />\r\nPour le client par exemple, il est important de conserver les num&eacute;ros qu&rsquo;il poss&egrave;de d&eacute;j&agrave; &nbsp;ou bien faut-il le pr&eacute;venir de tout supprimer !<br />\r\nOp&eacute;ration MySQL</p>\r\n\r\n<p>Lancer WAMP SERVER &hellip;Php My Admin&hellip;choisir Proarchives/Ago &hellip; Table Traitement<br />\r\nCliquez sur l&rsquo;Onglet SQL<br />\r\nLancez le code suivant :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>validez&nbsp;<br />\r\nRemarque<br />\r\nMySQL indique le nombre de lignes impact&eacute; par le code. Par cons&eacute;quent j&rsquo;anticipe et le pr&eacute;pare le nombre de ligne que je dois modifier. Par exemple, si je remets un chantier &agrave; la saisie, je sais que j&rsquo;ai 2 lignes (A et B) par photo. 2 X le nombre de photo = nombre de ligne impact&eacute;e.<br />\r\nAttention : Avant toute op&eacute;ration, il faut informer les &eacute;quipes de saisie et de contr&ocirc;le pour leur donner des explications<br />\r\nExemple : update &nbsp;&rsquo;traitement&rsquo;set &lsquo;Traitement_Type&rsquo;= &rsquo;SAISIE&rsquo; where &lsquo;Traitement_Photo_Url&rsquo; REGEXP &lsquo; PKB001_DRAGO_2012-12-10&rsquo; ;<br />\r\nNB : &nbsp;&nbsp; &nbsp;UPDATE = Remplace et sauvegarde<br />\r\n&nbsp;&nbsp; &nbsp;REGEXP = Contient<br />\r\n&nbsp;&nbsp; &nbsp;&lsquo;traitement&rsquo; attention pas d&rsquo;espace ni avant ni apr&egrave;s &nbsp;le nom de la table et les signes parce que pour chaque table &lsquo;traitement&rsquo; est entour&eacute; par des signes sp&eacute;ciaux.<br />\r\nExemple : &lsquo;PAL030_NEXITY_LAMY_RUEIL_2012-06-08&rsquo;<br />\r\nLe nom du chantier (des variables sont entour&eacute;s par des apostrophes), chaque ligne de commande se termine par un oint virgule (;) avant d&rsquo;aller &agrave; la ligne.</p>', '2016-07-11 19:47:00', 1, 0, NULL),
(48, 56, 46, 'Gestion des Utilisateurs', '<p><span style="color:#0000FF">Gestion des Utilisateurs</span></p>\r\n\r\n<p><br />\r\nMenu Environnement</p>\r\n\r\n<p>Dans ce menu accessible par l&rsquo;&eacute;cran d&rsquo;accueil, on g&egrave;re tous les utilisateurs de l&rsquo;applicatif (op&eacute;rateurs, contr&ocirc;leur, &hellip;)<br />\r\nA chaque utilisateur, on associe un r&ocirc;le (chiffre entre 0 et 7) qui lui permet d&rsquo;acc&eacute;der aux diff&eacute;rents &eacute;crans et fonctionnalit&eacute;s.</p>\r\n\r\n<p>R&ocirc;le<br />\r\n0&nbsp;&nbsp; &nbsp;inactif = absent<br />\r\n1&nbsp;&nbsp; &nbsp;saisie + contr&ocirc;le + environnement<br />\r\n2&nbsp;&nbsp; &nbsp;saisie + contr&ocirc;le<br />\r\n3&nbsp;&nbsp; &nbsp;contr&ocirc;les simples<br />\r\n4&nbsp;&nbsp; &nbsp;saisies simples<br />\r\n5&nbsp;&nbsp; &nbsp;saisie + contr&ocirc;le + super contr&ocirc;le + environnement<br />\r\n6&nbsp;&nbsp; &nbsp;saisie + contr&ocirc;le + super contr&ocirc;le + environnement + reconstruction de base<br />\r\n7&nbsp;&nbsp; &nbsp;correcteurs magiques</p>\r\n\r\n<p>Remarque : il doit toujours y avoir un utilisateur dont le r&ocirc;le est diff&eacute;rent de 0. Sinon le menu &laquo; Environnement &raquo; ne sera plus disponible pour personne !! Obligation alors d&rsquo;appeler l&rsquo;administrateur.</p>\r\n\r\n<p><br />\r\n<span style="color:#0000FF">SAISIE<br />\r\nContr&ocirc;le<br />\r\nUtilisation de Correcteur &nbsp;Magique</span><br />\r\nUn des principes de base de la saisie dans notre interface est que chaque op&eacute;rateur corrige sa propre saisie.<br />\r\nChaque saisie passe au contr&ocirc;le et repart en correction si erreurs.</p>\r\n\r\n<p>On a donc une saisie principale suivi (ou pas) de plusieurs corrections par le m&ecirc;me op&eacute;rateur &agrav\r\ne; la demande du contr&ocirc;leur.</p>\r\n\r\n<p>Tant que l&rsquo;op&eacute;rateur n&rsquo;a pas effectu&eacute; sa correction, la photo ne peut pas revenir au contr&ocirc;le.&nbsp;<br />\r\nA noter que le correcteur peut valider la correction (passer &agrave; la photo suivante) sans avoir effectu&eacute; de corrections (ca n&rsquo;est pas une obligation si par exemple l&rsquo;op&eacute;rateur estime qu&rsquo;il n&rsquo;a pas de r&eacute;ponses &agrave; la correction &agrave; faire). Si tel est le cas, cette photo non corrig&eacute;e peut &agrave; nouveau arriver au contr&ocirc;le d&egrave;s que l&rsquo;autre op&eacute;rateur a aussi effectu&eacute; ses corrections.</p>\r\n\r\n<p>Cette situation n&rsquo;est pas g&ecirc;nante tant que les op&eacute;rateurs (par leur login) ne sont pas absents. En effet si un op&eacute;rateur est absent (vacances, maladie, changement d&rsquo;&eacute;quipe,&hellip;) et que l&rsquo;une de ses photos est &agrave; corriger, la photo va rester bloqu&eacute; et ne revient pas chez le contr&ocirc;leur. Si bien qu&rsquo;en cas d&rsquo;absence d&rsquo;un des op&eacute;rateurs, la validation devient impossible puisque toutes les corrections de l&rsquo;op&eacute;rateur absent ne peuvent pas &ecirc;tre effectu&eacute;es.</p>\r\n\r\n<p>Le correcteur magique a pour fonction de permettre &agrave; n&rsquo;importe quel op&eacute;rateur (de saisie, ou de contr&ocirc;le) de se logger et de r&eacute;cup&eacute;rer toutes les photos &agrave; corriger des op&eacute;rateurs d&eacute;clar&eacute;s absents.</p>\r\n\r\n<p>Cela suppose donc que la gestion de l&rsquo;&eacute;quipe soit effectu&eacute;e en permanence, en temps r&eacute;el, avec identification des absents et des pr&eacute;sents selon les changements d&rsquo;&eacute;quipes.</p>\r\n\r\n<p>Les chantiers peuvent &ecirc;tre ainsi cl&ocirc;tur&eacute;s (totalit&eacute; des photos valid&eacute;es) m&ecirc;me si les op&eacute;rateurs ayant fait des saisies ne sont plus l&agrave; pour effectuer leur correction.</p>\r\n\r\n<p><span style="color:#0000FF">Utilisation de Super-Contr&ocirc;le</span></p>\r\n\r\n<p>Il permet de corriger la &nbsp;saisie &nbsp;A et B directement &nbsp;via l&rsquo;interface. Les &nbsp;photos &nbsp;peuvent &ecirc;tre plac&eacute;es en super contr&ocirc;le &nbsp;pour plusieurs raisons &nbsp;a savoir<br />\r\nAttente de validation d&rsquo;une consigne<br />\r\nAnomalie de saisie (boite et copro)<br />\r\nTrop grand nombres de caract&egrave;res &agrave; corriger<br />\r\nDans &nbsp;tous les cas le &nbsp;contr&ocirc;leur peut soit &nbsp;d&eacute;cider de traiter ces cas directement ou jugez &nbsp;de les renvoyer &nbsp;au contr&ocirc;le &nbsp;pour &nbsp;retraitement.<br />\r\nUne fois &nbsp;la &nbsp;photo &nbsp;corriger &nbsp;en super contr&ocirc;le , &nbsp;elle &nbsp;passe &nbsp;obligatoirement par le contr&ocirc;le avant &nbsp;d&rsquo;&ecirc;tre &nbsp;valider.<br />\r\n&nbsp;</p>', '2016-07-12 15:15:00', 1, 0, NULL),
(48, 57, 47, 'MySqldum', '<p>Mysqldump</p>\r\n\r\n<p>Proc&eacute;dure &lsquo;export puis d&rsquo;import. A utiliser lorsque les BDD sont lourdes (par exemple les bases archives)<br />\r\nAvec le DOS, ouvrir l&rsquo;invite de commande</p>\r\n\r\n<p>Se positionner avec CD dans le r&eacute;pertoire ou se trouve mysqldump en g&eacute;n&eacute;ral (en utilisant la commande CD &hellip;) pour obtenir<br />\r\n&nbsp;&nbsp; &nbsp;C:\\wamp\\bin\\mysql\\mysql5.5.8\\bin<br />\r\nExport<br />\r\nDans DOS, &eacute;crire&nbsp;<br />\r\nmysqldump -u root -p --opt Proarchives_archives &gt; proarchives_archives.sql<br />\r\nImport<br />\r\nIl doit se trouver dans C:\\wamp\\bin\\mysql\\mysql5.5.8\\bin<br />\r\nDans DOS, &eacute;crire&nbsp;<br />\r\nmysql -u root -p Proarchives_archives &lt; proarchives_archives.sql<br />\r\nOn peut y mettre la date dans le nom du fichier</p>', '2016-07-12 15:27:00', 1, 0, NULL),
(48, 58, 48, 'Mise à jour des interfaces sur le postes clients', '<p><span style="color:#0000FF">Mise &agrave; jour des interfaces sur les postes clients</span></p>\r\n\r\n<p><span style="color:#0000FF">*Pr&eacute;ambule</span><br />\r\nActuellement nous utilisons le r&eacute;pertoire commun Y:/Source pour ouvrir l&rsquo;interface de saisie.<br />\r\nL&rsquo;op&eacute;ratrice charge l&rsquo;interface de son poste client en cliquant sur le nom de l&rsquo;interface.<br />\r\nInconv&eacute;nient : l&rsquo;interface est ouverte en r&eacute;alit&eacute; sur le serveur autant de fois qu&rsquo;il y a de postes clients ce qui surcharge le serveur et peut occasionner des ralentissements voir des pertes de connexion.<br />\r\nAvantage : nous sommes certains que les op&eacute;ratrices ouvrent la m&ecirc;me version de l&rsquo;interface qui contient les r&egrave;gles de saisies propres &agrave; chaque client !&nbsp;<br />\r\n&nbsp;&nbsp;<br />\r\n<span style="color:#0000FF">*Sur le serveur : cr&eacute;ation d&rsquo;un r&eacute;pertoire commun</span><br />\r\nOn appelle un poste client, tous les postes qui sont connect&eacute;s au serveur.<br />\r\nSur Y:/Source qui se situe sur <u>le serveur</u>, nous allons cr&eacute;er un r&eacute;pertoire &laquo; Interface active &raquo;&nbsp;<br />\r\nDans ce dossier on trouvera :<br />\r\n*proarchives_v99d-open.exe<br />\r\n*caremploi_v99f10-open.exe<br />\r\n*Ago.exe<br />\r\n&nbsp;&nbsp; &nbsp;&hellip;.et autant de .exe qu&rsquo;il y a d&rsquo;interfaces de saisie<br />\r\n&nbsp;&nbsp; &nbsp;libmysqltcl.dll<br />\r\nlibmySQL.dll<br />\r\nxphoto.dll</p>\r\n\r\n<p>Les 3 derniers fichiers sont indispensables au fonctionnement des diff&eacute;rentes interfaces et ils sont communs &agrave; toutes les interfaces.</p>\r\n\r\n<p>Les consignes de mises &agrave; jour seront donn&eacute;es par Fred &agrave; Paris. Il faudra s&rsquo;assurer que la recopie du dossier soit faite sur tous les postes clients <u>sans exceptions</u>. Tant que la consigne de mise &agrave; jour n&rsquo;est pas donn&eacute;e, il n&rsquo;est pas n&eacute;cessaire de refaire de recopie.</p>\r\n\r\n<p><span style="color:#0000FF">*Installation sur les postes clients</span></p>\r\n\r\n<p>A partir de chaque poste client, je recopie l&rsquo;int&eacute;gralit&eacute; du r&eacute;pertoire &laquo; Interface active &raquo; qui se trouve dans Y:/Source directement sur le Bureau du poste client. Je ne recopie que ce r&eacute;pertoire et son contenu. Sur chaque poste client, je le positionne au m&ecirc;me endroit pour harmoniser les instalaltions.</p>\r\n\r\n<p>S&rsquo;il existe d&eacute;j&agrave;, je l&rsquo;&eacute;crase par le r&eacute;pertoire le plus r&eacute;cent que je suis en train de d&eacute;placer</p>\r\n\r\n<p>Pour des questions de commodit&eacute;, je cr&eacute;e un raccourci des .exe sur tous les postes clients dans la barre d&rsquo;outils Windows des interfaces que j&rsquo;utilise. Elles sont tr&egrave;s facilement accessibles notamment pour relancer l&rsquo;interface en cas de fermeture.</p>\r\n\r\n<p>Normalement les ouvertures, acc&egrave;s, affichages devraient &ecirc;tre beaucoup plus rapides pour tout le monde.</p>\r\n\r\n<p><span style="color:#0000FF">*Contr&ocirc;les</span></p>\r\n\r\n<p>Il faudra veiller &agrave; ce que tout le monde utilise ce r&eacute;pertoire situ&eacute; sur chacun des postes clients <u>et uniquement celui-l&agrave;</u> pour ouvrir les interfaces</p>\r\n\r\n<p><strong><span style="color:#000000">Interdiction d&rsquo;ouvrir l&rsquo;interface directement du serveur (Y:/Source ) comme avant.</span></strong></p>\r\n\r\n<p>Les contr&ocirc;leurs peuvent effectuer facilement une v&eacute;rification chaque matin en faisant &laquo; l&rsquo;appel &raquo; du num&eacute;ro de version qui s&rsquo;affiche en haut &agrave; gauche des interfaces<br />\r\n&nbsp;&nbsp; &nbsp;Exemples : &nbsp;&nbsp; &nbsp;12 02 2012 pro_v.79r2a pour l&rsquo;interface Proarchives<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;14 02 2012 ago_v.79r2b pour l&rsquo;interface Ago</p>\r\n\r\n<p>Tout le monde doit travailler sur le m&ecirc;me num&eacute;ro d&rsquo;interface.</p>\r\n\r\n<p><strong>Interdiction d&rsquo;avoir plusieurs r&eacute;pertoire &laquo; Interfaces actives &raquo; sur le chaque bureau du poste client.</strong></p>\r\n\r\n<p><br />\r\n<strong>Interdiction d&rsquo;avoir plusieurs interfaces identiques ouvertes sur le m&ecirc;me poste client en <u>m&ecirc;me temps</u> comme avant.</strong></p>\r\n\r\n<p>V&eacute;rifier que les temps d&rsquo;acc&egrave;s sont plus rapides sur tous les postes.</p>', '2016-07-12 15:38:07', 1, 0, NULL),
(48, 59, 49, 'Tableau de suivi', '<p><span style="color:#000080"><strong>TABLEAU DE SUIVI DES COMMANDES</strong></span></p>\r\n\r\n<p><span style="color:#0000FF">*Pr&eacute;ambule</span></p>\r\n\r\n<p>Ce tableau de suivi des commandes est une photographie toujours actualis&eacute;e (=en temps r&eacute;el) des chantiers qui sont ou termines ou en cours ou a venir et qui sont charg&eacute;s dans la base. Ce tableau doit &ecirc;tre identique &agrave; l&rsquo;&eacute;cran Avancement des travaux de l&rsquo;interface Web. La comparaison des 2 permet de se contr&ocirc;ler et d&rsquo;identifier des anomalies.&nbsp;<br />\r\nC&rsquo;est ce tableau qui est utilis&eacute; dans le cadre de la facturation des clients et donc &ecirc;tre conforme &agrave; la r&eacute;alit&eacute; et mentionner tous les incidents.</p>\r\n\r\n<p>Il doit &ecirc;tre actualis&eacute;e en temps r&eacute;el d&egrave;s que les photos sont d&eacute;compresses (=carnet de commandes &agrave; jour).</p>\r\n\r\n<p>Chaque envoi correspond &agrave; une commande que l&rsquo;on s&eacute;pare des autres commandes par une ligne blanche. Dans une commande on a en g&eacute;n&eacute;ral plusieurs chantiers d&rsquo;inventaire.</p>\r\n\r\n<p>Sur le serveur Y:\\Photos_AGO, on d&eacute;pose les nouveaux envois du client. Je dois donc avoir autant de commandes dans mon tableau que de r&eacute;pertoires d&rsquo;envoi.</p>\r\n\r\n<p><strong>Remarque 1 </strong>: On ne renomme jamais les r&eacute;pertoires ou les fichiers sauf &agrave; la demande du client. Cependant l&rsquo;interface ne fonctionne normalement que si la codification des chantiers est structur&eacute;e. Si le nom d&rsquo;un chantier (voir d&eacute;tail ci-dessous) n&rsquo;est pas conforme alors informer Paris</p>\r\n\r\n<p><strong>Remarque 2</strong> : Les noms des fichiers, des commandes, des chantiers &eacute;tant complexe et structur&eacute;s, on ne cherche jamais &agrave; les r&eacute;&eacute;crire.&nbsp;<br />\r\nOn utilise la petite manipulation suivante on s&eacute;lectionne le nom du fichier<br />\r\nPuis on fait renommer. Ensuite on fait copier et on fait &laquo; ECHAP ou ESC &raquo; (pour qu&rsquo;il ne modifie pas ce que l&rsquo;on a s&eacute;lectionn&eacute;) et on colle. Cette manipulation nous &eacute;vite de faire des erreurs sur les noms des fichiers et des commandes du client. Il ne peut pas y avoir de fautes puisqu&rsquo;on n&rsquo;&eacute;crit jamais et que l&rsquo;on colle.</p>\r\n\r\n<p><strong>Remarque 3</strong> : Dans le r&eacute;pertoire Y:\\Livraison_AGO on y d&eacute;place tous les chantiers termin&eacute;s du r&eacute;pertoire Y:\\Photos_AGO pour ne pas encombrer le r&eacute;pertoire actif. On peut attendre 1 mois apr&egrave;s l&rsquo;envoi au client pour faire le d&eacute;placement (=fichiers de restitution envoy&eacute;s au client et accept&eacute;s par le client).</p>\r\n\r\n<p><span style="color:#0000FF">*Description des colonnes du tableau</span></p>\r\n\r\n<p><strong><span style="color:#000000">N&deg;envoi </span>:</strong>&nbsp;&nbsp; &nbsp;c&rsquo;est le l&rsquo;information que l&rsquo;on r&eacute;cup&egrave;re par copier/coller du r&eacute;pertoire principal dans Photos_AGO. C&rsquo;est le num&eacute;ro de commande du client.</p>\r\n\r\n<p><strong>Chantiers :&nbsp;</strong>&nbsp; &nbsp;c&rsquo;est le nom du sous r&eacute;pertoire de n&deg; d&rsquo;envoi que l&rsquo;on r&eacute;cup&egrave;re par copier/coller&nbsp;<br />\r\nCe r&eacute;pertoire est compose du code client 6 caract&egrave;res du nom du client et suivi de la date de l&rsquo;inventaire r&eacute;alis&eacute; par l&rsquo;archiviste. Les 3 informations s&eacute;par&eacute;es par des _ et la date toujours au format AAAA-MM-JJ&nbsp;<br />\r\nSi le format de la date n&rsquo;est pas conforme informer imm&eacute;diatement Paris. Il doit contenir des tirets &laquo; - &raquo; et non des underscore &laquo; _ &raquo;. On a d&eacute;j&agrave; rencontr&eacute; des 2012_04-20. Cette codification va bloquer l&rsquo;interface.<br />\r\nEnvoyer un email type :<br />\r\n&laquo; Le format du nom du chantier &hellip;&hellip; de l&rsquo;envoi&hellip;&hellip; n&rsquo;est pas conforme. Il a &eacute;t&eacute; modifie par &hellip;&hellip;.. &raquo;</p>\r\n\r\n<p><strong>Stock de photos </strong>: lorsqu&rsquo;un envoi est d&eacute;pos&eacute; par le client, le client nous indique toujours le nombre total de photo dans l&rsquo;envoi. Il faut donc valider ce chiffre. Cette information est donn&eacute;e dans le rapport de chantier (l&rsquo;inventaire) ou dans le nom du chantier lui-m&ecirc;me (nom du r&eacute;pertoire) ou encore par clic droit propri&eacute;t&eacute;s dans Windows qui donne le nombre exact de fichier dans le sous-r&eacute;pertoire. Attention &agrave; ne pas comptabilis&eacute; des fichiers cach&eacute;s ou syst&egrave;mes propres aux envois photos (.db,&hellip;).&nbsp;<br />\r\nIl peut y a voir un &eacute;cart entre le rapport de chantier et le nombre de photo dans Windows. Cet &eacute;cart ressort en rouge dans l&rsquo;interface web : avancement des travaux. Il n&rsquo;est pas bloquant pour d&eacute;marrer la saisie mais devra avant restitution &ecirc;tre r&eacute;solu en accord avec le client. Le probl&egrave;me est peut-&ecirc;tre chez lui (oubli de photo, erreur sur le rapport de chantier,&hellip;) ou chez nous (probl&egrave;me de transfert,&hellip;).</p>\r\n\r\n<p><strong>Date de d&eacute;p&ocirc;t :</strong>&nbsp;&nbsp; &nbsp; c&rsquo;est la date dans Fizella &agrave; laquelle le chantier a &eacute;t&eacute; d&eacute;pos&eacute; sur le site FTP du client (= et mis &agrave; disposition de Proweb). Donc on doit avoir la m&ecirc;me date pour chaque chantier d&rsquo;un m&ecirc;me envoi.&nbsp;</p>\r\n\r\n<p><strong>Date de d&eacute;but travaux </strong>: Pour une raison ou pour une autre et en g&eacute;n&eacute;ral caus&eacute;e par le client (doublons dans la table adresse, erreur d&eacute;claration fichiers, transfert mal pass&eacute;, attentes de consignes,&hellip;.) les chantiers peuvent ne pas pouvoir commencer le jour de leur d&eacute;p&ocirc;t. La date de d&eacute;but travaux correspond &agrave; la date effective &agrave; laquelle le client nous aura transmis <u>tous les &eacute;l&eacute;ments</u> n&eacute;cessaires au d&eacute;marrage du chantier. On ne la renseigne que si elle diff&egrave;re de la date de d&eacute;p&ocirc;t. Cette date est renseign&eacute;e en &lsquo;&rsquo; ??? &rsquo;&rsquo; D&egrave;s que l&rsquo;on a connaissance d&rsquo;un chantier incomplet g&eacute;n&eacute;rant un retard pour le d&eacute;marrage (cons&eacute;quence sur la facturation &agrave; notre avantage).&nbsp;</p>\r\n\r\n<p><strong>Historique et Compteur fichier historique d&eacute;part :&nbsp;&nbsp; &nbsp;</strong><br />\r\nUtilis&eacute; pour le client Proarchives. Voir &laquo; Proc&eacute;dure Num&eacute;ro Compteur Proarchives &raquo; dans le dossier client.<br />\r\nPour les autres clients : toujours Sans historique</p>\r\n\r\n<p>Ce num&eacute;ro de compteur est indispensable pour r&eacute;aliser la phase d&rsquo;importation des photos car l&rsquo;interface nous informe du dernier num&eacute;ro connu et qui peut varier de celui de l&rsquo;historique du client. Il faut donc analyser et trancher.&nbsp;<br />\r\nLe num&eacute;ro de compteur est une donn&eacute;e tr&egrave;s sensible pour le client. Il est donc tr&egrave;s important de ne pas se tromper en voulant le renseigner dans l&rsquo;interface. Si le num&eacute;ro de compteur est mal renseign&eacute; tous les chantiers seront &agrave; RECONTROLER sans aucune autre alternative possible.&nbsp;</p>\r\n\r\n<p>La pr&eacute;sence de l&rsquo;historique pour Proarchives n&rsquo;est pas syst&eacute;matique.</p>\r\n\r\n<p><strong>Sans historique </strong>: il n&rsquo;y a pas d&rsquo;historique Excel associ&eacute; au chantier dans l&rsquo;envoi (= premier inventaire d&rsquo;un nouveau client de l&rsquo;archiviste)<br />\r\n2 cas de figure :<br />\r\n*L&rsquo;interface signale qu&rsquo;il existe un num&eacute;ro diff&eacute;rent de 0. On aurait du avoir un historique. <u>On demande au client de confirmer l&rsquo;absence d&rsquo;historique avant d&rsquo;effectuer l&rsquo;importation !</u> On reporte le N&deg; trouv&eacute; dans le module d&rsquo;importation de l&rsquo;interface dans le tableau suivi des commandes et l&rsquo;on mentionne la difficult&eacute; dans la colonne Observation.<br />\r\n*Notre interface est aussi &agrave; 0. On part donc de 0. On &eacute;crit &laquo; 0 &raquo; dans le suivi des chantiers.</p>\r\n\r\n<p><strong>Avec historique :</strong> on utilise une macro qui se trouve dans Dropbox/Service_Client/suivi des commandes et qui permet d&rsquo;identifier dans l&rsquo;historique Excel le plus grand num&eacute;ro du fichier.<br />\r\non ouvre le fichier et on lance la macro qui va chercher dans la colonne G = NUMERO DE DOSSIER (le plus grand nombre pr&eacute;sent dans la colonne).<br />\r\nOn reporte ce num&eacute;ro dans le tableau suivi des chantiers = Compteur fichier historique d&eacute;part.<br />\r\n4 cas de figure et 3 valeurs possibles (0, Interface, Nombre) :<br />\r\n* Le num&eacute;ro de compteur est identique entre l&rsquo;historique Excel et l&rsquo;interface. Pas de probl&egrave;me on r&eacute;alise l&rsquo;importation et on reporte le m&ecirc;me num&eacute;ro dans suivi des commandes.<br />\r\n*L&rsquo;historique du client pr&eacute;sente un num&eacute;ro plus grand que celui de l&rsquo;interface. Cela signifie que le client &agrave; int&eacute;grer des nouvelles lignes d&rsquo;archives depuis notre dernier inventaire dont nous n&rsquo;avons pas eu connaissances et il faut prendre le sien.<br />\r\n*L&rsquo;historique Excel a un num&eacute;ro de compteur plus petit que le notre dans l&rsquo;interface. Par ailleurs nous sommes en train de travailler sur un chantier en-cours qui n&rsquo;a pas encore &eacute;t&eacute; restitu&eacute; au client. Il est donc normal que l&rsquo;historique du client soit incomplet. C&rsquo;est donc notre num&eacute;ro d&rsquo;interface qui est correct. On &eacute;crit &laquo; Interface &raquo; dans le suivi des chantiers.<br />\r\n*L&rsquo;historique Excel a un num&eacute;ro de compteur plus petit que le notre dans l&rsquo;interface et aucun chantier en cours pour ce m&ecirc;me client de l&rsquo;archiviste. <u>On demande au client de confirmer son num&eacute;ro de compteur avant d&rsquo;effectuer l&rsquo;importation !</u></p>\r\n\r\n<p><strong>Table adresse</strong> : Utilis&eacute; pour le client Proarchives. Voir &laquo; Proc&eacute;dure Table adresse Proarchives &raquo; dans le dossier client.&nbsp;<br />\r\nDans 80% des cas il y en une. Cette table adresse n&rsquo;est utilis&eacute;e que si le service est Copropri&eacute;t&eacute;.&nbsp;</p>\r\n\r\n<p>Sans table adresse : le service n&rsquo;est pas Copropri&eacute;t&eacute;<br />\r\nAvec Table adresse : le client a bien communiqu&eacute; sa table</p>\r\n\r\n<p><u>Observations</u> : J&rsquo;&eacute;cris toutes les difficult&eacute;s rencontr&eacute;es pour chaque chantier qui peuvent expliquer un retard (doublon, demande client,&hellip;)</p>\r\n\r\n<p><u>Etat </u>: J&rsquo;&eacute;cris si le chantier est charg&eacute; dans l&rsquo;interface ou non. En cours, Charg&eacute;, &hellip;.<br />\r\n&nbsp;<br />\r\n<strong>Date de restitution</strong> : La connaissance de cette date, permet de conna&icirc;tre le calendrier de livraison pr&eacute;visionnel (15 jours pour Proarchives, 48h pour Cr&eacute;dit Agricole,&hellip;). Demander &agrave; Paris les d&eacute;lais pour chaque client ou chantier.</p>\r\n\r\n<p><strong>Remarque 1</strong> : dans l&rsquo;interface web un chantier est termin&eacute; lorsqu&rsquo;il est vert. Un certain nombre de contr&ocirc;le qualit&eacute; devant &ecirc;tre fait avant l&rsquo;envoi au client, il est indispensable qu&rsquo;un chantier passe au vert 24h avant la date de restitution pr&eacute;vue.</p>\r\n\r\n<p><strong>Remarque 2</strong> : nous avons un d&eacute;lai de 15 jours pour r&eacute;aliser la restitution d&rsquo;un chantier &agrave; partir de la remise compl&egrave;te des &eacute;l&eacute;ments.&nbsp;<br />\r\nPrenons l&rsquo;exemple d&rsquo;un chantier Proarchives qui a &eacute;t&eacute; livr&eacute; sans table d&rsquo;adresse le 15/03/2012, normalement la date de restitution de ce chantier = date de d&eacute;p&ocirc;t (transfert des photos) + 15 jours (week end y compris) = 30/03/2012<br />\r\nImaginons que le client d&eacute;pose la table adresse le 20/03/2012, alors la date de d&eacute;but travaux est renseign&eacute;e mais la date de restitution n&rsquo;est pas modifi&eacute;e. Elle reste la m&ecirc;me !<br />\r\nPar cons&eacute;quent le temps de traitement r&eacute;el est r&eacute;duit d&rsquo;autant de 5 jours. Le client sera factur&eacute; d&rsquo;une p&eacute;nalit&eacute; de 5 x 2%.&nbsp;</p>\r\n\r\n<p><strong>Remarque 3</strong> : le client a la possibilit&eacute; avec son interface client de passer un chantier en statut urgent et d&rsquo;indiquer une nouvelle date de restitution. Dans ce cas le d&eacute;lai de traitement sera Date urgent (nouvelle date de restitution) - Date de d&eacute;p&ocirc;t (ou date de d&eacute;but travaux). Dans le cas d&rsquo;une urgence ne pas oublier de modifier le tableau de suivi des commandes et de reporter la nouvelle date de restitution.</p>', '2016-07-12 15:39:00', 1, 0, NULL),
