(4, 5, 1, 1, 'Nouvelle Méthode d’auto coaching', 'Au lieu d’aller lire les messages  de meilleures animatrices (qualité de messages et cohérence) toute animatrice en auto coaching devra :\r\n1-	lire  les  rapports de coaching qui ont été envoyés dans leur  boite mail (professionnelles ou personnelles) et noter les  erreurs  qui lui on été   remontées !\r\n\r\n2-	lire  ses messages  propres afin de voir  si depuis les  coachings  elle a pu corriger les fautes remontées  ou  pas.\r\n\r\n\r\n3-	enfin  avoir le  courage de dire ce qu’elle  a   remarqué afin de permettre aux responsables de savoir comment  l’orienter dans le but de s’améliorer', '2015-08-10 16:50:00', 1, 0, NULL),
