(48, 21, 12, 13, 'MODERATION', '<p>PROCEDURE MODERATION ACCES GRATUIT &nbsp;(Profils de femmes) &nbsp; La &nbsp;Mod&eacute;ration des profils de femmes &nbsp;se fait sur &nbsp;la &nbsp;mod&eacute;ration sous la rubrique &laquo; Valider Acc&egrave;s gratuits &raquo; et &nbsp;consiste &nbsp;&agrave; &nbsp; analyser chaque profil &nbsp;en respectant certaines r&egrave;gles pr&eacute;&eacute;tablies. &nbsp;Elle s&rsquo;applique &nbsp;sur les deux &nbsp;bases : base Coquine et la &nbsp;base Grand Public. &nbsp; I-&nbsp;&nbsp; &nbsp;ACCES GRATUIT BASE COQUINE &nbsp; REGLES GENERALES: &nbsp; 1-&nbsp;&nbsp; &nbsp;Supprimer tous les profils dont IP n&rsquo;est pas la France. Normalement ces profils se trouvent au d&eacute;but et &agrave; la fin de la liste des inscrits. Valider avec pr&eacute;caution les profils Belgique (s&rsquo;il n&rsquo;est pas suspect et si le lieu de r&eacute;sidence indiqu&eacute; dans le profil est en Belgique). &nbsp;2-&nbsp;&nbsp; &nbsp;Valider avec pr&eacute;caution les profils de femmes noires. Ne pas donner l&rsquo;acc&egrave;s si les photos ne repr&eacute;sentent que des parties du corps ou si elles proposent dans la description une rencontre chaude. &nbsp; &nbsp; &nbsp;3-&nbsp;&nbsp; &nbsp;Supprimer les profils avec les photos de tr&egrave;s jolies femmes et les profils dont la description est du type &laquo;cherche mon &acirc;me s&oelig;ur&raquo; (r&egrave;gle pour la base adulte). &nbsp;4-&nbsp;&nbsp; &nbsp;Mot de passe suspect: si le profil a un mot de passe suspect qui est marqu&eacute; par rouge et qui est assez compliqu&eacute; (du type &laquo;ninho326987&raquo;) il faut supprimer ce profil. Si le mot de passe est simple (du type &laquo;azerty&raquo; ou &laquo;123456&raquo;) il faut analyser ce profil en entier &ndash;pseudo, photos, adresse mail &ndash;et le supprimer s&rsquo;il est suspect. &nbsp;5-&nbsp;&nbsp; &nbsp;Supprimer des profils dont le pseudo est du type: coeuratristee--tendresse14180--femmelibre1980 &nbsp;6-&nbsp;&nbsp; &nbsp;Supprimer les profils o&ugrave; le pseudo = adresse mail (surtout si c&rsquo;est un nom/pr&eacute;nom, une femme r&eacute;elle ne donne jamais son nom et pr&eacute;nom) &nbsp; &nbsp; 7-&nbsp;&nbsp; &nbsp; Supprimer les profils des hommes (m&ecirc;me si le pseudo est f&eacute;minin et l&lsquo;adresse mail appartient &agrave; un homme) &nbsp;8-&nbsp;&nbsp; &nbsp;Supprimer les profils contenant des coordonn&eacute;es (skype, tel, adresse mail, facebook, etc.) ainsi que les profils contant des mots &laquo;escorte&raquo;, &laquo;v&eacute;nale&raquo; etc. &nbsp;9-&nbsp;&nbsp; &nbsp;Quelques soient le pseudo, la description, l&rsquo;adresse mail et les photos NE DONNER JAMAIS l&rsquo;acc&egrave;s aux profils dont le mot de passe se termine par les chiffres 10, 12,123 et 225 &nbsp;10-&nbsp;&nbsp; &nbsp;Supprimer les profils des mineurs. Assez souvent leur mot de passe les d&eacute;masque &ndash;p.ex. le mot de passe 03052002 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp;Exemples de profils &agrave; supprimer : &nbsp;Supprimer &nbsp;tous les profils avec &nbsp;la geoIP autre que la &nbsp;France, ne valider que la France et la Belgique (seulement si la ville indiqu&eacute; est vraiment en Belgique, ne pas donc valider p.ex. Paris/Belgique) &nbsp; &nbsp; &nbsp;Supprimer les profils suivants : &nbsp;&bull;&nbsp;&nbsp; &nbsp;Le pseudo contient plusieurs lettres x, le mot &laquo; love &raquo; (surtout s&rsquo;il y a une photo d&rsquo;une jolie femme) &nbsp;Exemple : xxxbellaxxx, lolahot, love4real &nbsp; &nbsp; &bull;&nbsp;&nbsp; &nbsp;Les profils dont le mot de passe ne contient &nbsp;que des &nbsp;consonnes qui se &nbsp;r&eacute;p&egrave;tent &nbsp; &nbsp; &nbsp; &bull;&nbsp;&nbsp; &nbsp;Les profils avec le mot de passe suspect (marqu&eacute; &nbsp;par la couleur rouge) &nbsp; &nbsp; &nbsp;&bull;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;Si &nbsp;le pseudo et l&rsquo;adresse mail sont les m&ecirc;mes &nbsp;(lettre &agrave; &nbsp;lettre) &nbsp; &nbsp; &nbsp;&bull;&nbsp;&nbsp; &nbsp;Si la description contient &nbsp;l&rsquo;adresse mail, le num&eacute;ro de t&eacute;l&eacute;phone, les &nbsp;mots &laquo; &nbsp;escorte &raquo;, &laquo; &nbsp;venale &raquo;, etc. &nbsp; &nbsp; &nbsp;&bull;&nbsp;&nbsp; &nbsp;Si le mot de passe se termine &nbsp; sur les chiffres &laquo; 10 &raquo;, &laquo; 12 &raquo;, &laquo; 123 &raquo;, &nbsp;&laquo; 225 &raquo; &nbsp; &nbsp; &nbsp;&bull;&nbsp;&nbsp; &nbsp;Profils &nbsp;des mineurs (le mot de passe contient &nbsp;la date de naissance, ou &nbsp;le pseudo du type &laquo; anna14ans &raquo;, etc.) &nbsp; &nbsp; &nbsp;&bull;&nbsp;&nbsp; &nbsp;Les profils qui contiennent les mots &laquo; fleur &raquo;, &laquo; nuit &raquo;, &laquo; toujours &raquo;, &laquo; douce &raquo;, &laquo; ravissante &raquo; (pseudo/MDP/mail) &nbsp; &nbsp; &nbsp; &nbsp; &bull;&nbsp;&nbsp; &nbsp;S&rsquo;il y a plusieurs profils identiques de suite laisser un seul profil, supprimer tous les autres SEULEMENT si la ville et la date de naissance sont les m&ecirc;mes ! &nbsp; &nbsp; &nbsp;&bull;&nbsp;&nbsp; &nbsp;Les profils avec l&rsquo;adresse mail qui contient le nom de famille &laquo; Dupont &raquo;, &laquo; rousseau &raquo;, &laquo; Dubois &raquo; &nbsp; &nbsp; &nbsp;&bull;&nbsp;&nbsp; &nbsp;Les profils dont l&rsquo;adresse mail ou le pseudo/photo sont masculins. &nbsp; &nbsp; &nbsp;&bull;&nbsp;&nbsp; &nbsp;Les profils qui &nbsp;cherchent du s&eacute;rieux, un homme de sa vie, etc &nbsp; &nbsp; &nbsp;&bull;&nbsp;&nbsp; &nbsp;Avec des photos vol&eacute;es / photos de racoleuses connues / photos choquantes Utiliser Google Image pour la recherche par photo &nbsp; &nbsp; &nbsp;Ou faire une recherche sur des sites sp&eacute;cialis&eacute;s d&eacute;masquant les fakes p.ex. : &nbsp;&nbsp;&nbsp; &nbsp;http://arnaquesbrouteursafrique.eklablog.com/photos-femmes-de-couleurs-et-metisses-c17379191 &nbsp;&nbsp; &nbsp;http://www.arnacoeurs.com/pages/Les_albums_des_appats_feminins_22-8471421.html &nbsp;&nbsp; &nbsp;http://www.arnacoeurs.com/pages/Les_albums_des_appats_feminins-8959819.html &nbsp;&nbsp; &nbsp;http://arnaqueusebernadette.centerblog.net/ &nbsp;&nbsp; &nbsp;http://arnaqueusesdunet.centerblog.net/ &nbsp;&nbsp; &nbsp;http://arnaqueuses-du-net.skyrock.com/ &nbsp; &bull;&nbsp;&nbsp; &nbsp;Analyser tout le profil en int&eacute;gralit&eacute; (pseudo, mdp, photo, l&rsquo;adresse mail) et supprimer tous les &nbsp;profils suspects. Voici plusieurs exemples de profils &agrave; supprimer (la cause est marqu&eacute;e par la couleur rouge). &nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;II-&nbsp;&nbsp; &nbsp;ACCES &nbsp;GRATUIT BASE GRAND PUBLIC &nbsp;La r&egrave;gle &nbsp;est un peu &nbsp; diff&eacute;rente de celle &nbsp;de la &nbsp;base coquine. Elle s&rsquo;applique comme suit : &nbsp;SUPPRIMER : &nbsp;1-&nbsp;&nbsp; &nbsp;Tous les profils dont IP n&rsquo;est pas la France. Normalement ces profils se trouvent au d&eacute;but et &agrave; la fin de la liste des inscrits. Valider avec pr&eacute;caution les profils Belgique (s&rsquo;il n&rsquo;est pas suspect et si le lieu de r&eacute;sidence indiqu&eacute; dans le profil est en Belgique). &nbsp;2-&nbsp;&nbsp; &nbsp;Les profils avec mot de passe en rouge. Surtout : sansan, bonjour2014 (2015,2016), maman123 &nbsp;3-&nbsp;&nbsp; &nbsp;Les profils avec informations personnelles indiqu&eacute;es &nbsp;dans la description (skype, mail, tel, adresse web, etc.) &nbsp;4-&nbsp;&nbsp; &nbsp;Les profils dont les informations personnelles (skype, facebook, etc,) sont envoy&eacute;es des le premier message (visible dans la colonne &laquo; Messages &raquo;) &nbsp;5-&nbsp;&nbsp; &nbsp;Les profils avec des &nbsp;photos vol&eacute;es / photos de racoleuses connues &nbsp;6-&nbsp;&nbsp; &nbsp;Adresse mail bidon ou jetable &ndash; les adresses utilis&eacute;es les plus souvent sont : &nbsp;@live.fr &nbsp;@uu1.pl ou @uu1.fr &nbsp;@dayrep.com &nbsp;@jourrapide.com &nbsp;@netcourrier.com &nbsp;@einrot.com &nbsp;@fleckens.hu &nbsp;@cuvox.de &nbsp;@teleworm.us &nbsp;@armyspy.com &nbsp;@rhyta.com &nbsp;@gustr.com &nbsp;@clipmail.eu &nbsp;7-&nbsp;&nbsp; &nbsp;Le pseudo est du type : &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-&nbsp;&nbsp; &nbsp;femmeseule &nbsp;-&nbsp;&nbsp; &nbsp;coeurapprendre &nbsp;-&nbsp;&nbsp; &nbsp;coeurlibre &nbsp;-&nbsp;&nbsp; &nbsp;coeurtendre &nbsp;-&nbsp;&nbsp; &nbsp;nellasympa &nbsp;-&nbsp;&nbsp; &nbsp;antonella &nbsp;-&nbsp;&nbsp; &nbsp;nellacelib &nbsp;-&nbsp;&nbsp; &nbsp;bellacelib &nbsp;-&nbsp;&nbsp; &nbsp;coeurdouce &nbsp;-&nbsp;&nbsp; &nbsp;soleilrose &nbsp;-&nbsp;&nbsp; &nbsp;rachlova &nbsp;-&nbsp;&nbsp; &nbsp;sandrine &nbsp;-&nbsp;&nbsp; &nbsp;coeurdamour &nbsp;-&nbsp;&nbsp; &nbsp;labelle -&nbsp;&nbsp; &nbsp;cupidon &nbsp;-&nbsp;&nbsp; &nbsp;tristeseul &nbsp;-&nbsp;&nbsp; &nbsp;cupid &nbsp;&nbsp;&nbsp; &nbsp;Tous ce qui contient : c&oelig;ur, triste, douce, seule&hellip; &nbsp;8-&nbsp;&nbsp; &nbsp;Tout ce qui parait suspect ; surtout &nbsp;sur Miaoo &nbsp;Concernant les &nbsp;photos, malheureusement 90% &nbsp;des &nbsp;photos ne sont pas index&eacute;es Google Image. On peut utiliser les forums et les blongs &nbsp;pour une recherche des &nbsp; photos. &nbsp; Attention aux photos suivantes : &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; Voici un exemple de profils &nbsp;&agrave; supprimer (la cause est marqu&eacute;e par la couleur rouge) &nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>', '2016-05-12 11:29:00', 0, 0, NULL),
(48, 21, 12, 14, 'MODERATION', '<p>PROCEDURE MODERATION ACCES GRATUIT &nbsp;(Profils de femmes) &nbsp;</p>\r\n\r\n<p>La &nbsp;Mod&eacute;ration des profils de femmes &nbsp;se fait sur &nbsp;la &nbsp;mod&eacute;ration sous la rubrique &laquo; Valider Acc&egrave;s gratuits &raquo; et &nbsp;consiste &nbsp;&agrave; &nbsp; analyser chaque profil &nbsp;en respectant certaines r&egrave;gles pr&eacute;&eacute;tablies. &nbsp;Elle s&rsquo;applique &nbsp;sur les deux &nbsp;bases : base Coquine et la &nbsp;base Grand Public. &nbsp;</p>\r\n\r\n<p>I-&nbsp;&nbsp; &nbsp;ACCES GRATUIT BASE COQUINE &nbsp; REGLES GENERALES: &nbsp;</p>\r\n\r\n<p>1-&nbsp;&nbsp; &nbsp;Supprimer tous les profils dont IP n&rsquo;est pas la France. Normalement ces profils se trouvent au d&eacute;but et &agrave; la fin de la liste des inscrits. Valider avec pr&eacute;caution les profils Belgique (s&rsquo;il n&rsquo;est pas suspect et si le lieu de r&eacute;sidence indiqu&eacute; dans le profil est en Belgique). &nbsp;</p>\r\n\r\n<p>2-&nbsp;&nbsp; &nbsp;Valider avec pr&eacute;caution les profils de femmes noires. Ne pas donner l&rsquo;acc&egrave;s si les photos ne repr&eacute;sentent que des parties du corps ou si elles proposent dans la description une rencontre chaude. &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;3-&nbsp;&nbsp; &nbsp;Supprimer les profils avec les photos de tr&egrave;s jolies femmes et les profils dont la description est du type &laquo;cherche mon &acirc;me s&oelig;ur&raquo; (r&egrave;gle pour la base adulte). &nbsp;</p>\r\n\r\n<p>4-&nbsp;&nbsp; &nbsp;Mot de passe suspect: si le profil a un mot de passe suspect qui est marqu&eacute; par rouge et qui est assez compliqu&eacute; (du type <span style="color:#FF0000">&laquo;ninho326987&raquo;</span>) il faut supprimer ce profil. Si le mot de passe est simple (du type &laquo;azerty&raquo; ou &laquo;123456&raquo;) il faut analyser ce profil en entier &ndash;pseudo, photos, adresse mail &ndash;et le supprimer s&rsquo;il est suspect. &nbsp;</p>\r\n\r\n<p>5-&nb