p>&bull;&nbsp;&nbsp; &nbsp;Les profils avec le mot de passe suspect (marqu&eacute; &nbsp;par la couleur rouge) &nbsp; &nbsp; &nbsp;&bull;</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;Si &nbsp;le pseudo et l&rsquo;adresse mail sont les m&ecirc;mes &nbsp;(lettre &agrave; &nbsp;lettre) &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Si la description contient &nbsp;l&rsquo;adresse mail, le num&eacute;ro de t&eacute;l&eacute;phone, les &nbsp;mots &laquo; &nbsp;escorte &raquo;, &laquo; &nbsp;venale &raquo;, etc. &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Si le mot de passe se termine &nbsp; sur les chiffres &laquo; 10 &raquo;, &laquo; 12 &raquo;, &laquo; 123 &raquo;, &nbsp;&laquo; 225 &raquo; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Profils &nbsp;des mineurs (le mot de passe contient &nbsp;la date de naissance, ou &nbsp;le pseudo du type &laquo; anna14ans &raquo;, etc.) &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Les profils qui contiennent les mots &laquo; fleur &raquo;, &laquo; nuit &raquo;, &laquo; toujours &raquo;, &laquo; douce &raquo;, &laquo; ravissante &raquo; (pseudo/MDP/mail) &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;S&rsquo;il y a plusieurs profils identiques de suite laisser un seul profil, supprimer tous les autres SEULEMENT si la ville et la date de naissance sont les m&ecirc;mes ! &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;&bull;&nbsp;&nbsp; &nbsp;Les profils avec l&rsquo;adresse mail qui contient le nom de famille &laquo; Dupont &raquo;, &laquo; rousseau &raquo;, &laquo; Dubois &raquo; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Les profils dont l&rsquo;adresse mail ou le pseudo/photo sont masculins. &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;&bull;&nbsp;&nbsp; &nbsp;Les profils qui &nbsp;cherchent du s&eacute;rieux, un homme de sa vie, etc &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Avec des photos vol&eacute;es / photos de racoleuses connues / 