(48, 26, 16, 16, 'Base de Donnée', '<p style="text-align: justify;">Maintenance des bases de donn&eacute;es &nbsp;A.&nbsp;&nbsp; &nbsp;Pr&eacute;ambule J&rsquo;ai 2 fichiers Excel dans &nbsp;dropbox\\activit&eacute; qui s&rsquo;appelle : Base ago live et Base proarchive live. (Dans la base Ago j&rsquo;ai Cr&eacute;dit Agricole). &nbsp;Ces &nbsp;deux tableaux me permettent de connaitre l&rsquo;avancement des chantiers (proarchives ou CA) Ils sont construit sur le m&ecirc;me principe Dans un onglet l&rsquo;importation de toute la base (colonne N jusqu&#39;&agrave; la derni&egrave;re colonne) les premiers colonnes permettent d&rsquo;analyser l&rsquo;importation pour faire un tableau crois&eacute; dynamique (qui est donc une synth&egrave;se des informations contenus dans la base).Dans l&rsquo;onglet ou se trouve le TCD je peux voir l&rsquo;avancement &nbsp;des chantiers(en cliquant dans actualiser tout) puis dans le TCD refaire actualiser avec le clic droit A droite du TCD je renseigne la colonne entr&eacute;e stock par les valeurs que j&rsquo;ai saisies dans le tableau de suivi des commandes. &nbsp; Les colonnes stock a saisir et stock a valider sont calculer si le chiffre est n&eacute;gatif cela signifie qu&rsquo;il y a plus de saisie de photos &nbsp; dans la base qu&rsquo;il a de photos dans le chantier : &nbsp;il faudra donc supprimer les enregistrements dans la base si le chiffre est positif c&rsquo;est qu&rsquo;il reste des photos a saisir &nbsp;s&rsquo;il est nul c&rsquo;est que le chantier est termin&eacute; Quand une photo est dans la colonne informer paris c&rsquo;est quelle a un mauvais statut et qu&rsquo;il faut intervenir dans la base pour corriger l&rsquo;anomalie. &nbsp; &nbsp; On a autre TCD qui permet de comprendre le d&eacute;tail de l&rsquo;anomalie par photo. Il faut s&eacute;lectionner le num&eacute;ro d&rsquo;envoi et ensuite s&eacute;lectionner le chantier sur le quel on souhaite comprendre les anomalies Pour d&eacute;bloquer il faut ouvrir Access &nbsp;Menu d&eacute;marrer Application Access je retrouve les &nbsp;deux bases ago et proarchives (pr&eacute;c&eacute;der d&rsquo;un Z) trois tables sont tr&egrave;s importantes pour d&eacute;bloquer On a la table traitement :&nbsp;&nbsp; &nbsp;pour chaque saisie de la photo j&rsquo;ai son statut et le nom de la personne qui a fait la saisie (c&rsquo;est le champ utilisateur pseudo) Table photo :&nbsp;&nbsp; &nbsp;pour chaque saisie de la photo j&rsquo;ai toutes les boites saisies avec leur d&eacute;tail et le nom de la personne qui a fait la saisie Et table chantier :&nbsp;&nbsp; &nbsp;pour chaque photo (une ligne par photo) j&rsquo;ai les 2 noms des operateurs qui ont fait la saisie Pour d&eacute;bloquer une photo il faut que j&rsquo;aille modifier son statut et donc que j&rsquo;aille dans la table traitement. Une fois que je connais le nom du fichier de la photo je eux utiliser &nbsp; le filtre et coller le nom de la photo dans &laquo; contient &raquo; et les photos s&rsquo;affichent. &nbsp; Il existe &agrave; ce jour plusieurs type de blocage &nbsp;1&deg;) Blocage d&rsquo;un &eacute;cran de correction (y compris avec correcteur magique) &nbsp;Aller dans Access attach&eacute; &agrave; la base (&agrave; l&rsquo;interface) du blocage (Proarchives, Ago,&hellip;) qui se trouve dans Z:\\Administration\\Connexion Base ODBC\\ Ouvrir Afficher/Ouvrir la table traitement (enlever le filtre) Faire un filtre dans la colonne &laquo; Traitement Type &raquo; contient &laquo; correction &raquo; &nbsp;On affiche ainsi tous les saisis de photos en attente de correction V&eacute;rifier que la photo bloquante (et d&rsquo;autres !!!) ne contiennent pas de double {{ Normalement il ne doit y en avoir qu&rsquo;une seule mais il arrive que l&rsquo;interface en g&eacute;n&egrave;re une deuxi&egrave;me &nbsp; Nous utilisons 2 bases de donn&eacute;es distinctes pour faire la saisie. L&rsquo;une exclusivement consacr&eacute;e &agrave; Proarchives et l&rsquo;autre &agrave; Ago pour tous les autres clients (Cr&eacute;dit Agricole,&hellip;) &nbsp;On peut acc&eacute;der &agrave; ces 2 bases en utilisant le logiciel Access qui avec ses connecteurs ODBC, permet de se connecter &agrave; la fois pour en faire la lecture mais aussi des modifications en direct. Attention, ces modifications de la base sont d&eacute;finitives et les retours en arri&egrave;res tr&egrave;s limit&eacute;s. Les interventions dans les bases n&eacute;cessitent une formation et une pratique r&eacute;guli&egrave;re. &nbsp;La compr&eacute;hension des bases et des &nbsp;tables est fondamentale pour effectuer des op&eacute;rations de maintenance. &nbsp;BASE DE DONNEES&nbsp;&nbsp; &nbsp;TABLES&nbsp;&nbsp; &nbsp;FONCTIONS &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; Utilisateurs&nbsp;&nbsp; &nbsp;utilisateur&nbsp;&nbsp; &nbsp;Gestion des loggins, r&ocirc;le, choix du chantier de travail,&hellip; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; Chantier&nbsp;&nbsp; &nbsp;table_chantier&nbsp;&nbsp; &nbsp;Importation des photos des chantiers et des pseudos de la saisie A ou B &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; Chantier_rapport&nbsp;&nbsp; &nbsp;chantier_rapport_Table&nbsp;&nbsp; &nbsp;Suivi des envois, stocks &agrave; saisir, &agrave; valider, compteur &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; Proarchives&nbsp;&nbsp; &nbsp;Traitement&nbsp;&nbsp; &nbsp;Gestion des statuts par pseudo (saisie, correction, contr&ocirc;le, attente_admin,&hellip;) &nbsp;&nbsp; &nbsp;Photo&nbsp;&nbsp; &nbsp;Ecritures des informations sur les boites &nbsp;&nbsp; &nbsp;gestion&nbsp;&nbsp; &nbsp;R&egrave;gle de comptage des caract&egrave;res &nbsp;&nbsp; &nbsp;client_archiviste&nbsp;&nbsp; &nbsp;compteur des historiques &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; Ago&nbsp;&nbsp; &nbsp;Traitement&nbsp;&nbsp; &nbsp;Gestion des statuts par pseudo (saisie, correction, contr&ocirc;le, attente_admin,&hellip;) &nbsp;&nbsp; &nbsp;Photo&nbsp;&nbsp; &nbsp;Ecritures des informations sur les boites &nbsp;&nbsp; &nbsp;gestion&nbsp;&nbsp; &nbsp;R&egrave;gle de comptage des caract&egrave;res &nbsp;&nbsp; &nbsp;client_archiviste&nbsp;&nbsp; &nbsp;compteur des historiques &nbsp;B.&nbsp;&nbsp; &nbsp;Organisation des bases de donn&eacute;es 1.&nbsp;&nbsp; &nbsp;Table traitement &nbsp; 1 ligne pour chaque saisie A ou B. Donc la double saisie g&eacute;n&egrave;re 2 lignes par photo. Chaque saisie re&ccedil;oit un statut &nbsp; 2.&nbsp;&nbsp; &nbsp;Table photo &nbsp;C&rsquo;est dans cette table que l&rsquo;on trouve toutes les saisies des boites. Il y a autant de lignes qu&rsquo;il y a de boites sur 1 photo. Dans le cas de la multi copropri&eacute;t&eacute;, on a autant de lignes que de multi copropri&eacute;t&eacute;s. &nbsp;C.&nbsp;&nbsp; &nbsp;Type d&rsquo;anomalies pr&eacute;sentes dans la base 1.&nbsp;&nbsp; &nbsp;Une photo a &eacute;t&eacute; saisie plus de 2 fois (anomalies interface) &nbsp;On les rep&egrave;re dans Excel avec le tableau crois&eacute; Envoi-Chantier-Photos &nbsp;Une saisie A est compt&eacute;e 0,5 et la saisie B &eacute;galement 0,5. Si le total d&eacute;passe 1 cela signifie que la photo a &eacute;t&eacute; saisie plus de 2 fois, ce qui d&rsquo;une part est inutile et d&rsquo;autre part fausse le stock &agrave; saisir. Objectif : supprimer l&rsquo;enregistrement correspondant &agrave; des saisies C, D,&hellip; &nbsp;Allez dans la base Access Proarchives Allez sur la table traitement + double clicc pour actualiser les donn&eacute;es &nbsp;L&rsquo;int&eacute;gralit&eacute; des enregistrements apparait &nbsp; Enlever les filtres (clic sur ic&ocirc;ne en bas &agrave; gauche de &laquo; rechercher &raquo;) Dans Excel, copier l&rsquo;URL de la photo &gt;1 Dans Access, dans Traitement_Photo_URL, s&eacute;lectionner &laquo; contient &raquo; et coller la valeur de l&rsquo;URL. (On s&rsquo;&eacute;pargne ainsi en permanence d&rsquo;&eacute;crire un nom d&rsquo;URL avec le risque d&rsquo;erreur que cela suppose) Apparaisse toutes les lignes concernant la saisie de cette photo en URL &nbsp;Selon le statut de l&rsquo;URL, on supprime l&rsquo;enregistrement inadapt&eacute;. En g&eacute;n&eacute;ral celui qui poss&egrave;de l&rsquo;ID le plus grand. A noter que cette triple saisie, n&rsquo;emp&ecirc;che pas la validation d&rsquo;une photo. Exemple : &nbsp;Traitement_ID&nbsp;&nbsp; &nbsp;Traitement_Photo_Url&nbsp;&nbsp; &nbsp;Traitement_Utilisateur_Pseudo&nbsp;&nbsp; &nbsp;Traitement_Type&nbsp;&nbsp; &nbsp;Traitement_Control 25971&nbsp;&nbsp; &nbsp;Y:/Photos_AGO/ENVOI 2011.025/PFB001_FURGE_MULHAUSER_2011-10-28/PFB001_2011-10-28/PFB001_2011-10-28_AD_25.JPG&nbsp;&nbsp; &nbsp;B_Johnson&nbsp;&nbsp; &nbsp;SAISIE B_Johnson&nbsp;&nbsp; &nbsp; &nbsp;25960&nbsp;&nbsp; &nbsp;Y:/Photos_AGO/ENVOI 2011.025/PFB001_FURGE_MULHAUSER_2011-10-28/PFB001_2011-10-28/PFB001_2011-10-28_AD_25.JPG&nbsp;&nbsp; &nbsp;B_Johnson&nbsp;&nbsp; &nbsp;VALIDEE B_Johnson Wed Nov 30 12:41:49 2011&nbsp;&nbsp; &nbsp;R_Tchala 25962&nbsp;&nbsp; &nbsp;Y:/Photos_AGO/ENVOI 2011.025/PFB001_FURGE_MULHAUSER_2011-10-28/PFB001_2011-10-28/PFB001_2011-10-28_AD_25.JPG&nbsp;&nbsp; &nbsp;OperateurA&nbsp;&nbsp; &nbsp;VALIDEE OperateurA Wed Nov 30 12:41:49 2011&nbsp;&nbsp; &nbsp;R_Tchala &nbsp; La photo URL Y:/Photos_AGO/ENVOI 2011.025/PFB001_FURGE_MULHAUSER_2011-10-28/PFB001_2011-10-28/PFB001_2011-10-28_AD_25.JPG a &eacute;t&eacute; saisie &nbsp;fois. 2 fois par Johnson et 1 fois par Op&eacute;rateur A. C&rsquo;est Tachala qui a fait le dernier contr&ocirc;le de la photo. Les 2 derni&egrave;res lignes de traitement sont valid&eacute;es, ce qui signifie que la premi&egrave;re avec la statut SAISIE peut &ecirc;tre supprim&eacute;e. &nbsp;2.&nbsp;&nbsp; &nbsp;Probl&egrave;mes de statuts dans la table traitement &nbsp;Certains enregistrements de la table traitement suite &agrave; des op&eacute;rations de sorties de la base&hellip; restent dans un statut inappropri&eacute;e. &nbsp;a)&nbsp;&nbsp; &nbsp;Statut Control Lorsque plus personne n&rsquo;est sur la base, dans la table traitement Filtre afficher tout Filtre contient dans &laquo; Traitement_Type &raquo; contient CONTROL Ce statut d&eacute;signe une photo en cours de contr&ocirc;le mais si personne n&rsquo;est sur la base, il faut le modifier en &laquo; SAISIE &raquo; &nbsp;a)&nbsp;&nbsp; &nbsp;Statut Super_Control &nbsp;Ce statut d&eacute;signe une photo en cours de correction, mais si personne n&rsquo;est sur la base, il n&rsquo;a pas de raison d&rsquo;&ecirc;tre. &nbsp;Filtre afficher tout Filtre contient dans &laquo; Traitement_Type &raquo; contient Super_Control &nbsp;&nbsp; &nbsp;Ce statut d&eacute;signe une photo en cours de contr&ocirc;le mais si personne n&rsquo;est sur la base, il faut le modifier en &laquo; ATTENTE_ADMIN &raquo; &nbsp;b)&nbsp;&nbsp; &nbsp; Statut tmp &nbsp;Ce statut d&eacute;signe une photo en cours de correction, mais si personne n&rsquo;est sur la base, il n&rsquo;a pas de raison d&rsquo;&ecirc;tre. Filtre afficher tout Filtre contient dans &laquo; Traitement_Type &raquo; contient tmp &nbsp;&nbsp; &nbsp;Ce statut d&eacute;signe une photo en cours de contr&ocirc;le mais si personne n&rsquo;est sur la base, il faut le modifier en &laquo; SAISIE &raquo; c)&nbsp;&nbsp; &nbsp;Statut TEMP &nbsp;C&rsquo;est le statut d&rsquo;une photo en cours de saisie. Le nettoyage s&rsquo;effectue en 2 temps. Il faut regarder dans la table_chantier les noms des pseudos. Et comparer avec la table traitement. Si je supprime une ligne dans traitement en statut TEMP il faut que j&rsquo;enl&egrave;ve le pseudo dans la table_chantier correspondant de mani&egrave;re &agrave; refaire la double saisie.</p>', '2016-05-17 18:41:40', 0, 0, NULL);
