;le, attente_admin,&hellip;) &nbsp;&nbsp; &nbsp;Photo&nbsp;&nbsp; &nbsp;Ecritures des informations sur les boites &nbsp;&nbsp; &nbsp;gestion&nbsp;&nbsp; &nbsp;R&egrave;gle de comptage des caract&egrave;res &nbsp;&nbsp; &nbsp;client_archiviste&nbsp;&nbsp; &nbsp;compteur des historiques &nbsp;B.&nbsp;&nbsp; &nbsp;Organisation des bases de donn&eacute;es 1.&nbsp;&nbsp; &nbsp;Table traitement &nbsp; 1 ligne pour chaque saisie A ou B. Donc la double saisie g&eacute;n&egrave;re 2 lignes par photo. Chaque saisie re&ccedil;oit un statut &nbsp; 2.&nbsp;&nbsp; &nbsp;Table photo &nbsp;C&rsquo;est dans cette table que l&rsquo;on trouve toutes les saisies des boites. Il y a autant de lignes qu&rsquo;il y a de boites sur 1 photo. Dans le cas de la multi copropri&eacute;t&eacute;, on a autant de lignes que de multi copropri&eacute;t&eacute;s. &nbsp;C.&nbsp;&nbsp; &nbsp;Type d&rsquo;anomalies pr&eacute;sentes dans la base 1.&nbsp;&nbsp; &nbsp;Une photo a &eacute;t&eacute; saisie plus de 2 fois (anomalies interface) &nbsp;On les rep&egrave;re dans Excel avec le tableau crois&eacute; Envoi-Chantier-Photos &nbsp;Une saisie A est compt&eacute;e 0,5 et la saisie B &eacute;galement 0,5. Si le total d&eacute;passe 1 cela signifie que la photo a &eacute;t&eacute; saisie plus de 2 fois, ce qui d&rsquo;une part est inutile et d&rsquo;autre part fausse le stock &agrave; saisir. Objectif : supprimer l&rsquo;enregistrement correspondant &agrave; des saisies C, D,&hellip; &nbsp;Allez dans la base Access Proarchives Allez sur la table traitement + double clicc pour actualiser les donn&eacute;es &nbsp;L&rsquo;int&eacute;gralit&eacute; des enregistrements apparait &nbsp; Enlever les filtres (clic sur ic&ocirc;ne en bas &agrave; gauche de &laquo; rechercher &raquo;) Dans Excel, copier l&rsquo;URL de la photo &gt;1 Dans Access, dans Traitement_Photo_URL, s&eacute;lectionner &laquo; contient &raquo; et coller la valeur de l&rsquo;URL. (On s&rsquo;&eacute;pargne ainsi en permanence d&rsquo;&eacute;crire un nom d&rsquo;URL avec le risque d&rsquo;erreur que cela suppose) Apparaisse toutes les lignes concernant la saisie de cette photo en URL &nbsp;Selon le statut de l&rsquo;URL, on supprime l&rsquo;enregistrement inadapt&eacute;. En g&eacute;n&eacute;ral celui qui poss&egrave;de l&rsquo;ID le plus grand. A noter que cette triple saisie, n&rsquo;emp&ecirc;che pas la validation d&rsquo;une photo. Exemple : &nbsp;Traitement_ID&nbsp;&nbsp; &nbsp;Traitement_Photo_Url&nbsp;&nbsp; &nbsp;Traitement_Utilisateur_Pseudo&nbsp;&nbsp; &nbsp;Traitement_Type&nbsp;&nbsp; &nbsp;Traitement_Control 25971&nbsp;&nbsp; &nbsp;Y:/Photos_AGO/ENVOI 2011.025/PFB001_FURGE_MULHAUSER_2011-10-28/PFB001_2011-10-28/PFB001_2011-10-28_AD_25.JPG&nbsp;&nbsp; &nbsp;B_Johnson&nbsp;&nbsp; &nbsp;SAISIE B_Johnson&nbsp;&nbsp; &nbsp; &nbsp;25960&nbsp;&nbsp; &nbsp;Y:/Photos_AGO/ENVOI 2011.025/PFB001_FURGE_MULHAUSER_2011-10-28/PFB001_2011-10-28/PFB001_2011-10-28_AD_25.JPG&nbsp;&nbsp; &nbsp;B_Johnson&nbsp;&nbsp; &nbsp;VALIDEE B_Johnson Wed Nov 30 12:41:49 2011&nbsp;&nbsp; &nbsp;R_Tchala 25962&nbsp;&nbsp; &nbsp;Y:/Photos_AGO/ENVOI 2011.025/PFB001_FURGE_MULHAUSER_2011-10-28/PFB001_2011-10-28/PFB001_2011-10-28_AD_25.JPG&nbsp;&nbsp; &nbsp;OperateurA&nbsp;&nbsp; &nbsp;VALIDEE OperateurA Wed Nov 30 12:41:49 2011&nbsp;&nbsp; &nbsp;R_Tchala &nbsp; La photo URL Y:/Photos_AGO/ENVOI 2011.025/PFB001_FURGE_MULHAUSER_2011-10-28/PFB001_2011-10-28/PFB001_2011-10-28_AD_25.JPG a &eacute;t&eacute; saisie &nbsp;fois. 2 fois par Johnson et 1 fois par Op&eacute;rateur A. C&rsquo;est Tachala qui a fait le dernier contr&ocirc;le de la photo. Les 2 derni&egrave;res lignes de traitement sont valid&eacute;es, ce qui signifie que la premi&egrave;re avec la statut SAISIE peut &ecirc;tre supprim&eacute;e. &nbsp;2.&nbsp;&nbsp; &nbsp;Probl&egrave;mes de statuts dans la table traitement &nbsp;Certains enregistrements de la table traitement suite &agrave; des op&eacute;rations de sorties de la base&hellip; restent dans un statut inappropri&eacute;e. &nbsp;a)&nbsp;&nbsp; &nbsp;Statut Control Lorsque plus personne n&rsquo;est sur la base, dans la table traitement Filtre afficher tout Filtre contient dans &laquo; Traitement_Type &raquo; contient CONTROL Ce statut d&eacute;signe une photo en cours de contr&ocirc;le mais si personne n&rsquo;est sur la base, il faut le modifier en &laquo; SAISIE &raquo; &nbsp;a)&nbsp;&nbsp; &nbsp;Statut Super_Control &nbsp;Ce statut d&eacute;signe une photo en cours de correction, mais si personne n&rsquo;est sur la base, il n&rsquo;a pas de raison d&rsquo;&ecirc;tre. &nbsp;Filtre afficher tout Filtre contient dans &laquo; Traitement_Type &raquo; contient Super_Control &nbsp;&nbsp; &nbsp;Ce statut d&eacute;signe une photo en cours de contr&ocirc;le mais si personne n&rsquo;est sur la base, il faut le modifier en &laquo; ATTENTE_ADMIN &raquo; &nbsp;b)&nbsp;&nbsp; &nbsp; Statut tmp &nbsp;Ce statut d&eacute;signe une photo en cours de correction, mais si personne n&rsquo;est sur la base, il n&rsquo;a pas de raison d&rsquo;&ecirc;tre. Filtre afficher tout Filtre contient dans &laquo; Traitement_Type &raquo; contient tmp &nbsp;&nbsp; &nbsp;Ce statut d&eacute;signe une photo en cours de contr&ocirc;le mais si personne n&rsquo;est sur la base, il faut le modifier en &laquo; SAISIE &raquo; c)&nbsp;&nbsp; &nbsp;Statut TEMP &nbsp;C&rsquo;est le statut d&rsquo;une photo en cours de saisie. Le nettoyage s&rsquo;effectue en 2 temps. Il faut regarder dans la table_chantier les noms des pseudos. Et comparer avec la table traitement. Si je supprime une ligne dans traitement en statut TEMP il faut que j&rsquo;enl&egrave;ve le pseudo dans la table_chantier correspondant de mani&egrave;re &agrave; refaire la double saisie.</p>', '2016-05-17 18:50:27', 1, 0, NULL),
(48, 27, 17, 18, 'Restitution', '<p>RESTITUTION A.&nbsp;&nbsp; &nbsp;Restitution AGO Interface Restit_AGo_Sans_repertoire pour les chantiers sans r&eacute;pertoires et Ago standard avec &nbsp;r&eacute;pertoires. 1.&nbsp;&nbsp; &nbsp;L&rsquo;interface de connexion pour faire la restitution des chantiers sans r&eacute;pertoires est Restit_AGo_Sans_repertoire qui se trouve dans Y :\\Source. -&nbsp;&nbsp; &nbsp;Y:\\Source &hellip;Restit_AGo_Sans_repertoire -&nbsp;&nbsp; &nbsp;Cochez la case Modification Config Login BDD -&nbsp;&nbsp; &nbsp;Changez 192.168.3.55 en localhost -&nbsp;&nbsp; &nbsp;Connection -&nbsp;&nbsp; &nbsp;Entrez votre Login puis le Mot de Passe -&nbsp;&nbsp; &nbsp;Choisir le chantier &agrave; restituer -&nbsp;&nbsp; &nbsp;Cliquez sur Reconstruire fichier Client (le bouton en rouge au dessus de Pseudo_utilisateur). &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Apr&egrave;s quelques minutes, une boite de dialogue affiche le nombre de photos saisies. Le v&eacute;rifier dans l&rsquo;Interface Web dans la colonne Fichier &agrave; traiter. Trois (3) fichiers sont automatiquement cr&eacute;es dans le dossier de l&rsquo;Envoi en question sous 3 formats ;txt, csv, csv2007. &nbsp;2.&nbsp;&nbsp; &nbsp;On retourne dans : -&nbsp;&nbsp; &nbsp; Y:\\...Photos_Ago\\AZERTWIN 2012.0XX -&nbsp;&nbsp; &nbsp;Choisir un mod&egrave;le de fichier Excel pr&eacute;sent dans DropBox\\Service_Client\\Ago (avec macro) -&nbsp;&nbsp; &nbsp;Importer le fichier.csv qui porte le nom du chantier &nbsp;3.&nbsp;&nbsp; &nbsp;Ouvrir le Mod&egrave;le&hellip;Donn&eacute;es&hellip;externes choisir &laquo; &agrave; partir du texte &raquo;&hellip;choisir le fichier portant le nom du chantier.csv&hellip; puis importer. -&nbsp;&nbsp; &nbsp;V&eacute;rifier dans la 1&egrave;re fen&ecirc;tre Windows &nbsp;Choisir D&eacute;limiter puis dans la liste d&eacute;roulante &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; de Origine du fichier choisir Windows (ANSI) faire suivant. &nbsp;-&nbsp;&nbsp; &nbsp;Une nouvelle fen&ecirc;tre s&rsquo;ouvre, choisir comme s&eacute;parateur Point Virgule (;) et Tabulation&hellip;suivant&hellip; -&nbsp;&nbsp; &nbsp;S&eacute;lectionner toutes les colonnes et mettre au format Texte puis cliquer sur Terminer. -&nbsp;&nbsp; &nbsp;Vous avez votre fichier Excel &agrave; pr&eacute;parer suivant les consignes du client. Remarque a.&nbsp;&nbsp; &nbsp;On peut remplacer le chemin d&rsquo;acc&egrave;s \\AZERTWIN 2012.0XX par vide dans la colonne Lien_photo pour pouvoir visionner les photos (&agrave; faire avant de lancer la macro) &nbsp;4.&nbsp;&nbsp; &nbsp;Supprimez les lignes 3 et 4 (en-t&ecirc;te du fichier extrait) 5.&nbsp;&nbsp; &nbsp;Onglet Affichage&hellip;.Appliquez la Macro puis fermer. Le fichier est enregistr&eacute; dans Y:\\Photos_Ago 6.&nbsp;&nbsp; &nbsp;D&eacute;placer le fichier nom_chantier de Y:\\Photos_Ago &nbsp;vers son dossier chantier. Testez le lien pour voir si la photo s&rsquo;affiche = V&eacute;rifiez les liens dynamiques 7.&nbsp;&nbsp; &nbsp;V&eacute;rifiez si le nom de l&rsquo;onglet, du fichier, du code_client correspondent au nom du chanter 8.&nbsp;&nbsp; &nbsp;V&eacute;rifiez si toutes les colonnes correspondent aux consignes du client. Cette v&eacute;rification se fait en rapport avec le fichier PDF du client &nbsp;9.&nbsp;&nbsp; &nbsp;Copiez les formules de la ligne 1 &agrave; partir de la colonne BC &agrave; fin 10.&nbsp;&nbsp; &nbsp;Collez les formules en dessous de la ligne 2 de la colonne BC &agrave; fin puis jusqu&rsquo;&agrave; de la ligne vers le bas. Selon les consignes, effectuez les calculs date destruction &hellip;. Compl&eacute;tez les formules recopi&eacute;es (exemple CPCAM ou client 1635 avec quanti&egrave;me + 33 mois). &nbsp;11.&nbsp;&nbsp; &nbsp;Si je modifie des valeurs &nbsp;de champ je v&eacute;rifie que mes calculs (BC &agrave; B ?) sont corrects 12.&nbsp;&nbsp; &nbsp;Pour plus de v&eacute;rification, faire un tableau crois&eacute; dans une autre feuille de calcul pour voir si les services+ r&eacute;f&eacute;rence conteneur correspondent bien s&ucirc;r avec le fichier PDF du client 13.&nbsp;&nbsp; &nbsp;S&eacute;lectionnez les colonnes BC &agrave; BH, copiez puis collage sp&eacute;ciale en choisissant valeurs dans la petite fen&ecirc;tre de collage sp&eacute;ciale&hellip;enregistrez 14.&nbsp;&nbsp; &nbsp;Supprimer les colonnes A &amp; B puis E &agrave; BB. On garde le nom de la photo et le lien dynamique. 15.&nbsp;&nbsp; &nbsp;Copiez puis coller dans Bloc-notes&hellip;remplacer les espaces par point-virgule (;)&hellip;les tirets (-) par point-virgule (;) 16.&nbsp;&nbsp; &nbsp;Enregistrez&hellip;copier et le fichier.txt et le fichier.xls dans DropBox\\Entrep&ocirc;t_Ago-Proarchives\\Ago. 17.&nbsp;&nbsp; &nbsp;Je restitue AGO au fil de l&rsquo;eau. Lorsque tous les chantiers d&rsquo;un envoi sont termin&eacute;s, je cr&eacute;e dans dropbox un fichier compress&eacute; de l&rsquo;envoi .zip. J&rsquo;ajoute dans .zip le pdf du client (et les copies des ardoises tordues&hellip;). &nbsp;18.&nbsp;&nbsp; &nbsp;Quelques v&eacute;rifications a.&nbsp;&nbsp; &nbsp;Colonne -&nbsp;&nbsp; &nbsp;Les colonnes 1 &agrave; 6 ne sont jamais vides et les formules colonnes BZ rectifie si anomalie -&nbsp;&nbsp; &nbsp;Comparaison PDF client qui est obligatoire m&ecirc;me si l&rsquo;analyse des ardoises dans Ms Access est correcte. -&nbsp;&nbsp; &nbsp;2 fois le m&ecirc;me contr&ocirc;le : dans Ms Access au moment de la pr&eacute;paration des ardoises par le service qualit&eacute; et une derni&egrave;re fois juste avant la restitution. -&nbsp;&nbsp; &nbsp;Toujours v&eacute;rifier les liens dynamiques pour le fichier dans le chantier -&nbsp;&nbsp; &nbsp;Attention &agrave; ce que le .txt cr&eacute;&eacute; &agrave; partir d&rsquo;Excel soit homog&egrave;ne &agrave; Excel -&nbsp;&nbsp; &nbsp;Si Borne Sup&eacute;rieure = vide ou z&eacute;ro (0), remplacez par XXX -&nbsp;&nbsp; &nbsp;Le Quanti&egrave;me se situe toujours entre 1 &agrave; 365 &nbsp; 19.&nbsp;&nbsp; &nbsp;Quelques v&eacute;rifications Apr&egrave;s avoir termin&eacute; le fichier &agrave; restituer, pr&eacute;parez deux (2) colonnes &nbsp;-&nbsp;&nbsp; &nbsp;Quanti&egrave;me &agrave; renseigner &nbsp;et Ann&eacute;e Sup &nbsp;&agrave; renseigner. &nbsp;-&nbsp;&nbsp; &nbsp;Faire un filtre sur &laquo; destruction &raquo; en ressortant les XXX Le client renseignera les 2 colonnes ou l&rsquo;un ou l&rsquo;autre &nbsp;B.&nbsp;&nbsp; &nbsp;Restitution PROARCHIVES Les &eacute;tats de restitution doivent &ecirc;tre envoy&eacute;s par lot (la totalit&eacute; de l&rsquo;envoi) Elle se fait &agrave; partir de l&rsquo;Interface Web. 1.&nbsp;&nbsp; &nbsp;Cliquez sur l&rsquo;outil en forme de Papier&amp;crayon &nbsp;-&nbsp;&nbsp; &nbsp;Dans la nouvelle page, choisir Proarchives dans la liste d&eacute;roulante de INTERFACE -&nbsp;&nbsp; &nbsp;Choisir le chantier &agrave; restituer dans la liste d&eacute;roulante de CHANTIER -&nbsp;&nbsp; &nbsp;Proarchives dans la liste d&eacute;roulante de PARAMETRE -&nbsp;&nbsp; &nbsp;Choisir Tout pour avoir les fichiers .txt et xls dans la liste d&eacute;roulante de G&eacute;n&eacute;rer -&nbsp;&nbsp; &nbsp;Valider &nbsp; &nbsp; &nbsp; 2.&nbsp;&nbsp; &nbsp;Une nouvelle page s&rsquo;affiche vous affichant les fichiers &nbsp; &nbsp; &nbsp; -&nbsp;&nbsp; &nbsp;Quelques instants apr&egrave;s, vous aurez les fichiers restitu&eacute;s, le nombre (&agrave; valider avec l&rsquo;interface web) de photo, le nombre de lignes pour les photos valid&eacute;es et le temps de restitution -&nbsp;&nbsp; &nbsp;A droite se trouvent la restitution correspondant aux fichiers .txt et xlsx et restitution XXX qui correspond aux fichiers XXX.xlsx &nbsp;3.&nbsp;&nbsp; &nbsp;Pour retrouver ces fichiers, -&nbsp;&nbsp; &nbsp;C:\\ Wamp&hellip;www&hellip;azertwin&hellip;restitution&hellip;Proarchives -&nbsp;&nbsp; &nbsp;Les 3 fichiers restitu&eacute;s &agrave; savoir .txt, .xlsx et xxx.xlsx dans le dossier d&rsquo;Envoi &nbsp;4.&nbsp;&nbsp; &nbsp;V&eacute;rifications -&nbsp;&nbsp; &nbsp;V&eacute;rifiez si le nombre de photos affich&eacute; dans le point 2 correspond &agrave; celui du tableau de Suivi des commandes &nbsp;-&nbsp;&nbsp; &nbsp;Pour visionner les photos, d&eacute;placez le fichier dans le dossier Y:\\Photos_Ago\\ENVOI 2012.0XX (m&ecirc;me chose que pour Ago pour v&eacute;rifier que le lien dynamique fonctionne) -&nbsp;&nbsp; &nbsp; 5.&nbsp;&nbsp; &nbsp;Traitement du fichier de restitution -&nbsp;&nbsp; &nbsp;Des 3 fichiers, ouvrir le .xlsx qui se pr&eacute;sente sous cette forme &nbsp; &nbsp; Un fichier propre mais &agrave; v&eacute;rifier. &nbsp;-&nbsp;&nbsp; &nbsp;V&eacute;rifiez les doublons dans la colonne N&deg; Dossier -&nbsp;&nbsp; &nbsp;Si probl&egrave;me de macro doublons, copier l&rsquo;int&eacute;gralit&eacute; dans un nouveau fichier Excel (collage sp&eacute;cial valeur) et lancer la macro de doublon. -&nbsp;&nbsp; &nbsp;V&eacute;rifiez N&deg; DE CONTENEUR : si 0, remplacer par XXX &nbsp; a.&nbsp;&nbsp; &nbsp;Colonnes -&nbsp;&nbsp; &nbsp;V&eacute;rifiez s&rsquo;il y a des cellules vides dans les colonnes de 6,7,8,9,10,11,12,20 et corriger o&nbsp;&nbsp; &nbsp;Pour date inf = 01/01/1910 o&nbsp;&nbsp; &nbsp;Pour date sup = XXX alors forcement destruction= XXX -&nbsp;&nbsp; &nbsp;Colonne 9 vide &agrave; 99,9 % Il s&rsquo;agit de mettre un cabinet si mentionn&eacute; sur le conteneur -&nbsp;&nbsp; &nbsp;Colonne 10 : 75% &nbsp;vide. = petit num&eacute;ro sur la boite -&nbsp;&nbsp; &nbsp;Colonne 15 : si copropri&eacute;t&eacute; = 50% sinon toujours vide -&nbsp;&nbsp; &nbsp; Colonne 16 : si colonne 15 renseign&eacute; 95% renseign&eacute; -&nbsp;&nbsp; &nbsp;Colonne 17 : vide si description compl&egrave;te = date ou d&eacute;tail. 90 % renseign&eacute; -&nbsp;&nbsp; &nbsp;Colonne 18,19 : seulement copro ou g&eacute;rance (20%). Si 18 alors 19 ET si 19 alors 18 (renseign&eacute;s ensemble) ATTENTION !!! SI EXCEL EST MODIFIE ALORS LES 2 AUTRES FICHIERS DOIVENT ETRE MODIFIES (Doivent &ecirc;tre homog&egrave;ne) C&rsquo;est la raison pour laquelle il est plus facile parfois de faire corriger. Donc de remettre la photo &agrave; la saisie. Particuli&egrave;rement vrai pour les doublons N&deg; dossier -&nbsp;&nbsp; &nbsp;V&eacute;rifier que le client (PAF013, &hellip;.) ne revient pas plusieurs fois dans un envoi. Sinon consolider les fichiers. -&nbsp;&nbsp; &nbsp;Lancer la macro doublon -&nbsp;&nbsp; &nbsp;Trouver les N&deg; url photo en doublon -&nbsp;&nbsp; &nbsp;Avec les ODBC attaquez la base traitement de Proarchives -&nbsp;&nbsp; &nbsp;Filtre sur l&rsquo;URL et modifier VALIDEE par SAISIE pour les 2 lignes. Comme elle &agrave; un ID ancien, elle arrive au contr&ocirc;le tout de suite et sera valid&eacute;e rapidement. -&nbsp;&nbsp; &nbsp;Relancer la restitution et tout refaire depuis la 1ere &eacute;tape. Remarque : le fait de repasser au contr&ocirc;le permet d&rsquo;affecter &agrave; la validation un nouveau N&deg; de compteur. Cela signifie que la table client de l&rsquo;archiviste a &eacute;t&eacute; modifi&eacute;e. Si bien que si par hasard je fais la modification manuellement dans le fichier Excel, je dois penser &agrave; mettre la table client de l&rsquo;archiviste &agrave; jour. Le plus grand num&eacute;ro historique de mon fichier est celui de la table client de l&rsquo;archiviste de PROARCHIVES. &nbsp;NB : J&rsquo;envoi au client l&rsquo;ensemble des fichiers de l&rsquo;envoi en .zip. Lorsque tous les chantiers sont finis. &nbsp;C.&nbsp;&nbsp; &nbsp;La multicopropri&eacute;t&eacute; &nbsp;VALABLE QUE POUR LE SERVICE COPROPRIETE &nbsp;Si j&rsquo;ai un S dans N&deg; dossier alors 1 boite = 1 UA = 1 ligne Si j&rsquo;ai un M dans N&deg; dossier alors &nbsp;1 boite = plusieurs UA = plusieurs lignes &nbsp;Si j&rsquo;ai plusieurs &nbsp;M pour 1 m&ecirc;me boite alors Pour chacune des lignes j&rsquo;ai la m&ecirc;me description compl&egrave;te, m&ecirc;me intitul&eacute;, m&ecirc;me N&deg; archive. &nbsp; &nbsp; &nbsp; &nbsp;D.&nbsp;&nbsp; &nbsp;Restitution CARREFOURS_EMPLOI &nbsp;On utilise la restitution Proarchives qui donne 3 fichiers. &nbsp;M&ecirc;me proc&eacute;d&eacute; que Proarchives &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>', '2016-05-17 19:15:00', 1, 0, NULL),
(48, 28, 18, 19, 'Procédure de Sauvegarde', NULL, '2016-05-17 19:49:00', 1, 0, NULL),
(48, 28, 18, 20, 'Procédure de sauvegarde de la base de données Mysql', '<p>A.&nbsp;&nbsp; &nbsp;Pr&eacute;ambule</p>\r\n\r\n<p>Cette sauvegarde doit se faire :&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;Quotidiennement (en attente d&rsquo;une proc&eacute;dure automatis&eacute;e)</p>\r\n\r\n<p>Alors que les utilisateurs ne sont plus logg&eacute;s sur l&rsquo;interface (pause d&eacute;jeun&eacute;) Ou bien en faisant un STOP saisie</p>\r\n\r\n<p>Toujours conserver au moins 3 sauvegardes sur 3 jours diff&eacute;rents</p>\r\n\r\n<p>B.&nbsp;&nbsp; &nbsp;Description</p>\r\n\r\n<p>Sur le serveur aller sur l&rsquo;ic&ocirc;ne verte de la barre d&rsquo;outil Wampserver&hellip; PhpMyAdmin Sur l&lsquo;&eacute;cran apparait &agrave; gauche apparait l&rsquo;ensemble des bases de donn&eacute;es. Toutes ne font pas l&rsquo;objet d&rsquo;une sauvegarde. Nous int&eacute;resse :</p>\r\n\r\n<p>Ago (5)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;C&rsquo;est la base o&ugrave; l&rsquo;on stocke cr&eacute;dit agricole,&hellip; (5 tables)</p>\r\n\r\n<p>Chantier (1)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Tous les liens des adresses photos sur le serveur (1 table) &nbsp; &nbsp;</p>\r\n\r\n<p>Chantier_rapport (1)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Toutes les commandes du client (1 table) &nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;Proarchives (5) &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;Caremploi (5)&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>C&rsquo;est la base o&ugrave; l&rsquo;on stocke Proarchives (5 tables).</p>\r\n\r\n<p>Cliquer sur la base &agrave; sauvegarder. Par exemple Ago (5) &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;Sur l&lsquo;&eacute;cran apparait &agrave; gauche l&rsquo;ensemble des tables de la base de donn&eacute;es Ago (5) soit 5 tables. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;A droite dans des onglets apparaissent des actions</p>\r\n\r\n<p>S&eacute;lectionner &laquo; Exporter &raquo; &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>Ne rien modifier, les valeurs pas d&eacute;faut sont justes (les 5 tables doivent &ecirc;tre surlign&eacute;s en bleu fonc&eacute;) &nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;Tout En bas :&nbsp;&nbsp; &nbsp;Ne pas oublier compression = zipp&eacute; &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>Puis &laquo; Ex&eacute;cuter &raquo; (la dur&eacute;e de la sauvegarde d&eacute;pend de la taille de la base)</p>\r\n\r\n<p>A l&rsquo;issue de l&rsquo;action apparait une fen&ecirc;tre &nbsp;demandant de pr&eacute;ciser l&rsquo;endroit et le nom du fichier a enregistrer. Renommer la sauvegarde tout en conservant les extensions &laquo; .sql .gz &raquo; pour ne pas &eacute;craser les pr&eacute;c&eacute;dentes.</p>\r\n\r\n<p>Ago (5)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Quotidienne</p>\r\n\r\n<p>Chantier (1)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Quotidenne et au m&ecirc;me moment que Ago(5) ou Proarchives (5) &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>_rapport (1)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Quotidienne &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>Proarchives (5)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Quotidienne &nbsp;&nbsp; &nbsp;Utilisateurs&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Hebdomadaire ou si cr&eacute;ation de loggins &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>caremploi</p>\r\n\r\n<p>Ce fichier de sauvegarde doit &ecirc;tre enregistr&eacute; toujours au m&ecirc;me endroit dans &nbsp; Y :_Dropbox\\Proweb\\Back_up_base_de_donn&eacute;es &nbsp;A cet endroit les fichiers sont imm&eacute;diatement transmis &agrave; Paris</p>\r\n\r\n<p>Pour revenir dans l&rsquo;&eacute;cran de s&eacute;lection des bases de donn&eacute;es, cliquez sur l&rsquo;ic&ocirc;ne de la petite maison en haut &agrave; gauche. &nbsp;</p>\r\n\r\n<p>Termin&eacute; !</p>\r\n\r\n<p>&nbsp;Remarque 1 : si par hasard vous observez lors d&rsquo;une sauvegarde un message ou quelque chose de particulier et d&rsquo;inattendu : SORTIR, NE RIEN FAIRE ET INFORMER PARIS &nbsp;</p>\r\n\r\n<p>Remarque 2 : cette proc&eacute;dure de sauvegarde manuelle n&eacute;cessite beaucoup de pr&eacute;cautions car il s&rsquo;agit d&rsquo;intervenir dans la base de donn&eacute;es de Proweb. Suivre exactement cette proc&eacute;dure, pas &agrave; pas et sans &laquo; cr&eacute;ativit&eacute; &raquo;.</p>\r\n\r\n<p>Quand tout est fini, quitter le navigateur sans rien faire d&rsquo;autres.</p>\r\n\r\n<p>&nbsp;</p>', '2016-05-18 11:04:49', 1, 0, NULL),
(48, 29, 19, 21, 'Transfert et Vérification', NULL, '2016-05-17 19:51:00', 0, 0, NULL),
(48, 29, 19, 22, 'xxx', '<p>A.&nbsp;&nbsp; &nbsp;Pr&eacute;ambule</p>\r\n\r\n<p>Cette sauvegarde doit se faire :&nbsp;&nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>Quotidiennement (en attente d&rsquo;une proc&eacute;dure automatis&eacute;e)</p>\r\n\r\n<p>Alors que les utilisateurs ne sont plus logg&eacute;s sur l&rsquo;interface (pause d&eacute;jeun&eacute;)</p>\r\n\r\n<p>Ou bien en faisant un STOP saisie</p>\r\n\r\n<p>Toujours conserver au moins 3 sauvegardes sur 3 jours diff&eacute;rents &nbsp;</p>\r\n\r\n<p>B.&nbsp;&nbsp; &nbsp;Description</p>\r\n\r\n<p>Sur le serveur aller sur l&rsquo;ic&ocirc;ne verte de la barre d&rsquo;outil Wampserver&hellip; PhpMyAdmin Sur l&lsquo;&eacute;cran apparait &agrave; gauche apparait l&rsquo;ensemble des bases de donn&eacute;es. Toutes ne font pas l&rsquo;objet d&rsquo;une sauvegarde. Nous int&eacute;resse :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2016-05-18 11:17:37', 0, 0, NULL);
INSERT INTO `versions` (`ver_creator`, `ver_article`, `ver_version`, `Id`, `ver_titre`, `ver_content`, `ver_date`, `ver_editable`, `ver_del`, `attachement`) VALUES
(48, 23, 14, 23, 'Base de Donnée', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp;ORGANISATION DE LA BASE DE DONNEES</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> I.&nbsp;&nbsp; &nbsp;Fonctionnement de la base de donn&eacute;es</strong></p>\r\n\r\n<p>D&rsquo;une mani&egrave;re g&eacute;n&eacute;rale les diff&eacute;rentes interfaces permettent d&rsquo;&eacute;crire dans les BDD en respectant des masques et des r&egrave;gles de saisies. On utilise l&rsquo;interface web ou les ODBC pour effectuer des petites op&eacute;rations de maintenance sur les BDD. Une t&acirc;che effectu&eacute;e via les ODBC doit &ecirc;tre toujours interrog&eacute;e pour v&eacute;rifier si elle ne m&eacute;rite pas d&rsquo;&ecirc;tre impl&eacute;ment&eacute;e dans l&rsquo;interface web en tant qu&rsquo;outil permanent.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>1.&nbsp;&nbsp; &nbsp;Base Chantier Rapport</strong></p>\r\n\r\n<p>Elle contient une (1) table. Le contenu de cette table est impl&eacute;ment&eacute; lors d&#39;un chargement d&#39;un chantier en m&ecirc;me temps que la table_chantier de la BDD Chantier.</p>\r\n\r\n<p>Les champs importants de cette base sont :</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;<strong>Nom_Chantier</strong> : il est r&eacute;cup&eacute;r&eacute; lors du transfert du chantier</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;<strong>Total_photo</strong> : il est saisit au moment du transfert du chantier. C&#39;est le nombre de photo que le client dit avoir transf&eacute;r&eacute;</p>\r\n\r\n<p>-&nbsp;&nbsp; <strong>&nbsp;Date_transfert</strong> : correspond &agrave; la date &agrave; laquelle le client a d&eacute;pos&eacute; le chantier sur le serveur FTP</p>\r\n\r\n<p>-&nbsp;&nbsp; <strong>&nbsp;Compteur_photo</strong> : C&#39;est le N&deg; de compteur de la table client_archiviste renseign&eacute; au moment de l&#39;importation. Cette donn&eacute;e est statique &nbsp;-&nbsp;&nbsp; &nbsp;<strong>Date_restitution</strong> : lorsque la date d&#39;envoi est saisie, le chantier n&#39;apparait plus dans l&#39;interface web.</p>\r\n\r\n<p>Le contenue de cette table, dont le &laquo; r&eacute;sum&eacute; &raquo; est visible dans l&rsquo;interface web dans le module &laquo; avancement des travaux &raquo; doit &ecirc;tre rapproch&eacute; en permanence du tableau Excel <strong><span style="color:#000000">Suivi des chantiers.</span></strong> Notamment sur les quantit&eacute;s, dates, compteur,&hellip; Ces 2 outils doivent se lire en miroir l&rsquo;un de l&rsquo;autre. Ils racontent la m&ecirc;me chose l&rsquo;un saisie manuellement (Excel) et l&rsquo;autre automatis&eacute; (BDD Mysql-Interface web).</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>2.&nbsp;&nbsp; &nbsp;Base Chantier</strong></p>\r\n\r\n<p>Elle contient une (1) table</p>\r\n\r\n<p>Le contenu de cette table est impl&eacute;ment&eacute; lors d&#39;un chargement d&#39;un chantier en m&ecirc;me temps que la table Chantier_rapport. Il y a autant d&#39;enregistrements que de photos &agrave; saisir.</p>\r\n\r\n<p>Les champs importants de cette base sont :</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;<strong>Chantier_lien_photo </strong></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;<strong>Chantier_Pseudo_Saisie1 :</strong> qui correspondant &agrave; l&rsquo;op&eacute;ratrice qui effectue la 1&egrave;re saisie</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;<strong>Chantier_Pseudo_Saisie2 </strong>: qui correspondant &agrave; l&rsquo;op&eacute;ratrice qui effectue la 2&egrave;me saisie</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;<strong>Type_de_photo :</strong> qui correspond &agrave; l&rsquo;UA ou Ardoise C&rsquo;est dans cette table que se construit le principe de la double saisie.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>3.&nbsp;&nbsp; &nbsp;Base Proarchives </strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Elle contient cinq (5) tables.</p>\r\n\r\n<p>&nbsp;Une des 5 tables, la table Traitement sert &agrave; g&eacute;rer le Process : Saisie &ndash; Contr&ocirc;le &ndash; Correction &ndash; Contr&ocirc;le - Validation</p>\r\n\r\n<p>Cette table est utilis&eacute;e pour g&eacute;rer le process de traitement de la saisie de photo. &nbsp;A une photo correspond 2 enregistrements correspondants &agrave; la saisie de A et B. Les champs importants de cette table sont :</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Traitement_Type qui contient le statut de la Photo</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Traitement_Correction qui contient l&rsquo;ensemble des descriptions des champs &agrave; corriger. &nbsp;</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;4.&nbsp;&nbsp; &nbsp;Base Ago </strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Contient cinq (5) tables</p>\r\n\r\n<p>Pour des questions de coh&eacute;rence et d&rsquo;homog&eacute;n&eacute;it&eacute; on fait en sorte que les BDD soient similaires pour tous les clients m&ecirc;me si les champs ne sont pas tous utilis&eacute;s.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> 5.&nbsp;&nbsp; &nbsp;Base Recall</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Contient cinq (5) tables.</p>\r\n\r\n<p>Pour des questions de coh&eacute;rence et d&rsquo;homog&eacute;n&eacute;it&eacute; on fait en sorte que les BDD soient similaires pour tous les clients m&ecirc;me si les champs ne sont pas tous utilis&eacute;s.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp;6.&nbsp;&nbsp; &nbsp;Base caremploi </strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Elle contient cinq (5) tables.</p>\r\n\r\n<p>&nbsp;Une des 5 tables, la table Traitement sert &agrave; g&eacute;rer le Process : Saisie &ndash; Contr&ocirc;le &ndash; Correction &ndash; Contr&ocirc;le - Validation</p>\r\n\r\n<p>Cette table est utilis&eacute;e pour g&eacute;rer le process de traitement de la saisie de photo. &nbsp;A une photo correspond 2 enregistrements correspondants &agrave; la saisie de A et B. Les champs importants de cette table sont :</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Traitement_Type qui contient le statut de la Photo</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Traitement_Correction qui contient l&rsquo;ensemble des descriptions des champs &agrave; corriger. &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; <strong>&nbsp;II.&nbsp;&nbsp; &nbsp;Description du Process dans la table traitement </strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp;1&nbsp;&nbsp; &nbsp;Le cycle normal </strong></p>\r\n\r\n<p>Les photos &agrave; saisir suivent toutes le m&ecirc;me cycle.</p>\r\n\r\n<p>Elles sont d&rsquo;abord import&eacute;es dans la BDD chantier pour recevoir la saisie de A puis de B. L&rsquo;ordre des saisies se fait dans l&rsquo;ordre d&lsquo;importation c&#39;est-&agrave;-dire dans l&rsquo;ordre de leur r&eacute;pertoire Windows.</p>\r\n\r\n<p>Chaque saisie A et B g&eacute;n&egrave;re une ligne dans la table traitement.<u> Donc pour respecter la double saisie, toute URL photo totalement saisie doit avoir g&eacute;n&eacute;r&eacute;e 2 lignes dans la table traitement.</u></p>\r\n\r\n<p>Description des diff&eacute;rents 11 statuts dans la table traitement pour chaque ligne d&rsquo;enregistrement.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; TEMP = Saisie en cours pour l&rsquo;op&eacute;rateur dont le nom figure dans Traitement_Utilisateur_Pseudo</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; SAISIE = Saisie termin&eacute;e (= en attente de contr&ocirc;le) pour l&rsquo;op&eacute;rateur dont le nom figure dans Traitement_Utilisateur_Pseudo</p>\r\n\r\n<p><u><strong>&nbsp; Lorsque 2 lignes de la table traitement pour une m&ecirc;me URL photo portent le statut SAISIE, la photo est disponible pour le contr&ocirc;le.</strong></u> &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;CONTROL = L&rsquo;URL photo est en cours de contr&ocirc;le sur la 1ere boite pour l&#39;op&eacute;rateur dont le nom figure dans Traitement_Control &nbsp;&nbsp;&nbsp; &nbsp;CCTION_tmp = L&rsquo;URL photo est en cours de contr&ocirc;le sur les autres boites pour l&#39;op&eacute;rateur dont le nom figure dans Traitement_Control &nbsp;</p>\r\n\r\n<p>A l&rsquo;issue de la phase de contr&ocirc;le, la photo part ou non en correction pour l&rsquo;un ou les 2 op&eacute;rateurs. Pour les 2 enregistrements de la table traitement, je peux avoir une des lignes en statut SAISIE et l&rsquo;autre en statut CORRECTION. Ou les 2 en statuts CORRECTIONS !</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;CORRECTION = en attente de Correction pour l&rsquo;op&eacute;rateur dont le nom figure dans Traitement_Utilisateur_Pseudo &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;TEMP_CORRECT = en cours de Correction pour l&rsquo;op&eacute;rateur dont le nom figure dans Traitement_Utilisateur_Pseudo</p>\r\n\r\n<p><u>A l&rsquo;issue de la phase de correction, la photo reprend le statut SAISIE. Elle peut donc &ecirc;tre pr&eacute;sent&eacute;e &agrave; nouveau au contr&ocirc;le.</u></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; VALIDEE = A = B. La photo n&rsquo;est plus disponible pour l&rsquo;interface de saisie ou de contr&ocirc;le ou de super-contr&ocirc;le. La table traitement stocke tous les enregistrements portant le statut VALIDEE (= historique).</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>2&nbsp;&nbsp; &nbsp;Le cycle &eacute;tendu </strong></p>\r\n\r\n<p>Il arrive qu&rsquo;une photo pr&eacute;sente des caract&eacute;ristiques qui n&eacute;cessitent une intervention d&rsquo;un super contr&ocirc;leur. Les photos sont isol&eacute;es dans des SAS d&rsquo;attentes. &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;<strong> a)</strong>&nbsp;&nbsp; <u><strong>&nbsp;Attente administrateur</strong></u></p>\r\n\r\n<p>Seul un op&eacute;rateur ayant le r&ocirc;le de super contr&ocirc;leur peut r&eacute;cup&eacute;rer la photo et effectuer des corrections pour tous les champs manuellement (tr&egrave;s sensible)</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ATTENTE_ADMIN = la photo est mis &agrave; l&rsquo;&eacute;cart du cycle normal. &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; SUPER_CONTROL = L&rsquo;URL photo est en cours de Super-contr&ocirc;le sur la 1ere boite pour l&#39;op&eacute;rateur dont le nom figure dans Traitement_Control</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;SSTION_tmp = L&rsquo;URL photo est en cours de Super-contr&ocirc;le sur les autres boites pour l&#39;op&eacute;rateur dont le nom figure dans Traitement_Control A l&rsquo;issue de la phase de Super-contr&ocirc;le, la photo reprend le statut SAISIE. Elle peut donc &ecirc;tre pr&eacute;sent&eacute;e &agrave; nouveau au contr&ocirc;le.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; <strong>&nbsp; b)</strong>&nbsp;&nbsp; &nbsp;<u><strong>Attente Client </strong></u></p>\r\n\r\n<p>ATTENTE_CLIENT. Il arrive qu&rsquo;une photo doive &ecirc;tre sortie du cycle normal ou du Super-contr&ocirc;le par manque d&rsquo;informations du client. Elle est alors non disponible pour les op&eacute;rateurs, les contr&ocirc;leurs et le super-contr&ocirc;leur. &nbsp;</p>\r\n\r\n<p>Attention !!! &nbsp;Pour la remettre dans le cycle normal, il faut modifier manuellement les ODBC en passant ATTENTE_ADMIN en Statut SAISIE. La photo peut alors revenir au contr&ocirc;leur et en transmettant &agrave; l&rsquo;&eacute;quipe les consignes du client. &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp;c)&nbsp;&nbsp; &nbsp;<u>Remarques importantes</u> </strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;1.&nbsp;&nbsp; &nbsp;Le seul &eacute;cran o&ugrave; une photo peut &ecirc;tre d&eacute;finitivement VALIDEE est l&rsquo;&eacute;cran de contr&ocirc;le.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;2.&nbsp;&nbsp; &nbsp;C&rsquo;est au moment o&ugrave; l&rsquo;on contr&ocirc;le et valide une photo que l&rsquo;on d&eacute;clenche un certain nombre d&rsquo;automate comme l&rsquo;incr&eacute;mentation des compteurs. Tant qu&rsquo;une photo n&rsquo;est pas valid&eacute;e, il n&rsquo;est pas n&eacute;cessaire de mouvementer le compteur. Par ailleurs si je souhaite relancer l&rsquo;incr&eacute;mentation du compteur, il suffit de passer du Statut VALIDEE au statut SAISIE et reprendre un cycle.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; 3.&nbsp;&nbsp; &nbsp;Toute modification via les ODBC n&eacute;cessite une prudence particuli&egrave;re pour modifier un statut. Il faut notamment bien comprendre s&rsquo;il faut modifier les 2 lignes de la table traitement ou 1 seule. Au final, on a le choix entre SAISIE (renvoyer au contr&ocirc;le= 90 % des cas), ATTENTE_ADMIN (envoyer au super-contr&ocirc;le).</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; 4.&nbsp;&nbsp; &nbsp;On ne modifie jamais un statut qui pr&eacute;sente une signification en-cours de modification de l&rsquo;enregistrement (TEMP_CORRECT, TEMP, CONTROL, SUPER_CONTROL, CCTION_tmp, SSTION_tmp) sauf op&eacute;rations de maintenance. Cela revient &agrave; &laquo; CASSER &raquo; le travail qu&rsquo;une op&eacute;ratrice est en train d&rsquo;effectuer.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; 5.&nbsp;&nbsp; &nbsp; lorsque l&rsquo;automate de l&rsquo;interface enregistre le statut il &eacute;crit le statut + le pseudo de l&rsquo;op&eacute;rateur. (Exemple : SAISIE A_Danhin) mais le pseudo n&rsquo;est pas obligatoire pour faire fonctionner l&rsquo;interface (fonction contient &hellip; et non &eacute;gal&hellip;)</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; 6.&nbsp;&nbsp; &nbsp;l&rsquo;ordre des saisies se fait dans l&rsquo;ordre des enregistrements de la table d&rsquo;importation chantier. L&rsquo;ordre du contr&ocirc;le se fait dans l&rsquo;ordre historique. D&rsquo;abord la plus ancienne puis la plus r&eacute;cente de la table traitement d&egrave;s lors qu&rsquo;elles sont doubles. L&rsquo;ordre des corrections se fait dans l&rsquo;ordre historique. Un num&eacute;ro d&rsquo;index plus petit dans la table traitement d&eacute;signe une photo plus ancienne. &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;<strong> &nbsp;1&nbsp;&nbsp; &nbsp;Quelques probl&egrave;mes rencontr&eacute;s</strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong> 1.1&nbsp;&nbsp; &nbsp;</strong><u><strong>Le nombre &laquo; photos d&eacute;clar&eacute;es &raquo; diff&eacute;rent &laquo; photos re&ccedil;ues &raquo; </strong></u></p>\r\n\r\n<p>Dans l&rsquo;interface Web nous remarquons que le nombre de photos d&eacute;clar&eacute;es n&rsquo;est pas &eacute;gale au nombre de photos re&ccedil;ues et la ligne de ce chantier est en rouge. Deux cas de figures se pr&eacute;sentent :</p>\r\n\r\n<p><strong>a)&nbsp;&nbsp; &nbsp;Le client oublie une photo</strong></p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Copiez la photo dans le r&eacute;pertoire correspondant</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Allez dans Ms Access, ouvrez la base chantier</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;S&eacute;lectionnez et copiez le nom de la photo dans chantier_photo sans oublier d&rsquo;attribuer un num&eacute;ro d&rsquo;index&hellip;.compl&eacute;tez les autres champs -&nbsp;&nbsp; &nbsp;Enregistrez</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Allez dans l&rsquo;interface Web et actualiser la page.</p>\r\n\r\n<p>&nbsp;<strong>b)&nbsp;&nbsp; &nbsp;La quantit&eacute; d&eacute;clar&eacute;e par le client est erron&eacute;e </strong></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;&nbsp; &nbsp;Dans Ms ACCESS, ouvrez la table chantier_rapport</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; - &nbsp; &nbsp;Dans le champ total_photo, changez le nombre de photos</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;&nbsp; &nbsp;Enregistrez</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;&nbsp; &nbsp;Allez dans l&rsquo;interface Web et actualisez la page.</p>\r\n\r\n<p><strong>1.&nbsp;&nbsp; &nbsp;Le triplet</strong></p>\r\n\r\n<p>La couleur de ce chantier est orange. Le triplet se manifeste quand la m&ecirc;me photo est saisie 3 ou 4 fois. Pour le corriger :</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-&nbsp;&nbsp; &nbsp;S&eacute;lectionnez le chantier en question</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-&nbsp;&nbsp; &nbsp;Cliquez sur <strong>Nettoyage</strong> (Cf. la figure ci-apr&egrave;s) &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-&nbsp;&nbsp; &nbsp;Dans la liste d&eacute;roulante de Rechercher, choisir Triplet puis valider</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-&nbsp;&nbsp; &nbsp;Une nouvelle fen&ecirc;tre s&rsquo;ouvre qui affiche les photos en triplet ou en quadruplet. Attention !!! Avant de proc&eacute;der &agrave; toute modification, il faut regarder le statut de la photo (correction, contr&ocirc;le&hellip;), dans ce cas, ne faites rien. Par contre si la photo est en saisie, -&nbsp;&nbsp; &nbsp;Cliquez sur nettoyage. Et la saisie reprend. &nbsp;</p>\r\n\r\n<p><strong>2.&nbsp;&nbsp; &nbsp;Blocage sur une photo </strong></p>\r\n\r\n<p>Il y a des bugs qui s&rsquo;affichent sur les interfaces pendant la <strong>correction ou contr&ocirc;le</strong>, pour le r&eacute;soudre :</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;S&eacute;lectionnez le chantier</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Cliquez sur Nettoyage</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Dans la liste d&eacute;roulante, choisir D&eacute;bloquer contr&ocirc;le, si la photo est en contr&ocirc;le ou sur D&eacute;bloquer correction si la photo est en correction.</p>\r\n\r\n<p>&nbsp;<strong>3.&nbsp;&nbsp; &nbsp;Supprimer une saisie d&rsquo;une photo (rare)</strong></p>\r\n\r\n<p>Pour supprimer totalement la saisie d&rsquo;une photo.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;&nbsp; &nbsp;S&eacute;lectionner l&rsquo;URL photo dans la <strong>table traitement</strong> et supprimer les enregistrements (1 ou 2 lignes pour A et B)</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;S&eacute;lectionner l&rsquo;URL photo dans la table photo et supprimer les enregistrements (toutes les lignes ou variables selon A et B !)</p>\r\n\r\n<p><strong>Attention </strong>: &agrave; ce stade, la photo ne pourra pas &ecirc;tre RE-saisie, car il subsiste les enregistrements des pseudos dans la table chantier.</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;S&eacute;lectionner l&rsquo;URL photo dans la table chantier et effacer les 2 pseudos (ou 1 seul pour A ou B).</p>\r\n\r\n<p>&nbsp;<strong>4.&nbsp;&nbsp; &nbsp;Chantier mal charg&eacute; Si une importation se passe mal</strong></p>\r\n\r\n<p>Ne pas h&eacute;siter et supprimer les enregistrements li&eacute;s &agrave; l&rsquo;importation</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Via ODBC supprimer la ou les lignes de<strong> rapport_chantier </strong>contenant exactement le nom du <strong>chantier</strong> dans le champ &laquo; url_chantier &raquo;</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Via ODBC supprimer la ou les lignes de chantier contenant exactement le nom du chantier dans le champ <strong>&laquo; Chantier_Dossier_Travail &raquo;</strong></p>', '2016-05-17 13:04:00', 1, 0, NULL),
(48, 32, 22, 25, 'Importation des chantiers', '<p><span style="color:#0000FF"><strong>IMPORTATION DES CHANTIERS<br />\r\nAGO - &nbsp;PROARCHIVES - CAREMPLOI</strong></span></p>\r\n\r\n<p><strong>⦁&nbsp;&nbsp; &nbsp;Proarchives</strong><br />\r\nApr&egrave;s avoir t&eacute;l&eacute;charg&eacute; l&rsquo;envoi, proc&eacute;dez &agrave; la v&eacute;rification des &eacute;l&eacute;ments suivants :<br />\r\n⦁&nbsp;&nbsp; &nbsp;V&eacute;rifiez si le nombre de photos envoy&eacute; correspond au rapport de photos envoy&eacute; par le client<br />\r\n⦁&nbsp;&nbsp; &nbsp;V&eacute;rifiez s&rsquo;il y a table adresse ou pas /G&eacute;rance ou Copro<br />\r\n⦁&nbsp;&nbsp; &nbsp;V&eacute;rifiez s&rsquo;il y a l&rsquo;historique si oui lancez la macro pour avoir le num&eacute;ro de compteur</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;<strong>Importation du chantier</strong><br />\r\nLancez l&rsquo;application <strong>Importation Proarchives&hellip;</strong>apr&egrave;s identification vous avez la figure 1 suivante</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Fig.1</strong></p>\r\n\r\n<p><br />\r\n⦁&nbsp;&nbsp; &nbsp;Cliquez sur <strong>SETTINGS CHANTIER</strong><br />\r\n⦁&nbsp;&nbsp; &nbsp;Cliquez sur <strong>R&eacute;pertoire Envois&hellip;Y:\\Photo_AGO&hellip;puis OK</strong><br />\r\n⦁&nbsp;&nbsp; &nbsp;Ensuite sur cliquez sur Scan R&eacute;pertoire<br />\r\nUne fen&ecirc;tre suivante s&rsquo;ouvre</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2016-05-18 17:21:00', 1, 0, 'uploads/wiki/30335.jpeg'),
(48, 32, 22, 26, 'Importation des chantiers', '<p><span style="color:#0000FF"><strong>IMPORTATION DES CHANTIERS<br />\r\nAGO - &nbsp;PROARCHIVES - CAREMPLOI</strong></span></p>\r\n\r\n<p><strong>⦁&nbsp;&nbsp; &nbsp;Proarchives</strong><br />\r\nApr&egrave;s avoir t&eacute;l&eacute;charg&eacute; l&rsquo;envoi, proc&eacute;dez &agrave; la v&eacute;rification des &eacute;l&eacute;ments suivants :<br />\r\n⦁&nbsp;&nbsp; &nbsp;V&eacute;rifiez si le nombre de photos envoy&eacute; correspond au rapport de photos envoy&eacute; par le client<br />\r\n⦁&nbsp;&nbsp; &nbsp;V&eacute;rifiez s&rsquo;il y a table adresse ou pas /G&eacute;rance ou Copro<br />\r\n⦁&nbsp;&nbsp; &nbsp;V&eacute;rifiez s&rsquo;il y a l&rsquo;historique si oui lancez la macro pour avoir le num&eacute;ro de compteur</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;<strong>Importation du chantier</strong><br />\r\nLancez l&rsquo;application <strong>Importation Proarchives&hellip;</strong>apr&egrave;s identification vous avez la figure 1 suivante</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Fig.1</strong></p>\r\n\r\n<p><br />\r\n⦁&nbsp;&nbsp; &nbsp;Cliquez sur <strong>SETTINGS CHANTIER</strong><br />\r\n⦁&nbsp;&nbsp; &nbsp;Cliquez sur <strong>R&eacute;pertoire Envois&hellip;Y:\\Photo_AGO&hellip;puis OK</strong><br />\r\n⦁&nbsp;&nbsp; &nbsp;Ensuite sur cliquez sur Scan R&eacute;pertoire<br />\r\nUne fen&ecirc;tre suivante s&rsquo;ouvre</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2016-05-18 17:21:00', 1, 0, 'uploads/wiki/30335.jpeg'),
(48, 32, 22, 27, 'Importation des chantiers', '<p><span style="color:#0000FF"><strong>IMPORTATION DES CHANTIERS<br />\r\nAGO - &nbsp;PROARCHIVES - CAREMPLOI</strong></span></p>\r\n\r\n<p><strong>⦁&nbsp;&nbsp; &nbsp;Proarchives</strong><br />\r\nApr&egrave;s avoir t&eacute;l&eacute;charg&eacute; l&rsquo;envoi, proc&eacute;dez &agrave; la v&eacute;rification des &eacute;l&eacute;ments suivants :<br />\r\n⦁&nbsp;&nbsp; &nbsp;V&eacute;rifiez si le nombre de photos envoy&eacute; correspond au rapport de photos envoy&eacute; par le client<br />\r\n⦁&nbsp;&nbsp; &nbsp;V&eacute;rifiez s&rsquo;il y a table adresse ou pas /G&eacute;rance ou Copro<br />\r\n⦁&nbsp;&nbsp; &nbsp;V&eacute;rifiez s&rsquo;il y a l&rsquo;historique si oui lancez la macro pour avoir le num&eacute;ro de compteur</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;<strong>Importation du chantier</strong><br />\r\nLancez l&rsquo;application <strong>Importation Proarchives&hellip;</strong>apr&egrave;s identification vous avez la figure 1 suivante</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Fig.1</strong></p>\r\n\r\n<p><br />\r\n⦁&nbsp;&nbsp; &nbsp;Cliquez sur <strong>SETTINGS CHANTIER</strong><br />\r\n⦁&nbsp;&nbsp; &nbsp;Cliquez sur <strong>R&eacute;pertoire Envois&hellip;Y:\\Photo_AGO&hellip;puis OK</strong><br />\r\n⦁&nbsp;&nbsp; &nbsp;Ensuite sur cliquez sur Scan R&eacute;pertoire<br />\r\nUne fen&ecirc;tre suivante s&rsquo;ouvre</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2016-05-18 17:29:23', 1, 0, 'uploads/wiki/30335.jpeg'),
(48, 21, 12, 28, 'MODERATION', '<p><strong><u>PROCEDURE MODERATION ACCES GRATUIT</u> &nbsp;(Profils de femmes)</strong> &nbsp;</p>\r\n\r\n<p>La &nbsp;Mod&eacute;ration des profils de femmes &nbsp;se fait sur &nbsp;la &nbsp;mod&eacute;ration sous la rubrique &laquo; Valider Acc&egrave;s gratuits &raquo; et &nbsp;consiste &nbsp;&agrave; &nbsp; analyser chaque profil &nbsp;en respectant certaines r&egrave;gles pr&eacute;&eacute;tablies. &nbsp;Elle s&rsquo;applique &nbsp;sur les deux &nbsp;bases : base Coquine et la &nbsp;base Grand Public. &nbsp;</p>\r\n\r\n<p><strong>I-&nbsp;&nbsp; &nbsp;ACCES GRATUIT BASE COQUINE &nbsp; REGLES GENERALES: &nbsp;</strong></p>\r\n\r\n<p>1-&nbsp;&nbsp; &nbsp;Supprimer tous les profils dont IP n&rsquo;est pas la France. Normalement ces profils se trouvent au d&eacute;but et &agrave; la fin de la liste des inscrits. Valider avec pr&eacute;caution les profils Belgique (s&rsquo;il n&rsquo;est pas suspect et si le lieu de r&eacute;sidence indiqu&eacute; dans le profil est en Belgique). &nbsp;</p>\r\n\r\n<p>2-&nbsp;&nbsp; &nbsp;Valider avec pr&eacute;caution les profils de femmes noires. Ne pas donner l&rsquo;acc&egrave;s si les photos ne repr&eacute;sentent que des parties du corps ou si elles proposent dans la description une rencontre chaude. &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;3-&nbsp;&nbsp; &nbsp;Supprimer les profils avec les photos de tr&egrave;s jolies femmes et les profils dont la description est du type &laquo;cherche mon &acirc;me s&oelig;ur&raquo; (r&egrave;gle pour la base adulte). &nbsp;</p>\r\n\r\n<p>4-&nbsp;&nbsp; &nbsp;Mot de passe suspect: si le profil a un mot de passe suspect qui est marqu&eacute; par rouge et qui est assez compliqu&eacute; (du type <span style="color:#FF0000">&laquo;ninho326987&raquo;</span>) il faut supprimer ce profil. Si le mot de passe est simple (du type &laquo;azerty&raquo; ou &laquo;123456&raquo;) il faut analyser ce profil en entier &ndash;pseudo, photos, adresse mail &ndash;et le supprimer s&rsquo;il est suspect. &nbsp;</p>\r\n\r\n<p>5-&nbsp;&nbsp; &nbsp;Supprimer des profils dont le pseudo est du type: coeuratristee--tendresse14180--femmelibre1980 &nbsp;</p>\r\n\r\n<p>6-&nbsp;&nbsp; &nbsp;Supprimer les profils o&ugrave; le pseudo = adresse mail (surtout si c&rsquo;est un nom/pr&eacute;nom, une femme r&eacute;elle ne donne jamais son nom et pr&eacute;nom) &nbsp; &nbsp;</p>\r\n\r\n<p>7-&nbsp;&nbsp; &nbsp; Supprimer les profils des hommes (m&ecirc;me si le pseudo est f&eacute;minin et l&lsquo;adresse mail appartient &agrave; un homme) &nbsp;</p>\r\n\r\n<p>8-&nbsp;&nbsp; &nbsp;Supprimer les profils contenant des coordonn&eacute;es (skype, tel, adresse mail, facebook, etc.) ainsi que les profils contant des mots &laquo;escorte&raquo;, &laquo;v&eacute;nale&raquo; etc. &nbsp;</p>\r\n\r\n<p>9-&nbsp;&nbsp; &nbsp;Quelques soient le pseudo, la description, l&rsquo;adresse mail et les photos NE DONNER JAMAIS l&rsquo;acc&egrave;s aux profils dont le mot de passe se termine par les chiffres 10, 12,123 et 225 &nbsp;</p>\r\n\r\n<p>10-&nbsp;&nbsp; &nbsp;Supprimer les profils des mineurs. Assez souvent leur mot de passe les d&eacute;masque &ndash;p.ex. le mot de passe 03052002 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp;Exemples de profils &agrave; supprimer : &nbsp;</p>\r\n\r\n<p>Supprimer &nbsp;tous les profils avec &nbsp;la geoIP autre que la &nbsp;France, ne valider que la France et la Belgique (seulement si la ville indiqu&eacute; est vraiment en Belgique, ne pas donc valider p.ex. Paris/Belgique) &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>Supprimer les profils suivants : &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Le pseudo contient plusieurs lettres x, le mot &laquo; love &raquo; (surtout s&rsquo;il y a une photo d&rsquo;une jolie femme) &nbsp;Exemple : xxxbellaxxx, lolahot, love4real &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Les profils dont le mot de passe ne contient &nbsp;que des &nbsp;consonnes qui se &nbsp;r&eacute;p&egrave;tent &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Les profils avec le mot de passe suspect (marqu&eacute; &nbsp;par la couleur rouge) &nbsp; &nbsp; &nbsp;&bull;</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;Si &nbsp;le pseudo et l&rsquo;adresse mail sont les m&ecirc;mes &nbsp;(lettre &agrave; &nbsp;lettre) &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Si la description contient &nbsp;l&rsquo;adresse mail, le num&eacute;ro de t&eacute;l&eacute;phone, les &nbsp;mots &laquo; &nbsp;escorte &raquo;, &laquo; &nbsp;venale &raquo;, etc. &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Si le mot de passe se termine &nbsp; sur les chiffres &laquo; 10 &raquo;, &laquo; 12 &raquo;, &laquo; 123 &raquo;, &nbsp;&laquo; 225 &raquo; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Profils &nbsp;des mineurs (le mot de passe contient &nbsp;la date de naissance, ou &nbsp;le pseudo du type &laquo; anna14ans &raquo;, etc.) &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Les profils qui contiennent les mots &laquo; fleur &raquo;, &laquo; nuit &raquo;, &laquo; toujours &raquo;, &laquo; douce &raquo;, &laquo; ravissante &raquo; (pseudo/MDP/mail) &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;S&rsquo;il y a plusieurs profils identiques de suite laisser un seul profil, supprimer tous les autres SEULEMENT si la ville et la date de naissance sont les m&ecirc;mes ! &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;&bull;&nbsp;&nbsp; &nbsp;Les profils avec l&rsquo;adresse mail qui contient le nom de famille &laquo; Dupont &raquo;, &laquo; rousseau &raquo;, &laquo; Dubois &raquo; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Les profils dont l&rsquo;adresse mail ou le pseudo/photo sont masculins. &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;&bull;&nbsp;&nbsp; &nbsp;Les profils qui &nbsp;cherchent du s&eacute;rieux, un homme de sa vie, etc &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Avec des photos vol&eacute;es / photos de racoleuses connues / photos choquantes Utiliser Google Image pour la recherche par photo &nbsp; &nbsp; &nbsp;Ou faire une recherche sur des sites sp&eacute;cialis&eacute;s d&eacute;masquant les fakes p.ex. :</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; &nbsp;http://arnaquesbrouteursafrique.eklablog.com/photos-femmes-de-couleurs-et-metisses-c17379191</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;http://www.arnacoeurs.com/pages/Les_albums_des_appats_feminins_22-8471421.html</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;http://www.arnacoeurs.com/pages/Les_albums_des_appats_feminins-8959819.html</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;http://arnaqueusebernadette.centerblog.net/</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;http://arnaqueusesdunet.centerblog.net/</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;http://arnaqueuses-du-net.skyrock.com/ &nbsp;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Analyser tout le profil en int&eacute;gralit&eacute; (pseudo, mdp, photo, l&rsquo;adresse mail) et supprimer tous les &nbsp;profils suspects.</p>\r\n\r\n<p>Voici plusieurs exemples de profils &agrave; supprimer (la cause est marqu&eacute;e par la couleur rouge). &nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p><strong>&nbsp; &nbsp;II-&nbsp;&nbsp; &nbsp;ACCES &nbsp;GRATUIT BASE GRAND PUBLIC &nbsp;</strong></p>\r\n\r\n<p>La r&egrave;gle &nbsp;est un peu &nbsp; diff&eacute;rente de celle &nbsp;de la &nbsp;base coquine. Elle s&rsquo;applique comme suit :</p>\r\n\r\n<p>&nbsp;SUPPRIMER :</p>\r\n\r\n<p>&nbsp;1-&nbsp;&nbsp; &nbsp;Tous les profils dont IP n&rsquo;est pas la France. Normalement ces profils se trouvent au d&eacute;but et &agrave; la fin de la liste des inscrits. Valider avec pr&eacute;caution les profils Belgique (s&rsquo;il n&rsquo;est pas suspect et si le lieu de r&eacute;sidence indiqu&eacute; dans le profil est en Belgique). &nbsp;</p>\r\n\r\n<p>2-&nbsp;&nbsp; &nbsp;Les profils avec mot de passe en rouge. Surtout : sansan, bonjour2014 (2015,2016), maman123 &nbsp;</p>\r\n\r\n<p>3-&nbsp;&nbsp; &nbsp;Les profils avec informations personnelles indiqu&eacute;es &nbsp;dans la description (skype, mail, tel, adresse web, etc.) &nbsp;</p>\r\n\r\n<p>4-&nbsp;&nbsp; &nbsp;Les profils dont les informations personnelles (skype, facebook, etc,) sont envoy&eacute;es des le premier message (visible dans la colonne &laquo; Messages &raquo;) &nbsp;</p>\r\n\r\n<p>5-&nbsp;&nbsp; &nbsp;Les profils avec des &nbsp;photos vol&eacute;es / photos de racoleuses connues &nbsp;</p>\r\n\r\n<p>6-&nbsp;&nbsp; &nbsp;Adresse mail bidon ou jetable &ndash; les adresses utilis&eacute;es les plus souvent sont :</p>\r\n\r\n<p>&nbsp;@live.fr &nbsp;@uu1.pl ou @uu1.fr &nbsp;</p>\r\n\r\n<p>@dayrep.com &nbsp;</p>\r\n\r\n<p>@jourrapide.com &nbsp;</p>\r\n\r\n<p>@netcourrier.com &nbsp;</p>\r\n\r\n<p>@einrot.com &nbsp;</p>\r\n\r\n<p>@fleckens.hu &nbsp;</p>\r\n\r\n<p>@cuvox.de &nbsp;</p>\r\n\r\n<p>@teleworm.us &nbsp;</p>\r\n\r\n<p>@armyspy.com &nbsp;</p>\r\n\r\n<p>@rhyta.com &nbsp;</p>\r\n\r\n<p>@gustr.com &nbsp;</p>\r\n\r\n<p>@clipmail.eu &nbsp;</p>\r\n\r\n<p>7-&nbsp;&nbsp; &nbsp;Le pseudo est du type : &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;femmeseule</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;coeurapprendre &nbsp;</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;coeurlibre</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;coeurtendre &nbsp;</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;nellasympa &nbsp;</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;antonella</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;nellacelib</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;bellacelib</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;coeurdouce</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;soleilrose</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;rachlova</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;sandrine</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;coeurdamour</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;labelle</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;cupidon</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;tristeseul</p>\r\n\r\n<p>&nbsp;-&nbsp;&nbsp; &nbsp;cupid &nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp;Tous ce qui contient : c&oelig;ur, triste, douce, seule&hellip; &nbsp;</p>\r\n\r\n<p>8-&nbsp;&nbsp; &nbsp;Tout ce qui parait suspect ; surtout &nbsp;sur Miaoo &nbsp;Concernant les &nbsp;photos, malheureusement 90% &nbsp;des &nbsp;photos ne sont pas index&eacute;es Google Image. On peut utiliser les forums et les blongs &nbsp;pour une recherche des &nbsp; photos. &nbsp; Attention aux photos suivantes : &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Voici un exemple de profils &nbsp;&agrave; supprimer (la cause est marqu&eacute;e par la couleur rouge) &nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>', '2016-05-12 13:26:52', 0, 0, NULL),
(48, 42, 32, 29, 'Client_821_Consignes', '<p><span style="font-size:22px"><span style="color:#0000CD">Relation Client : Consignes</span></span></p>\r\n\r\n<p><strong>Client AGO : &nbsp;&nbsp; &nbsp;821</strong></p>\r\n\r\n<p>Interface : &nbsp;&nbsp; &nbsp;AGO</p>\r\n\r\n<p>Type : &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Fr&eacute;quent&nbsp;</p>\r\n\r\n<p>D&eacute;lais :&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;D&egrave;s que c&rsquo;est pr&ecirc;t</p>\r\n\r\n<p><span style="color:#0000FF">*Importation</span></p>\r\n\r\n<p>Choisir l&rsquo;interface AGO</p>\r\n\r\n<p>Compteur : indiff&eacute;rent</p>\r\n\r\n<p>Fichier rapport_chantier : laisser vide !</p>\r\n\r\n<p>Consignes Pr&eacute;paration</p>\r\n\r\n<p>1&egrave;re &eacute;tape : Important : v&eacute;rifier que les photos sont &agrave; l&rsquo;endroit (gain de temps pour toute l&rsquo;&eacute;quipe)</p>\r\n\r\n<p>Code service sur 3 caract&egrave;res.</p>\r\n\r\n<p>Identifier et saisir la ref conteneur en triple saisie</p>\r\n\r\n<p>Mettre dur&eacute;e conservation = 0&nbsp;&nbsp; &nbsp;sur la 1ere photo de la 1ere partie du chantier (il suffit qu&rsquo;elle y soit</p>\r\n\r\n<p>qu&rsquo;une seule fois)</p>\r\n\r\n<p>Ann&eacute;e destruction ne sera plus &agrave; saisir</p>\r\n\r\n<p><span style="color:#0000FF">*Consignes Saisie-Contr&ocirc;le</span></p>\r\n\r\n<p><u>Zone en t&ecirc;te</u></p>\r\n\r\n<p>Ref Conteneur : pas de 0 devant</p>\r\n\r\n<p>Dur&eacute;e Conservation = 0</p>\r\n\r\n<p><u>Zone Unit&eacute; d&rsquo;archives</u></p>\r\n\r\n<p>Exp 1 : Saisir le libell&eacute; coch&eacute; sur la boite ou &eacute;crit &agrave; la main</p>\r\n\r\n<p><br />\r\nExp 2 : Puis le Num&eacute;ro. Exemple 1724. En g&eacute;n&eacute;ral au dessus de la s&eacute;quence</p>\r\n\r\n<p><br />\r\nSi s&eacute;quence avec les num&eacute;ros mettre &laquo; A &raquo; &agrave; la fin du champ et changer de champs</p>\r\n\r\n<p><br />\r\nExemple&nbsp;&nbsp; &nbsp;Expression 3&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;245 A</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Expression 4&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;345</p>\r\n\r\n<p><br />\r\nSi un seul num&eacute;ro ne pas mettre &laquo; A &raquo;</p>\r\n\r\n<p>Exp 5 : saisir la date accol&eacute;e. Exemple 02052011</p>\r\n\r\n<p>Bornes inf et sup : <u>ne pas saisir.</u></p>\r\n\r\n<p>Renseigner Ann&eacute;e Inf et Ann&eacute;e Sup</p>\r\n\r\n<p><span style="color:#0000FF">*Consignes Restitution</span></p>\r\n\r\n<p><u>Contr&ocirc;le Qualit&eacute;</u></p>\r\n\r\n<p>Statistique</p>\r\n\r\n<p><u>Format restitution</u></p>\r\n\r\n<p><br />\r\nFormat : Excel avec lien hypertexte</p>\r\n\r\n<p>Mod&egrave;le : 0 AGO_CPCAM_Restitution_Client.xltm</p>\r\n\r\n<p>Utiliser ce mod&egrave;le avec macro permettant lien hypertexte</p>\r\n\r\n<p>Colonage Final:</p>\r\n\r\n<p>N&deg; Photo ; Lien hypertexte ; Service ; N&deg; Conteneur ; Ann&eacute;e Inf ; Ann&eacute;e Sup ; Destruction (laisser vide) ; Description compl&egrave;te</p>', '2016-06-14 13:20:00', 1, 0, NULL),
(48, 47, 37, 30, 'Consigne_de_traitement', '<p><span style="font-size:20px"><span style="color:rgb(0, 0, 205)">Nouvelle Interface de saisie&nbsp;</span></span></p>\r\n\r\n<p><span style="font-size:20px"><span style="color:rgb(0, 0, 205)">&lsquo;&rsquo;Proarchives_v95-open&rsquo;&rsquo;</span></span></p>\r\n\r\n<p>Cette &nbsp;interface &nbsp;est &nbsp;mise en place afin de &nbsp;faciliter le traitement des cas de multi-copropri&eacute;t&eacute;s.<br />\r\nComme vous pouvez le constater &nbsp;sur l&rsquo;image en dessous &nbsp;tous les champs de l&rsquo;ancienne &nbsp;interface ont &eacute;t&eacute; &nbsp;repris &nbsp;sauf &nbsp;le &nbsp;champ &lsquo;&rsquo;Titre&rsquo;&rsquo; &nbsp;qui a &nbsp;&eacute;t&eacute; &nbsp;ins&eacute;r&eacute; au dessus &nbsp;des champs &nbsp;expression.<br />\r\nLe nom &nbsp;de la nouvelle &nbsp;appli : &nbsp;&nbsp;<span style="color:rgb(255, 0, 0)">&lsquo;&rsquo;proarchives_v95-open&rsquo;&rsquo;</span></p>\r\n\r\n<p>&nbsp;<br />\r\nAinsi &nbsp;donc la &nbsp;r&egrave;gle de saisie &nbsp;ne change pas &nbsp;pour les boites simples &nbsp;c&rsquo;est a dire une seul copro.<br />\r\n&nbsp;Par &nbsp;contre &nbsp;une nouvelle r&egrave;gle &nbsp;s&rsquo;applique &nbsp;pour &nbsp;les champs &agrave; plusieurs &nbsp;copropri&eacute;t&eacute;s. G&eacute;n&eacute;ralement lorsque &nbsp;nous &nbsp;saisissons les &nbsp;&eacute;l&eacute;ments &nbsp;d&rsquo;une &nbsp;boite a multi copros , tous les &eacute;l&eacute;ments &nbsp;n&rsquo;apparaissent &nbsp;que sur la 1ere &nbsp;copro et &nbsp;plus rien sur les &nbsp;autres copros de &nbsp;la &nbsp;boite en question. D&eacute;sormais il s&rsquo;agit pour nous de &nbsp;ressaisir &nbsp;pour chaque copros les m&ecirc;mes &eacute;l&eacute;ments.<br />\r\nExemple &nbsp; de la photo &nbsp;ci &ndash; dessous :<br />\r\n&nbsp;&nbsp;</p>\r\n\r\n<p>Nous avons 4 copropri&eacute;t&eacute;s :</p>\r\n\r\n<p><strong><u>Exemple de saisie &nbsp;a l&rsquo;ancienne :</u></strong><br />\r\nCopro &nbsp;1 : 202&nbsp;<br />\r\nExp 1 : &nbsp;&nbsp; &nbsp;RECOMMANDES CONVOC AG PV AG<br />\r\nExp 2 : AG DU 22/05/2007<br />\r\nCopro 2 : 229<br />\r\nExp 1 : AG 15-05-2007<br />\r\nCopro 3 : 240<br />\r\nExp 1 : AG 31-05-2007<br />\r\nCopro 4 : 9558<br />\r\nExp 1 : VIDE</p>\r\n\r\n<p><strong><u>ANCIENNE Restitution&nbsp;</u><br />\r\nCOPRO 202 - RECOMMANDES CONVOC AG PV AG - &nbsp;AG DU 22/05/2007</strong></p>\r\n\r\n<p><strong>COPRO 229 - AG 15-05-2007</strong></p>\r\n\r\n<p><strong>COPRO 240 - AG 31-05-2007</strong></p>\r\n\r\n<p><strong>COPRO 9558</strong></p>\r\n\r\n<p><u>Exemple nouvelle saisie :</u></p>\r\n\r\n<p>Saisir en Titre &lsquo;&rsquo;RECOMMANDES CONVOC AG PV AG&rsquo;&rsquo; (cochez la case afin que le titre se r&eacute;p&egrave;te pour les autres copros) et saisir &nbsp;l&rsquo;intitul&eacute;<br />\r\nCopro &nbsp;202&nbsp;<br />\r\nExp 1 : AG DU 22/05/2007<br />\r\nCopro &nbsp;229<br />\r\nExp 1 : AG 15-05-2007<br />\r\nCopro 240<br />\r\nExp 1: AG 31-05-2007<br />\r\nCopro &nbsp;9558<br />\r\nExp 1: VIDE</p>\r\n\r\n<p><u>Nouvelle Restitution&nbsp;</u></p>\r\n\r\n<p><strong>COPRO 202 - RECOMMANDES CONVOC AG PV AG - &nbsp;AG DU 22/05/200</strong></p>\r\n\r\n<p><strong>COPRO 229 - RECOMMANDES CONVOC AG PV AG - AG 15-05-2007</strong></p>\r\n\r\n<p><strong>COPRO240 &nbsp;- RECOMMANDES CONVOC AG PV AG - AG 31-05-2007</strong></p>\r\n\r\n<p><strong>COPRO 9558 - RECOMMANDES CONVOC AG PV A</strong></p>\r\n\r\n<p><span style="color:rgb(255, 0, 0)"><strong>NB : La &nbsp;restitution ci-dessus &nbsp;est &nbsp;le r&eacute;el but de cette &nbsp;nouvelle &nbsp;interface</strong></span>.</p>\r\n\r\n<p><span style="color:rgb(255, 0, 0)">ATTENTION : Si l&rsquo;hors de la saisie d&rsquo;une &nbsp;boite a multi-copropri&eacute;t&eacute;s l&rsquo;op&eacute;ratrice se rends compte qu&rsquo;elle n&rsquo;a pas coch&eacute; la petite case permettant de reprendre le m&ecirc;me &nbsp;titre pour les autres copros il &nbsp;lui &nbsp;faudra &nbsp;ressaisir dans le champ &nbsp;expression l&rsquo;&eacute;l&eacute;ment &lsquo;&rsquo;Titre&rsquo;&rsquo; de la boite.<br />\r\nA l&rsquo;exemple de la photo ci-dessus, il faudra &nbsp;ressaisir &nbsp;en exp 1 de la copro 2,3 et 4 le libell&eacute;</span>&nbsp;&laquo; RECOMMANDES CONVOC AG PV AG &raquo;.</p>\r\n\r\n<p>&nbsp;Un &nbsp;2eme nouvel &nbsp;exemple &nbsp;toujours pour le cas des multi-copropri&eacute;t&eacute;s&nbsp;</p>\r\n\r\n<p>L&rsquo;exemple &nbsp;ici est &nbsp;celui de la boite 1<br />\r\n&nbsp;<br />\r\nVoila &nbsp;comment la saisie se faisait :</p>\r\n\r\n<p>Copro MS 0030853 - 49 r&eacute;publique</p>\r\n\r\n<p>Exp 1 : 2006/2007</p>\r\n\r\n<p>Copro MS 0030938 &ndash; 11 Chaptal</p>\r\n\r\n<p>Exp 1 : 2007/2008 &nbsp;charges A</p>\r\n\r\n<p>&nbsp;NB : La saisie est &lsquo;&rsquo;<span style="color:rgb(255, 0, 0)">Fausse</span>&nbsp;&lsquo;&rsquo; &nbsp;&eacute;tant donn&eacute; &nbsp;que &nbsp; le titre &nbsp;de la boite &nbsp;est &nbsp;bien le mot &lsquo;&rsquo;charges&rsquo;&rsquo;.</p>\r\n\r\n<p><u><strong>Fichier restitution (FAUX)</strong></u></p>\r\n\r\n<p>Copro MS 0030853 - 49 r&eacute;publique - 2006/2007<br />\r\nCopro MS 0030938 &ndash; 11 Chaptal - 2007/2008 &nbsp;charges A</p>\r\n\r\n<p><u><strong>Fichier &nbsp;restitution (VRAI)</strong></u></p>\r\n\r\n<p>Copro MS 0030853 - 49 r&eacute;publique - charges A - 2006/2007<br />\r\nCopro MS 0030938 &ndash; 11 Chaptal - charges A - 2007/2008 &nbsp;<br />\r\n&nbsp;<br />\r\nPS :&nbsp;<br />\r\n⦁&nbsp;&nbsp; &nbsp;Dans le cas o&ugrave; il ne s&rsquo;agit que des photos &nbsp;simples, &nbsp;laisser &nbsp;le champ &lsquo;&rsquo;titre&rsquo;&rsquo; vide et &nbsp;saisir &nbsp;comme auparavant.<br />\r\n⦁&nbsp;&nbsp; &nbsp;Les champs &lsquo;&rsquo;MOIS inf et sup &lsquo;&rsquo; &nbsp;sont &nbsp; gris&eacute;s afin &nbsp;de permettre &nbsp;d&rsquo;aller &nbsp;un peu plus &nbsp;vite. D&eacute;sormais &nbsp;seul l&rsquo;ann&eacute;e &nbsp;inf &nbsp;et sup est a saisir.</p>\r\n\r\n<p><br />\r\nIL &nbsp;faut faire attention &nbsp;a ne pas &nbsp;confondre &nbsp;les multi copropri&eacute;t&eacute;s a certains &nbsp;&eacute;l&eacute;ments &nbsp;de la &nbsp;g&eacute;rance .<br />\r\n⦁&nbsp;&nbsp; &nbsp;Le &lsquo;&rsquo;service&rsquo;&rsquo; est le 1er &nbsp;element &nbsp;qui doit attirer &nbsp;sur la saisie &nbsp;qu il &nbsp;faut adapter a une boite donn&eacute;e &nbsp;meme &nbsp;si les elements &nbsp;inscrit &nbsp;paraissent flou (exple foto &nbsp;ci-dessus boite 1 et 2 )<br />\r\n⦁&nbsp;&nbsp; &nbsp;Ensuite &nbsp;viens &nbsp;la &nbsp;&lsquo;&rsquo;structure&rsquo;&rsquo; &nbsp;de la &nbsp;boite<br />\r\n⦁&nbsp;&nbsp; &nbsp;Puis &nbsp;enfin &nbsp;son contenu.</p>\r\n\r\n<p>&nbsp;<br />\r\n&nbsp;&nbsp; &nbsp;Dans &nbsp;ce cas &nbsp; precis &nbsp;, &nbsp;la &nbsp;saisie &nbsp;serait la suite&nbsp;<br />\r\nBoite 1&nbsp;<br />\r\nTitre : Impayes copro (cochez la case)<br />\r\nCopro 1 : 2 chemin de crepieux caluire (lien : &hellip;.)<br />\r\nLigne 1 : vermelin 24/03/2006&hellip;&hellip;.<br />\r\nCopro 2 : bois d&rsquo;oz rue piscine &hellip;..<br />\r\nLigne 1 : salanon &amp; virapin<br />\r\nEtc &hellip;.<br />\r\nIdem pour la boite 2<br />\r\nTitre : Impayes copro 2002 &nbsp;a 2007 (cochez la case)<br />\r\nCopro 1 :&hellip;&hellip;.</p>', '2016-06-15 18:55:00', 1, 0, NULL);
INSERT INTO `versions` (`ver_creator`, `ver_article`, `ver_version`, `Id`, `ver_titre`, `ver_content`, `ver_date`, `ver_editable`, `ver_del`, `attachement`) VALUES
(48, 45, 35, 31, 'Manuel_de_formation_à_l_interface_de_contrôle', '<p><span style="color:rgb(0, 0, 255)">MANUEL DE FORMATION A L&rsquo;INTERFACE DE CONT&Ocirc;LE</span></p>\r\n\r\n<p><br />\r\n<span style="color:rgb(255, 0, 0)">En rouge les informations nouvelles depuis la V1 du manuel</span></p>\r\n\r\n<p><span style="color:rgb(255, 0, 0)">1&deg;) ATTENTION, si pendant l&rsquo;utilisation de l&rsquo;interface vous avez un bug, vous devez informer Paris avec la proc&eacute;dure suivante.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Sur le poste o&ugrave; est constat&eacute; le bug, apparait une fen&ecirc;tre sp&eacute;ciale. Appuyer sur la touche &laquo; Imp&eacute;cr &raquo; (= photographie de l&rsquo;&eacute;cran de travail)<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Ouvrir Word et faire coller (l&rsquo;image apparait) et enregistrer le contenu.</span></p>\r\n\r\n<p><span style="color:rgb(255, 0, 0)">Envoyer &agrave; Paris le document Word en pi&egrave;ce jointe en d&eacute;crivant le plus pr&eacute;cis&eacute;ment dans le corps de l&rsquo;email comment le bug est apparu.</span></p>\r\n\r\n<p><span style="color:rgb(255, 0, 0)">Quel bouton, quel &eacute;cran, quel saisie de photo,&hellip; le plus synth&eacute;tiquement possible. Le document Word est insuffisant pour r&eacute;soudre le</span></p>\r\n\r\n<p><span style="color:rgb(255, 0, 0)">probl&egrave;me.</span></p>\r\n\r\n<p><span style="color:rgb(255, 0, 0)">Dans tous les cas vous devez ensuite FERMER l&rsquo;applicatif sur le poste o&ugrave; il s&rsquo;est produit. En effet, les informations apr&egrave;s un bug ne sont</span></p>\r\n\r\n<p><span style="color:rgb(255, 0, 0)">plus saisies correctement dans la base de donn&eacute;es m&ecirc;me si &agrave; priori cela semble fonctionner &agrave; l&rsquo;&eacute;cran.</span></p>\r\n\r\n<p><span style="color:rgb(255, 0, 0)">2&deg;) Il se peut qu&rsquo;&agrave; l&rsquo;ouverture du logiciel &nbsp;un utilisateur soit d&eacute;clar&eacute;e en ligne lorsque l&rsquo;on s&eacute;lectionne son pseudo. Ce n&rsquo;est pas grave ;&nbsp;</span></p>\r\n\r\n<p><span style="color:rgb(255, 0, 0)">c&rsquo;est parce que l&rsquo;applicatif a mal &eacute;t&eacute; ferm&eacute; la fois pr&eacute;c&eacute;dente sur ce pseudo. Il suffit de s&eacute;lectionner le pseudo et de quitter l&rsquo;interface. A</span></p>\r\n\r\n<p><span style="color:rgb(255, 0, 0)">l&rsquo;ouverture suivante, cette anomalie aura disparue.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<span style="color:rgb(0, 0, 255)">*Les grands principes du contr&ocirc;le</span></p>\r\n\r\n<p><br />\r\nL&rsquo;utilisation de l&rsquo;interface de contr&ocirc;le n&eacute;cessite une bonne connaissance des r&egrave;gles de saisies.</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*D&eacute;roulement du traitement</span></p>\r\n\r\n<p>L&rsquo;interface est compos&eacute;e de 3 modules principaux et d&rsquo;un &eacute;cran d&rsquo;accueil. Chaque utilisateur de l&rsquo;interface peut selon sa fonction acc&eacute;der &agrave;</p>\r\n\r\n<p>diff&eacute;rents niveaux d&rsquo;utilisation de l&rsquo;interface.</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*La saisie</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*La correction</span></p>\r\n\r\n<p>Le second principe de base du contr&ocirc;le est qu&rsquo;un contr&ocirc;leur ne modifie pas une saisie mais fait &laquo; refaire &raquo; la saisie aux op&eacute;rateurs en</p>\r\n\r\n<p>indiquant sur quel champ pr&eacute;cis&eacute;ment porte la correction.</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*La validation</span><br />\r\nLe premier principe du fonctionnement de l&rsquo;interface est que la saisie d&rsquo;une photo est totalement valid&eacute;e que si la saisie de l&rsquo;op&eacute;rateur A</p>\r\n\r\n<p>est &eacute;gal &agrave; la saisie de l&rsquo;op&eacute;rateur B.</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Comment fonctionne l&rsquo;interface de saisie</span></p>\r\n\r\n<p>Pr&eacute;sentation de l&rsquo;automate</p>\r\n\r\n<p>Lors de la validation, il remet la photo &agrave; probl&egrave;me dans le &laquo; pool &raquo; des photos &agrave; corriger. A la sortie du module de contr&ocirc;le, la photo est ou valid&eacute;e ou &agrave; corriger.<br />\r\nLes diff&eacute;rents intervenants&nbsp;<br />\r\nLe r&ocirc;le de l&rsquo;op&eacute;rateur de saisie<br />\r\nEn mode correction, seul l&rsquo;op&eacute;rateur ayant fait la saisie principale a acc&egrave;s &agrave; la correction de sa photo. L&rsquo;&eacute;cran de correction s&rsquo;affiche pour l&rsquo;op&eacute;rateur de saisie d&egrave;s qu&rsquo;une correction est &agrave; faire. Une correction est toujours prioritaire sur la saisie de nouvelles photos. L&rsquo;op&eacute;rateur de saisie ne choisit donc pas le traitement qu&rsquo;il fait mais c&rsquo;est l&rsquo;automate qui lui pr&eacute;sente dans l&rsquo;ordre (correction puis saisie) son travail &agrave; ex&eacute;cuter.&nbsp;</p>\r\n\r\n<p>Le r&ocirc;le du contr&ocirc;leur<br />\r\nSi bien que le traitement du chantier du client avance au fur et &agrave; mesure que les photos les plus anciennes sont valid&eacute;es. Le cycle de traitement est :<br />\r\n*saisie principale par 2 op&eacute;rateurs A et B<br />\r\n*contr&ocirc;le des 2 saisies par 1 contr&ocirc;leur<br />\r\n*correction de A ou B ou des 2<br />\r\n*contr&ocirc;le des 2 saisies par 1 contr&ocirc;leur<br />\r\n*correction de A ou B ou des 2<br />\r\n*etc. autant de fois qu&rsquo;il est n&eacute;cessaire pour aboutir &agrave; saisie A= saisie B</p>\r\n\r\n<p>Contrairement aux op&eacute;rateurs de saisie qui sont atttach&eacute;s au traitement d&rsquo;une photo, des contr&ocirc;leurs diff&eacute;rents peuvent intervenir sur une m&ecirc;me photo. sans &ecirc;tre l&rsquo;auteur des premi&egrave;res demandes de corrections.&nbsp;</p>\r\n\r\n<p>Lorsque les 2 saisies sont identiques pour le contr&ocirc;leur alors le fichier de restitution est automatiquement g&eacute;n&eacute;r&eacute; par l&rsquo;interface. Le fichier s&rsquo;enrichit ainsi au fur et &agrave; mesure de la validation des photos.</p>\r\n\r\n<p>C&rsquo;est le contr&ocirc;leur qui est responsable de la qualit&eacute; du fichier restitu&eacute; au client et du respect des d&eacute;lais. A ce titre, il transmet aux op&eacute;rateurs de saisie toute l&rsquo;information n&eacute;cessaire et en particulier les &laquo; r&egrave;gles de bonnes pratiques de la saisie &raquo; (cf Cahier des r&egrave;gles de saisie &raquo;). Ces r&egrave;gles peuvent varier d&rsquo;un client &agrave; l&rsquo;autre et sont maintenues &agrave; jour.</p>\r\n\r\n<p><br />\r\n<span style="color:rgb(0, 0, 255)">*Le r&ocirc;le de l&rsquo;administrateur</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Les diff&eacute;rentes phases du contr&ocirc;le</span></p>\r\n\r\n<p><br />\r\nPlusieurs taches sont n&eacute;cessaires pour garantir la qualit&eacute; du fichier de restitution. On distingue 4 phases distinctes propres aux op&eacute;rations de contr&ocirc;le :<br />\r\n*La r&eacute;ception des &eacute;l&eacute;ments<br />\r\n*La pr&eacute;paration du chantier<br />\r\n*Le contr&ocirc;le qualit&eacute;<br />\r\n*L&rsquo;envoi des fichiers</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*La r&eacute;ception des &eacute;l&eacute;ments sur le serveur</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Organisation des documents sur le serveur</span></p>\r\n\r\n<p>La mise &agrave; disposition des &eacute;l&eacute;ments par le client a lieu 1 fois par semaine. Nous disposons d&rsquo;un d&eacute;lai de 14 jours pour lui retourner le fichier de restitution ou moins si le client nous pr&eacute;sente des demandes urgentes.&nbsp;<br />\r\nLe contr&ocirc;leur est le garant du respect des d&eacute;lais de traitement (cf staffing de l&rsquo;&eacute;quipe de saisie)</p>\r\n\r\n<p>Le client nous fait savoir (par email) que des chantiers (ensemble d&rsquo;&eacute;l&eacute;ments num&eacute;ris&eacute;s pr&eacute;sents dans des dossiers Windows) sont &agrave; notre disposition. Il faut transf&eacute;rer les &eacute;l&eacute;ments de son serveur sur le serveur maison.&nbsp;<br />\r\nL&rsquo;interface est op&eacute;rationnelle &agrave; partir du moment o&ugrave; les chantiers sont plac&eacute;s dans le r&eacute;pertoire &laquo; Archivage-Photos &raquo;.</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">Les modifications interdites</span></p>\r\n\r\n<p>Tr&egrave;s Important et primordial pour pr&eacute;server l&rsquo;int&eacute;grit&eacute; des donn&eacute;es :</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;<span style="color:rgb(255, 0, 0)">On ne d&eacute;place jamais les fichiers du client &agrave; l&rsquo;int&eacute;rieur d&rsquo;un dossier (ou chantier)<br />\r\nOn ne renomme jamais les fichiers ou les dossiers du client<br />\r\nOn ne d&eacute;place que le dossier principal (ou chantier) avec tous les &eacute;l&eacute;ments qu&rsquo;il contient</span></p>\r\n\r\n<p>&nbsp;A l&rsquo;issue du traitement, les &eacute;l&eacute;ments du client pr&eacute;sents sur notre serveur sont exactement identiques &agrave; ceux qu&rsquo;il nous a transmis au d&eacute;but du chantier</p>\r\n\r\n<p>Les &eacute;l&eacute;ments num&eacute;ris&eacute;s transmis par le client peuvent &ecirc;tre des photographies (.jpg), des fichiers sons (.mp3) ou des scanners.&nbsp;</p>\r\n\r\n<p>Le contr&ocirc;leur est le garant de l&rsquo;organisation des fichiers sur le serveur. Il doit &ecirc;tre en contact r&eacute;gulier avec le service informatique pour garantir l&rsquo;int&eacute;grit&eacute; de fichiers, la s&eacute;curit&eacute;, les sauvegardes et la restauration des fichiers si besoin.</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*La pr&eacute;paration du chantier</span></p>\r\n\r\n<p>La phase de pr&eacute;paration consiste &agrave; pr&eacute;parer les fichiers num&eacute;ris&eacute;s pour les op&eacute;rateurs de saisie et &agrave; d&eacute;j&agrave; anticiper les probl&egrave;mes qu&rsquo;ils pourraient rencontrer.</p>\r\n\r\n<p><br />\r\n<span style="color:rgb(0, 0, 255)">*Comment l&rsquo;interface automatise le process</span></p>\r\n\r\n<p>Il s&rsquo;agit d&rsquo;un travail de pr&eacute;paration.&nbsp;<br />\r\nEn saisie et donc au contr&ocirc;le les premi&egrave;res photos affich&eacute;es dans l&rsquo;interface sont les plus anciennes du r&eacute;pertoire chantier. L&rsquo;archiviste codifiant les plus anciennes par 001.jpg, puis 002.jpg,&hellip;<br />\r\nLe premier travail consiste &agrave; prendre un peu d&rsquo;avance sur la saisie et &agrave; remettre &agrave; l&rsquo;endroit les photos en s&rsquo;aidant de la visionneuse de Windows. Si vous avez fait de la saisie, vous savez qu&rsquo;il vaut mieux que les photos apparaissent &laquo; &agrave; l&rsquo;endroit &raquo; c&#39;est-&agrave;-dire l&agrave; o&ugrave; le sens de la lecture est le plus facile. En effet les mouvements de rotations des images en saisie sont lourds &agrave; manipuler et il est pr&eacute;f&eacute;rable d&rsquo;anticiper cette op&eacute;ration avec Windows. On enregistre la photo sous son angle le plus facile &agrave; lire. Il faut environ 1 heure pour faire d&eacute;filer 100 photos et les positionner &laquo; &agrave; l&rsquo;endroit &raquo;. Mais c&rsquo;est un gain de temps tr&egrave;s appr&eacute;ciable en saisie. On gagne en fluidit&eacute;.</p>\r\n\r\n<p>Dans un fichier Excel &laquo; suivi des chantiers &raquo;, dans le r&eacute;pertoire Archivage-Gestion, on indique le nom du chantier et le nombre de photos qu&rsquo;il contient. On utilise pour cela l&rsquo;utilitaire propri&eacute;t&eacute; d&rsquo;un r&eacute;pertoire et on sait alors pr&eacute;cis&eacute;ment le nombre de photos qu&rsquo;il contient.</p>\r\n\r\n<p>Dans le m&ecirc;me fichier Excel, on doit &agrave; cette occasion lister les photos dont l&rsquo;analyse est plus complexe. Notamment celles qui portent un N&deg; d&rsquo;archive et une borne inf&eacute;rieures ou sup&eacute;rieures. En effet ces 3 champs peuvent &ecirc;tre oubli&eacute;s en saisie A et B (champs d&rsquo;analyse et de saisie) et donc ne pas &ecirc;tre consid&eacute;r&eacute;es en anomalies au contr&ocirc;le (cardans le cas d&rsquo;un oubli alors A=B !). Une simple liste des .jpg de ces photos complexes permettra de s&rsquo;assurer plus tard qu&rsquo;elles ont &eacute;t&eacute; correctement saisies. La liste devra &ecirc;tre imprim&eacute;e et transmise &agrave; la saisie pour les informer des photos qui n&eacute;cessitent une vigilance suppl&eacute;mentaire.</p>\r\n\r\n<p>De m&ecirc;me le contr&ocirc;leur durant ce premier balayage peut identifier les photos floues ou celles o&ugrave; le signe d&rsquo;illisibilit&eacute; XXX sera utilis&eacute;. La liste devra &ecirc;tre imprim&eacute;e et transmise &agrave; la saisie pour les informer des photos qui n&eacute;cessitent une saisie XXX particuli&egrave;re.</p>\r\n\r\n<p>L&rsquo;objectif de ce travail pr&eacute;paratoire est :<br />\r\n*de dimensionner le chantier (combien de photos dans le stock &agrave; traiter)<br />\r\n*de lister les photos complexes (n&deg; d&rsquo;archives, bornes inf et sup)<br />\r\n*d&rsquo;anticiper au maximum l&rsquo;utilisation des caract&egrave;res d&rsquo;illisibilit&eacute;</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Les r&egrave;gles de bonnes pratiques de la saisie</span></p>\r\n\r\n<p>Dans ce m&ecirc;me fichier Excel, les contr&ocirc;leurs tiennent un livre de bord dans lequel il explique les cas probl&eacute;matiques de saisie rencontr&eacute;s et la mani&egrave;re dont ils les ont r&eacute;solus. Les diff&eacute;rents manuels de formation (saisie ou contr&ocirc;le) seront enrichis par la suite des r&egrave;gles qui ont &eacute;t&eacute; appliqu&eacute;es. Logiquement avec le temps, on aura des manuels complets des cas de figures rencontr&eacute;s et comment il faut les r&eacute;soudre.<br />\r\nLa premi&egrave;re tache du contr&ocirc;leur consiste &agrave; bien r&eacute;ceptionner le chantier de l&rsquo;archiviste (stock de photos).</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Le contr&ocirc;le qualit&eacute;</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Les fichiers de restitution</span></p>\r\n\r\n<p>Les fichiers de restitutions sont g&eacute;n&eacute;r&eacute;s automatiquement par l&rsquo;interface.</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*D&eacute;finition d&rsquo;un enregistrement dans Excel</span></p>\r\n\r\n<p>A chaque photo valid&eacute;e par le contr&ocirc;leur, un fichier Excel structur&eacute; selon les exigences du client est enrichi des nouveaux enregistrements correspondants &agrave; la photo.<br />\r\n1 enregistrement (1 ligne dans Excel) est g&eacute;n&eacute;r&eacute; pour chaque boite d&rsquo;archives de la photo<br />\r\n1 enregistrement (1 ligne dans Excel) est g&eacute;n&eacute;r&eacute; pour chaque copropri&eacute;t&eacute; d&rsquo;une boite d&rsquo;archive<br />\r\nUne photo comprenant 4 boites d&rsquo;archives sera restitu&eacute; par 4 enregistrements<br />\r\nSi une boite contient 1 ou plusieurs copropri&eacute;t&eacute; on restitue autant de ligne d&rsquo;enregistrement qu&rsquo;il y a de copropri&eacute;t&eacute;<br />\r\n&nbsp;&nbsp; &nbsp;1 boite avec 1 copropri&eacute;t&eacute; pour 1 enregistrement dans le fichier<br />\r\n&nbsp;&nbsp; &nbsp;1 boite avec 2 copropri&eacute;t&eacute;s pour 2 enregistrements dans le fichier<br />\r\n&nbsp;&nbsp; &nbsp;2 boites avec 2 copropri&eacute;t&eacute;s chacune pour 4 enregistrements dans le fichier<br />\r\n2 boites avec 2 copropri&eacute;t&eacute;s pour l&rsquo;une et 1 copropri&eacute;t&eacute; pour l&rsquo;autre pour 3 enregistrements dans le fichier &hellip;</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Dessin des fichiers de restitution</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Emplacement du fichier de restitution client</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Pr&eacute;sentation de l&#39;&eacute;cran de contr&ocirc;le</span></p>\r\n\r\n<p>Lorsque vous ouvrez votre &eacute;cran de contr&ocirc;le les automates de comparaison sont d&eacute;j&agrave; intervenus. Ils vont vous guider dans la comparaison des 2 saisies A et B.&nbsp;</p>\r\n\r\n<p>Lorsque les saisies sont similaires les champs sont verts<br />\r\nLorsque les saisies sont diff&eacute;rentes les champs sont oranges</p>\r\n\r\n<p>Selon le choix A refaire, les champs passent au rouge (=&agrave; refaire) pour A ou B ou les deux.</p>\r\n\r\n<p>Donc lorsque tous les champs entre A et B sont &eacute;gaux alors tous les champs sont verts.</p>\r\n\r\n<p>Vous disposez d&rsquo;un champ communication pour A et B, qui peut vous permettre de pr&eacute;ciser votre contr&ocirc;le et d&rsquo;informer l&rsquo;op&eacute;rateur A ou B avec un message qui sera lisible lors de la correction.</p>\r\n\r\n<p>Concernant les expressions, vous pouvez d&eacute;placer un groupe Expression/N&deg; archive/Intitul&eacute; et le positionner sur un autre rang. Cela dans le cas ou A et B n&rsquo;ont pas saisie dans le m&ecirc;me ordre. Logiquement le cas doit &ecirc;tre rare.</p>\r\n\r\n<p>Vous pouvez &eacute;galement remettre sur 1 rang ce qui aurait &eacute;t&eacute; saisie sur 2 rangs en utilisant les petits num&eacute;ros sur les c&ocirc;t&eacute;s. Il se peut qu&rsquo;&agrave; l&rsquo;issue de cette op&eacute;ration de recadrage des informations la saisie soit alors conforme pour A et B. Cela peut &eacute;viter &agrave; remettre &agrave; la correction.</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Le contr&ocirc;le du texte saisie</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Contr&ocirc;le de la zone d&rsquo;en-t&ecirc;te</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Contr&ocirc;le des champs de saisie</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Contr&ocirc;le des champs d&rsquo;analyse</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Les probl&egrave;mes de structure</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*A et B n&rsquo;ont pas le m&ecirc;me nombre d&rsquo;enregistrements</span></p>\r\n\r\n<p>A l&rsquo;ouverture du contr&ocirc;le, une fen&ecirc;tre s&rsquo;affiche pour r&eacute;soudre cette diff&eacute;rence</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Un op&eacute;rateur a enregistr&eacute; 2 fois la m&ecirc;me saisie</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Un op&eacute;rateur a oubli&eacute; 1 saisie</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Supprimer &nbsp;un enregistrement &nbsp;de la saisie de A ou B</span></p>\r\n\r\n<p>Le contr&ocirc;leur ne fait que refaire ce qui a &eacute;t&eacute; fait et envoie en correction ses demandes.<br />\r\nPartant de ce partis pris il n&rsquo;a pas pouvoir de supprimer un enregistrement d&rsquo;une boite ou d&rsquo;une copropri&eacute;t&eacute; r&eacute;alis&eacute; par un op&eacute;rateur de saisie. Il fait supprimer l&rsquo;enregistrement par celui qui l&rsquo; a saisie.<br />\r\nPour faire supprimer un enregistrement, il faut qu&rsquo;il envoie en correction (l&rsquo;enregistrement) la boite ou la copropri&eacute;t&eacute; en cochant tous les champs ayant fait l&rsquo;objet d&rsquo;une saisie par &agrave; Refaire et en indiquant dans la boite Message sous la photo l&rsquo;indication de supprimer la boite. Lorsque le correcteur r&eacute;cup&egrave;re la photo et lit la recommandation, il sait qu&rsquo;il doit effacer tous les champs de saisie. Lors de la validation de son enregistrement (boite ou copropri&eacute;t&eacute;) vide l&rsquo;interface supprime l&rsquo;enregistrement<br />\r\nRemarque : les champs d&rsquo;en-t&ecirc;tes du conteneur ne sont pas concern&eacute;s. Seuls les champs boite/copro (&agrave; la droite de l&rsquo;&eacute;cran) doivent &ecirc;tre effac&eacute;s pour que la suppression soit effective.</p>\r\n\r\n<p><br />\r\nIl peut seulement ajouter des enregistrements &laquo; vides &raquo; et supprimer ces m&ecirc;mes enregistrements</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">A et B ont le m&ecirc;me nombre d&rsquo;enregistrements</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">A et B ont tous les 2 oubli&eacute; une saisie</span></p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">A et B n&rsquo;ont pas saisi le m&ecirc;me nombre de copropri&eacute;t&eacute; et de boite</span></p>\r\n\r\n<p>En effet,&nbsp;<br />\r\n(A) peut pour une photo avoir saisie :&nbsp;&nbsp; &nbsp;4 boites, dont 1 avec 3 copropri&eacute;t&eacute;s soit 6 enregistrements<br />\r\n(B) peut pour une photo avoir saisie :&nbsp;&nbsp; &nbsp;5 boites, dont 1 avec 2 copropri&eacute;t&eacute;s soit 6 enregistrements<br />\r\n(A) et (B) ont bien le m&ecirc;me nombre d&rsquo;enregistrements</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">Comment utiliser le bouton &laquo; Mettre la photo en attente administrateur &raquo;</span></p>\r\n\r\n<p><br />\r\nA l&rsquo;issue du contr&ocirc;le il existe 2 possibilit&eacute;s pour une photo :<br />\r\n*Etre valid&eacute;e<br />\r\n*envoy&eacute;e en correction<br />\r\nIl existe une 3eme possibilit&eacute; &agrave; utiliser avec pr&eacute;caution car elle d&eacute;clenche une action &agrave; Paris. D&eacute;cider de mettre une photo en attente administrateur. Cette action permet de ne pas valider une photo (envoi au client) et de ne pas la remettre non plus en correction. Le processus de saisie/contr&ocirc;le/correction peut se poursuivre pour la photo suivante.&nbsp;</p>\r\n\r\n<p>Cela peut &ecirc;tre in&eacute;vitable lors d&rsquo;un probl&egrave;me tr&egrave;s particulier de saisie. Vous devez le plus rapidement possible informer par mail Paris qu&rsquo;une photo est en attente.&nbsp;</p>\r\n\r\n<p>Exemple de cas de mise en attente :</p>\r\n\r\n<p>*cr&eacute;ation d&rsquo;un service (car il doit &ecirc;tre valid&eacute; avec l&rsquo;archiviste)</p>\r\n\r\n<p>*un nombre de passage trop important entre la correction et le contr&ocirc;le. A partir d&rsquo;un nombre de passage d&eacute;fini, la photo est automatiquement bloqu&eacute;e pour &ecirc;tre supervis&eacute;</p>\r\n\r\n<p>*un probl&egrave;me jamais rencontr&eacute; et n&eacute;cessitant de nouvelles consignes</p>\r\n\r\n<p><br />\r\nCette option permet de faire intervenir une quatri&egrave;me personne dans le processus de v&eacute;rification et de restitution &agrave; l&rsquo;archiviste son fichier avec une exigence qualit&eacute; renforc&eacute;e.</p>\r\n\r\n<p><span style="color:rgb(0, 0, 255)">*Utilisation de la zone &laquo; Message &raquo;</span></p>\r\n\r\n<p>N&rsquo;importe quel op&eacute;rateur peut utiliser cette zone de commentaire. Elle sert &agrave; &eacute;changer entre tous les intervenants tout au long du processus de saisie de la photo.&nbsp;<br />\r\nChaque enregistrement, boite ou copropri&eacute;t&eacute; dispose d&rsquo;une zone message.</p>\r\n\r\n<p>Attention &agrave; rester concis et clair.<br />\r\nExemple :&nbsp;</p>\r\n\r\n<p>*saisir B1<br />\r\n*sup Boite<br />\r\n*place du XXX</p>\r\n\r\n<p>On verra &agrave; mettre en place des abr&eacute;viations pour aller le plus vite possible (cf &laquo; R&egrave;gles de bonnes pratiques &raquo;)</p>\r\n\r\n<p>Lors de la mise en attente administrateur, il est n&eacute;cessaire d&rsquo;expliquer en quelques mots le pourquoi de l&rsquo;action. Par ailleurs, il est n&eacute;cessaire d&rsquo;envoyer un mail &agrave; Paris dans le but d&rsquo;informer l&rsquo;administrateur du blocage d&rsquo;une photo dans un sas.&nbsp;<br />\r\nTant qu&rsquo;une photo est bloqu&eacute;e, le fichier final ne peut pas &ecirc;tre retourn&eacute; au client. Il est donc important de veiller &agrave; ce que les photos en attentes ne le soient pas trop longtemps</p>\r\n\r\n<p>Disposition photo</p>\r\n\r\n<p>Remarque : le contr&ocirc;leur intervient &agrave; chaque r&eacute;ception des photographies pour pr&eacute;parer le travail des op&eacute;rateurs de saisie. Il dispose les photographies pour qu&rsquo;elles se pr&eacute;sentent de la mani&egrave;re la plus lisible possible. Verticalement ou horizontalement pour offrir le maximum de lecture &laquo; &agrave; l&rsquo;endroit &raquo;.</p>', '2016-06-14 18:17:00', 1, 0, NULL),
(48, 48, 38, 32, 'Règle de bases propres à nous', '<p><strong><span style="font-size:20px">MANUEL DES REGLES DE BASES SAISIES DES PHOTOS</span></strong></p>\r\n\r\n<p><strong><span style="color:#0000FF">P</span></strong>our &nbsp;une bonne &nbsp;saisie &nbsp;il est &nbsp;indispensable de maitriser &nbsp;les &nbsp;r&egrave;gles &nbsp;de &nbsp;bases &nbsp;qui sont propres &agrave; chaque &nbsp;client.</p>\r\n\r\n<p><u>R&egrave;gles de bases saisies PROARCHIVES</u></p>\r\n\r\n<p>Nous connaissons tous la 1&egrave;re r&egrave;gle de base incontournable de Pro archives &nbsp;SAISIR &nbsp;A L&rsquo;IDENTIQUE &agrave; celle-ci s&rsquo;ajoute les r&egrave;gles de bases suivantes :</p>\r\n\r\n<p><span style="background-color:#D3D3D3">1) Les &nbsp;caract&egrave;res &nbsp;sp&eacute;ciaux tels</span> (: ! ;, . *) inscrits sur une boite ne sont pas saisie dans les champs en</p>\r\n\r\n<p>expression sauf dans la partie Adresse copro &nbsp;boite o&ugrave; nous pouvons retrouver :</p>\r\n\r\n<p>Exemple : 4, rue du chemin de fer</p>\r\n\r\n<p>A.G &nbsp;2012 devient AG 2012<br />\r\nAG. 2012 devient AG 2012<br />\r\nA.G.E 1999 a &nbsp;AGE 1999<br />\r\nB.P 8515 &nbsp;devient BP 8515<br />\r\nS.G.P.P 1988 devient SGPP 1988</p>\r\n\r\n<p><span style="background-color:#A9A9A9">2) L&rsquo;interpr&eacute;tation des &nbsp;champs &nbsp;dates</span></p>\r\n\r\n<p>Nous avons diff&eacute;rent types &nbsp;d&rsquo;analyses de champs</p>\r\n\r\n<p><strong>a-) <u>2008 &amp; ANT&nbsp;</u></strong></p>\r\n\r\n<p>Date inf. : RIEN<br />\r\nDate sup : 12/2008<br />\r\n<strong>NB </strong>: AVANT 2008 et ANTERIEUR A 2008 veulent dire la m&ecirc;me chose &nbsp;ils sont donc analys&eacute;s de la m&ecirc;me mani&egrave;re.<br />\r\n(On aurait pu mettre 12/2007 mais l&rsquo;interface ne retrouvera pas l&rsquo;ann&eacute;e 2007 puisqu&rsquo;elle ne figure pas sur la &nbsp;boite)</p>\r\n\r\n<p>b) <u><strong>Avant 2008</strong></u></p>\r\n\r\n<p>Date inf. : RIEN<br />\r\nDate sup : 01/2008</p>\r\n\r\n<p>c-) &nbsp;<strong><u>inf&eacute;rieur &agrave; 2008</u></strong></p>\r\n\r\n<p>Date inf. : RIEN<br />\r\nDate sup : 01/2008</p>\r\n\r\n<p>d-) <u><strong>2008&lt;2009</strong></u></p>\r\n\r\n<p>Date inf. : 01/2008<br />\r\nDate sup : 12/2009<br />\r\nLorsqu&rsquo;une date est illisible la r&egrave;gles des XXX est applicable c&rsquo;est &agrave; dire :<br />\r\nMois/jj/ann&eacute;e<br />\r\nXX/XX/XXXX<br />\r\nLorsque nous avons sur une boite des dates :<br />\r\nExemple : 01/01/1999<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 12/09/2009<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;25/01/2000<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2008 &amp; ant<br />\r\nDate inf. : RIEN<br />\r\nDate sup : 09/2009<br />\r\nL&rsquo;ann&eacute;e 1999 ne pr&eacute;cise en rien le d&eacute;but de l&rsquo;activit&eacute;.&nbsp;</p>\r\n\r\n<p>NB : Le champ date sup&eacute;rieur ne reste jamais vide. Supposons que nous ayons une boite sans date &nbsp;les champs doit &nbsp;&ecirc;tre renseigner comme suit :<br />\r\nDate inf. : VIDE<br />\r\nDate sup :&nbsp;<br />\r\nMois : XX<br />\r\nAnn&eacute;e : XXXX<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="background-color:#808080">3-)Saisir LIGNE 2 avec la LIGNE 1</span><br />\r\n&nbsp;<br />\r\nExemple 3&egrave;me &nbsp;boite&nbsp;<br />\r\nNous devons &nbsp;saisir :<br />\r\nExpression : Ravalement fa&ccedil;ade 2eme tranche<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2008 &amp; ant<br />\r\nEt &nbsp;NON : Ravalement&nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Fa&ccedil;ade 2eme tranche&nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2008 &amp; ant</p>\r\n\r\n<p><span style="background-color:#696969">4-) Les multi copropri&eacute;t&eacute;s</span></p>\r\n\r\n<p>Qu&rsquo;est ce qu&rsquo;une copropri&eacute;t&eacute;<br />\r\nUne copropri&eacute;t&eacute; c&rsquo;est une adresse, elle peut &ecirc;tre soit compl&egrave;te &lsquo;&rsquo;41 rue des occidents&rsquo;&rsquo; ou elle peut &ecirc;tre un num&eacute;ro &lsquo;&rsquo;code ville&rsquo;&rsquo; &agrave; partir duquel avec la table adresse nous faisons un lien pour retrouver l&rsquo;adresse correspondante.<br />\r\n⦁&nbsp;&nbsp; &nbsp;Il faut pouvoir analyser rapidement une photo &agrave; multi copropri&eacute;t&eacute;s en cas de doute ou d&rsquo;incompr&eacute;hension demander &agrave; l&rsquo;un des contr&ocirc;leurs ou au responsable<br />\r\n⦁&nbsp;&nbsp; &nbsp;Lorsque le num&eacute;ro copro ne correspond pas au lien dans la table adresse et que l&rsquo;adresse correspond &agrave; un autre num&eacute;ro, il faut reporter le num&eacute;ro qui ne correspond &agrave; RIEN dans le champ expression<br />\r\n⦁&nbsp;&nbsp; &nbsp;Lorsque et le num&eacute;ro de copro et l&rsquo;adresse ne se retrouvent pas dans la table adresse du client, il est indispensable de les saisir &agrave; leur endroit respectif c&rsquo;est &agrave; dire num&eacute;ro copro et adresse &nbsp;copro.<br />\r\nOn ne renseigne les bornes que si la s&eacute;quence est ininterrompue<br />\r\nSi la s&eacute;quence est interrompue j&#39;&eacute;clate par copro en autant de ligne que n&eacute;cessaire<br />\r\nSi j&#39;ai par exemple 40 &amp; 50 ca veut dire 2 copro et non pas 10 ...</p>\r\n\r\n<p><br />\r\nNB : Les ann&eacute;es ne se r&eacute;p&egrave;te pas dans le champ expression pour toutes les copros, il suffit de cocher la petite case qui se trouve &agrave; droite sur la 1&egrave;re ligne pour celle-ci se r&eacute;p&egrave;te sur toutes les copros juste au dessus des champs analyses date.<br />\r\nIl est donc important de ramener pour le cas des multi copros l&rsquo;ann&eacute;e ou les dates &agrave; la 1&egrave;re ligne.</p>\r\n\r\n<p>Exemple : FACTURES&nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; COMPTA<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2001<br />\r\nDEVIENT : FACTURES COMPTA 2001 &nbsp;(sur une seule ligne et vous cochez la case)</p>\r\n\r\n<p><span style="background-color:#808080">5-)LES ELEMENTS ENTRE PARENTHESES</span></p>\r\n\r\n<p>Les &eacute;l&eacute;ments entre les parenth&egrave;ses ne sont aucunement repris en intitul&eacute;. Ils sont consid&eacute;r&eacute;s comme des d&eacute;tails. Sauf exception d&rsquo;une boite n&rsquo;ayant que pour &eacute;l&eacute;ment d&rsquo;expression un &eacute;l&eacute;ment se trouvant dans la parenth&egrave;se.<br />\r\nExemple : Copropri&eacute;t&eacute;s<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(Factures) 2001 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; intitul&eacute;s FACTURES<br />\r\nIdem pour le mot &nbsp;&lsquo;&rsquo;DIVERS&rsquo;&rsquo; il &nbsp;ne se met pas &nbsp;en intitul&eacute; car il ne pr&eacute;cise en rien au client &agrave; ce dont il fait allusion ou ce &agrave; quoi.</p>\r\n\r\n<p><span style="background-color:#808080">6-)REORGANISATION &nbsp;ET &nbsp;SAISIE DES BOITES</span></p>\r\n\r\n<p>NB : La 1ere boites &agrave; saisir est la boite qui se trouve le plus &agrave; gauche ou au dessus des autres boites et la derni&egrave;re la plus &agrave; droite. Toujours saisir dans le sens de rotation d&rsquo;une aiguille d&rsquo;une montre.</p>\r\n\r\n<p><span style="background-color:#808080">7-)Les &nbsp;num&eacute;ros de comptes &nbsp;bancaires&nbsp;</span></p>\r\n\r\n<p>Exemple : N&deg;86011-066-258 au N&deg;851232-066-145 ne constituent pas des &nbsp;bornes inferieur et sup&eacute;rieur. Idem pour les num&eacute;ros de factures (facture doit n&deg;25 au N&deg;35). Sont consid&eacute;r&eacute;es comme des &nbsp;bornes inf. et sup des s&eacute;quences de chiffres ou de lettres tels : AP &agrave; ZP ; de 650 &agrave; 750 ou p40 &agrave; p66.</p>', '2016-06-15 19:28:00', 1, 0, NULL),
