(48, 51, 41, 39, 'Problèmes matériels et logiciels rencontrés', '<p>Bonjour, aujourd&#39;hui le 18 juin 2016</p>\r\n\r\n<p>Aux allentours de 15h30, nous avons perdu la connexion internet sur la 2 liaisons Togo T&eacute;l&eacute;com: 4Mo+Ip 41.207.174.52 (22 22 60 21) et 2Mo&nbsp;(22 21 60 21).</p>', '2016-06-24 12:54:42', 1, 0, NULL),
(48, 51, 41, 40, 'Problèmes matériels et logiciels rencontrés', '<p>Bonjour, aujourd&#39;hui le 18 juin 2016</p>\r\n\r\n<p>Rappel:</p>\r\n\r\n<p>1) Liaison pricipale 4Mo + 4IP</p>\r\n\r\n<p>2) Liasion backup 2Mo</p>\r\n\r\n<p>3) Caf&eacute; informatique 4Mo + 1 IP</p>\r\n\r\n<p>Aux allentours de 15h30, nous avons perdu la connexion internet sur la 2 liaisons Togo T&eacute;l&eacute;com: 4Mo+Ip 41.207.174.52 (22 22 60 21) la liaison principale et 2Mo&nbsp;(22 21 60 21) la liaison backup.</p>', '2016-06-24 12:57:38', 1, 0, NULL),
(48, 51, 41, 41, 'Problèmes matériels et logiciels rencontrés', '<p>Bonjour, aujourd&#39;hui le 18 juin 2016</p>\r\n\r\n<p>Rappel:</p>\r\n\r\n<p>1) Liaison pricipale 4Mo + 4IP</p>\r\n\r\n<p>2) Liasion backup 2Mo</p>\r\n\r\n<p>3) Caf&eacute; informatique 4Mo + 1 IP</p>\r\n\r\n<p>Aux allentours de 15h30, nous avons perdu la connexion internet sur la 2 liaisons Togo T&eacute;l&eacute;com: 4Mo+Ip 41.207.174.52 (22 22 60 21) la liaison principale et 2Mo&nbsp;(22 21 60 21) la liaison backup. Apr&egrave;s avoir red&eacute;marrer les 2 modems de Togo t&eacute;l&eacute;com, la liaison BackUp est revenue mais par contre la liaison principale n&#39;est toujours pas revenue. Alors j&#39;ai fait un tour sur le routeur Cisco 2600 Series qui est reli&eacute; au Switch Catalyst Cisco 2950 Series qui nous sert de basculement de connexion</p>', '2016-06-24 13:02:44', 1, 0, NULL),
(48, 51, 41, 42, 'Problèmes matériels et logiciels rencontrés', '<p>Bonjour, aujourd&#39;hui le 18 juin 2016</p>\r\n\r\n<p>Rappel:</p>\r\n\r\n<p>1) Liaison pricipale 4Mo + 4IP</p>\r\n\r\n<p>2) Liasion backup 2Mo</p>\r\n\r\n<p>3) Caf&eacute; informatique 4Mo + 1 IP</p>\r\n\r\n<p>Aux allentours de 15h30, nous avons perdu la connexion internet sur la 2 liaisons Togo T&eacute;l&eacute;com: 4Mo+Ip 41.207.174.52 (22 22 60 21) la liaison principale et 2Mo&nbsp;(22 21 60 21) la liaison backup. Apr&egrave;s avoir red&eacute;marrer les 2 modems de Togo t&eacute;l&eacute;com, la liaison BackUp est revenue mais par contre la liaison principale n&#39;est toujours pas revenue. Alors j&#39;ai fait un tour sur le routeur Cisco 2600 Series qui est reli&eacute; au Switch Catalyst Cisco 2950 Series qui nous sert de basculement de connexion</p>', '2016-06-24 13:16:47', 1, 0, NULL),
(48, 51, 41, 43, 'Problèmes matériels et logiciels rencontrés', '<p>Bonjour, aujourd&#39;hui le 18 juin 2016</p>\r\n\r\n<p>Rappel:</p>\r\n\r\n<p>1) Liaison pricipale 4Mo + 4IP</p>\r\n\r\n<p>2) Liasion backup 2Mo</p>\r\n\r\n<p>3) Caf&eacute; informatique 4Mo + 1 IP</p>\r\n\r\n<p>&nbsp;</p>', '2016-06-24 13:17:36', 0, 0, NULL),
(48, 51, 41, 44, 'Problèmes matériels et logiciels rencontrés', '<p>Bonjour, aujourd&#39;hui le 18 juin 2016</p>\r\n\r\n<p>Rappel:</p>\r\n\r\n<p>1) Liaison pricipale 4Mo + 4IP</p>\r\n\r\n<p>2) Liasion backup 2Mo</p>\r\n\r\n<p>3) Caf&eacute; informatique 4Mo + 1 IP</p>\r\n\r\n<p>Aux alentours de 15h30, nous avons perdu la connexion internet sur les 2 liaisons Togo T&eacute;l&eacute;com. Apr&egrave;s avoir red&eacute;marrer les 2 modems de Togo t&eacute;l&eacute;com, la liaison Backup est revenue mais par contre la liaison principale n&#39;est toujours pas revenue.<br />\r\nAlors j&#39;ai fait un tour sur le routeur Cisco 2600 Series qui est reli&eacute; au Switch Catalyst Cisco 2950 Series qui nous sert de basculement de connexion entre la liaison principale et la liaison Caf&eacute;. Sur le routeur Cisco, j&rsquo;ai lanc&eacute; un Ping 8.8.8.8, un DNS de Google et l&agrave; la connexion ne passe pas. J&rsquo;ai refais un autre Ping sur un second DNS de Google 8.8.4.4 et la connexion passe. J&rsquo;ai alors modifi&eacute; le param&eacute;trage fait avant et qui demandait au routeur Cisco de v&eacute;rifier la connexion internet &agrave; partir de 8.8.8.8 en passant par Togo t&eacute;l&eacute;com par 8.8.4.4 en passant toujours par Togo T&eacute;l&eacute;com en le mettant en premi&egrave;re position et le 8.8.8.8 en seconde position.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2016-06-24 13:20:39', 0, 0, NULL),
(48, 51, 41, 45, 'Problèmes matériels et logiciels rencontrés', '<p>Bonjour, aujourd&#39;hui le 18 juin 2016</p>\r\n\r\n<p>Rappel:</p>\r\n\r\n<p>1) Liaison pricipale 4Mo + 4IP</p>\r\n\r\n<p>2) Liasion backup 2Mo</p>\r\n\r\n<p>3) Caf&eacute; informatique 4Mo + 1 IP</p>\r\n\r\n<p>Aux alentours de 15h30, nous avons perdu la connexion internet sur les 2 liaisons Togo T&eacute;l&eacute;com. Apr&egrave;s avoir red&eacute;marrer les 2 modems de Togo t&eacute;l&eacute;com, la liaison Backup est revenue mais par contre la liaison principale n&#39;est toujours pas revenue.</p>\r\n\r\n<p><br />\r\nAlors j&#39;ai fait un tour sur le routeur Cisco 2600 Series qui est reli&eacute; au Switch Catalyst Cisco 2950 Series qui nous sert de basculement de connexion entre la liaison principale et la liaison Caf&eacute;. Sur le routeur Cisco, j&rsquo;ai lanc&eacute; un Ping 8.8.8.8, un DNS de Google et l&agrave; la connexion ne passe pas. J&rsquo;ai refais un autre Ping sur un second DNS de Google 8.8.4.4 et la connexion passe. J&rsquo;ai alors modifi&eacute; le param&eacute;trage fait avant et qui demandait au routeur Cisco de v&eacute;rifier la connexion internet &agrave; partir de 8.8.8.8 en passant par Togo t&eacute;l&eacute;com par 8.8.4.4 en passant toujours par Togo T&eacute;l&eacute;com en le mettant en premi&egrave;re position et le 8.8.8.8 en seconde position.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2016-06-24 13:20:51', 0, 0, NULL),
