(48, 51, 41, 50, 'Problèmes matériels et logiciels rencontrés', '<p><span style="font-family:courier new,courier,monospace">Bonjour, aujourd&#39;hui le 18 juin 2016</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">Rappel:</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">1) Liaison pricipale 4Mo + 4IP</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">2) Liasion backup 2Mo</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">3) Caf&eacute; informatique 4Mo + 1 IP</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">Aux alentours de 15h30, nous avons perdu la connexion internet sur les 2 liaisons Togo T&eacute;l&eacute;com. Apr&egrave;s avoir red&eacute;marrer les 2 modems de Togo t&eacute;l&eacute;com, la liaison Backup est revenue mais par contre la liaison principale n&#39;est toujours pas revenue.</span></p>\r\n\r\n<p style="text-align:justify"><br />\r\n<span style="font-family:courier new,courier,monospace">Alors j&#39;ai fait un tour sur le routeur Cisco 2600 Series qui est reli&eacute; au Switch Catalyst Cisco 2950 Series qui nous sert de basculement de connexion entre la liaison principale et la liaison Caf&eacute;. Sur le routeur Cisco, j&rsquo;ai lanc&eacute; un Ping 8.8.8.8, un DNS de Google et l&agrave; la connexion ne passe pas. J&rsquo;ai refais un autre Ping sur un second DNS de Google 8.8.4.4 et la connexion passe. J&rsquo;ai alors modifi&eacute; le param&eacute;trage fait avant et qui demandait au routeur Cisco de v&eacute;rifier la connexion internet &agrave; partir de 8.8.8.8 en passant par Togo t&eacute;l&eacute;com par 8.8.4.4 en passant toujours par Togo T&eacute;l&eacute;com en le mettant en premi&egrave;re position et le 8.8.8.8 en seconde position.</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">Tout est redevenu normal. Par ailleurs pendant que j&#39;essayais de r&eacute;soudre le probl&egrave;me sur la liaison principale, tous les postes &eacute;taient connect&eacute;s sur la seconde liaison Backup.</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">................................................................................</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:courier new,courier,monospace">Bonjour aujourd&rsquo;hui mardi 21 juin 2016</span></p>\r\n\r\n<p style="text-align: justify;"><br />\r\n<span style="font-family:courier new,courier,monospace">A 11h25 la connexion est perdue sur la liaison principale. M&ecirc;me pas avoir red&eacute;marr&eacute; plusieurs fois le modem, il n&rsquo;y a toujours pas de connexion. C&rsquo;est &agrave; 14h55 que la connexion est revenue. Signal&eacute; &agrave; Togo T&eacute;l&eacute;com c&rsquo;est le lendemain qu&rsquo;ils m&rsquo;ont inform&eacute;&nbsp;qu&rsquo;ils avaient fait des travaux sur leur liaison. Que le plus souvent c&rsquo;est les Week-end qu&rsquo;ils profitent pour faire la maintenance sur certains serveurs.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:courier new,courier,monospace">...........................................................................</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:courier new,courier,monospace">Aujourd&#39;hui mercredi 22 juin 2016,</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:courier new,courier,monospace">Les filles du Web</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2016-06-24 13:36:58', 0, 0, NULL),
(48, 51, 41, 51, 'Problèmes matériels et logiciels rencontrés', '<p><span style="font-family:courier new,courier,monospace">Bonjour, aujourd&#39;hui le 18 juin 2016</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">Rappel:</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">1) Liaison pricipale 4Mo + 4IP</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">2) Liasion backup 2Mo</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">3) Caf&eacute; informatique 4Mo + 1 IP</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">Aux alentours de 15h30, nous avons perdu la connexion internet sur les 2 liaisons Togo T&eacute;l&eacute;com. Apr&egrave;s avoir red&eacute;marrer les 2 modems de Togo t&eacute;l&eacute;com, la liaison Backup est revenue mais par contre la liaison principale n&#39;est toujours pas revenue.</span></p>\r\n\r\n<p style="text-align:justify"><br />\r\n<span style="font-family:courier new,courier,monospace">Alors j&#39;ai fait un tour sur le routeur Cisco 2600 Series qui est reli&eacute; au Switch Catalyst Cisco 2950 Series qui nous sert de basculement de connexion entre la liaison principale et la liaison Caf&eacute;. Sur le routeur Cisco, j&rsquo;ai lanc&eacute; un Ping 8.8.8.8, un DNS de Google et l&agrave; la connexion ne passe pas. J&rsquo;ai refais un autre Ping sur un second DNS de Google 8.8.4.4 et la connexion passe. J&rsquo;ai alors modifi&eacute; le param&eacute;trage fait avant et qui demandait au routeur Cisco de v&eacute;rifier la connexion internet &agrave; partir de 8.8.8.8 en passant par Togo t&eacute;l&eacute;com par 8.8.4.4 en passant toujours par Togo T&eacute;l&eacute;com en le mettant en premi&egrave;re position et le 8.8.8.8 en seconde position.</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">Tout est redevenu normal. Par ailleurs pendant que j&#39;essayais de r&eacute;soudre le probl&egrave;me sur la liaison principale, tous les postes &eacute;taient connect&eacute;s sur la seconde liaison Backup.</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">................................................................................</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">Bonjour aujourd&rsquo;hui mardi 21 juin 2016</span></p>\r\n\r\n<p style="text-align:justify"><br />\r\n<span style="font-family:courier new,courier,monospace">A 11h25 la connexion est perdue sur la liaison principale. M&ecirc;me pas avoir red&eacute;marr&eacute; plusieurs fois le modem, il n&rsquo;y a toujours pas de connexion. C&rsquo;est &agrave; 14h55 que la connexion est revenue. Signal&eacute; &agrave; Togo T&eacute;l&eacute;com c&rsquo;est le lendemain qu&rsquo;ils m&rsquo;ont inform&eacute;&nbsp;qu&rsquo;ils avaient fait des travaux sur leur liaison. Que le plus souvent c&rsquo;est les Week-end qu&rsquo;ils profitent pour faire la maintenance sur certains serveurs.</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">...........................................................................</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">Aujourd&#39;hui mercredi 22 juin 2016,</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:courier new,courier,monospace">Les filles du Web m&rsquo;ont interpel&eacute; sur un probl&egrave;me li&eacute; &agrave; leur application d&rsquo;animation. Les messages de celles qui interviennent sur l&rsquo;animation ne partent pas tout comme celles qui interviennent sur la messagerie et en plus ne re&ccedil;oivent pas de messages.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2016-06-24 13:42:49', 0, 0, NULL),
(48, 51, 41, 52, 'Problèmes matériels et logiciels rencontrés', '<p><span style="font-family:courier new,courier,monospace">Bonjour, aujourd&#39;hui le 18 juin 2016</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">Rappel:</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">1) Liaison pricipale 4Mo + 4IP</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">2) Liasion backup 2Mo</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">3) Caf&eacute; informatique 4Mo + 1 IP</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">Aux alentours de 15h30, nous avons perdu la connexion internet sur les 2 liaisons Togo T&eacute;l&eacute;com. Apr&egrave;s avoir red&eacute;marrer les 2 modems de Togo t&eacute;l&eacute;com, la liaison Backup est revenue mais par contre la liaison principale n&#39;est toujours pas revenue.</span></p>\r\n\r\n<p style="text-align:justify"><br />\r\n<span style="font-family:courier new,courier,monospace">Alors j&#39;ai fait un tour sur le routeur Cisco 2600 Series qui est reli&eacute; au Switch Catalyst Cisco 2950 Series qui nous sert de basculement de connexion entre la liaison principale et la liaison Caf&eacute;. Sur le routeur Cisco, j&rsquo;ai lanc&eacute; un Ping 8.8.8.8, un DNS de Google et l&agrave; la connexion ne passe pas. J&rsquo;ai refais un autre Ping sur un second DNS de Google 8.8.4.4 et la connexion passe. J&rsquo;ai alors modifi&eacute; le param&eacute;trage fait avant et qui demandait au routeur Cisco de v&eacute;rifier la connexion internet &agrave; partir de 8.8.8.8 en passant par Togo t&eacute;l&eacute;com par 8.8.4.4 en passant toujours par Togo T&eacute;l&eacute;com en le mettant en premi&egrave;re position et le 8.8.8.8 en seconde position.</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">Tout est redevenu normal. Par ailleurs pendant que j&#39;essayais de r&eacute;soudre le probl&egrave;me sur la liaison principale, tous les postes &eacute;taient connect&eacute;s sur la seconde liaison Backup.</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">................................................................................</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">Bonjour aujourd&rsquo;hui mardi 21 juin 2016</span></p>\r\n\r\n<p style="text-align:justify"><br />\r\n<span style="font-family:courier new,courier,monospace">A 11h25 la connexion est perdue sur la liaison principale. M&ecirc;me pas avoir red&eacute;marr&eacute; plusieurs fois le modem, il n&rsquo;y a toujours pas de connexion. C&rsquo;est &agrave; 14h55 que la connexion est revenue. Signal&eacute; &agrave; Togo T&eacute;l&eacute;com c&rsquo;est le lendemain qu&rsquo;ils m&rsquo;ont inform&eacute;&nbsp;qu&rsquo;ils avaient fait des travaux sur leur liaison. Que le plus souvent c&rsquo;est les Week-end qu&rsquo;ils profitent pour faire la maintenance sur certains serveurs.</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">...........................................................................</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">Aujourd&#39;hui mercredi 22 juin 2016,</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">Les filles du Web m&rsquo;ont interpel&eacute; sur un probl&egrave;me li&eacute; &agrave; leur application d&rsquo;animation. Les messages de celles qui interviennent sur l&rsquo;animation et sur la messagerie sont rest&eacute;s en attente et en plus ne re&ccedil;oivent pas de messages.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-family:courier new,courier,monospace">J&rsquo;ai inform&eacute; Beno&icirc;t sur le probl&egrave;me, il me dit qu&rsquo;ils &eacute;taient entrain de faires les travaux sur un serveur mais que rapidement l&rsquo;animation va reprendre. Il a demand&eacute; que toutes les animatrices se d&eacute;connectent de l&#39;application et de se reconnecter. Toutes les messages en sont partis sur l&rsquo;animation que sur la messagerie.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2016-06-24 13:49:22', 0, 0, NULL),
(48, 51, 41, 53, 'Problèmes matériels et logiciels rencontrés', '<p><span style="font-family:courier new,courier,monospace">Bonjour, aujourd&#39;hui le 18 juin 2016</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">Rappel:</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">1) Liaison pricipale 4Mo + 4IP</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">2) Liasion backup 2Mo</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">3) Caf&eacute; informatique 4Mo + 1 IP</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">Aux alentours de 15h30, nous avons perdu la connexion internet sur les 2 liaisons Togo T&eacute;l&eacute;com. Apr&egrave;s avoir red&eacute;marrer les 2 modems de Togo t&eacute;l&eacute;com, la liaison Backup est revenue mais par contre la liaison principale n&#39;est toujours pas revenue.</span></p>\r\n\r\n<p style="text-align:justify"><br />\r\n<span style="font-family:courier new,courier,monospace">Alors j&#39;ai fait un tour sur le routeur Cisco 2600 Series qui est reli&eacute; au Switch Catalyst Cisco 2950 Series qui nous sert de basculement de connexion entre la liaison principale et la liaison Caf&eacute;. Sur le routeur Cisco, j&rsquo;ai lanc&eacute; un Ping 8.8.8.8, un DNS de Google et l&agrave; la connexion ne passe pas. J&rsquo;ai refais un autre Ping sur un second DNS de Google 8.8.4.4 et la connexion passe. J&rsquo;ai alors modifi&eacute; le param&eacute;trage fait avant et qui demandait au routeur Cisco de v&eacute;rifier la connexion internet &agrave; partir de 8.8.8.8 en passant par Togo t&eacute;l&eacute;com par 8.8.4.4 en passant toujours par Togo T&eacute;l&eacute;com en le mettant en premi&egrave;re position et le 8.8.8.8 en seconde position.</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">Tout est redevenu normal. Par ailleurs pendant que j&#39;essayais de r&eacute;soudre le probl&egrave;me sur la liaison principale, tous les postes &eacute;taient connect&eacute;s sur la seconde liaison Backup.</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">................................................................................</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">Bonjour aujourd&rsquo;hui mardi 21 juin 2016</span></p>\r\n\r\n<p style="text-align:justify"><br />\r\n<span style="font-family:courier new,courier,monospace">A 11h25 la connexion est perdue sur la liaison principale. M&ecirc;me pas avoir red&eacute;marr&eacute; plusieurs fois le modem, il n&rsquo;y a toujours pas de connexion. C&rsquo;est &agrave; 14h55 que la connexion est revenue. Signal&eacute; &agrave; Togo T&eacute;l&eacute;com c&rsquo;est le lendemain qu&rsquo;ils m&rsquo;ont inform&eacute;&nbsp;qu&rsquo;ils avaient fait des travaux sur leur liaison. Que le plus souvent c&rsquo;est les Week-end qu&rsquo;ils profitent pour faire la maintenance sur certains serveurs.</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">...........................................................................</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">Aujourd&#39;hui mercredi 22 juin 2016,</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">Les filles du Web m&rsquo;ont interpel&eacute; sur un probl&egrave;me li&eacute; &agrave; leur application d&rsquo;animation. Les messages de celles qui interviennent sur l&rsquo;animation et sur la messagerie sont rest&eacute;s en attente et en plus ne re&ccedil;oivent pas de messages.</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">J&rsquo;ai inform&eacute; Beno&icirc;t sur le probl&egrave;me, il me dit qu&rsquo;ils &eacute;taient entrain de faires les travaux sur un serveur mais que rapidement l&rsquo;animation va reprendre. Apr&egrave;s son OK, Il a demand&eacute; que toutes les animatrices se d&eacute;connectent de l&#39;application et de se reconnecter, tous les messages en attente sont partis sur l&rsquo;animation que sur la messagerie et tout le travail a repris.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2016-06-24 13:51:12', 0, 0, NULL),
