;taient entrain de faires les travaux sur un serveur mais que rapidement l&rsquo;animation va reprendre. Apr&egrave;s son OK, Il a demand&eacute; que toutes les animatrices se d&eacute;connectent de l&#39;application et de se reconnecter, tous les messages en attente sont partis sur l&rsquo;animation que sur la messagerie et tout le travail a repris.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2016-06-24 14:09:32', 0, 0, NULL),
(48, 51, 41, 55, 'Problèmes matériels et logiciels rencontrés', '<p><span style="font-family:courier new,courier,monospace">Bonjour, aujourd&#39;hui le 18 juin 2016</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">Rappel:</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">1) Liaison pricipale 4Mo + 4IP</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">2) Liasion backup 2Mo</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">3) Caf&eacute; informatique 4Mo + 1 IP</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">Aux alentours de 15h30, nous avons perdu la connexion internet sur les 2 liaisons Togo T&eacute;l&eacute;com. Apr&egrave;s avoir red&eacute;marrer les 2 modems de Togo t&eacute;l&eacute;com, la liaison Backup est revenue mais par contre la liaison principale n&#39;est toujours pas revenue.</span></p>\r\n\r\n<p style="text-align:justify"><br />\r\n<span style="font-family:courier new,courier,monospace">Alors j&#39;ai fait un tour sur le routeur Cisco 2600 Series qui est reli&eacute; au Switch Catalyst Cisco 2950 Series qui nous sert de basculement de connexion entre la liaison principale et la liaison Caf&eacute;. Sur le routeur Cisco, j&rsquo;ai lanc&eacute; un Ping 8.8.8.8, un DNS de Google et l&agrave; la connexion ne passe pas. J&rsquo;ai refais un autre Ping sur un second DNS de Google 8.8.4.4 et la connexion passe. J&rsquo;ai alors modifi&eacute; le param&eacute;trage fait avant et qui demandait au routeur Cisco de v&eacute;rifier la connexion internet &agrave; partir de 8.8.8.8 en passant par Togo t&eacute;l&eacute;com par 8.8.4.4 en passant toujours par Togo T&eacute;l&eacute;com en le mettant en premi&egrave;re position et le 8.8.8.8 en seconde position.</span></p>\r\n\r\n<p><span style="font-family:courier new,courier,monospace">Tout est redevenu normal. Par ailleurs pendant que j&#39;essayais