credi 22 juin 2016,</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">Les filles du Web m&rsquo;ont interpel&eacute; sur un probl&egrave;me li&eacute; &agrave; leur application d&rsquo;animation. Les messages de celles qui interviennent sur l&rsquo;animation et sur la messagerie sont rest&eacute;s en attente et en plus ne re&ccedil;oivent pas de messages.</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">J&rsquo;ai inform&eacute; Beno&icirc;t sur le probl&egrave;me, il me dit qu&rsquo;ils &eacute;taient entrain de faires les travaux sur un serveur mais que rapidement l&rsquo;animation va reprendre. Apr&egrave;s son OK, Il a demand&eacute; que toutes les animatrices se d&eacute;connectent de l&#39;application et de se reconnecter, tous les messages en attente sont partis sur l&rsquo;animation que sur la messagerie et tout le travail a repris.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2016-06-24 14:10:40', 0, 0, NULL),
