rier new,courier,monospace">Les filles du Web m&rsquo;ont interpel&eacute; sur un probl&egrave;me li&eacute; &agrave; leur application d&rsquo;animation. Les messages de celles qui interviennent sur l&rsquo;animation et sur la messagerie sont rest&eacute;s en attente et en plus ne re&ccedil;oivent pas de messages.</span></p>\r\n\r\n<p style="text-align:justify"><span style="font-family:courier new,courier,monospace">J&rsquo;ai inform&eacute; Beno&icirc;t sur le probl&egrave;me, il me dit qu&rsquo;ils &eacute;taient entrain de faires les travaux sur un serveur mais que rapidement l&rsquo;animation va reprendre. Apr&egrave;s son OK, Il a demand&eacute; que toutes les animatrices se d&eacute;connectent de l&#39;application et de se reconnecter, tous les messages en attente sont partis sur l&rsquo;animation que sur la messagerie et tout le travail a repris.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2016-06-24 14:11:14', 0, 0, NULL);
INSERT INTO `versions` (`ver_creator`, `ver_article`, `ver_version`, `Id`, `ver_titre`, `ver_content`, `ver_date`, `ver_editable`, `ver_del`, `attachement`) VALUES
(48, 54, 44, 57, 'Scratch de la BD', '<p><span style="color:#0000FF">Proc&eacute;dure de r&eacute;paration de la base de donn&eacute;es Mysql</span></p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Pr&eacute;ambule<br />\r\nCette situation apparait notamment fr&eacute;quemment apr&egrave;s une panne de courant alors que la base de donn&eacute;es est ouverte, en cours d&rsquo;utilisation.</p>\r\n\r\n<p>Cette r&eacute;paration n&eacute;cessite que tous les postes clients soient &eacute;teints pour qu&rsquo;ils soient par la suite relanc&eacute;s proprement</p>\r\n\r\n<p>Une fois le serveur rallum&eacute;, il doit &ecirc;tre &eacute;teint &agrave; nouveau en utilisant cette fois le menu D&eacute;marrez/Eteindre de Windows.</p>\r\n\r\n<p>Puis d&eacute;marrer le serveur normalement (donc en fait le serveur est relanc&eacute; 2 fois).</p>\r\n\r\n<p>Le logiciel Wampserver &eacute;tant charg&eacute; et d&eacute;marr&eacute; avec Windows, s&rsquo;il est en orange, cela peut vouloir dire qu&rsquo;il est emp&ecirc;ch&eacute; par Skype ou Teamviewer principalement. Donc quitter Skype, Teamviewer,&hellip; tant que Wampserver n&rsquo;est pas au VERT. Sinon il faudra le r&eacute;installer (la r&eacute;installation ne d&eacute;truit pas les bases de donn&eacute;es).</p>\r\n\r\n<p>Avant d&rsquo;effectuer la moindre op&eacute;ration de maintenance, les bases de donn&eacute;es doivent &ecirc;tre sauvegard&eacute;es en suivant la proc&eacute;dure &laquo; Sauvegarde de la base de donn&eacute;es Mysql.docx &raquo;. On va sauvegarder une base abim&eacute;e mais ca peut servir&hellip; dans un sous r&eacute;pertoire before_scratch ou bien on veillera &agrave; enregistrer les sauvegardes en mentionnant dans les noms des sauvegardes &laquo; before scratch &raquo;</p>\r\n\r\n<p>Surtout on ne &laquo; se prom&egrave;ne pas &raquo; dans les menus PHPmYadmin ! C&rsquo;est tr&egrave;s important de respecter toutes les actions de la proc&eacute;dure et de ne pas en faire plus.</p>\r\n\r\n<p>⦁&nbsp;&nbsp; &nbsp;Description de la r&eacute;paration<br />\r\nUne fois le serveur allum&eacute; &laquo; proprement &raquo; = seconde fois :<br />\r\nRelancer Teamviewer (acc&egrave;s France)<br />\r\nAller sur l&rsquo;ic&ocirc;ne verte de la barre d&rsquo;outil Wampserver et s&eacute;lectionner PhpMyAdmin</p>\r\n\r\n<p>Sur l&lsquo;&eacute;cran apparait &agrave; gauche apparait l&rsquo;ensemble des bases de donn&eacute;es. Toutes doivent faire l&rsquo;objet d&rsquo;une analyse/r&eacute;paration. Nous int&eacute;resse :<br />\r\n&nbsp;&nbsp; &nbsp;Ago (5)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;C&rsquo;est la base o&ugrave; l&rsquo;on stocke cr&eacute;dit agricole,&hellip; (5 tables)<br />\r\n&nbsp;&nbsp; &nbsp;Chantier (1)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Tous les liens des adresses photos sur le serveur (1 table)<br />\r\n&nbsp;&nbsp; &nbsp;_rapport (1)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Toutes les commandes du client (1 table)<br />\r\n&nbsp;&nbsp; &nbsp;Proarchives (5)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;C&rsquo;est la base o&ugrave; l&rsquo;on stocke Proarchives (5 tables).<br />\r\n&nbsp;&nbsp; &nbsp;Utilisateurs&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;C&rsquo;est la base o&ugrave; l&rsquo;on stocke les Loggins (1 table).</p>\r\n\r\n<p>Cliquer sur la base &agrave; analyser/r&eacute;parer.&nbsp;<br />\r\nPar exemple celle en cours au moment du scratch Ago (5) ou Proarchives (5)</p>\r\n\r\n<p>Sur l&lsquo;&eacute;cran apparait &agrave; gauche l&rsquo;ensemble des tables de la base de donn&eacute;es par exemple Ago (5) soit 5 tables.&nbsp;<br />\r\nA droite dans des onglets apparaissent des actions et la liste des tables</p>\r\n\r\n<p>ATTENTION : ne pas aller sur une table en particulier. Il faut rester sur l&rsquo;ic&ocirc;ne de la base de donn&eacute;es. C&rsquo;est pr&eacute;f&eacute;rable : cliquer sur une table scratch&eacute;e peut rendre les op&eacute;rations plus d&eacute;licates de r&eacute;cup&eacute;ration. Il faut laisser le logiciel faire exactement son job.</p>\r\n\r\n<p><br />\r\nS&eacute;lectionner toutes les tables avec les boites &agrave; cocher. On peut aussi utiliser l&rsquo;expression soulign&eacute; &laquo; tout cocher &raquo;&nbsp;</p>\r\n\r\n<p>A c&ocirc;t&eacute; se trouve un petit menu d&eacute;roulant &laquo; Pour la s&eacute;lection &raquo;.</p>\r\n\r\n<p>ATTENTION, le choix et l&rsquo;ordre de s&eacute;lection des ACTIONS DANS CE MENU SONT DEFINITIVES. On sera donc particuli&egrave;rement vigilant &agrave; ne pas utiliser (Vider, supprimer table,&hellip;)</p>\r\n\r\n<p>1&deg;) Utiliser Pour la s&eacute;lection = &laquo; V&eacute;rifier la table &raquo; (l&rsquo;ex&eacute;cution est imm&eacute;diate)</p>\r\n\r\n<p>Faire une copie &eacute;cran du r&eacute;sultat de l&rsquo;analyse et enregistr&eacute; le document &agrave; l&rsquo;endroit ou la sauvegarde before_scratch a &eacute;t&eacute; faite</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n2&deg;) Re-s&eacute;lectionner la Base de donn&eacute;es Proarchives(5)<br />\r\nRe-s&eacute;lectionner toutes les tables (tout cocher)</p>\r\n\r\n<p>Utiliser Pour la s&eacute;lection = &laquo; R&eacute;parer la table &raquo; (l&rsquo;ex&eacute;cution est imm&eacute;diate)</p>\r\n\r\n<p>Faire une copie &eacute;cran du r&eacute;sultat de l&rsquo;analyse et enregistr&eacute; le document &agrave; l&rsquo;endroit ou la sauvegarde before_scratch a &eacute;t&eacute; faite</p>\r\n\r\n<p>3&deg;) Recommencer les op&eacute;rations Analyse puis r&eacute;paration tant que les messages ne sont pas tous OK<br />\r\n4&deg;) Re-s&eacute;lectionner la Base de donn&eacute;es Proarchives(5)<br />\r\nRe-s&eacute;lectionner toutes les tables (tout cocher)</p>\r\n\r\n<p>Utiliser Pour la s&eacute;lection = &laquo; Optimiser la table &raquo; (l&rsquo;ex&eacute;cution est imm&eacute;diate)</p>\r\n\r\n<p>5&deg;) Recommencer les 3 op&eacute;rations pour les Base de donn&eacute;es suivantes. Pour revenir dans l&rsquo;&eacute;cran de s&eacute;lection des bases de donn&eacute;es, cliquez sur l&rsquo;ic&ocirc;ne de la petite maison en haut a gauche.<br />\r\nEn effet plusieurs bases sont ouvertes en m&ecirc;me temps dont il faut respecter la synchronisation de la r&eacute;paration.</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp;Ago (5)<br />\r\n&nbsp;&nbsp; &nbsp;Chantier (1)<br />\r\n&nbsp;&nbsp; &nbsp;_rapport (1)<br />\r\n&nbsp;&nbsp; &nbsp;Proarchives (5)<br />\r\n&nbsp;&nbsp; &nbsp;Utilisateurs</p>\r\n\r\n<p>Si &agrave; l&rsquo;&eacute;tape 1&deg;) le r&eacute;sultat de l&rsquo;analyse est &laquo; OK &raquo;, vous pouvez passer &agrave; la base suivante.</p>\r\n\r\n<p>6&deg;) A l&rsquo;issue de cette r&eacute;paration, la proc&eacute;dure de sauvegarde doit &ecirc;tre r&eacute;alis&eacute;e en mentionnant dans le nom d&rsquo;enregistrement de chaque base &laquo; after_scratch &raquo; ou dans un sous r&eacute;pertoire</p>\r\n\r\n<p>7&deg;) A l&rsquo;issue des sauvegardes, le serveur doit &ecirc;tre &agrave; nouveau &eacute;teint via la commande Windows puis rallum&eacute;.</p>\r\n\r\n<p>C&rsquo;est seulement &agrave; ce moment l&agrave; que les postes clients peuvent &ecirc;tre rallum&eacute;s ou red&eacute;marr&eacute;s si possible avant toute utilisation de l&rsquo;interface.</p>\r\n\r\n<p><br />\r\nRemarque 1 : si par hasard vous observez lors d&rsquo;une sauvegarde un message ou quelque chose de particulier et d&rsquo;inattendu : SORTIR, NE RIEN FAIRE ET INFORMER PARIS</p>\r\n\r\n<p>Remarque 2 : &agrave; l&rsquo;issue de la sauvegarde, INFORMER PARIS des impressions &eacute;crans qui ont &eacute;t&eacute; r&eacute;alis&eacute;s. Si possible les nommer avec chronologie s&rsquo;ils sont nombreux voir les commenter dans Word.<br />\r\n(analyse1, analyse 2, r&eacute;paration 1, r&eacute;paration 2,&hellip;). Les messages d&rsquo;erreur peuvent justifier une maintenance plus tard. Une bonne pratique serait d&rsquo;ajouter au moment ou l&rsquo;interface red&eacute;marre la premi&egrave;re photo qui apparait en saisie, en correction et au contr&ocirc;le. Cela peut permettre de faire un cut-off.</p>\r\n\r\n<p>Remarque 3 : cette proc&eacute;dure de r&eacute;paration solutionne 95% des probl&egrave;mes. Si un probl&egrave;me persiste il sera n&eacute;cessaire de recharger la derni&egrave;re sauvegarde.</p>\r\n\r\n<p><br />\r\n⦁&nbsp;&nbsp; &nbsp;Recharge d&rsquo;une sauvegarde</p>\r\n\r\n<p>La date de la derni&egrave;re sauvegarde nous dit le temps de travail qui sera perdu&hellip;<br />\r\nSi l&rsquo;on en vient &agrave; recharger une sauvegarde, c&rsquo;est qu&rsquo;une table est irr&eacute;cup&eacute;rable. Les op&eacute;rations de maintenance ci-dessus sont inefficaces.&nbsp;<br />\r\nLorsqu&rsquo;on recharge une base de donn&eacute;es, on recharge toutes les tables &agrave; une m&ecirc;me date de toutes les bases. C&rsquo;est la raison pour laquelle une sauvegarde des diff&eacute;rentes bases doit se faire au m&ecirc;me moment pour toutes les bases durant les op&eacute;rations r&eacute;cur\r\nrentes de sauvegarde (sauf d&eacute;rogation).&nbsp;</p>\r\n\r\n<p>&nbsp;L&rsquo;op&eacute;ration va consister &agrave; supprimer les bases de donn&eacute;es totalement, &agrave; les recr&eacute;er puis &agrave; recharger la sauvegarde.</p>\r\n\r\n<p><br />\r\n1&deg;) Ouvrir Wampserver\\PhpMyAdmin<br />\r\n2&deg;) S&eacute;lectionner la base de donn&eacute;es (sans s&eacute;lectionner les tables en dessous)<br />\r\n3&deg;) S&eacute;lectionner l&rsquo;onglet &laquo; Supprimer &raquo; en haut &agrave; droite et confirmer<br />\r\nNormalement &agrave; ce moment l&agrave; on est tr&egrave;s &eacute;prouv&eacute; &hellip; mais il faut le faire&hellip;<br />\r\n4&deg;) Dans le menu d&rsquo;accueil, on recr&eacute;e toutes les bases en respectant scrupuleusement l&rsquo;othographe (minuscule, majuscule,&hellip;)<br />\r\n&nbsp;&nbsp; &nbsp;proarchives<br />\r\n&nbsp;&nbsp; &nbsp;ago<br />\r\n&nbsp;&nbsp; &nbsp;utilisateurs<br />\r\n&nbsp;&nbsp; &nbsp;chantier<br />\r\n&nbsp;&nbsp; &nbsp;chantier_rapport</p>\r\n\r\n<p>Le petit num&eacute;ro &agrave; droite du nom indique le nombre de table dans la base. Il ne faut pas le saisir !<br />\r\nQue le nom (exemple &agrave; l&rsquo;image)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dans Cr&eacute;er une base de donn&eacute;es &eacute;crire le nom exact<br />\r\nDans Interclassement, choisir &laquo; utf8_unicode_ci &raquo;<br />\r\nDans Interclassement pour la base Mysql choisir &nbsp;&laquo; utf8_unicode_ci &raquo; puis cr&eacute;er</p>\r\n\r\n<p>5&deg;) Une fois la base cr&eacute;&eacute;, aller dans &laquo;le menu onglet &laquo; Importer &raquo; et choisir le fichier de sauvegarde<br />\r\nEn .sql.gz correspondant au m&ecirc;me nom de la base puis Ex&eacute;cuter</p>\r\n\r\n<p>6&deg;) Refaire l&rsquo;op&eacute;ration pour toutes les bases de donn&eacute;es. Toutes les tables sont alors avec leur structure et les donn&eacute;es.</p>\r\n\r\n<p>Termin&eacute; !</p>\r\n\r\n<p>&nbsp;</p>', '2016-07-11 18:59:00', 1, 0, NULL),
(48, 58, 48, 58, 'Mise à jour des interfaces sur le postes clients', '<p><span style="color:#0000FF">Mise &agrave; jour des interfaces sur les postes clients</span></p>\r\n\r\n<p><span style="color:#0000FF">*Pr&eacute;ambule</span><br />\r\nActuellement nous utilisons le r&eacute;pertoire commun Y:/Source pour ouvrir l&rsquo;interface de saisie.<br />\r\nL&rsquo;op&eacute;ratrice charge l&rsquo;interface de son poste client en cliquant sur le nom de l&rsquo;interface.<br />\r\nInconv&eacute;nient : l&rsquo;interface est ouverte en r&eacute;alit&eacute; sur le serveur autant de fois qu&rsquo;il y a de postes clients ce qui surcharge le serveur et peut occasionner des ralentissements voir des pertes de connexion.<br />\r\nAvantage : nous sommes certains que les op&eacute;ratrices ouvrent la m&ecirc;me version de l&rsquo;interface qui contient les r&egrave;gles de saisies propres &agrave; chaque client !&nbsp;<br />\r\n&nbsp;&nbsp;<br />\r\n<span style="color:#0000FF">*Sur le serveur : cr&eacute;ation d&rsquo;un r&eacute;pertoire commun</span><br />\r\nOn appelle un poste client, tous les postes qui sont connect&eacute;s au serveur.<br />\r\nSur Y:/Source qui se situe sur le serveur, nous allons cr&eacute;er un r&eacute;pertoire &laquo; Interface active &raquo;&nbsp;<br />\r\nDans ce dossier on trouvera :<br />\r\nproarchives_v99d-open.exe<br />\r\ncaremploi_v99f10-open.exe<br />\r\nAgo.exe<br />\r\n&nbsp;&nbsp; &nbsp;&hellip;.et autant de .exe qu&rsquo;il y a d&rsquo;interfaces de saisie<br />\r\n&nbsp;&nbsp; &nbsp;libmysqltcl.dll<br />\r\nlibmySQL.dll<br />\r\nxphoto.dll</p>\r\n\r\n<p>Les 3 derniers fichiers sont indispensables au fonctionnement des diff&eacute;rentes interfaces et ils sont communs &agrave; toutes les interfaces.</p>\r\n\r\n<p>Les consignes de mises &agrave; jour seront donn&eacute;es par Fred &agrave; Paris. Il faudra s&rsquo;assurer que la recopie du dossier soit faite sur tous les postes clients sans exceptions. Tant que la consigne de mise &agrave; jour n&rsquo;est pas donn&eacute;e, il n&rsquo;est pas n&eacute;cessaire de refaire de recopie.</p>\r\n\r\n<p><span style="color:#0000FF">*Installation sur les postes clients</span></p>\r\n\r\n<p>A partir de chaque poste client, je recopie l&rsquo;int&eacute;gralit&eacute; du r&eacute;pertoire &laquo; Interface active &raquo; qui se trouve dans Y:/Source directement sur le Bureau du poste client. Je ne recopie que ce r&eacute;pertoire et son contenu. Sur chaque poste client, je le positionne au m&ecirc;me endroit pour harmoniser les instalaltions.</p>\r\n\r\n<p>S&rsquo;il existe d&eacute;j&agrave;, je l&rsquo;&eacute;crase par le r&eacute;pertoire le plus r&eacute;cent que je suis en train de d&eacute;placer</p>\r\n\r\n<p>Pour des questions de commodit&eacute;, je cr&eacute;e un raccourci des .exe sur tous les postes clients dans la barre d&rsquo;outils Windows des interfaces que j&rsquo;utilise. Elles sont tr&egrave;s facilement accessibles notamment pour relancer l&rsquo;interface en cas de fermeture.</p>\r\n\r\n<p>Normalement les ouvertures, acc&egrave;s, affichages devraient &ecirc;tre beaucoup plus rapides pour tout le monde.</p>\r\n\r\n<p><span style="color:#0000FF">*Contr&ocirc;les</span></p>\r\n\r\n<p>Il faudra veiller &agrave; ce que tout le monde utilise ce r&eacute;pertoire situ&eacute; sur chacun des postes clients et uniquement celui-l&agrave; pour ouvrir les interfaces</p>\r\n\r\n<p><strong><span style="color:#000000">Interdiction d&rsquo;ouvrir l&rsquo;interface directement du serveur (Y:/Source ) comme avant.</span></strong></p>\r\n\r\n<p>Les contr&ocirc;leurs peuvent effectuer facilement une v&eacute;rification chaque matin en faisant &laquo; l&rsquo;appel &raquo; du num&eacute;ro de version qui s&rsquo;affiche en haut &agrave; gauche des interfaces<br />\r\n&nbsp;&nbsp; &nbsp;Exemples : &nbsp;&nbsp; &nbsp;12 02 2012 pro_v.79r2a pour l&rsquo;interface Proarchives<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;14 02 2012 ago_v.79r2b pour l&rsquo;interface Ago</p>\r\n\r\n<p>Tout le monde doit travailler sur le m&ecirc;me num&eacute;ro d&rsquo;interface.</p>\r\n\r\n<p><strong>Interdiction d&rsquo;avoir plusieurs r&eacute;pertoire &laquo; Interfaces actives &raquo; sur le chaque bureau du poste client.</strong></p>\r\n\r\n<p><br />\r\n<strong>Interdiction d&rsquo;avoir plusieurs interfaces identiques ouvertes sur le m&ecirc;me poste client en <u>m&ecirc;me temps</u> comme avant.</strong></p>\r\n\r\n<p>V&eacute;rifier que les temps d&rsquo;acc&egrave;s sont plus rapides sur tous les postes.</p>', '2016-07-12 15:29:00', 1, 0, NULL),
